(1, 1, 1, '&lt;div class=cms-template_title-subtitle&gt;&lt;h2&gt;Canon Powershot g7 X Mark III&lt;/h2&gt;&lt;h3&gt;Pokaż swój świat&lt;/h3&gt;&lt;p&gt;Canon PowerShot G7 X Mark III to &lt;strong&gt;idealny aparat dla vlogerów, blogerów i każdego kto publikuje treści online.&lt;/strong&gt; Model ten zapewni Ci zachwycające efekty, które pozwolą Ci na pokazanie Twojego świata w doskonałej jakości. Oferuje m.in. &lt;strong&gt;filmowanie w rozdzielczości 4K i dużą matrycę 1\'\' o rozdzielczości 20 MP.&lt;/strong&gt; W połączeniu ze &lt;strong&gt;świetnym obiektywem i niezwykle kompaktową konstrukcją&lt;/strong&gt; będziesz mieć do dyspozycji narzędzie, które umożliwi Ci rejestrowanie wszystkich świetnych pomysłów i niesamowitych chwil gdziekolwiek jesteś. &lt;/div&gt;&lt;div class=cms-template_photo25-text75&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/products/2956b31f0a.jpg&gt;&lt;/div&gt;&lt;h3&gt;Najlepszy aparat do vlogowania&lt;/h3&gt;&lt;p&gt; Aparat Canon Powershot G7 mark III otrzymał nagrodę dla &lt;strong&gt;najlepszego aparatu do vlogowania roku 2020 &lt;/strong&gt;przyznaną przez &lt;strong&gt;TIPA&lt;/strong&gt; (Technical Image Press Association) - globalną organizację, zrzeszającą czasopisma o tematyce związanej z fotografią i obrazowaniem. Nagrody TIPA to najbardziej prestiżowe nagrody w branży przyznawane co roku sprzętom wyróżniającym się na tle konkurencji.&lt;/div&gt;&lt;div class=cms-template_text50-photo50&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/products/400d4c210.jpg&gt;&lt;/div&gt;&lt;h3&gt;Dziel się swoją kreatywnością&lt;/h3&gt;&lt;p&gt;Twórz materiały, które przyciągną uwagę widzów. Przekrocz ograniczenia smartfona i &lt;strong&gt;wnieś swoje vlogowanie lub blogowanie na wyższy poziom. &lt;/strong&gt;Dzięki świetnej &lt;strong&gt;1-calowej matrycy o rozdzielczości 20 MP&lt;/strong&gt; aparat zapewnie znakomite rezultaty, a&lt;strong&gt; obiektyw z ponad 4-krotnym zoomem &lt;/strong&gt;umożliwi skomponowanie doskonałych ujęć. &lt;/div&gt;&lt;p&gt;&lt;strong&gt;Wyjątkowa jakość obrazów 4K i możliwość tworzenia slow-motion z prędkością 120 kl./s&lt;/strong&gt; pozwolą Ci pokazać każdy detal. Dodatkowo możesz wykorzystać &lt;strong&gt;złącze mikrofonowe&lt;/strong&gt;, które zagwarantuje nieskazitelny dźwięk. Dostarczaj swoim widzom&lt;strong&gt; zdjęcia i filmy najwyższej jakości. Prosta w obsłudze łączność ze smartfonem &lt;/strong&gt;ułatwia udostępnianie multimediów w mediach społecznościowych i YouTube. &lt;h3&gt;Przełam ograniczenia smartfonów&lt;/h3&gt;&lt;p&gt;Canon PowerShot G7 X Mark III pozwala iść o krok dalej niż podczas fotografowania i filmowania wyłącznie smartfonem. Przede wszystkim wykorzystuje &lt;strong&gt;dużą 1-calową matrycę,&lt;/strong&gt; która zapewnia materiały pozbawione szumów nawet przy małej ilości światła. Co więcej zastosowany &lt;strong&gt;obiektyw 24-100 mm&lt;/strong&gt; (ekwiwalent formatu 35 mm) &lt;strong&gt;o światłosile f/1.8-f/2.8&lt;/strong&gt; pozwala ukazać sceny z różnorodnej perspektywy. Możesz dzięki niemu wykonać szerokie ujęcia i efektowne zbliżenia. &lt;p&gt;&lt;strong&gt;Subtelne nieostrości i możliwość zabawy głębią ostrości &lt;/strong&gt;pozwolą skupić uwagę widzów na najważniejszych dla Ciebie elementach. To także możliwość tworzenia niezwykle nastrojowych ujęć. Wykorzystaj potencjał aparatu kompaktowego i przenieś swoje vlogowanie oraz blogowanie na wyższym poziom. &lt;h3&gt;Przyjazne użytkowanie&lt;/h3&gt;&lt;p&gt;Canon PowerShot G7 X Mark III udostępnia &lt;strong&gt;przyjazny i intuicyjny ekran dotykowy&lt;/strong&gt;. &lt;strong&gt;Możesz go obrócić tak, aby z łatwością wykonać selfie lub samodzielnie nagrać odcinek vloga.&lt;/strong&gt; &lt;strong&gt;Konfigurowalne przyciski &lt;/strong&gt;pozwalają dostosować aparat do własnego stylu użytkowania i potrzeb. &lt;div class=cms-template_text50-photo50&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/products/401c11bb0.jpg&gt;&lt;/div&gt;&lt;h3&gt;Bezproblemowa komunikacja&lt;/h3&gt;&lt;p&gt;&lt;strong&gt;Aparat ten z łatwością skomunikujesz z urządzeniem mobilnym &lt;/strong&gt;dzięki bezprzewodowej łączności Bluetooth. Dzięki temu możesz błyskawicznie i bez żadnych przeszkód udostępniać treści online. Bądź na bieżąco w kontakcie i przekazuj swoje multimedia do mediów społecznościowych czy YouTube. Co więcej dzięki łączności bezprzewodowej &lt;strong&gt;możesz wykorzystać aplikację Canon Camera Connect do zdalnej obsługi aparatu&lt;/strong&gt;. Możesz więc rozstawić swój plan zdjęciowy, ustawić się przed obiektywem i nie zmieniając pozycji sterować ustawieniami aparatu oraz wykorzystywać podgląd ekranu. &lt;/div&gt;&lt;h3&gt;Technologia, która da Ci przewagę&lt;/h3&gt;&lt;p&gt;&lt;strong&gt;Szybki procesor DIGIC 8&lt;/strong&gt; umożliwia robienie zdjęć ze zdumiewającą&lt;strong&gt; prędkością 30 kl./s&lt;/strong&gt;. Dzięki temu nie przegapisz żadnej chwili. Możesz wykonywać relacje z wydarzeń sportowych i pokazywać swoim widzom każdy ułamek sekundy oraz wszystkie emocje rozgrywek. Wykorzystaj &lt;strong&gt;format RAW&lt;/strong&gt; do rozbudowanej edycji zdjęć. Format ten pozwala na niemal nieograniczoną edycję. Dodatkowo dzięki niemu możesz poprawić swoje fotografie tak, aby były wolne od wszelkich niedoskonałości. Nawet jeśli zdarzy Ci się zarejestrować obraz nie do końca tak, jak tego sobie życzysz, to w post produkcji możesz poprawić jasność, kontrast, balans bieli i inne parametry w takim stopniu, jakiego nie umożliwia JPG. Poza tym &lt;strong&gt;RAW to zawsze najwyższa jakość obrazu.&lt;/strong&gt;&lt;ul&gt;&lt;li&gt;&lt;a href=https://www.canon.co.uk/cameras/powershot-g7-x-mark-iii/ target=_blank&gt;Opis produktu na zagranicznej stronie producenta&lt;/a&gt;&lt;li&gt;&lt;a href=https://www.canon.pl/cameras/powershot-g7-x-mark-iii/# target=_blank&gt;Opis produktu na polskiej stronie producenta&lt;/a&gt;&lt;li&gt;&lt;a href=https://www.canon.pl/cameras/powershot-g7-x-mark-iii/specifications/ target=_blank&gt;Pełna specyfikacja techniczna na stronie producenta&lt;/a&gt;&lt;li&gt;&lt;a href=http://blog.cyfrowe.pl/2017/03/16/dlaczego-warto-fotografowac-w-rawach-poznaj-mozliwosci-jakie-daje-plik-raw-2/ target=_blank&gt;Dlaczego warto fotografować w RAWach? Poznaj możliwości jakie daje plik RAW. - artykuł na blog.cyfrowe.pl&lt;/a&gt;&lt;/ul&gt;&lt;p class=short_description itemprop=description&gt;Canon PowerShot G7 X Mark III to idealny aparat dla vlogerów, blogerów i każdego kto publikuje treści online. Model ten zapewni Ci zachwycające efekty, które pozwolą Ci na pokazanie Twojego świata w doskonałej jakości. Oferuje m.in. filmowanie w rozdzielczości 4K i dużą matrycę 1\'\' o rozdzielczości 20 MP. W połączeniu ze świetnym obiektywem o zakresie ogniskowych 24-100 mm (ekwiwalent formatu 35 mm) i niezwykle kompaktową konstrukcją będziesz mieć do dyspozycji narzędzie, które umożliwi Ci rejestrowanie wszystkich świetnych pomysłów i niesamowitych chwil gdziekolwiek jesteś. ', '', 'aparat-cyfrowy-canon-powershot-g7-x-mark-iii', '', '', '', 'Aparat cyfrowy Canon PowerShot G7 X Mark III', '', '', '', ''),
(2, 1, 1, '&lt;div class=cms-template_title-subtitle&gt;&lt;h2&gt;aparat do wideoblogów Sony ZV-1 II &lt;/h2&gt;&lt;h3&gt; Ekran z regulacją kąta nachylenia do vlogowania, zmiennoogniskowy obiektyw szerokokątny, filmy 4K i wielokierunkowy mikrofon&lt;/h3&gt;&lt;p&gt;&lt;strong&gt;ZV-1 II &lt;/strong&gt;to idealny aparat dla autorów &lt;strong&gt;wideoblogów&lt;/strong&gt;, którzy chcą opowiadać o swoim świecie. Ma wbudowany obiektyw zmiennoogniskowy &lt;strong&gt;18-50 mm&lt;/strong&gt;, pozwalający pokazać całe otoczenie albo skupić się na głównym obiekcie. Dzięki dużemu, &lt;strong&gt;1-calowemu przetwornikowi&lt;/strong&gt; obrazu zapewnia doskonałą jakość &lt;strong&gt;filmu 4K&lt;/strong&gt;.  Aby używać opracowanych przez firmę &lt;strong&gt;Sony&lt;/strong&gt;, cenionych funkcji do vlogowania, wystarczy nacisnąć przycisk. A jeśli chcesz nadać vlogowi wygląd prawdziwego filmu, włącz tryb &lt;strong&gt;\"Kinowy vlog\"&lt;/strong&gt;. Możesz też połączyć aparat ze smartfonem przy użyciu &lt;strong&gt;aplikacji Creators\' App&lt;/strong&gt; i przesyłać do mediów społecznościowych filmy, które chcesz opublikować.&lt;/div&gt;&lt;div class=cms-template_photo100&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat cyfrowy Sony ZV-1 II (ZV1M2BDI.EU) Cashbacku Raty 20x0%\"src=//upload.cyfrowe.pl/cyfrowe/products/1690003009c.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;div class=cms-template_video100&gt;&lt;div class=cms-video-wrapper&gt;&lt;div class=cms-video&gt;&lt;iframe allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\"allowfullscreen frameborder=0 scrolling=no src=https://www.youtube.com/embed/z3ZDZF0Fy20&gt;&lt;/iframe&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;h3&gt;Pokaż więcej na swoim blogu&lt;/h3&gt;&lt;p&gt;Ten lekki aparat ze zmiennoogniskowym &lt;strong&gt;obiektywem superszerokokątnym 18-50 mm&lt;/strong&gt; o dużej jasności obejmie jeszcze większą część sceny. Doskonała jakość obrazu filmowego &lt;strong&gt;4K (30/25/24p) z dużego, 1-calowego przetwornika&lt;/strong&gt; i tryb zwolnionego tempa pomogą uzyskać znakomity materiał filmowy, a tryb zdjęć pionowych zapewni kadrowanie, jakiego potrzebujesz.&lt;div class=cms-template_photo100&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat cyfrowy Sony ZV-1 II (ZV1M2BDI.EU) Cashbacku Raty 20x0%\"src=//upload.cyfrowe.pl/cyfrowe/products/16901f1ab7b.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;h3&gt;Vloguj w najlepsze&lt;/h3&gt;&lt;p&gt;Ten &lt;strong&gt;aparat 4K&lt;/strong&gt; łączy w sobie najlepsze rozwiązania, jakie firma Sony opracowała dla twórców materiałów wideo. Używaj funkcji &lt;strong&gt;przełącznika bokeh &lt;/strong&gt;do rozmywania tła jednym naciśnięciem przycisku, prezentuj przedmioty w trybie prezentacji produktu i zadbaj o ostrość wszystkich osób w kadrze przy pomocy &lt;strong&gt;systemu rozpoznawania wielu twarzy&lt;/strong&gt;. A gdy filmujesz, kontrolę nad vlogiem ułatwi Ci odchylany ekran z funkcjami dotykowymi i lampka sygnalizująca nagrywanie.&lt;div class=cms-template_photo100&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat cyfrowy Sony ZV-1 II (ZV1M2BDI.EU) Cashbacku Raty 20x0%\"src=//upload.cyfrowe.pl/cyfrowe/products/169106a5cc0.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;h3&gt;Kinowa jakość gdzie tylko zechcesz&lt;/h3&gt;&lt;p&gt;Nagrywaj &lt;strong&gt;vlogi wyglądające jak filmy&lt;/strong&gt;. Nowe ustawienia &lt;strong&gt;\"Kinowy vlog\"&lt;/strong&gt; pozwolą nadać obrazowi kinową kolorystykę i dodać czarne pasy u góry i u dołu. A dzięki funkcjom &lt;strong&gt;Real-time Eye AF&lt;/strong&gt; i śledzenia w czasie rzeczywistym filmowany obiekt zawsze będzie ostry.&lt;div class=cms-template_photo100&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat cyfrowy Sony ZV-1 II (ZV1M2BDI.EU) Cashbacku Raty 20x0%\"src=//upload.cyfrowe.pl/cyfrowe/products/1690951481b.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;h3&gt;Najlepszy dźwięk prosto z aparatu&lt;/h3&gt;&lt;p&gt;Dzięki wbudowanemu w &lt;strong&gt;aparat ZV-1 II inteligentnemu mikrofonowi&lt;/strong&gt; z trzema kapsułami nadasz vlogowi atrakcyjną oprawę dźwiękową. Mikrofon może zbierać dźwięk dobiegający tylko od&lt;strong&gt; przodu, tylko od tyłu lub ze wszystkich stron&lt;/strong&gt;. A dostarczana w zestawie osłona przeciwwiatrowa pomoże wyeliminować niepożądane dźwięki.&lt;div class=cms-template_photo100&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat cyfrowy Sony ZV-1 II (ZV1M2BDI.EU) Cashbacku Raty 20x0%\"src=//upload.cyfrowe.pl/cyfrowe/products/1690814cfe1.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;h3&gt;Dziel się ze światem&lt;/h3&gt;&lt;p&gt;Kiedy połączysz &lt;strong&gt;aparat ZV-1 II&lt;/strong&gt; z laptopem lub smartfonem, możesz prowadzić transmisje strumieniowe bez używania karty przechwytującej i dodatkowych aplikacji. A dzięki najnowszej aplikacji &lt;strong&gt;Sony Creator\'s App&lt;/strong&gt; szybko prześlesz ujęcia i opublikujesz je w mediach społecznościowych.&lt;div class=cms-template_photo100&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat cyfrowy Sony ZV-1 II (ZV1M2BDI.EU) Cashbacku Raty 20x0%\"src=//upload.cyfrowe.pl/cyfrowe/products/1690735692b.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;h3&gt;Ułatw sobie vlogowanie&lt;/h3&gt;&lt;p&gt;Używaj aparatu &lt;strong&gt;ZV-1 II &lt;/strong&gt;w połączeniu z uchwytem &lt;strong&gt;GP-VP2BT&lt;/strong&gt;, zapewniającym stabilniejszy obraz, bardziej intuicyjną obsługę i więcej przyjemności z tworzenia vloga. Uchwyt działa &lt;strong&gt;bez przewodów i własnego źródła zasilania&lt;/strong&gt;. Pozwala włączać nagrywanie i może pełnić funkcję ministatywu do&lt;strong&gt; aparatu ZV-1 II&lt;/strong&gt;.&lt;div class=cms-template_photo100&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat cyfrowy Sony ZV-1 II (ZV1M2BDI.EU) Cashbacku Raty 20x0%\"src=//upload.cyfrowe.pl/cyfrowe/products/1690673c722.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;h3&gt;Ograniczenie użycia plastiku&lt;/h3&gt;&lt;p&gt;Ten kompaktowy aparat jest częściowo wykonany z&lt;strong&gt; tworzywa sztucznego z recyklingu&lt;/strong&gt;. Jego opakowanie zawiera &lt;strong&gt;mniej plastiku&lt;/strong&gt;, a włoski osłony przeciwwiatrowej powstają wyłącznie z&lt;strong&gt; poliestru z recyklingu&lt;/strong&gt;.&lt;div class=\"cms-template_4photos-grid cms-grid cms-grid-4 js-flexbox\"&gt;&lt;div class=cms-box&gt;&lt;div class=box-inner&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat cyfrowy Sony ZV-1 II (ZV1M2BDI.EU) Cashbacku Raty 20x0%\"src=//upload.cyfrowe.pl/cyfrowe/products/169020f8b92.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;div class=cms-box&gt;&lt;div class=box-inner&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat cyfrowy Sony ZV-1 II (ZV1M2BDI.EU) Cashbacku Raty 20x0%\"src=//upload.cyfrowe.pl/cyfrowe/products/169034cc0cf.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;div class=cms-box&gt;&lt;div class=box-inner&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat cyfrowy Sony ZV-1 II (ZV1M2BDI.EU) Cashbacku Raty 20x0%\"src=//upload.cyfrowe.pl/cyfrowe/products/16904f6341f.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;div class=cms-box&gt;&lt;div class=box-inner&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat cyfrowy Sony ZV-1 II (ZV1M2BDI.EU) Cashbacku Raty 20x0%\"src=//upload.cyfrowe.pl/cyfrowe/products/16905618698.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;p class=short_description itemprop=description&gt;ZV-1 II to idealny aparat dla autorów wideoblogów, którzy chcą opowiadać o swoim świecie. Ma wbudowany obiektyw zmiennoogniskowy 18-50 mm, pozwalający pokazać całe otoczenie albo skupić się na głównym obiekcie. Dzięki dużemu, 1-calowemu przetwornikowi obrazu zapewnia doskonałą jakość filmu 4K.  Aby używać opracowanych przez firmę Sony, cenionych funkcji do vlogowania, wystarczy nacisnąć przycisk. A jeśli chcesz nadać vlogowi wygląd prawdziwego filmu, włącz tryb \"Kinowy vlog\". Możesz też połączyć aparat ze smartfonem przy użyciu aplikacji Creators\' App i przesyłać do mediów społecznościowych filmy, które chcesz opublikować.', '', 'aparat-cyfrowy-sony-zv-1-ii-zv1m2bdieu', '', '', '', 'Aparat cyfrowy Sony ZV-1 II (ZV1M2BDI.EU)', '', '', '', ''),
(3, 1, 1, '&lt;div class=cms-template_title-subtitle&gt;&lt;h2&gt;Nikon Coolpix P1000&lt;/h2&gt;&lt;h3&gt;Niemożliwe jest w Twoim zasięgu&lt;/h3&gt;&lt;p&gt;&lt;strong&gt;Dotknij gwiazd. Podążaj za lecącymi ptakami. Niebo przestaje być niedostępne, gdy masz do dyspozycji 125-krotny zoom optyczny. Wykonuj zdjęcia i rejestruj filmy motywów, które dotychczas były poza Twoim zasięgiem.&lt;/strong&gt;&lt;/div&gt;&lt;div class=cms-template_photo100&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/descFiles/21102801172.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;h3&gt;Przekrocz granicę&lt;/h3&gt;&lt;p&gt;Krajobraz Księżyca. Samoloty rejsowe. Dzika przyroda. &lt;strong&gt;To wszystko będzie w Twoim zasięgu z Nikonem Coolpix P1000. Zakres ogniskowych wynoszący 24-3000 mm&lt;/strong&gt; (odpowiednik formatu 35 mm) sprawia, że nic Cię nie ograniczy. Dodatkowo masz wsparcie&lt;strong&gt; 250-krotnego zoomu cyfrowego, który poszerza zakres aż do 6000 mm. &lt;/strong&gt;Z &lt;strong&gt;Nikonem Coolpix P1000 możesz wszystko&lt;/strong&gt; - objąć szeroki plan lub przyjrzeć się najdrobniejszym detalom.&lt;div class=\"cms-template_2photos-grid cms-grid cms-grid-2 js-flexbox\"&gt;&lt;div class=cms-box&gt;&lt;div class=box-inner&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/descFiles/191107340764.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;div class=cms-box&gt;&lt;div class=box-inner&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/descFiles/12048584385.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;h3&gt;Zachwycające ujęcia&lt;/h3&gt;&lt;p&gt;Wykonuj doskonale ostre zdjęcia nawet przy zastosowaniu długich ogniskowych. &lt;strong&gt;Jasny obiektyw f/2.8-8 Nikkor, sensor o rozdzielczości 16 MP i obsługa RAWów&lt;/strong&gt; to gwarancja doskonałych rezultatów. &lt;strong&gt;Niezwykle czuła matryca CMOS, wyjątkowo wydajny procesor EXPEED i zawansowana budowa optyczna &lt;/strong&gt;minimalizują zniekształcenia nawet przy ekstremalnych zbliżeniach. &lt;strong&gt;Szybki i celny system AF zapewni ostre zdjęcia&lt;/strong&gt;, dokładnie w tym punkcie, w którym zapragniesz. &lt;strong&gt;Wykonuj zdjęcia seryjne z prędkością 7 kl./s&lt;/strong&gt;, dzięki czemu nie przegapisz żadnego momentu. &lt;strong&gt;Format RAW dają niesamowite możliwości edycyjne&lt;/strong&gt;, pozwalając Ci na wyciśnięcie ze swoich zdjęć maksimum i pełną kontrolę nad finalnym efektem.&lt;div class=cms-template_photo100&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/descFiles/31157961905.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;h3&gt;Przyjrzyj się dokładnie&lt;/h3&gt;&lt;p&gt;&lt;strong&gt;Nikon Coolpix P1000 posiada znakomity elektroniczny wizjer o ultra wysokiej rozdzielczości wynoszącej ok. 2 360 000 punktów.&lt;/strong&gt; Zapewnia wyraźny i szczegółowy obraz w każdych warunkach. Możesz dzięki niemu mieć doskonały ogląd sytuacji i intuicyjnie kadrować fotografie. &lt;strong&gt;Dodatkowo wizjer jest wspierany przez jasny 3,2\'\', odchylany ekran LCD o rozdzielczości 921 000 punktów. &lt;/strong&gt;Możesz go odchylić tak, aby ułatwić sobie obsługę aparatu i kadrowanie. Poczuj pełną swobodę podczas obsługi aparatu - &lt;strong&gt;czujnik automatycznie przełączy Cię pomiędzy monitorem a wizjerem, gdy tylko zbliżysz aparat do oka.&lt;/strong&gt;&lt;div class=\"cms-template_2photos-grid cms-grid cms-grid-2 js-flexbox\"&gt;&lt;div class=cms-box&gt;&lt;div class=box-inner&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/descFiles/181624008235.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;div class=cms-box&gt;&lt;div class=box-inner&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/descFiles/17725144790.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;div class=\"cms-template_2photos-grid cms-grid cms-grid-2 js-flexbox\"&gt;&lt;div class=cms-box&gt;&lt;div class=box-inner&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/descFiles/15296463075.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;div class=cms-box&gt;&lt;div class=box-inner&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/descFiles/161452488493.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;h3&gt;Filmy 4K przy niezwykle długiej ogniskowej&lt;/h3&gt;&lt;p&gt;Nikon Coolpix P1000 daje Ci niezwykłe możliwości twórcze również w zakresie wideo. &lt;strong&gt;Z łatwością nagrywaj filmy 4K/UHD z prędkością 30 kl./s lub Full HD (1080p) z prędkością 60 kl./s. &lt;/strong&gt;Dzięki wyjątkowemu zoomowi możesz zarejestrować przelatujący samolot lub powierzchnię Księżyca. &lt;strong&gt;Aparat oferuje port mikro HDMI&lt;/strong&gt;, co pozwala np. na korzystanie z zewnętrznego monitora podglądowego. &lt;strong&gt;Nikon Coolpix P1000 to także możliwość nagrywania doskonałego dźwięku z wykorzystaniem zewnętrznych mikrofonów. &lt;/strong&gt;Pozwoli Ci na to wbudowane gniazdo jack. &lt;strong&gt;Baw się obrazem z wykorzystaniem funkcji Superlapse, &lt;/strong&gt;która pozwala na uchwycenie zmieniających się krajobrazów i ukazania świata z odmiennej perspektywy. Z pewnością niezwykle ekscytującym przeżyciem będzie wykorzystanie tego trybu do rejestrowania zjawisk astronomicznych, takich jak np. wędrówka Srebrnego Globu po firmamencie lub ruchy gwiazd.&lt;h3&gt;Stabilne ujęcia&lt;/h3&gt;&lt;p&gt;&lt;strong&gt;Wbudowana redukcja drgań &lt;/strong&gt;eliminuje poruszenia spowodowane drżeniem dłoni i dłuższymi czasami naświetlania. Wydajna stabilizacja jest niezwykle ważna podczas korzystania z teleobiektywów, jakim jest wykorzystywany przez Nikona Coolpixa P1000 instrument optyczny. &lt;strong&gt;Zaimplementowany system pozwala na wydłużenie czasu naświetlania o pięć stopni.&lt;/strong&gt; Funkcja ta jest przydatna nie tylko podczas korzystania z długich ogniskowych, ale również w trakcie fotografowania przy małej ilości światła. Stanowi również ogromną pomoc w przypadku rejestrowania filmów.&lt;p&gt;&lt;strong&gt;Specjalny tryb VR Active jest pomocny w trakcie fotografowania, gdy się poruszasz. &lt;/strong&gt;Niezależnie czy z pokładu kołyszącej się łodzi dostrzeżesz w oddali wzbijającego się do lotu kormorana, czy będziesz śledził poruszający się obiekt siedząc w samochodzie poruszającym się po wyboistej drodze, z pewnością to uchwycisz.&lt;div class=cms-template_text67-photo33&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/descFiles/6762026853973.jpg&gt;&lt;/div&gt;&lt;h3&gt;Pozostań w kontakcie dzięki SnapBridge&lt;/h3&gt;&lt;p&gt;&lt;strong&gt;Nikon Coolpix P1000 daje pełną swobodę nie tylko dzięki swojemu wyjątkowemu obiektywowi - to także możliwość bezprzewodowej łączności z Twoim urządzeniem mobilnym&lt;/strong&gt;. Przesyłaj i synchronizuj swoje zdjęcia do smartfona lub tabletu i natychmiast je udostępniaj. &lt;strong&gt;Możesz także operować zdalnie aparatem. &lt;/strong&gt;Wszystko to przy wykorzystaniu &lt;strong&gt;technologii łączności bezprzewodowej Bluetooth® Low Energy i wbudowanego modułu Wi-Fi, &lt;/strong&gt;która zapewnia znakomitą wydajność.&lt;strong&gt; Możesz także wykorzystać urządzenie mobilne, aby dodawać do fotografii geotagi &lt;/strong&gt;i zapamiętywać dokładne położenie fotografowanych obiektów. &lt;strong&gt;Dzięki aplikacji mobilnej możesz zdalnie wyzwalać migawkę i sterować zoomem.&lt;/strong&gt;&lt;/div&gt;&lt;h3&gt;Odnajdź się w każdej sytuacji&lt;/h3&gt;&lt;p&gt;&lt;strong&gt;Nikon Coolpix P1000 oferuje Ci świetne tryby pracy, które możesz wykorzystać podczas realizowania różnorodnych wyzwań fotograficznych. &lt;/strong&gt;Skorzystaj z &lt;strong&gt;trybu fotografowania Księżyca,&lt;/strong&gt; który gwarantuje odpowiednie dobieranie parametrów podczas rejestrowania faz Srebrnego Globu.&lt;strong&gt; Tryb obserwacji ptaków &lt;/strong&gt;pozwoli Ci zbliżyć się nawet do najbardziej płochliwych zwierząt. &lt;strong&gt;Możesz także stworzyć multiekspozycję nakładając na siebie 3 zdjęcia - to świetny sposób na kreatywną zabawę.&lt;/strong&gt;&lt;h3&gt;Zawsze namierzaj swój cel&lt;/h3&gt;&lt;p&gt;&lt;strong&gt;Ergonomiczna konstrukcja, duży uchwyt i przemyślane rozmieszczenie przycisków sterujących &lt;/strong&gt;ułatwiają szybką oraz płynną obsługę aparatu i regulację zoomu. &lt;strong&gt;Obudowa aparatu gwarantuje pewne trzymanie, a regulacja zoomu umieszczona z boku umożliwia jego wygodną obsługę za pomocą kciuka&lt;/strong&gt;. Aparat oferuje także&lt;strong&gt; funkcję \"snap-back\",&lt;/strong&gt; która pozwala na szybką zmianę ogniskowej na szeroki kąt. &lt;strong&gt;Nikon Coolpix P1000 to również bardzo kompaktowa konstrukcja. Waży zaledwie 1/4 wagi aparatu SLR, a jednocześnie oferuje super teleobiektyw.&lt;/strong&gt;&lt;h3&gt;Rozbuduj swój system&lt;/h3&gt;&lt;p&gt;&lt;strong&gt;Nikon Coolpix P1000 został wyposażony w złącze gorącej stopki, które umożliwia zastosowanie zewnętrznej, reporterskiej lampy błyskowej. &lt;/strong&gt;Wypróbuj np. kompaktową lampę Nikon SB-700, która da Ci ogromne możliwości podczas pracy ze światłem błyskowym. Ponadto możesz zastosować akcesoria, takie jak np. zewnętrzny, stereofoniczny mikrofon ME-1 lub bezprzewodowy mikrofon ME-W1, tak aby nagrywać doskonale czysty dźwięk.&lt;div class=cms-template_photo100&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/descFiles/61609000817.jpg&gt;&lt;/div&gt;&lt;p&gt;Nikon Coolpix P1000 z lampą Nikon SB-700&lt;/div&gt;&lt;ul&gt;&lt;li&gt;&lt;a href=https://www.nikon.pl/pl_PL/product/digital-cameras/coolpix/coolpix-p1000 target=_blank&gt;Opis produktu na polskiej stronie producenta&lt;/a&gt;&lt;li&gt;&lt;a href=https://www.europe-nikon.com/en_GB/product/digital-cameras/coolpix/super-zoom-share/coolpix-p1000 target=_blank&gt;Opis produktu na zagranicznej stronie producenta&lt;/a&gt;&lt;li&gt;&lt;a href=https://www.nikon.pl/pl_PL/product/digital-cameras/coolpix/coolpix-p1000#photo_video_gallery target=_blank&gt;Galeria zdjęć i filmów wykonanych aparatem Nikon Coolpix P1000&lt;/a&gt;&lt;li&gt;&lt;a href=http://blog.cyfrowe.pl/2019/03/12/nikon-p1000-i-p900-porownanie-dwoch-superzoomow-o-imponujacym-zakresie-ogniskowych/ target=_blank&gt;Porównanie aparatów Nikon P900 i Nikon P1000 na Blog.cyfrowe.pl&lt;/a&gt;&lt;/ul&gt;&lt;p class=short_description itemprop=description&gt;Nikon Coolpix P1000 oferuje zdumiewające możliwości, głównie za sprawą 125-krotnego zoomu optycznego (zakres ogniskowych 24-3000 mm dla 35 mm) i 250-krotnego zoomu cyfrowego. Dzięki temu możesz wykonać zdjęcia zarówno szerokich planów, jak i bardzo odległych obiektów, takich jak np. lecący samolot lub ptaki. Ponadto aparat został wyposażony w niezwykle czuły sensor CMOS o rozdzielczości 16 MP, światłosiłę f/2.8-f/8, wyjątkowo wydajny procesor EXPEED, szybki i celny system AF, możliwość wykonywania zdjęć seryjnych z prędkością 7 kl./s, wydajną redukcję drgań, rozbudowane tryby tematyczne, elektroniczny wizjer, odchylany wyświetlacz LCD TFT, nagrywanie filmów w jakości 4K i zapis w formacie RAW.', '', 'aparat-cyfrowy-nikon-coolpix-p1000', '', '', '', 'Aparat cyfrowy Nikon Coolpix P1000', '', '', '', ''),
(4, 1, 1, '&lt;div class=cms-template_title-subtitle&gt;&lt;h2&gt;Canon PowerShot G7 X Mark II PREMIUM KIT&lt;/h2&gt;&lt;h3&gt;Kompaktowy aparat cyfrowy&lt;/h3&gt;&lt;p&gt;&lt;strong&gt;Canon G7 X mark II&lt;/strong&gt; to kolejna odsłona kompaktowego aparatu z obiektywem o doskonałej jasności f:/1.8-2.8 i ponad 4-krotnym zoomem. Wyposażony w dużą, 1 calową matrycę o rozdzielczości 20.1 mln piksela umożliwia wykonanie doskonałych zdjęć w każdych warunkach. Aby w pełni wykorzystać możliwości aparatu możliwe jest fotografowanie w manualnych trybach. Całości dopełnia super szybki procesor obróbki obrazu Digic 7.&lt;/div&gt;&lt;div class=cms-template_text33x3&gt;&lt;div class=cms-text-column&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat cyfrowy Canon PowerShot G7 X Mark II premium kit\"src=//upload.cyfrowe.pl/cyfrowe/products/11341596310.jpg&gt;&lt;/div&gt;&lt;h3&gt;Aparat na każde warunki &lt;/h3&gt;&lt;p&gt;&lt;strong&gt;Canon G7 X mark II &lt;/strong&gt;wyposażony został w HS System, na który składa się podświetlana matryca CMOS o wielkości 1,0 cala oraz rozdzielczości 20,1 megapikseli, a także fantasyczny procesor DIGIC 7. To wszystko zapewnia świetne, ostre i wyraźne zdjęcia niezależnie od oświetlenia.&lt;/div&gt;&lt;div class=cms-text-column&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat cyfrowy Canon PowerShot G7 X Mark II premium kit\"src=//upload.cyfrowe.pl/cyfrowe/products/11342dd067f.jpg&gt;&lt;/div&gt;&lt;h3&gt;Stabilizacja obrazu&lt;/h3&gt;&lt;p&gt;Dynamiczna scena? Bez obaw! PowerShot G7 X Mark II poradzi sobie na najwyższym poziomie. Do jego produkcji wykorzystany został 4-stopniowy inteligentny stabilizator obrazu z technologią Dual Sensing IS, która zapewnia wyraźne i nieporuszone zdjęcia i filmy. &lt;/div&gt;&lt;div class=cms-text-column&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat cyfrowy Canon PowerShot G7 X Mark II premium kit\"src=//upload.cyfrowe.pl/cyfrowe/products/113431b8bb9.jpg&gt;&lt;/div&gt;&lt;h3&gt;Jasna optyka &lt;/h3&gt;&lt;p&gt;Aparat posiada:&lt;ul&gt;&lt;li&gt;jasny obiektyw o przysłonie f/1,8-2,8,&lt;li&gt;ogniskową j 24 mm,&lt;li&gt;4,2-krotny zoom optyczny,&lt;li&gt;maksymalną czułość ISO 25600.&lt;/ul&gt;&lt;p&gt;Dzięki temu otrzymasz piękne i jasne zdjęcia w każdych waurnkach. &lt;/div&gt;&lt;/div&gt;&lt;div class=cms-template_text33x3&gt;&lt;div class=cms-text-column&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat cyfrowy Canon PowerShot G7 X Mark II premium kit\"src=//upload.cyfrowe.pl/cyfrowe/products/11344ac6e1d.jpg&gt;&lt;/div&gt;&lt;h3&gt;Wszystko pod kontrolą&lt;/h3&gt;&lt;p&gt;W trybie filmowania ręcznego masz możliwość dostosowania przysłony, czasu naświetlania oraz czułości ISO według swoich potrzeb. Wyzwalaj swoją kreatywność - Ty decydujesz jak ma wyglądać Twoje dzieło. &lt;/div&gt;&lt;div class=cms-text-column&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat cyfrowy Canon PowerShot G7 X Mark II premium kit\"src=//upload.cyfrowe.pl/cyfrowe/products/11345fa3361.jpg&gt;&lt;/div&gt;&lt;h3&gt;Niewyobrażalnie ostry &lt;/h3&gt;&lt;p&gt;W celu uzyskania ostrości za pomocą możesz skorzystać z funkcji:&lt;ul&gt;&lt;li&gt;wzmocnienia krawędzi w trybie MF - ręczne ustawianie precyzyjnej ostrości ,&lt;li&gt;dotykowego AF - tworzenie kinowych efektów płynnej zmiany ostrości&lt;/ul&gt;&lt;/div&gt;&lt;div class=cms-text-column&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat cyfrowy Canon PowerShot G7 X Mark II premium kit\"src=//upload.cyfrowe.pl/cyfrowe/products/11346c689c8.jpg&gt;&lt;/div&gt;&lt;h3&gt;Profesjonalna jakość &lt;/h3&gt;&lt;p&gt;Dostosuj liczbę klatek na sekundę (24, 25, 30, 50 i 60 kl./s) i nagrywaj filmy Full HD 60p o fantastycznej jakości. &lt;/div&gt;&lt;/div&gt;&lt;div class=cms-template_text33x3&gt;&lt;div class=cms-text-column&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat cyfrowy Canon PowerShot G7 X Mark II premium kit\"src=//upload.cyfrowe.pl/cyfrowe/products/113516ca449.jpg&gt;&lt;/div&gt;&lt;h3&gt;Odchylany ekran&lt;/h3&gt;&lt;p&gt;Canon PowerShot G7 X Mark II wyposażony został w duży, odchylany ekran dotykowy o przekątnej 7,5 cm, co daje 1.04 ml punktów sRGB. Dzięki temu możesz tworzyć materiały z ujęć pod różnym kątem. &lt;/div&gt;&lt;div class=cms-text-column&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat cyfrowy Canon PowerShot G7 X Mark II premium kit\"src=//upload.cyfrowe.pl/cyfrowe/products/113525ca04e.jpg&gt;&lt;/div&gt;&lt;h3&gt;Regulowane elementy sterujące&lt;/h3&gt;&lt;p&gt;PowerShot G7 X Mark II posiada konfigurowalny, dwufunkcyjny pierścień regulacji na obiektywie, który zapewnia łatwe przełączanie między sprawną i stopniową regulacją ustawień ekspozycji lub ostrości. &lt;/div&gt;&lt;div class=cms-text-column&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat cyfrowy Canon PowerShot G7 X Mark II premium kit\"src=//upload.cyfrowe.pl/cyfrowe/products/1135388712a.jpg&gt;&lt;/div&gt;&lt;h3&gt;Magia rozmycia&lt;/h3&gt;&lt;p&gt;9 - listkowa przysłona umożliwia stworzenie na zdjęciu magicznego rozmycia. Przejmij kontrolę nad głębią ostrości i stwórz malownicze tło. &lt;/div&gt;&lt;/div&gt;&lt;div class=cms-template_text33x3&gt;&lt;div class=cms-text-column&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat cyfrowy Canon PowerShot G7 X Mark II premium kit\"src=//upload.cyfrowe.pl/cyfrowe/products/11354cfec75.jpg&gt;&lt;/div&gt;&lt;h3&gt;Komfort użytkowania&lt;/h3&gt;&lt;ul&gt;&lt;li&gt;Przycisk Wi-Fi gwarantuje prosty i szybki skrót do funckji Wi-Fi w aparacie.&lt;li&gt;Możliwość ładowania podczas pracy lub przeglądania internetu przy użyciu komputera lub ładowarki do smartfona posiadającej złącze USB. &lt;/ul&gt;&lt;/div&gt;&lt;div class=cms-text-column&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat cyfrowy Canon PowerShot G7 X Mark II premium kit\"src=//upload.cyfrowe.pl/cyfrowe/products/11355c22e1a.jpg&gt;&lt;/div&gt;&lt;h3&gt;5-osiowa stabilizacja &lt;/h3&gt;&lt;p&gt;Za wyjątkową stabilność i wyraistość Twoich filmów odpowiada 5-osiowy, zaawansowany i dynamiczny stabilizator obrazu, który niweluje drgania aparatu. Ponadto aparat posiada funkcję automatycznego poziomowania, która zapewnia proste linie horyzontu. &lt;/div&gt;&lt;div class=cms-text-column&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat cyfrowy Canon PowerShot G7 X Mark II premium kit\"src=//upload.cyfrowe.pl/cyfrowe/products/113569cf784.jpg&gt;&lt;/div&gt;&lt;h3&gt;Obsługa obrazów RAW &lt;/h3&gt;&lt;ul&gt;&lt;li&gt;14-bitowe obrazy RAW zapewniają płynną integrację z cyklem pracy EOS.&lt;li&gt;Funkcje konwersji w aparacie.&lt;li&gt;Możliwość obróbki plików RAW w aparacie gwarantują najwyższą możliwą jakość udostępnianych obrazów.&lt;/ul&gt;&lt;/div&gt;&lt;/div&gt;&lt;div class=cms-template_text33x3&gt;&lt;div class=cms-text-column&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat cyfrowy Canon PowerShot G7 X Mark II premium kit\"src=//upload.cyfrowe.pl/cyfrowe/products/11348cbd5f4.jpg&gt;&lt;/div&gt;&lt;h3&gt;Nie tylko zdjęcia&lt;/h3&gt;&lt;p&gt;Nie ograniczaj się tylko do tworzenia zdjęć. Ten niewielki kieszonkowy aparat Canon zapewnia równie doskonałe filmy w jakości Full HD - spróbuj i przekonaj się o jego możliwościach. &lt;/div&gt;&lt;div class=cms-text-column&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat cyfrowy Canon PowerShot G7 X Mark II premium kit\"src=//upload.cyfrowe.pl/cyfrowe/products/113491a1f5a.jpg&gt;&lt;/div&gt;&lt;h3&gt;Uniwersalny aparat&lt;/h3&gt;&lt;p&gt;PowerShot G7 X Mark II to kompaktowy aparat, który sprawdza się idealnie podczas fotografowania w każdych, nawet trudnych warunkach oświetleniowych.&lt;/div&gt;&lt;div class=cms-text-column&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat cyfrowy Canon PowerShot G7 X Mark II premium kit\"src=//upload.cyfrowe.pl/cyfrowe/products/1135064f7d3.jpg&gt;&lt;/div&gt;&lt;h3&gt;Podziel się z innymi &lt;/h3&gt;&lt;p&gt;Nie rób zdjęć tylko dla siebie - pokaż je światu! Przesyłaj treści do swojego smartfona i dziel się radością ze swoimi bliskimi. &lt;/div&gt;&lt;/div&gt;&lt;p class=short_description itemprop=description&gt;Canon G7 X mark II to kolejna odsłona kompaktowego aparatu z obiektywem o doskonałej jasności f:/1.8-2.8 i ponad 4-krotnym zoomem. Wyposażony w dużą, 1 calową matrycę o rozdzielczości 20.1 mln piksela umożliwia wykonanie doskonałych zdjęć w każdych warunkach. Aby w pełni wykorzystać możliwości aparatu możliwe jest fotografowanie w manualnych trybach. Całości dopełnia super szybki procesor obróbki obrazu Digic 7.', '', 'aparat-cyfrowy-canon-powershot-g7-x-mark-ii-premium-kit', '', '', '', 'Aparat cyfrowy Canon PowerShot G7 X Mark II premium kit', '', '', '', ''),
(5, 1, 1, '&lt;div class=cms-template_title-subtitle&gt;&lt;h2&gt;Canon PowerShot G7 X Mark II &lt;/h2&gt;&lt;h3&gt;Kompaktowy aparat cyfrowy&lt;/h3&gt;&lt;p&gt;&lt;strong&gt;Canon G7 X mark II&lt;/strong&gt; to kolejna odsłona kompaktowego aparatu z obiektywem o doskonałej jasności f:/1.8-2.8 i ponad 4-krotnym zoomem. Wyposażony w dużą, 1-calową matrycę o rozdzielczości 20.1 mln piksela umożliwia wykonanie doskonałych zdjęć w każdych warunkach. Aby w pełni wykorzystać możliwości aparatu, możliwe jest fotografowanie w manualnych trybach. Całości dopełnia super szybki procesor obróbki obrazu Digic 7.&lt;/div&gt;&lt;div class=cms-template_text33x3&gt;&lt;div class=cms-text-column&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat cyfrowy Canon PowerShot G7 X Mark II premium kit\"src=//upload.cyfrowe.pl/cyfrowe/products/11341596310.jpg&gt;&lt;/div&gt;&lt;h3&gt;Aparat na każde warunki &lt;/h3&gt;&lt;p&gt;&lt;strong&gt;Canon G7 X mark II &lt;/strong&gt;wyposażony został w HS System, na który składa się podświetlana matryca CMOS o wielkości 1,0 cala oraz rozdzielczości 20,1 megapikseli, a także fantasyczny procesor DIGIC 7. To wszystko zapewnia świetne, ostre i wyraźne zdjęcia niezależnie od oświetlenia.&lt;/div&gt;&lt;div class=cms-text-column&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat cyfrowy Canon PowerShot G7 X Mark II premium kit\"src=//upload.cyfrowe.pl/cyfrowe/products/11342dd067f.jpg&gt;&lt;/div&gt;&lt;h3&gt;Stabilizacja obrazu&lt;/h3&gt;&lt;p&gt;Dynamiczna scena? Bez obaw! PowerShot G7 X Mark II poradzi sobie na najwyższym poziomie. Do tego produkcji wykorzystany został 4-stopniowy inteligentny stabilizator obrazu z technologią Dual Sensing IS, która zapewnia wyraźne i nieporuszone zdjęcia i filmy. &lt;/div&gt;&lt;div class=cms-text-column&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat cyfrowy Canon PowerShot G7 X Mark II premium kit\"src=//upload.cyfrowe.pl/cyfrowe/products/113431b8bb9.jpg&gt;&lt;/div&gt;&lt;h3&gt;Jasna optyka &lt;/h3&gt;&lt;p&gt;Aparat posiada:&lt;ul&gt;&lt;li&gt;jasny obiektyw o przysłonie f/1,8-2,8,&lt;li&gt;ogniskową j 24 mm,&lt;li&gt;4,2-krotny zoom optyczny,&lt;li&gt;maksymalną czułość ISO 25600.&lt;/ul&gt;&lt;p&gt;Dzięki temu otrzymasz piękne i jasne zdjęcia w każdych waurnkach. &lt;/div&gt;&lt;/div&gt;&lt;div class=cms-template_text33x3&gt;&lt;div class=cms-text-column&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat cyfrowy Canon PowerShot G7 X Mark II premium kit\"src=//upload.cyfrowe.pl/cyfrowe/products/11344ac6e1d.jpg&gt;&lt;/div&gt;&lt;h3&gt;Wszystko pod kontrolą&lt;/h3&gt;&lt;p&gt;W trybie filmowania ręcznego masz możliwość dostosowania przysłony, czasu naświetlania oraz czułości ISO według swoich potrzeb. Wyzwalaj swoją kreatywność - Ty decydujesz jak ma wyglądać Twoje dzieło. &lt;/div&gt;&lt;div class=cms-text-column&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat cyfrowy Canon PowerShot G7 X Mark II premium kit\"src=//upload.cyfrowe.pl/cyfrowe/products/11345fa3361.jpg&gt;&lt;/div&gt;&lt;h3&gt;Niewyobrażalnie ostry &lt;/h3&gt;&lt;p&gt;W celu uzyskania ostrości za pomocą możesz skorzystać z funkcji:&lt;ul&gt;&lt;li&gt;wzmocnienia krawędzi w trybie MF - ręczne ustawianie precyzyjnej ostrości ,&lt;li&gt;dotykowego AF - tworzenie kinowych efektów płynnej zmiany ostrości&lt;/ul&gt;&lt;/div&gt;&lt;div class=cms-text-column&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat cyfrowy Canon PowerShot G7 X Mark II premium kit\"src=//upload.cyfrowe.pl/cyfrowe/products/11346c689c8.jpg&gt;&lt;/div&gt;&lt;h3&gt;Profesjonalna jakość &lt;/h3&gt;&lt;p&gt;Dostosuj liczbę klatek na sekundę (24, 25, 30, 50 i 60 kl./s) i nagrywaj filmy Full HD 60p o fantastycznej jakości. &lt;/div&gt;&lt;/div&gt;&lt;div class=cms-template_text33x3&gt;&lt;div class=cms-text-column&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat cyfrowy Canon PowerShot G7 X Mark II premium kit\"src=//upload.cyfrowe.pl/cyfrowe/products/113516ca449.jpg&gt;&lt;/div&gt;&lt;h3&gt;Odchylany ekran&lt;/h3&gt;&lt;p&gt;Canon PowerShot G7 X Mark II wyposażony został w duży, odchylany ekran dotykowy o przekątnej 7,5 cm, co daje 1.04 ml punktów sRGB. Dzięki temu możesz tworzyć materiały z ujęć pod różnym kątem. &lt;/div&gt;&lt;div class=cms-text-column&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat cyfrowy Canon PowerShot G7 X Mark II premium kit\"src=//upload.cyfrowe.pl/cyfrowe/products/113525ca04e.jpg&gt;&lt;/div&gt;&lt;h3&gt;Regulowane elementy sterujące&lt;/h3&gt;&lt;p&gt;PowerShot G7 X Mark II posiada konfigurowalny, dwufunkcyjny pierścień regulacji na obiektywie, który zapewnia łatwe przełączanie między sprawną i stopniową regulacją ustawień ekspozycji lub ostrości. &lt;/div&gt;&lt;div class=cms-text-column&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat cyfrowy Canon PowerShot G7 X Mark II premium kit\"src=//upload.cyfrowe.pl/cyfrowe/products/1135388712a.jpg&gt;&lt;/div&gt;&lt;h3&gt;Magia rozmycia&lt;/h3&gt;&lt;p&gt;9 - listkowa przysłona umożliwia stworzenie na zdjęciu magicznego rozmycia. Przejmij kontrolę nad głębią ostrości i stwórz malownicze tło. &lt;/div&gt;&lt;/div&gt;&lt;div class=cms-template_text33x3&gt;&lt;div class=cms-text-column&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat cyfrowy Canon PowerShot G7 X Mark II premium kit\"src=//upload.cyfrowe.pl/cyfrowe/products/11354cfec75.jpg&gt;&lt;/div&gt;&lt;h3&gt;Komfort użytkowania&lt;/h3&gt;&lt;ul&gt;&lt;li&gt;Przycisk Wi-Fi gwarantuje prosty i szybki skrót do funckji Wi-Fi w aparacie.&lt;li&gt;Możliwość ładowania podczas pracy lub przeglądania internetu przy użyciu komputera lub ładowarki do smartfona posiadającej złącze USB. &lt;/ul&gt;&lt;/div&gt;&lt;div class=cms-text-column&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat cyfrowy Canon PowerShot G7 X Mark II premium kit\"src=//upload.cyfrowe.pl/cyfrowe/products/11355c22e1a.jpg&gt;&lt;/div&gt;&lt;h3&gt;5-osiowa stabilizacja &lt;/h3&gt;&lt;p&gt;Za wyjątkową stabilność i wyraistość Twoich filmów odpowiada 5-osiowy, zaawansowany i dynamiczny stabilizator obrazu, który niweluje drgania aparatu. Ponadto aparat posiada funkcję automatycznego poziomowania, która zapewnia proste linie horyzontu. &lt;/div&gt;&lt;div class=cms-text-column&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat cyfrowy Canon PowerShot G7 X Mark II premium kit\"src=//upload.cyfrowe.pl/cyfrowe/products/113569cf784.jpg&gt;&lt;/div&gt;&lt;h3&gt;Obsługa obrazów RAW &lt;/h3&gt;&lt;ul&gt;&lt;li&gt;14-bitowe obrazy RAW zapewniają płynną integrację z cyklem pracy EOS.&lt;li&gt;Funkcje konwersji w aparacie.&lt;li&gt;Możliwość obróbki plików RAW w aparacie gwarantują najwyższą możliwą jakość udostępnianych obrazów.&lt;/ul&gt;&lt;/div&gt;&lt;/div&gt;&lt;div class=cms-template_text33x3&gt;&lt;div class=cms-text-column&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat cyfrowy Canon PowerShot G7 X Mark II premium kit\"src=//upload.cyfrowe.pl/cyfrowe/products/11348cbd5f4.jpg&gt;&lt;/div&gt;&lt;h3&gt;Nie tylko zdjęcia&lt;/h3&gt;&lt;p&gt;Nie ograniczaj się tylko do tworzenia zdjęć. Ten niewielki kieszonkowy aparat Canon zapewnia równie doskonałe filmy w jakości Full HD - spróbuj i przekonaj się o jego możliwościach. &lt;/div&gt;&lt;div class=cms-text-column&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat cyfrowy Canon PowerShot G7 X Mark II premium kit\"src=//upload.cyfrowe.pl/cyfrowe/products/113491a1f5a.jpg&gt;&lt;/div&gt;&lt;h3&gt;Uniwersalny aparat&lt;/h3&gt;&lt;p&gt;PowerShot G7 X Mark II to kompaktowy aparat, który sprawdza się idealnie podczas fotografowania w każdych, nawet trudnych warunkach oświetleniowych.&lt;/div&gt;&lt;div class=cms-text-column&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat cyfrowy Canon PowerShot G7 X Mark II premium kit\"src=//upload.cyfrowe.pl/cyfrowe/products/1135064f7d3.jpg&gt;&lt;/div&gt;&lt;h3&gt;Podziel się z innymi &lt;/h3&gt;&lt;p&gt;Nie rób zdjęć tylko dla siebie - pokaż je światu! Przesyłaj treści do swojego smartfona i dziel się radością ze swoimi bliskimi. &lt;/div&gt;&lt;/div&gt;&lt;ul class=optional-links&gt;&lt;li&gt;&lt;a title=\"Opis produktu na polskiej stronie producenta\"href=http://www.canon.pl/for_home/product_finder/cameras/digital_camera/powershot/powershot_g7_x_mark_ii/ rel=nofollow target=_blank&gt;Opis produktu na polskiej stronie producenta&lt;/a&gt;&lt;/ul&gt;&lt;p class=short_description itemprop=description&gt;Canon G7 X mark II to kolejna odsłona kompaktowego aparatu z obiektywem o doskonałej jasności f:/1.8-2.8 i ponad 4-krotnym zoomem. Wyposażony w dużą, 1 calową matrycę o rozdzielczości 20.1 mln piksela umożliwia wykonanie doskonałych zdjęć w każdych warunkach. Aby w pełni wykorzystać możliwości aparatu możliwe jest fotografowanie w manualnych trybach. Całości dopełnia super szybki procesor obróbki obrazu Digic 7.', '', 'aparat-cyfrowy-canon-powershot-g7-x-mark-ii', '', '', '', 'Aparat cyfrowy Canon PowerShot G7 X Mark II', '', '', '', '');
INSERT INTO `ps_product_lang` (`id_product`, `id_shop`, `id_lang`, `description`, `description_short`, `link_rewrite`, `meta_description`, `meta_keywords`, `meta_title`, `name`, `available_now`, `available_later`, `delivery_in_stock`, `delivery_out_stock`) VALUES
(6, 1, 1, '&lt;div class=cms-template_title-subtitle&gt;&lt;h2&gt;Sony RX100 VII&lt;/h2&gt;&lt;h3&gt;Kolejna odsłona uznanej serii zaawansowanych aparatów kompaktowych&lt;/h3&gt;&lt;p&gt;Seria aparatów Sony RX100 to &lt;strong&gt;znakomite aparaty kompaktowe dla wymagających użytkowników. &lt;/strong&gt;VII odsłona ponownie &lt;strong&gt;w zwartej obudowie mieści uniwersalny obiektyw zmiennoogniskowy 24-200 mm&lt;/strong&gt; (ekwiwalent formatu 35 mm) o &lt;strong&gt;doskonałych parametrach optycznych. Niebywale szybki autofokus cechujący się czasem reakcji wynoszący 0,02 s &lt;/strong&gt;pozwala na uzyskanie doskonale ostrych zdjęć każdej dynamicznej akcji. W połączeniu z&lt;strong&gt; udoskonalonym systemem śledzenia ruchu w czasie rzeczywistym i funkcją Eye AF&lt;/strong&gt;, a także &lt;strong&gt;ulepszoną stabilizacją obrazu&lt;/strong&gt; zdołasz podjąć się każdego wyzwania&lt;strong&gt;. Zewnętrzne gniazdo mikrofonowe &lt;/strong&gt;poszerza funkcjonalność aparatu w zakresie realizacji materiału wideo.&lt;/div&gt;&lt;div class=cms-template_photo25-text75&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/products/2956b31f0a.jpg&gt;&lt;/div&gt;&lt;h3&gt;Najlepszy specjalistyczny aparat kompaktowy&lt;/h3&gt;&lt;p&gt;Aparat Sony RX100 VII otrzymał nagrodę dla &lt;strong&gt;najlepszego specjalistycznego aparatu z kompaktowego roku 2020 &lt;/strong&gt;przyznaną przez &lt;strong&gt;TIPA&lt;/strong&gt; (Technical Image Press Association) - globalną organizację, zrzeszającą czasopisma o tematyce związanej z fotografią i obrazowaniem. Nagrody TIPA to najbardziej prestiżowe nagrody w branży przyznawane co roku sprzętom wyróżniającym się na tle konkurencji.&lt;/div&gt;&lt;div class=cms-template_text50-photo50&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/products/65787cd35.jpg&gt;&lt;/div&gt;&lt;h3&gt;Szeroki zakres zoomu - sfotografuj każdy temat&lt;/h3&gt;&lt;p&gt;W Sony RX100 VII zastosowano &lt;strong&gt;ultra uniwersalny obiektyw zmiennoogniskowy 24-200 mm&lt;/strong&gt; (ekwiwalent formatu 35 mm), który umożliwia realizacje niezwykle szerokiego zakresu tematów. Dzięki niemu wykonasz rozległe pejzaże, uchwycisz piękno architektury czy wykonasz doskonałe portrety i zdumiewające zbliżenia dzikiej przyrody czy zawodów sportowych.&lt;/div&gt;&lt;p&gt;Co więcej taki uniwersalny zakres sprawdzi się w trakcie realizowania fotoreportaży czy fotografii podróżniczej. Miej go zawsze przy sobie i uchwyć wszytko to, co Cię poruszy. Obiektyw ten charakteryzuje się &lt;strong&gt;doskonałymi parametrami i jakością optyczną oraz rozdzielczością w całym zakresie ogniskowych. &lt;/strong&gt;&lt;p&gt;Sony RX100 VII daje więc dostęp do &lt;strong&gt;uniwersalnego zakresu ogniskowych &lt;/strong&gt;w &lt;strong&gt;małej, kompaktowej obudowie. &lt;/strong&gt;Dzięki niemu nie ma konieczności zabierania ze sobą ciężkich teleobiektywów czy całego arsenału instrumentów optycznych, aby objąć wszystkie możliwe sceny. &lt;strong&gt;Zaawansowana konstrukcja optyczna obejmująca 4 soczewki asferyczne i 2 szklane elementy ED&lt;/strong&gt; (o bardzo niskiej dyspersji) pozwala na uzyskiwanie perfekcyjnych rezultatów.&lt;div class=\"cms-template_3photos-grid cms-grid cms-grid-3 js-flexbox\"&gt;&lt;div class=cms-box&gt;&lt;div class=box-inner&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/products/65440b6f7.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;div class=cms-box&gt;&lt;div class=box-inner&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/products/6564a9512.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;div class=cms-box&gt;&lt;div class=box-inner&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/products/655948a50.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;h3&gt;Niebywała wydajność&lt;/h3&gt;&lt;p&gt;W połączeniu z &lt;strong&gt;doskonałą, ulepszoną matrycą CMOS o rozmiarze 1\'\' i rodzielczości 20.1 MP, &lt;/strong&gt;a także&lt;strong&gt; niezwykle wydajnym procesorem Bionz X &lt;/strong&gt;otrzymasz dostęp do niebywałej szybkości i jakości przetwarzania obrazu. Aparat ten umożliwia &lt;strong&gt;wykonywanie zdjęć seryjnych z prędkością 20 kl./s, &lt;/strong&gt;a także niezwykle wydajny &lt;strong&gt;system ciągłego śledzenia AF, &lt;/strong&gt;który jest niezawodny nawet wtedy, gdy obiekty poruszają się nieregularnie lub z dużą prędkością. Aparat udostępnia &lt;strong&gt;tryb \"Pojedynczej serii zdjęć\", umożliwiający fotografowanie z oszałamiającą prędkością 90 kl./s.&lt;/strong&gt; Łączna liczba &lt;strong&gt;357 punktów AF z detekcją fazy&lt;/strong&gt; pozwala z ogromną precyzją wskazać, co jest najważniejsze w kadrze. Co więcej Sony RX100 VII posiada także &lt;strong&gt;425 punktów AF wykorzystujących detekcją kontrastu.&lt;/strong&gt;&lt;div class=cms-template_photo100&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/products/659058040.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;div class=cms-template_photo100&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/products/6532d039e.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;p&gt;&lt;strong&gt;System śledzenia AF&lt;/strong&gt; wykorzystuje algorytmy rozpoznawania obiektów oparte o rozwiązania AI. Działa on zarówno podczas fotografowania, jak i filmowania. &lt;strong&gt;Funkcja Eye AF &lt;/strong&gt;pozwala na uzyskanie perfekcyjnej ostrości podczas realizowania portretów.&lt;strong&gt; Co więcej działa nie tylko podczas fotografowania ludzi - aparat jest w stanie śledzić także oczy zwierząt. &lt;/strong&gt;&lt;p&gt;Sony RX100 VII został wyposażony w&lt;strong&gt; niezwykle wydajną stabilizację obrazu, &lt;/strong&gt;która oferuje &lt;strong&gt;wydajność 4 stopni EV przy ogniskowej 200 mm&lt;/strong&gt;. Oznacza to więc nie tylko możliwość skorzystania z dłuższych czasów naświetlania bez użycia statywu przy ograniczonym oświetleniu, ale również wygodniejszą i bardziej skuteczną pracę z teleobiektywem. &lt;strong&gt;Minimalny czas otwarcia migawki wynosi 1/32 000 s&lt;/strong&gt;. Z pewnością uchwycisz każdy ułamek chwili.&lt;strong&gt; Migawka może działać w trybie cichym&lt;/strong&gt;, tak więc możesz fotografować niezwykle dyskretnie tak, aby nie wpływać na nastrój sceny.&lt;h3&gt;Doskonały tryb filmowania&lt;/h3&gt;&lt;p&gt;Sony RX100 VII to nie tylko świetne zdjęcia, ale również zachwycające filmy. Oferuje&lt;strong&gt; jakość 4K i niezwykle płynne działanie systemu AF. Tryby śledzenia i funkcja Eye AF działają także w trybie filmowania, działając w czasie rzeczywistym. Tryb HLG pozwala na uzyskiwanie obrazów HDR &lt;/strong&gt;łącząc aparat z telewizorami Sony TV za pośrednictwem kabla USB. &lt;p&gt;Sony RX100 VII oferuje funkcje dla ambitnych vlogerów. &lt;strong&gt;Ostrością możesz sterować za pomocą funkcji dotyku&lt;/strong&gt;, co pozwala na niezwykle szybkie i łatwe wpływanie na obraz. &lt;strong&gt;Możliwość podłączenia zewnętrznego mikrofonu&lt;/strong&gt; czy &lt;strong&gt;obracany ekran &lt;/strong&gt;umożliwiają realizowanie odcinków vloga w dowolnym miejscu. &lt;strong&gt;Stabilizacja obrazu działa także dla jakości 4K.&lt;/strong&gt; Sony RX100 VII &lt;strong&gt;wspiera S-Log3 i S-Log2.&lt;/strong&gt; Dzięki temu uzyskasz idealne efekty w post produkcji. Aparat udostępnia &lt;strong&gt;interwałometr&lt;/strong&gt;, który umożliwia realizację filmów typu time lapse. &lt;div class=cms-template_photo100&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/products/660b3cce5.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;div class=cms-template_text50-photo50&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/products/65808d699.jpg&gt;&lt;/div&gt;&lt;h3&gt;Komfortowa obsługa&lt;/h3&gt;&lt;p&gt;Sony RX100 VII został wyposażony w&lt;strong&gt; funkcjonalny wizjer XGA OLED Tru-Finder o rozdzielczości ok. 2,35 mln pkt, który jest chowany w obudowie&lt;/strong&gt; (typu pop up). &lt;strong&gt;Ekran LCD o przekątnej 3\'\' i rozdzielczości 921 000 pkt jest ruchomy,&lt;/strong&gt; co pozwala na łatwiejsze fotografowanie z nietypowej perspektywy czy wykonywanie selfie. Możesz także skorzystać z &lt;strong&gt;konfigurowalnych przycisków&lt;/strong&gt; i dostosować ich funkcje. &lt;/div&gt;&lt;ul&gt;&lt;li&gt;&lt;a href=https://www.sony.com/electronics/cyber-shot-compact-cameras/dsc-rx100m7 target=_blank&gt;Opis produktu na zagranicznej stronie producenta&lt;/a&gt;&lt;/ul&gt;&lt;ul class=optional-links&gt;&lt;li&gt;&lt;a title=\"Strefa filmowa Sony \"href=https://www.cyfrowe.pl/lp/strefa-filmowa-sony.html rel=nofollow target=_blank&gt;Strefa filmowa Sony &lt;/a&gt;&lt;/ul&gt;&lt;p class=short_description itemprop=description&gt;Seria aparatów Sony RX100 to znakomite aparaty kompaktowe dla wymagających użytkowników. VIII odsłona ponownie w zwartej obudowie mieści uniwersalny obiektyw zmiennoogniskowy 24-200 mm (ekwiwalent formatu 35 mm) o doskonałych parametrach optycznych. Niebywale szybki autofokus cechujący się czasem reakcji wynoszący 0,02 s pozwala na uzyskanie doskonale ostrych zdjęć każdej dynamicznej akcji. W połączeniu z udoskonalonym systemem śledzenia ruchu w czasie rzeczywistym i funkcją Eye AF, a także ulepszoną stabilizacją obrazu zdołasz podjąć się każdego wyzwania. Zewnętrzne gniazdo mikrofonowe poszerza funkcjonalność aparatu w zakresie realizacji materiału wideo.', '', 'aparat-cyfrowy-sony-dsc-rx100-vii-dscrx100m7', '', '', '', 'Aparat cyfrowy Sony DSC-RX100 VII (DSCRX100M7)', '', '', '', ''),
(7, 1, 1, '&lt;div class=cms-template_title-subtitle&gt;&lt;h2&gt;Sony DSC-RX 10 IV&lt;/h2&gt;&lt;h3&gt;Aparat kompaktowy o profesjonalnych możliwościach&lt;/h3&gt;&lt;p&gt;Aparaty &lt;strong&gt;Sony RX&lt;/strong&gt; to seria zaawansowanych kompaktów klasy premium, które&lt;strong&gt; oferują profesjonalną jakość zdjęć i funkcje godne zawodowców&lt;/strong&gt;, gwarantując jednocześnie &lt;strong&gt;prostotę obsługi odpowiednią dla początkujących&lt;/strong&gt;. Wyposażone w najnowsze technologie Sony oraz optykę spod znaku Zeiss &lt;strong&gt;tworzą nową definicję aparatu kompaktowego.&lt;/strong&gt; Wyróźnić można wśród nich aparaty typu zoom o możliwosciach lustrzanek (linia RX10), konstrukcje kieszonkowe z rozbudowanymi opcjami filmowymi (linia RX100) oraz inspirowane klasyką XX w. kompakty z pełnoklatkową matrycą 35 mm (linia RX1).&lt;/div&gt;&lt;h2&gt;Przeznaczenie&lt;/h2&gt;&lt;p&gt;Sony DSC-RX10 IV to aparat kompaktowy typu &lt;strong&gt;wszystko-w-jednym, który swoimi osiągami zawstydzi niejedną lustrzankę&lt;/strong&gt;. Idealny &lt;strong&gt;dla profesjonalistów&lt;/strong&gt; (np. użytkowników systemu Sony Alfa), którzy potrzebują buckupu swojego sprzętu. Będzie również idealnym wyborem &lt;strong&gt;dla zaawansowanych entuzjastów fotografii&lt;/strong&gt;, oczekujących &lt;strong&gt;obrazu najwyższej jakości przy jednoczesnym zachowaniu prostoty obsługi&lt;/strong&gt;. Sony DSC-RX 10 IV to aparat profesjonalny i uniwersalny zarazem, gotowy do użycia bez konieczności zmienia obiektywów z całym spektrum zastosowań: od szerokich pejzaży po gigantyczne zbliżenia dzikich zwierząt i wydarzeń sportowych.&lt;h2&gt;Cechy i Korzyści&lt;/h2&gt;&lt;h3&gt;Niezrównany autofokus&lt;/h3&gt;&lt;div class=cms-template_text33x3&gt;&lt;div class=cms-text-column&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/descFiles/dfc8a68c3fd188f08303675e309c7cc21685328261.jpg&gt;&lt;/div&gt;&lt;h4&gt;Szybkość działania&lt;/h4&gt;&lt;p&gt;Zastosowanie nowego modułu autofokusa pozwoliło osiągnąć nieprawdopodobną &lt;strong&gt;prędkość ustawiania ostrości wynoszącą zaledwie 0.03 s&lt;/strong&gt;.&lt;/div&gt;&lt;div class=cms-text-column&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/descFiles/e57d8e8fdb5d9a819172d3ed38be7e641521022352.jpg&gt;&lt;/div&gt;&lt;h4&gt;Ostrzenie na dowolny punkt&lt;/h4&gt;&lt;p&gt;System automatycznego ostrzenia oparto o &lt;strong&gt;315 punktów z detekcją fazy oraz 25 punktów z detekcją kontrastu&lt;/strong&gt;. Pozwoli Ci to ustawić ostrość na obiekcie niezależnie od tego, w której części kadru się znajdzie.&lt;/div&gt;&lt;div class=cms-text-column&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/descFiles/ea6e837dc97442b7b6fd811c21a126df1770446763.png&gt;&lt;/div&gt;&lt;h4&gt;Precyzyjne śledzenie&lt;/h4&gt;&lt;p&gt;Wiele punktów oraz wysoka czułość autofokusa pozwalają na &lt;strong&gt;precyzyjne śledzenie nawet bardzo małych i szybko poruszających się obiektów&lt;/strong&gt;.&lt;/div&gt;&lt;/div&gt;&lt;h3&gt;Ergonomiczna konstrukcja&lt;/h3&gt;&lt;div class=cms-template_text33x3&gt;&lt;div class=cms-text-column&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/descFiles/5f57287448da7a45f7dace7ccda06e681273776409.jpg&gt;&lt;/div&gt;&lt;h4&gt;Limiter AF&lt;/h4&gt;&lt;p&gt;Jeśli masz pewność co do warunków w jakich przyjdzie Ci fotografować, możesz skorzystać z limitera umieszczonego na boku obiektywu. &lt;strong&gt;Pozwala on na jeszcze szybsze ustawianie ostrości.&lt;/strong&gt;&lt;/div&gt;&lt;div class=cms-text-column&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/descFiles/cdc673e0312027f28ec68f1fad29b976421569211.jpg&gt;&lt;/div&gt;&lt;h4&gt;Szybka zmiana trybu pracy&lt;/h4&gt;&lt;p&gt;Chcesz&lt;strong&gt; szybko zmienić tryb pracy autofokusa&lt;/strong&gt; z ciągłego na pojedyńczy? Nic prostszego, wystarczy, że zmienisz pozycję jednego pokrętła.&lt;/div&gt;&lt;div class=cms-text-column&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/descFiles/d3be444aaf161347b6a5f36c59e60346292394966.jpg&gt;&lt;/div&gt;&lt;h4&gt;Wygodne ustawianie ostrości&lt;/h4&gt;&lt;p&gt;Dedykowany przycisk ustawiania ostrości pozwala zrezygnować ze standardowego wciskania spustu migawki do połowy.&lt;/div&gt;&lt;/div&gt;&lt;h3&gt;Fotografuj co tylko chcesz&lt;/h3&gt;&lt;div class=cms-template_photo100&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/descFiles/adasd636085161.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;p&gt;RX10 IV wyróżnia się obiektywem o &lt;strong&gt;niezwykle szerokim zakresie ogniskowych od 24 do 600 mm&lt;/strong&gt;, co w rezultacie daje aż 25-krotny zoom optyczny. Krótkie ogniskowe doskonale nadają się do uwieczniania szerokich planów, na przykład krajobrazów lub architektury i scen ulicznych, natomiast długie świetnie spisują się w fotografii portretowej, sportowej i przyrodniczej. Ponadto duży otwór przysłony &lt;strong&gt;f/2.4-4.0&lt;/strong&gt; oraz &lt;strong&gt;zaawansowana matryca wspierana przez procesor obrazu BIONZ X&lt;/strong&gt; pozwalają na uchwycenie wielu detali w dowolnych warunkach oświetleniowych. W konstrukcji obiektywu Zeiss Vario-Sonnar nie mogło zabraknąć soczewek specjalnych (ED, Super ED i asferycznych), które pozbywaja się niedoskonałości takich jak aberracja chromatyczna praz poprawiają kolory i kontrast na fotografii.&lt;div class=cms-template_text50-text50&gt;&lt;div class=cms-text-column&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/descFiles/84f9a4ce538ab2a4ee31ed083d248e81204017383.jpg&gt;&lt;/div&gt;&lt;h4&gt;Wydajna stabilizacja&lt;/h4&gt;&lt;p&gt;Zaawansowany układ stabilizacji obrazu pozwala wydłużyć czas naświetlania aż o 4.5 stopnia przysłony &lt;strong&gt;bez rozmycia obrazu przy fotografowaniu z ręki.&lt;/strong&gt; Oznacza to wyższą jakość zdjęć wykonywanych w trudnych warunkach oświetleniowych oraz podczas korzystania z bardzo dużego zoomu.&lt;/div&gt;&lt;div class=cms-text-column&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/descFiles/2a54c5d6ef4b118de0fd65e74abb44371612244685.jpg&gt;&lt;/div&gt;&lt;h4&gt;Zoom Assist&lt;/h4&gt;&lt;p&gt;Podczas ostrzenia na długich ogniskowych zdarza się, że fotograf traci z kadru poruszający się obiekt, w takich sytuacjach funkcja Zoom Assist - domyślnie dostępna pod przyciskiem C - zmniejsza ogniskową obiektywu, zwiększając tym samym pole widzenia. Po znalezieniu obiektu wystarczy puścić przycisk, aby aparat ustawił pierwotną ogniskową.&lt;/div&gt;&lt;/div&gt;&lt;div class=cms-template_text50-photo50&gt;&lt;div class=cms-photo&gt;&lt;img style=\"float: right;\"src=//upload.cyfrowe.pl/cyfrowe/descFiles/004d5fe2a666a8afbb7cdbbecce8ff3b1488045971.jpg&gt;&lt;/div&gt;&lt;h3&gt;Szybki tryb seryjny&lt;/h3&gt;&lt;p&gt;Połączenie procesora BIONZ X o wysokiej mocy obliczeniowej z matrycą o rozdzielczości 20.1 megapikseli pozwoliło na osiągnięcie &lt;strong&gt;24 kl./s&lt;/strong&gt; przy pełnej rozdzielczości zdjęć, &lt;strong&gt;co czyni uchwycenie decydującego momentu jeszcze prostszym.&lt;/strong&gt; Maksymalna liczba zdjęć w serii to aż 249 klatek!&lt;/div&gt;&lt;h3&gt;Niesamowite filmy 4K&lt;/h3&gt;&lt;div class=cms-template_photo100&gt;&lt;div class=cms-photo&gt;&lt;img style=\"float: left;\"src=//upload.cyfrowe.pl/cyfrowe/descFiles/fd3eb773ed0d7176a8ff601dab695a581262561326.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;p&gt;&lt;strong&gt;Filmowanie w rozdzielczości 3840 x 2160&lt;/strong&gt; (4 razy większej niż Full HD) może zachęcić amatorów filmowania do sięgnięcia po produkt Sony. Materiały zarejestrowane w 4K z pewnością zrobią wrażenie na Twoich widzach. Dodatkowe akcesoria (mikrofony, lampy i monitory podglądowe) sprawią, że nagrania będą kompletne pod każdym względem, a sam proces nagrywania będzie bardzo wygodny.&lt;p&gt;Technologia filmowania polegająca na odczytywaniu informacji ze wszystkich pikseli, pozwala zebrać matrycy niemal &lt;strong&gt;2x więcej informacji&lt;/strong&gt; w porównaniu do inncych aparatów z funkcją 4K. &lt;strong&gt;Ogranicza to tzw. efekt mory i postrzępionych krawędzi. Mniej widoczny jest również efekt rolling shutter. &lt;/strong&gt;Dzięki kodekowi XAVC S filmy zapisywane są w wysokiej jakości a maksymalna prędkość zapisu wynosi 100 i 50 Mb/s. Istnieje też możliwość nagrania pliku pośredniego (proxy) o małej przepływności, który &lt;strong&gt;przyspiesza i ułatwia montaż, zwłaszcza na słabych komputerach oraz pozwala współpracować online i udostępniać filmy w sieci. &lt;/strong&gt;&lt;h3&gt;Super Slow Motion&lt;/h3&gt;&lt;p&gt;Zastosowanie szybkich podzespołów pozwoliło osiągnąć &lt;strong&gt;oszałamiającą szybkość pracy&lt;/strong&gt;, skutkującą możliwością nagrywania wideo w 960 lub 1000kl./s (NTSC/PAL) oraz czasem ekspozycji wynoszącym 1/32 000s! Taki klatkaż pozwoli Ci na pokazanie nagranej sceny 40x wolniej niż w rzeczywistości.&lt;div class=cms-template_text50-photo50&gt;&lt;div class=cms-photo&gt;&lt;img style=\"float: right;\"src=//upload.cyfrowe.pl/cyfrowe/descFiles/cabd0f9def92b64d56d08bc33fc8f3062134452060.jpg&gt;&lt;/div&gt;&lt;h3&gt;Funkcjonalny ekran LCD&lt;/h3&gt;&lt;p&gt;Wyświetlacz w Sony DSC-RX10 IV zaprojetkowano w taki sposób, aby był maksymalnie praktyczny. Wysoka rozdzielczość (1440 tys. punktów) sprawia, że wyświetlane obrazy są bardzo szczegółowe, a odchylany ekran ułatwia kadrowanie z nietypowej perpsketywy, np. nad głowami ludzi lub blisko ziemi.&lt;/div&gt;&lt;h3&gt;Zdalne sterowanie&lt;/h3&gt;&lt;p&gt;Dzięki &lt;strong&gt;aplikacji One touch remote &lt;/strong&gt;zamienisz swój smartfon lub tablet w wizjer lub pilot zdalnego sterowania. Natomiast &lt;strong&gt;One touch sharing&lt;/strong&gt; pozwoli umieścić zdjęcia i wideo na SNS (Social Network Site). Wystarczy zainstalować aplikację PlayMemories Mobile do urządzenia z NFC wyposażonego w system operacyjny Android.&lt;div class=cms-template_photo50-text50&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/descFiles/4595072abc5eac41033dbf758df02a60417595515.jpg&gt;&lt;/div&gt;&lt;h3&gt;Darmowy program do obróbki zdjęć&lt;/h3&gt;&lt;p&gt;Capture One Express od Phase One to &lt;strong&gt;jeden z najlepszych programów do obróbki zdjęć w formacie RAW&lt;/strong&gt;. Znajdziesz w nim profile przeznaczone do szeregu aparatów Sony, dokładny edytor kolorów, który ułatwia subtelne korekty kolorystyki obrazu, a także proste narzędzia do tworzenia zdjęć czarno-białych i HDR. &lt;strong&gt;Użytkownicy produktów Sony mogą pobrać program i używać go całkowicie bezpłatnie&lt;/strong&gt;.&lt;p&gt;&lt;span class=toutcopy&gt;Produkt jest też zgodny z aplikacjami Final Cut Pro X oraz iMovie.&lt;/span&gt;&lt;/div&gt;&lt;h2&gt;Nagrody i wyróżnienia&lt;/h2&gt;&lt;div class=cms-template_text75-photo25&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/descFiles/DSC-RX10M4_front1086216384.jpg&gt;&lt;/div&gt;&lt;h3&gt;Najlepszy aparat z dużym zoomem&lt;/h3&gt;&lt;p&gt;Model RX 10 mk IV to zdobywca prestiżowej nagrody TIPA (2018) dla najlepszego aparatu z dużym zoomem. Technical Image Press Association to globalna organizacja, zrzeszająca czasopisma o tematyce związanej z fotografią i obrazowaniem.&lt;/div&gt;&lt;ul&gt;&lt;li&gt;&lt;a href=https://www.sony.pl/electronics/cyber-shot-aparaty-kompaktowe/dsc-rx10m4 target=_blank&gt;Opis produktu na polskiej stronie producenta&lt;/a&gt;&lt;li&gt;&lt;a href=https://www.sony.com/electronics/cyber-shot-compact-cameras/dsc-rx10m4&gt;Opis produktu na zagranicznej stronie producenta&lt;/a&gt;&lt;li&gt;&lt;a href=https://www.sony.net/Products/di_photo-gallery/camera/DSC-RX10M4/&gt;Galeria zdjęć wykonana aparatem Sony DSC-RX10 IV&lt;/a&gt;&lt;li&gt;&lt;a href=https://helpguide.sony.net/dsc/1720/v1/pl/index.html target=_blank&gt;Przewodnik obsługi aparatu on-line&lt;/a&gt;&lt;li&gt;&lt;a href=//upload.cyfrowe.pl/cyfrowe/uploader_plikow/RX10IV.pdf target=_blank&gt;Instrukcja pdf&lt;/a&gt;&lt;/ul&gt;&lt;ul class=optional-links&gt;&lt;li&gt;&lt;a title=\"Strefa filmowa Sony \"href=https://www.cyfrowe.pl/lp/strefa-filmowa-sony.html rel=nofollow target=_blank&gt;Strefa filmowa Sony &lt;/a&gt;&lt;/ul&gt;&lt;p class=short_description itemprop=description&gt;Aparat typu megazoom wyposażony w matrycę o rozdzielczości 20.1 MP oraz wysokiej jakości obiektyw o zakresie ogniskowych 24-600 mm f/2.4-4.0. Zastosowanie szybkiego procesora BIONZ-X z pamięcią DRAM pozwoliło na osiągnięcie bardzo szybkiego trybu seryjnego 24 kl./s oraz rejestrację filmów w rozdzielczości 4K i Full HD o dużej przepływności 100 Mb/s. Idealny do nagrań typu slow motion z prędkością 960 kl/s. Urządzenie umożliwia komunikację przez Wi-Fi oraz NFC. Zdobywca prestiżowej nagrody TIPA 2018.', '', 'aparat-cyfrowy-sony-dsc-rx10-iv-dscrx10m4', '', '', '', 'Aparat cyfrowy Sony DSC-RX10 IV (DSCRX10M4)', '', '', '', ''),
(8, 1, 1, '&lt;div class=cms-template_title-subtitle&gt;&lt;h2&gt;Sony ZV-1 &lt;/h2&gt;&lt;h3&gt;Aparat kompaktowy klasy premium, polecany dla twórców wideo.&lt;/h3&gt;&lt;p&gt;Sony ZV-1 to aparat stworzony z myślą o &lt;strong&gt;vlogerach, youtuberach i innych twórcach wideo&lt;/strong&gt;, którzy pragną zapewnić swoim widzom &lt;strong&gt;wysoką jakość&lt;/strong&gt; prezentowanych materiałów. Zaprojektowany tak, aby &lt;strong&gt;ułatwiać tworzenie treści &lt;/strong&gt;(intuicyjne i proste w obsłudze menu), umożliwia pracę nawet osobom &lt;strong&gt;bez specjalnej wiedzy technicznej z zakresu filmowania. &lt;/strong&gt; Dzięki funkcji 4K HDR i narzędziom do sterowania ekspozycją Twoje filmy będą zawsze wyglądać doskonale, a Ty&lt;strong&gt; przejmiesz pełną kontrolę nad procesem tworzenia&lt;/strong&gt; odcinków vloga.&lt;/div&gt;&lt;div class=cms-template_video100&gt;&lt;div class=cms-video-wrapper&gt;&lt;div class=cms-video&gt;&lt;iframe allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\"allowfullscreen frameborder=0 scrolling=no src=https://www.youtube.com/embed/ZGzF76DvlIA&gt;&lt;/iframe&gt;&lt;/div&gt;&lt;/div&gt;&lt;p&gt;Recenzja aparatu autorstwa Cyfrowe.pl&lt;/div&gt;&lt;div class=cms-template_text33x3&gt;&lt;div class=cms-text-column&gt;&lt;h3&gt;Uchylny ekran LCD&lt;/h3&gt;&lt;p&gt;Filmowanie samego siebie jest maksymalnie wygodne! Widzisz siebie podczas występu przed kamerą bez dodatkowego monitora.&lt;/div&gt;&lt;div class=cms-text-column&gt;&lt;h3&gt;Kierunkowy mikrofon&lt;/h3&gt;&lt;p&gt;Mikrofon z trzema kapsułami i osłoną przeciwwietrzną w zestawie zapewni Ci doskonały dźwięk w każdych warunkach, zwłaszcza przy nagrywaniu vlogów.&lt;/div&gt;&lt;div class=cms-text-column&gt;&lt;h3&gt;Doskonałe \"wnętrze\"&lt;/h3&gt;&lt;p&gt;Sercem aparatu jest duża jak na kompakt matryca 1-calowa CMOS Exmor RS, która w połączeniu z obiektywem Zeiss 24-70 mm F1.8-2.8 zapewni profesjonalną jakość obrazu.&lt;/div&gt;&lt;/div&gt;&lt;h3&gt; Topowa jakość obrazu&lt;/h3&gt;&lt;ul&gt;&lt;li&gt;Obiektyw ZEISS 24-70 mm sprawdzi się podczas realizacji różnorodnych ujęć - od &lt;strong&gt;zbliżeń twarzy&lt;/strong&gt; osoby mówiącej do kamery aż po &lt;strong&gt;szersze plany&lt;/strong&gt;. &lt;li&gt;Duża matryca w połączeniu z jasną optyką zwiększy widoczność detali &lt;strong&gt; w kiepskich warunkach oświetleniowych.&lt;/strong&gt;&lt;li&gt;Umożliwi także uzyskanie &lt;strong&gt;płytkiej głębi ostrości i artystycznie rozmytego tła&lt;/strong&gt;.&lt;/ul&gt;&lt;h3 style=\"text-align: center;\"class=background-block-gray&gt;Ułatwienia dla twórców. Zostań jednoosobową ekipą filmową!&lt;/h3&gt;&lt;h3&gt;Naturalne odcienie karnacji, gładka skóra i miękko rozmyte tło&lt;/h3&gt;&lt;div class=cms-template_photo50-text50&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/products/359252f394.jpg&gt;&lt;/div&gt;&lt;p&gt;Udoskonalona technologia przetwarzania kolorów firmy Sony wiernie odwzorowuje odcienie karnacji i skóry tak, aby nadać twarzom zdrowy, naturalny wygląd. &lt;strong&gt;Dzięki temu Ty i goście występujący przed obiektywem Twojego Sony ZV-1 będą wyglądać zawsze pięknie&lt;/strong&gt;.&lt;/div&gt;&lt;ul&gt;&lt;li&gt;Aparat udostępnia tryb efektowy \"gładka skóra\".&lt;li&gt;By wyeksponować główny obiekt poprzez rozmycie tła lub uzyskać ostrość całej sceny, wystarczy nacisnąć dedykowany przycisk (C1).&lt;/ul&gt;&lt;h3&gt;Lepsze recenzje i prezentacje produktów dzięki szybkiemu i dokładnemu AF&lt;/h3&gt;&lt;div class=cms-template_video50-text50&gt;&lt;div class=cms-video-wrapper&gt;&lt;div class=cms-video&gt;&lt;iframe allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\"allowfullscreen frameborder=0 scrolling=no src=https://www.youtube.com/embed/MSkN-jME6mM&gt;&lt;/iframe&gt;&lt;/div&gt;&lt;/div&gt;&lt;p&gt;Funkcja \"prezentacja produktu\" pozwoli Ci nagrać atrakcyjny materiał vlogowy i reklamowy. &lt;strong&gt;Kiedy będziesz trzymać produkt przed obiektywem, aparat natychmiast ustawi na niego ostrość. &lt;/strong&gt;Unikniesz więc typowych problemów z systemem AF. Podobnie przy robieniu selfie, możesz w prosty i szybki sposób przełączyć ostrość z twarzy na tło i odwrotnie za pomocą tylko 1 przycisku!&lt;/div&gt;&lt;h3&gt;Sztuczna inteligencja: autofokus precyzyjnie śledzi Twoją źrenicę!&lt;/h3&gt;&lt;div class=cms-template_photo50-text50&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/products/3604656607.jpg&gt;&lt;/div&gt;&lt;p&gt;Już nigdy nie będziesz musiał się martwić o to, czy ostrość jest ustawiona w dobrym miejscu! Gdy tylko zwrócisz twarz w stronę aparatu Sony ZV-1, rozpozna on kolor, wzory (poziom jasności), odległość od obiektu (głębię) i informacje o twarzy/oku i &lt;strong&gt;przełączy się w precyzyjny tryb śledzenia ostrości&lt;/strong&gt;, zaznaczając najważniejsze elementy ramkami.&lt;/div&gt;&lt;div class=cms-template_text50-photo50&gt;&lt;ul&gt;&lt;li&gt;Ostrość szybko i dokładnie przenosi się między Tobą a produktem, bez problemów z autofokusem.&lt;li&gt;Funkcja jest przypisana do osobnego przycisku na aparacie C2, co przyspiesza jego obsługę.&lt;li&gt;Jedno przycisnięcie włączy priorytetowe ustawienie ostrości na twarz i rozszerzy pole widzenia.&lt;li&gt;Mamy aż 315 czujników z wykrywaniem fazy, skutecznych także w ruchu.&lt;li&gt;System Fast Hybrid AF posiada 65% pokrycia kadru, co daje Ci swobę w działaniu.&lt;/ul&gt;&lt;/div&gt;&lt;h3&gt;Wydajna stabilizacja obrazu &lt;/h3&gt;&lt;p&gt;W aparacie Sony ZV-1  połączono to co najlepsze! System stabilizacji SteadyShot™ jest &lt;strong&gt;hybrydą rozwiązań optycznych i elektronicznych&lt;/strong&gt;. Zamiast stawać w bezruchu, poczuj energię i koncentruj się wyłącznie na treści swojego video.&lt;div class=cms-template_text50-photo50&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/products/35933ed91d.jpg&gt;&lt;/div&gt;&lt;ul&gt;&lt;li&gt;Płynny i stabilny obraz nawet w trakcie chodzenia.&lt;li&gt;Opcjonalny uchwyt eliminuje rozmazanie i skoki obrazu.&lt;li&gt;Zaprojektowany specjalnie do zdjęć z ręki.&lt;/ul&gt;&lt;/div&gt;&lt;div class=cms-template_text50-photo50&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/products/3605935fe8.jpg&gt;&lt;/div&gt;&lt;h3&gt;Z cienia na słońce&lt;/h3&gt;&lt;p&gt;Ujęcia nakręcone pod wpływem chwili podnoszą atrakcyjność wideobloga, ale stanowią olbrzymie wyzwanie dla większości aparatów i kamer. Inteligentny algorytm przejść AE w aparacie ZV-1 umożliwia:&lt;/div&gt;&lt;ul&gt;&lt;li&gt;Szybkie korekty ekspozycji nawet przy radykalnych zmianach oświetlenia&lt;li&gt;Poprawne naświetlenie kadru, gdy wychodzisz z cienia na słońce i odwrotnie&lt;li&gt;Ustawienie priorytetu na twarz, dzięki któremu ludzie prezentują się świetnie nawet w kiepskim oświetleniu.&lt;/ul&gt;&lt;h3&gt;Na mieście i w tłumie&lt;/h3&gt;&lt;p&gt;Odgłosy miasta i ludzi nie przeszkodzą Ci w nagraniu dobrego dźwięku. &lt;strong&gt;Wbudowany mikrofon kierunkowy &lt;/strong&gt;z trzema kapsułami precyzyjnie uchwyci dźwięki dobiegające od przodu aparatu.&lt;p&gt;Ponadto, ZV-1 może być używany z uchwytem Bluetooth® Sony GP-VPT2BT (do kupienia osobno). Pozwala on &lt;strong&gt;bezprzewodowo sterować zoomem, nagrywaniem i innymi funkcjami&lt;/strong&gt;, a w razie potrzeby uwalnia ręce — zmieniając się w stabilny &lt;strong&gt;ministatyw&lt;/strong&gt;.&lt;h3&gt;Slow motion w 40-krotnie zwolnionym tempie!&lt;/h3&gt;&lt;div class=cms-template_text50-photo50&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/products/3606d94e7e.jpg&gt;&lt;/div&gt;&lt;p&gt;Dzięki funkcji nagrywania w bardzo zwolnionym tempie Twoje filmy zyskają dramatyzm i urok. Nagrywając w tempie &lt;strong&gt;do 1000 kl./s&lt;/strong&gt;, możesz uchwycić decydujący moment akcji lub w ciekawy sposób pokazać codzienną scenę. Regulowana prędkość odtwarzania pozwala spowalniać tempo w zakresie&lt;strong&gt; od 4x do 40x&lt;/strong&gt;.&lt;h3&gt;Animacje poklatkowe z wielu godzin i tysięcy klatek&lt;/h3&gt;&lt;p&gt;Aparat ZV-1 ma tryb fotografowania z interwałem, idealny do tworzenia kinowych animacji poklatkowych z użyciem programu komputerowego Imaging EdgeTM Desktop. &lt;strong&gt;Regulacja interwału nagrywania&lt;/strong&gt; (1-60 sekund) i pełne możliwości ręcznej regulacji ustawień pozwalają uzyskać fantastyczne obrazy płynących chmur lub smug świateł, tworzone nawet z &lt;strong&gt;9999 zdjęć&lt;/strong&gt;.&lt;p&gt;&lt;strong&gt;Wejście zasilania USB umożliwia podłączenie powerbanku i utrwalanie scen przez wiele godzin.&lt;/strong&gt;&lt;/div&gt;&lt;div class=cms-template_photo50-text50&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/products/3607a23ea4.jpg&gt;&lt;/div&gt;&lt;h3&gt;Wyraź siebie za pomocą twórczych efektów&lt;/h3&gt;&lt;p&gt;Ustawienia z grup \"Strefa twórcza\" i \"Efekt wizualny\" pozwalają kształtować wygląd obrazu w celu zwiększenia jego atrakcyjności i nadania mu indywidualnego charakteru.&lt;/div&gt;&lt;ul&gt;&lt;li&gt;\"Strefa twórcza\" służy do korygowania kontrastu, kolorystyki i innych parametrów.&lt;li&gt;\"Efekt wizualny\", z ustawieniami takimi jak obraz czarno-biały czy miniatura, nada obrazom nowy, niecodzienny charakter.&lt;/ul&gt;&lt;h3 style=\"text-align: center;\"class=background-block-gray&gt;Udostępniaj swoją twórczość w sieci&lt;/h3&gt;&lt;div class=cms-template_text33x3&gt;&lt;div class=cms-text-column&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/products/36115fc566.jpg&gt;&lt;/div&gt;&lt;h3 style=\"text-align: center;\"&gt;Szybkie przesyłanie filmów na smartfona&lt;/h3&gt;&lt;p&gt;Nie musisz już używać słabszej kamery w smartfonie, aby szybko publikować odcinki vloga. Darmowa aplikacja Imaging Edge Mobile dostępna jest na urządzenia z systemem iOS i Android i umożliwia udostępnianie oraz edytowaniem filmów z aparatu Sony ZV-1.&lt;/div&gt;&lt;div class=cms-text-column&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/products/3612734124.jpg&gt;&lt;/div&gt;&lt;h3 style=\"text-align: center;\"&gt;Dopasowanie do każdej platformy&lt;/h3&gt;&lt;p&gt;Po zainstalowaniu dodatku Movie Edit możesz dopasować swój film do różnych platform społecznościowych - z automatycznym kadrowaniem na obiekt. Skutecznie kompresuje on drgania, aby obraz był płynny i ustabilizowany.&lt;/div&gt;&lt;div class=cms-text-column&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/products/3613f4e5fa.jpg&gt;&lt;/div&gt;&lt;h3 style=\"text-align: center;\"&gt;Pionowe filmy&lt;/h3&gt;&lt;p&gt;Swój film udostępnisz w social mediach bez marnowania czasu na obracanie i kadrowanie go na komputerze! Sony ZV-1 dodaje specjalne metatagi do pionowych filmów, co pozwala natychmiast przesłać materiał na wybraną platformę.&lt;/div&gt;&lt;/div&gt;&lt;h3 style=\"text-align: center;\"class=background-block-gray&gt;Nagrywaj jak zawodowcy&lt;/h3&gt;&lt;div class=cms-template_photo50-text50&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/products/36088e9876.jpg&gt;&lt;/div&gt;&lt;h3&gt;Krzywe gamma S-Log&lt;/h3&gt;&lt;p&gt;Krzywe gamma S-Log2 i S-Log3 pozwalają uzyskać spójne obrazy z różnych aparatów i kamer, a ponadto zwiększają elastyczność przy korekcie kolorów w postprodukcji. Z kolei profile obrazu umożliwiają nadanie obrazowi pożądanego wyglądu.&lt;/div&gt;&lt;div class=cms-template_photo50-text50&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/products/3609d546a2.jpg&gt;&lt;/div&gt;&lt;h3&gt;Wbudowany filtr ND&lt;/h3&gt;&lt;p&gt;Filtr neutralnie szary (ND) daje większą kontrolę nad ekspozycją obrazu filmowego, a w rezultacie pozwala twórczo sterować głębią ostrości lub tworzyć magiczne ujęcia wody, świateł lub ruchu przy długim czasie otwarcia migawki. Pozwala również używać dużego otworu przysłony przy bardzo mocnym oświetleniu (np. w samo południe lub w studio)&lt;/div&gt;&lt;div class=cms-template_photo50-text50&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/products/3610611439.jpg&gt;&lt;/div&gt;&lt;h3&gt;Filmy w jakości 4K&lt;/h3&gt;&lt;p&gt;Jeśli chcesz utrwalić piękny świat — i siebie — ze wszystkimi szczegółami, nagraj film w formacie 4K (QFHD 3840 x 2160). Szybki przetwornik aparatu ZV-1 odczytuje wszystkie piksele, których jest około 70% więcej niż w obrazie 4K. Dzięki tym dodatkowym danym każda klatka filmu zdumiewa szczegółowością.&lt;/div&gt;&lt;div class=cms-template_video100&gt;&lt;div class=cms-video-wrapper&gt;&lt;div class=cms-video&gt;&lt;iframe allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\"allowfullscreen frameborder=0 scrolling=no src=https://www.youtube.com/embed/adUTt9fxlrI&gt;&lt;/iframe&gt;&lt;/div&gt;&lt;/div&gt;&lt;p&gt;Obejrzyj, żeby dowiedzieć się więcej o Sony ZV1&lt;/div&gt;&lt;ul&gt;&lt;li&gt;&lt;a href=https://blog.cyfrowe.pl/test-sony-zv-1-swietny-aparat-dla-vlogera/ target=_blank&gt;Przeczytaj recenzję aparatu na blogu Cyfrowe.pl &gt;&lt;/a&gt;&lt;/ul&gt;&lt;ul class=optional-links&gt;&lt;li&gt;&lt;a title=\"Strefa filmowa Sony \"href=https://www.cyfrowe.pl/lp/strefa-filmowa-sony.html rel=nofollow target=_blank&gt;Strefa filmowa Sony &lt;/a&gt;&lt;/ul&gt;&lt;p class=short_description itemprop=description&gt;Sony ZV-1 to aparat stworzony z myślą o vlogerach, Youtuberach i innych twórcach wideo, którzy pragną zapewnić swoim widzom wysoką jakość prezentowanych materiałów. Wyposażony w obiektyw Zeiss 24-70 mm oraz mikrofon kierunkowy z osłoną przeciwwietrzną w zestawie. Zaprojektowany tak, aby ułatwiać tworzenie treści (intuicyjne i proste w obsłudze menu), które umożliwi pracę nawet osobom bez specjalnej wiedzy technicznej z zakresu filmowania.  ', '', 'aparat-cyfrowy-sony-zv-1-zv1bdi', '', '', '', 'Aparat cyfrowy Sony ZV-1 (ZV1BDI)', '', '', '', ''),
(9, 1, 1, '&lt;div class=cms-template_title-subtitle&gt;&lt;h2&gt;Sony HX99&lt;/h2&gt;&lt;h3&gt;Niezwykle mały aparat z ogromnym zoomem i funkcją \"prawdziwego\" 4K&lt;/h3&gt;&lt;p&gt;Aparat został zaprojektowany z myślą o użytkownikach, potrzebujących małego, kompaktowego urządzenia, które będą mogli mieć zawsze przy sobie. Jednocześnie Sony HX99 oferuje potężny zakres ogniskowych 24-720 mm (ekwiwalent dla formatu małoobrazkowego). Sercem aparatu jest doskonały procesor obrazu BIONZ X z interfejsem LSI. Rozwiązanie to umożliwia fotografowanie z prędkością do 10 kl./s przy limicie bufora do 155 zdjęć. Błyskawiczny system AF reaguje w czasie 0,09 s. Ponadto aparat oferuje funkcję Eye AF, obsługę formatu RAW, praktyczny pierścień sterujący zlokalizowany przy obiektywie, wizjer elektroniczny i uchylny, dotykowy ekran LCD.&lt;/div&gt;&lt;div class=cms-template_photo100&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/descFiles/61175499606.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;h3&gt;Obiektyw ZEISS Vario-Sonnar T* 24-720 mm&lt;/h3&gt;&lt;p&gt;Ogromny zakres ogniskowych oferowanych przez aparat pozwala na wszechstronne wykorzystanie. Obiektyw umożliwia fotografowanie rozległych krajobrazów i wykonywanie niezwykłych zbliżeń. Stabilizacja obrazu Optical Steady Shot skutecznie eliminuje rozmycia powstające podczas fotografowania z dłuższymi czasami naświetlania lub w trakcie korzystania z teleobiektywu. Funkcja Zoom Assist pozwala na chwilowe poszerzenie kąta widzenia w trakcie korzystania z teleobiektywu, w celu zorientowania się, co dzieje się w otoczeniu danego obiektu.&lt;h3&gt;Potężna moc przetwarzania&lt;/h3&gt;&lt;p&gt;Sony HX99 może rejestrować materiał 4K z pełnym odczytem wszystkich pikseli matrycy bez łączenia ich w grupy. Oznacza to, że detale obrazu są pięknie renderowane, a błędy takie jak np. efekt mory i postrzępienie krawędzi są skutecznie redukowane. Możesz także wykonać film slow motion w jakości HD z prędkością 100 kl./s.&lt;p&gt;Ponieważ życie potrafi zaskakiwać niezwykłymi momentami, aparat musi reagować natychmiast. Błyskawiczny tryb AF reaguje w czasie zaledwie 0,09 s, a udoskonalony procesor obrazu BIONZ X pozwala na rejestrowanie zdjęć seryjnych z prędkością 10 kl./s (limit bufora wynosi 155 zdjęć). Sony HX99 ułatwia również wykonywanie pięknych portretów - wykorzystuje technologię Eye AF znaną z modeli α. Fotografom, którzy chcą mieć pełną kontrolę nad finalnym efektem, przyda się dostęp do formatu RAW. Dzięki temu w cyfrowej ciemni można uzyskać nieporównywalnie lepsze rezultaty niż w przypadku korzystania z plików JPEG.&lt;p&gt;Aparat oferuje maksymalną czułość ISO 6400, co pozwala na wykonywanie zdjęć przy małej ilości światła. Z Sony HX99 możesz fotografować w każdych warunkach.&lt;div class=cms-template_text50-photo50&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/descFiles/31472577332.jpg&gt;&lt;/div&gt;&lt;h3&gt;Intuicyjna i wygodna obsługa&lt;/h3&gt;&lt;p&gt;Obudowa aparatu posiada ergonomiczny układ przycisków funkcyjnych i elementów sterowania. Komfort i szybkość obsługi zwiększa pierścień sterujący zlokalizowany tuż przy obiektywie (można do niego przypisać funkcje). Dodatkowo użytkownik może skorzystać z funkcji personalizowania menu, tworząc listę 30 funkcji, które będą natychmiast przywoływane w razie potrzeby.&lt;/div&gt;&lt;p&gt;Obracany o 180 stopni, dotykowy ekran LCD pozwala na łatwe kadrowanie selfie i zdjęć grupowych. Przydaje się również podczas fotografowania z nietypowej perspektywy. Udoskonalony grip zwiększa pewność podczas trzymania aparatu i zapewnia większą stabilność w trakcie fotografowania. Funkcje dotykowe umożliwiają intuicyjne ustawianie ostrości - wystarczy jedynie wskazać palcem miejsce, w którym zdjęcie ma być ostre.&lt;div class=cms-template_photo100&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/descFiles/7410800340.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;p&gt;Aparat pozyskuje dane GPS za pośrednictwem łączności bezprzewodowej Bluetooth. Dzięki temu może gromadzić dane na temat lokalizacji. Ponadto Sony HX99 pozwala na szybkie udostępnianie multimediów w serwisach społecznościowych.&lt;ul&gt;&lt;li&gt;&lt;a href=https://helpguide.sony.net/dsc/1820/v1/pl/index.html target=_blank&gt;Przewodnik obsługi aparatu on-line&lt;/a&gt;&lt;li&gt;&lt;a href=//upload.cyfrowe.pl/cyfrowe/uploader_plikow/hx99.pdf target=_blank&gt;Instrukcja pdf&lt;/a&gt;&lt;/ul&gt;&lt;ul class=optional-links&gt;&lt;li&gt;&lt;a title=\"Strefa filmowa Sony \"href=https://www.cyfrowe.pl/lp/strefa-filmowa-sony.html rel=nofollow target=_blank&gt;Strefa filmowa Sony &lt;/a&gt;&lt;/ul&gt;&lt;p class=short_description itemprop=description&gt;Aparat został zaprojektowany z myślą o użytkownikach, potrzebujących małego, kompaktowego urządzenia, które będą mogli mieć zawsze przy sobie. Jednocześnie Sony HX99 oferuje potężny zakres ogniskowych 24-720 mm (ekwiwalent dla formatu małoobrazkowego). Sercem aparatu jest doskonały procesor obrazu BIONZ X z interfejsem LSI. Rozwiązanie to umożliwia fotografowanie z prędkością do 10 kl./s przy limicie bufora do 155 zdjęć. Błyskawiczny system AF reaguje w czasie 0,09 s. Ponadto aparat oferuje funkcję Eye AF, obsługę formatu RAW, wizjer elektroniczny i uchylny ekran LCD.', '', 'aparat-cyfrowy-sony-dsc-hx99', '', '', '', 'Aparat cyfrowy Sony DSC-HX99', '', '', '', '');
INSERT INTO `ps_product_lang` (`id_product`, `id_shop`, `id_lang`, `description`, `description_short`, `link_rewrite`, `meta_description`, `meta_keywords`, `meta_title`, `name`, `available_now`, `available_later`, `delivery_in_stock`, `delivery_out_stock`) VALUES
(10, 1, 1, '&lt;div class=cms-template_title-subtitle&gt;&lt;h2&gt;aparat oM TOUGH TG-7 czerwony&lt;/h2&gt;&lt;h3&gt;Ultra wytrzymały aparat&lt;/h3&gt;&lt;p&gt;&lt;strong&gt;OM Tough TG-7&lt;/strong&gt; to kolejna odsłona jedynej w swoim rodzaju serii wyjątkowo wytrzymałych aparatów, które są gotowe na każdą przygodę. Jeśli chcesz poczuć prawdziwą wolność fotografowania i filmowania, tak aby nic Cię nie ograniczało nawet podczas najbardziej wymagającej wyprawy, to sięgnij po ten model. Nie martw się więcej o to, czy sprzęt dotrzyma Ci kroku. Niech Twój aparat Cię nie zatrzymuje, lecz daje Ci jeszcze więcej możliwości. Nie obawiaj się, że coś mu się stanie w trakcie uprawiania swoich ulubionych sportów czy cieszenia się pełnią życia. &lt;strong&gt;OM Tough TG-7&lt;/strong&gt; to &lt;strong&gt;wodoszczelność do 15 m, odporność na upadki z wysokości 2,1 m, odporność na zgniatanie 100 Kgf, wytrzymywanie ultra ekstremalnych temperatur do -10°C czy wysoka pyłoszczelność. &lt;/strong&gt;Sięgnij po więcej. Sięgnij po OM Tough TG-7.&lt;/div&gt;&lt;div class=cms-template_video100&gt;&lt;div class=cms-video-wrapper&gt;&lt;div class=cms-video&gt;&lt;iframe allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\"allowfullscreen frameborder=0 scrolling=no src=https://www.youtube.com/embed/h17MjMNYOWA?si=og_ZaXBq_a5i5fQ_&gt;&lt;/iframe&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;div class=cms-template_photo100&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat cyfrowy Olympus TOUGH TG-7 czarny, wyjątkowo odporny\"src=//upload.cyfrowe.pl/cyfrowe/products/17933cbfcfc.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;h3&gt;Wysoka jakość zdjęć i filmów&lt;/h3&gt;&lt;p&gt;Ogromna wytrzymałość byłaby niczym, gdyby wewnątrz tej wyjątkowo &lt;strong&gt;szczelnej i odpornej obudowie&lt;/strong&gt; nie skrywały się świetne &lt;strong&gt;podzespoły&lt;/strong&gt;. Sercem tego mocarza jest &lt;strong&gt;matryca 12 MP CMOS BSI 1/2,3\'\' i procesor obrazowy TruePic TM VIII. &lt;/strong&gt;Dzięki nim stworzysz zachwycające ujęcia nawet przy trudnym oświetleniu, wciąż ciesząc się znakomitą jakością obrazu. OM TG-7 może filmować w &lt;strong&gt;rozdzielczości 4K. &lt;/strong&gt;&lt;div class=cms-template_photo100&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat cyfrowy Olympus TOUGH TG-7 czarny, wyjątkowo odporny\"src=//upload.cyfrowe.pl/cyfrowe/products/17937c08278.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;h3&gt;Uniwersalny obiektyw&lt;/h3&gt;&lt;p&gt;Ten aparat możesz zabrać ze sobą wszędzie nie tylko ze względu na jego mega wytrzymałość, ale również przez to, że oferuje uniwersalny obiektyw o szerokim zakresie ogniskowych. &lt;strong&gt;4-krotny zoom 25-100 mm&lt;/strong&gt; (odpowiednik dla formatu 35 mm) umożliwia wykonywanie zarówno szerokich ujęć, jak i zbliżeń. Przyda się doskonale do uchwycenia zdumiewających pejzaży, jak i niesamowitych portretów, pełnych emocji, które wywołują przeżywane przygody. Wchodź na szczyt, a po drodze uwieczniaj zapierające dech w piersiach widoki szerokim kątem, a gdy już dotrzesz tam, gdzie chcesz, zrób portrety wszystkim towarzyszom wędrówki. &lt;strong&gt;Światłosiła tego obiektywu wynosi f/2-4.9,&lt;/strong&gt; co umożliwia fotografowanie i filmowanie przy małej ilości światła z ręki lub łatwe operowanie głębią ostrości.&lt;div class=cms-template_photo100&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat cyfrowy Olympus TOUGH TG-7 czarny, wyjątkowo odporny\"src=//upload.cyfrowe.pl/cyfrowe/products/179362b777f.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;h3&gt;Korzystaj z możliwości różnych trybów&lt;/h3&gt;&lt;p&gt;&lt;strong&gt;Obiektyw OM TG-7&lt;/strong&gt; doskonale sprawdzi się także podczas filmowania. Od szerokich planów po zbliżenia - nagraj każdy etap wędrówki, każdy piękny widok i każdy detal. Obiektyw może działać nawet w &lt;strong&gt;trybie makro, &lt;/strong&gt;który pozwala na robienie zdumiewających fotografii i filmów zbliżeniowych. Pokaż maleńkie szczegóły i pokazuj to, czego bez Ciebie nikt by nie dostrzegł. Możesz nawet skorzystać z &lt;strong&gt;trybu telekonwertera.&lt;/strong&gt;&lt;div class=cms-template_photo100&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat cyfrowy Olympus TOUGH TG-7 czarny, wyjątkowo odporny\"src=//upload.cyfrowe.pl/cyfrowe/products/1793253c968.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;h3&gt;Stabilizacja obrazu&lt;/h3&gt;&lt;p&gt;Nawet najbardziej dynamiczna akcja będzie na wyciągnięcie ręki. Dosłownie, bo dzięki &lt;strong&gt;wbudowanej stabilizacji obrazu &lt;/strong&gt;możesz fotografować i filmować z ręki, mając pewność, że Twoje ujęcia będą ultra ostre. &lt;div class=cms-template_photo100&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat cyfrowy Olympus TOUGH TG-7 czarny, wyjątkowo odporny\"src=//upload.cyfrowe.pl/cyfrowe/products/1793124e7d2.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;h3&gt;Wyświetlacz o przekątnej 3\'\'&lt;/h3&gt;&lt;p&gt;Kadruj bezproblemowo i śledź nagrywanie ujęć na dużym, czytelnym &lt;strong&gt;wyświetlaczu o przekątnej 3\'\'. &lt;/strong&gt;Jego&lt;strong&gt; rozdzielczość wynosi 1 037 tys&lt;/strong&gt;. &lt;strong&gt;punktów&lt;/strong&gt;, umożliwiając Ci dostrzeganie szczegółów obrazów. Ten aparat to także intuicyjna nawigacja po menu i ergonomiczne rozmieszczone przyciski funkcyjne. &lt;div class=cms-template_photo100&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat cyfrowy Olympus TOUGH TG-7 czarny, wyjątkowo odporny\"src=//upload.cyfrowe.pl/cyfrowe/products/17929948ea2.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;h3&gt;Wiele czujników&lt;/h3&gt;&lt;p&gt;Zbieraj dane o swojej podróży i zapisuj je przy swoich obrazach. Dzięki temu będziesz mieć od razu pełną relację ze swoich eskapad. Aparat posiada &lt;strong&gt;GPS&lt;/strong&gt; (GLONASS, Galileo, QZSS), &lt;strong&gt;kompas, manometr, czujnik temperatury i czujnik przyspieszenia. &lt;/strong&gt;&lt;div class=\"cms-template_2photos-grid cms-grid cms-grid-2 js-flexbox\"&gt;&lt;div class=cms-box&gt;&lt;div class=box-inner&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat cyfrowy Olympus TOUGH TG-7 czerwony, wyjątkowo odporny\"src=//upload.cyfrowe.pl/cyfrowe/products/179866bf499.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;div class=cms-box&gt;&lt;div class=box-inner&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat cyfrowy Olympus TOUGH TG-7 czerwony, wyjątkowo odporny\"src=//upload.cyfrowe.pl/cyfrowe/products/1798767b3ef.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;h3&gt;Kompatybilny z wieloma różnymi akcesoriami&lt;/h3&gt;&lt;p&gt;Rozbuduj możliwości swojego&lt;strong&gt; OM TG-7&lt;/strong&gt; dzięki dostępności szerokiej gamy akcesoriów (sprzedawane oddzielnie). W sprzedaży dostępne są &lt;strong&gt;etui, paski, konwertery, filtry, lampa makro, dyfuzor lampy błyskowej, pilot zdalnego sterowania czy obudowa podwodna&lt;/strong&gt;. Osiągaj więcej z OM Tough TG-7. &lt;div class=\"cms-template_2photos-grid cms-grid cms-grid-2 js-flexbox\"&gt;&lt;div class=cms-box&gt;&lt;div class=box-inner&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat cyfrowy Olympus TOUGH TG-7 czerwony, wyjątkowo odporny\"src=//upload.cyfrowe.pl/cyfrowe/products/17988da6230.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;div class=cms-box&gt;&lt;div class=box-inner&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat cyfrowy Olympus TOUGH TG-7 czerwony, wyjątkowo odporny\"src=//upload.cyfrowe.pl/cyfrowe/products/179898ef9d0.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;div class=cms-template_photo100&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat cyfrowy Olympus TOUGH TG-7 czarny, wyjątkowo odporny\"src=//upload.cyfrowe.pl/cyfrowe/products/17928013a87.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;p class=short_description itemprop=description&gt;Kolejna odsłona niezwykle wytrzymałego aparatu, który poradzi sobie w każdej ekstremalnej sytuacji. Z OM TG-7 nie musisz martwić się o to, że aparat będzie miał jakiś wypadek - zapewnia wodoszczelność do 15 m, odporność na upadki z wysokości 2,1 m, odporność na zgniatanie 100 Kgf, wytrzymywanie ultra ekstremalnych temperatur do -10°C i wysoką pyłoszczelność. Posiada obiektyw 25-100 mm f/2-4.9, wbudowaną stabilizację obrazu, matrycę 12 MP CMOS BSI 1/2.3\'\' i nagrywa w jakości 4K.', '', 'aparat-cyfrowy-olympus-tough-tg-7-czerwony-wyjatkowo-odporny', '', '', '', 'Aparat cyfrowy Olympus TOUGH TG-7 czerwony~ wyjątkowo odporny', '', '', '', ''),
