frowy Olympus TOUGH TG-7 czarny, wyjątkowo odporny\"src=//upload.cyfrowe.pl/cyfrowe/products/179866bf499.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;div class=cms-box&gt;&lt;div class=box-inner&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat cyfrowy Olympus TOUGH TG-7 czarny, wyjątkowo odporny\"src=//upload.cyfrowe.pl/cyfrowe/products/1798767b3ef.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;h3&gt;Kompatybilny z wieloma różnymi akcesoriami&lt;/h3&gt;&lt;p&gt;Rozbuduj możliwości swojego&lt;strong&gt; OM TG-7&lt;/strong&gt; dzięki dostępności szerokiej gamy akcesoriów (sprzedawane oddzielnie). W sprzedaży dostępne są &lt;strong&gt;etui, paski, konwertery, filtry, lampa makro, dyfuzor lampy błyskowej, pilot zdalnego sterowania czy obudowa podwodna&lt;/strong&gt;. Osiągaj więcej z OM Tough TG-7. &lt;div class=\"cms-template_2photos-grid cms-grid cms-grid-2 js-flexbox\"&gt;&lt;div class=cms-box&gt;&lt;div class=box-inner&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat cyfrowy Olympus TOUGH TG-7 czarny, wyjątkowo odporny\"src=//upload.cyfrowe.pl/cyfrowe/products/179898ef9d0.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;div class=cms-box&gt;&lt;div class=box-inner&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat cyfrowy Olympus TOUGH TG-7 czarny, wyjątkowo odporny\"src=//upload.cyfrowe.pl/cyfrowe/products/17988da6230.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;div class=cms-template_photo100&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat cyfrowy Olympus TOUGH TG-7 czarny, wyjątkowo odporny\"src=//upload.cyfrowe.pl/cyfrowe/products/17928013a87.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;p class=short_description itemprop=description&gt;Kolejna odsłona niezwykle wytrzymałego aparatu, który poradzi sobie w każdej ekstremalnej sytuacji. Z OM TG-7 nie musisz martwić się o to, że aparat będzie miał jakiś wypadek - zapewnia wodoszczelność do 15 m, odporność na upadki z wysokości 2,1 m, odporność na zgniatanie 100 Kgf, wytrzymywanie ultra ekstremalnych temperatur do -10°C i wysoką pyłoszczelność. Posiada obiektyw 25-100 mm f/2-4.9, wbudowaną stabilizację obrazu, matrycę 12 MP CMOS BSI 1/2.3\'\' i nagrywa w jakości 4K.', '', 'aparat-cyfrowy-olympus-tough-tg-7-czarny-wyjatkowo-odporny', '', '', '', 'Aparat cyfrowy Olympus TOUGH TG-7 czarny~ wyjątkowo odporny', '', '', '', ''),
(12, 1, 1, '&lt;div class=cms-template_title-subtitle&gt;&lt;h2&gt;Panasonic Lumix dmc-lx15&lt;/h2&gt;&lt;h3&gt;Kompaktowy aparat o dużych możliwościach foto i video&lt;/h3&gt;&lt;/div&gt;&lt;div class=cms-template_photo100&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/descFiles/DMC-LX15EP-K-Product_Main_PictureGlobal-1_pl_pl1817156723.jpg&gt;&lt;/div&gt;&lt;p&gt;Panasonic Lumix DMC LX15&lt;/div&gt;&lt;h2&gt;Przeznaczenie&lt;/h2&gt;&lt;p&gt;&lt;strong&gt;Mieszczący się w dłoni&lt;/strong&gt; aparat kompaktowy Panasonic Lumix DMC-LX15 &lt;strong&gt;doskonale sprawdzi się w podróży&lt;/strong&gt;. Jego kieszonkowy rozmiar ułatwia przemieszczanie się i sięganie po niego za każdym razem, &lt;strong&gt;gdy chcesz utrwalić wspaniałe wspomnienia. &lt;/strong&gt;Małe wymiary nie wymusiły żadnych kompromisów w jakości technologii użytych w jego wnętrzu. Aparat zapewnia świetne wrażenia wizualne dzięki dużej, &lt;strong&gt;1-calowej matrycy.&lt;/strong&gt; Posiada obiektyw legendarnej marki &lt;strong&gt;Leica&lt;/strong&gt; i funkcję filmowania w &lt;strong&gt;4K&lt;/strong&gt;. Bardzo wygodny, obracany o 180 stopni ekran &lt;strong&gt;zachęca do robienia selfie&lt;/strong&gt; a nietypowa funkcja &lt;strong&gt;Post Focus&lt;/strong&gt; uratuje każde zdjęcie, pozwalając na ustawienie ostrości już po wykonaniu fotogrtafii.&lt;h2&gt;Cechy i korzyści&lt;/h2&gt;&lt;div class=cms-template_text67-photo33&gt;&lt;div class=cms-photo&gt;&lt;img style=\"float: right;\"src=//upload.cyfrowe.pl/cyfrowe/descFiles/11910032473.jpg&gt;&lt;/div&gt;&lt;h3&gt;Porządna i duża jak na kompakt matryca&lt;/h3&gt;&lt;p&gt;Panasonic Lumix LX15 wyposażony jest w &lt;strong&gt;1-calową matrycę&lt;/strong&gt; o rozdzielczości 20.1 megapiksela, która w połączeniu z procesorem &lt;strong&gt;Venus Engine&lt;/strong&gt; potrafi rejestrować  &lt;strong&gt;ostre, wyraźne i pełne szczegółów obrazy&lt;/strong&gt;, zarówno w formacie JPG oraz RAW. Gwarantuje &lt;strong&gt;przy tym niski poziom szumu cyfrowego &lt;/strong&gt;nawet podczas fotografowania z wykorzystaniem wysokich czułości (zakres od 80 do 25 600 ISO).&lt;p&gt;Ogromnym plusem jest też jakość odwzorowania kolorów i naturalny wygląd fotografii bez konieczności obróbki.&lt;strong&gt; Twoje zdjęcia z wakacji zachwycą od razu po zgraniu z karty. &lt;/strong&gt;Lumix  LX15 wykracza poza tradycyjne ograniczenia aparatów kompaktowych.&lt;/div&gt;&lt;div class=cms-template_photo33-text67&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/descFiles/LX10_feature_global_2-1-11400603386.jpg&gt;&lt;/div&gt;&lt;h3&gt;Doskonała optyka LEICA&lt;/h3&gt;&lt;p&gt;Aparat wyposażono w &lt;strong&gt;jasny obiektyw&lt;/strong&gt; LEICA z przysłoną o zakresie F/1.4-2.8, co jest świetnym osiągnięciem na tle innych aparatów kompaktowych.  &lt;strong&gt;Ułatwi fotografowanie skąpo oświetlonych scen&lt;/strong&gt;, np. we wnętrzach lub w pochmurny dzień. Pomoże także uzyskać atrakcyjny efekt rozmycia w tle fotografii (bokeh).&lt;p&gt;Uniwersalna ogniskowa świetnie sprawdzi się w większości codziennych sytuacji, a 3-krotny zoom optyczny umożliwi przybliżanie obrazu przy zachowaniu jak najlepszej jego jakości.&lt;h3&gt;&lt;strong&gt;5-osiowa optyczna stabilizacja obrazu &lt;/strong&gt;&lt;/h3&gt;&lt;p&gt;Wbudowany stabilizator HYBRID O.I.S.+ z 5-osiową korekcją skutecznie niweluje 5 typów poruszenia aparatu - w poziomie, w pionie, w osi obrotu, obrotu w pionie i obrotu w poziomie. Umożliwia nagrywanie wideo bez niechcianych drgań potrzas trzymania aparatu w jednej ręce.  Lumix LX15 wykrywa horyzont i zachowuje jego poziomą linię nawet w przypadku przechylenia aparatu.&lt;/div&gt;&lt;div class=cms-template_photo33-text67&gt;&lt;div class=cms-photo&gt;&lt;img style=\"float: left;\"src=//upload.cyfrowe.pl/cyfrowe/descFiles/21369712781.jpg&gt;&lt;/div&gt;&lt;h3&gt;Filmowanie w 4K&lt;/h3&gt;&lt;p&gt;Panasonic Lumix LX15 pozwala na rejestrację wideo 4K (3840 x 2160 pikseli). Tak duża rozdzielczość pozwala zobaczyć każdy szczegół a także daje duże możliwości podczas obróbki materiału.&lt;/div&gt;&lt;div class=cms-template_text67-photo33&gt;&lt;div class=cms-photo&gt;&lt;img style=\"float: right;\"src=//upload.cyfrowe.pl/cyfrowe/descFiles/3128901683.jpg&gt;&lt;/div&gt;&lt;h3&gt;Intuicyjna obsługa&lt;/h3&gt;&lt;p&gt;&lt;span style=\"color: rgb(82, 82, 82); font-size: 1.8rem;\"&gt;Aparat posiada kilka przyscisków i pokręteł umożliwiających szybki dostęp do niezbędnych funkcji. Jedno z pokręteł pozwala na wybór trybu fotografowania, drugie służy do sterowania wartością przysłony - podobnie jak w lustrzankach. Możliwe jest również sterowanie czasem naświetlania oraz ogniskową obiektywu (zoomem).&lt;/span&gt;&lt;h3&gt;Sterowanie za pomocą aplikacji&lt;/h3&gt;&lt;p&gt;Dzięki aplikacji Panasonic Image App możesz używać smartfona / tabletu jako kontrolera do powiększania, ustawiania ostrości i fotografowania z daleka.&lt;/div&gt;&lt;div class=cms-template_photo33-text67&gt;&lt;div class=cms-photo&gt;&lt;img style=\"float: left;\"src=//upload.cyfrowe.pl/cyfrowe/descFiles/4742374259.jpg&gt;&lt;/div&gt;&lt;h3&gt;Obracany ekran LCD do selfie i vlogowania&lt;/h3&gt;&lt;p&gt;Wyświetlacz LCD o przekątnej 3.0 cali i rozdzielczości 1 040 tysięcy punktów zamocowano na przegubie umożliwiającym&lt;strong&gt; obrót ekranu o 180 stopni&lt;/strong&gt;. Jest to bardzo przydatna opcja pozwalająca na wykonywanie doskonale skadrowanych zdjęć typu selfie i do vlogowania.&lt;/div&gt;&lt;div class=cms-template_text67-photo33&gt;&lt;div class=cms-photo&gt;&lt;img style=\"float: right;\"src=//upload.cyfrowe.pl/cyfrowe/descFiles/5846684369.jpg&gt;&lt;/div&gt;&lt;h3&gt;Post Focus - ustawia ostrość po zrobieniu zdjęcia&lt;/h3&gt;&lt;p&gt;&lt;strong&gt;Dzięki funkcji Post Focus uratujesz każde spontaniczne zdjęcie z wakacji i rozwiniesz skrzydła w precyzyjnej fotografii produktów.&lt;/strong&gt; Możesz wybrać punkt, na którym będzie ustawiona ostrość...  już po zrobieniu zdjęcia! Dzięki temu najważniejszy fragment zdjęcia zawsze będzie perfekcyjnie ostry.&lt;/div&gt;&lt;div class=cms-template_photo33-text67&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/descFiles/LX10_feature_global_2-4-11604569493.jpg&gt;&lt;/div&gt;&lt;h3&gt;Photo 4K - uchwyć najlepszy moment&lt;/h3&gt;&lt;p&gt;Lumix LX15 umożliwia wykonywanie zdjęć o rozdzielczości 8MPx z szybkością aż 30 kl./s&lt;strong&gt;. To niemalże jak nagrywanie filmu! &lt;/strong&gt;Nieważne czy fotografujesz drapieżne zwierzęta, sportowców czy rodzinne spotkanie,&lt;strong&gt; funkcja 4K Photo zawsze da Ci możliwośc wyboru najlepszego ujęcia.&lt;/strong&gt;&lt;/div&gt;&lt;h2&gt;Materiały dodatkowe&lt;/h2&gt;&lt;div class=\"cms-template_grid5 cms-grid cms-grid-5 js-flexbox\"&gt;&lt;div class=cms-box&gt;&lt;div class=box-inner&gt;&lt;div class=cms-photo&gt;&lt;a href=https://upload.cyfrowe.pl/cyfrowe/instrukcje/aparaty/panasonic/kompakty/DC_lx15_instrukcja.pdf target=_blank&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/descFiles/lx15559386570.jpg&gt;&lt;/a&gt;&lt;/div&gt;&lt;div class=cms-description&gt;&lt;h3&gt;&lt;a href=https://upload.cyfrowe.pl/cyfrowe/instrukcje/aparaty/panasonic/kompakty/DC_lx15_instrukcja.pdf target=_blank&gt;Instrukcja PDF&lt;/a&gt;&lt;/h3&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;div class=cms-box&gt;&lt;div class=box-inner&gt;&lt;div class=cms-photo&gt;&lt;a href=https://upload.cyfrowe.pl/cyfrowe/instrukcje/aparaty/panasonic/Tabela_kompatybilnosci.pdf target=_blank&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/descFiles/tabelka2064150669.jpg&gt;&lt;/a&gt;&lt;/div&gt;&lt;div class=cms-description&gt;&lt;h3&gt;&lt;a href=https://upload.cyfrowe.pl/cyfrowe/instrukcje/aparaty/panasonic/Tabela_kompatybilnosci.pdf target=_blank&gt;Tabela kompatybilności&lt;/a&gt;&lt;/h3&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;ul&gt;&lt;li&gt;&lt;a href=https://www.panasonic.com/pl/consumer/kamery-i-aparaty/aparaty-kompaktowe/dmc-lx15.html target=_blank&gt;Opis produktu na polskiej stronie producenta&lt;/a&gt;&lt;li&gt;&lt;a href=https://www.panasonic.com/pl/consumer/kamery-i-aparaty-uczyc-sie/kamery-i-aparaty/zalety-wideo-4k.html target=_blank&gt;Opis technologii 4K w aparatach Panasonic &lt;/a&gt;&lt;li&gt;&lt;a href=https://www.panasonic.com/pl/consumer/kamery-i-aparaty-uczyc-sie/artykuly/post_focus.html target=_blank&gt;Samouczek funkcji Post Fokus&lt;/a&gt;&lt;/ul&gt;&lt;p class=short_description itemprop=description&gt;Kieszonkowy aparat kompaktowy Panasonic LX15 oferuje zapis zdjęć w formacie RAWi JPG, nagrywanie filmów w 4K oraz funkcję post fokus. Duża, 1-calowa matryca MOS gwarantuje zapis szczegółowych i wyrazistych zdjęć, a szeroki zakres ISO 80-25 600 w połączeniu z jasnym obiektywem LEICA F1.4-2.8 umożliwia fotografowanie w skąpym oświetleniu. Wyposażony w obracany o 180 stopni 3-calowy ekran LCD i 3-krotny zoom optyczny (ogniskwa 8.8-26.4 mm) jest doskonałym wyborem na na co dzień i na wakacje, do robienia selfie oraz kręcenia vlogów. Całość została zamknięta w gustownej i wytrzymałej obudowie.', '', 'aparat-cyfrowy-panasonic-lumix-lx15-czarny', '', '', '', 'Aparat cyfrowy Panasonic LUMIX LX15 czarny', '', '', '', ''),
(13, 1, 1, '&lt;div class=cms-template_title-subtitle&gt;&lt;h2&gt;aparat cyfrowy ricoh gr iiix&lt;/h2&gt;&lt;h3&gt;Inna perspektywa, tak samo twórcze doznania&lt;/h3&gt;&lt;p&gt;Ricoh GR IIIx to kolejny członek linii zaawansowanych aparatów kompaktowych. Tym razem został wyposażony w &lt;strong&gt;obiektyw o kącie widzenia odpowiadającym ogniskowej 40 mm dla formatu małoobrazkowego. &lt;/strong&gt;Jest to więc nieco inne spojrzenie na fotografię uliczną czy reportażową niż w przypadku modelu GRIII, który posiada obiektyw 28 mm. Model oznaczony x daje niezwykle uniwersalny kąt widzenia, który pozwala być zarówno w centrum wydarzeń, jednakże ogranicza przerysowania charakterystyczne dla obiektywów szerokokątnych. Ten aparat to nie tylko świetny obiektyw, który sprawdzi się w wielu gatunkach fotografii i na codzień, ale również &lt;strong&gt;zaawansowane funkcje i rozwiązania, które pozwalają na znakomite obrazowanie. &lt;/strong&gt;&lt;/div&gt;&lt;div class=cms-template_video100&gt;&lt;div class=cms-video-wrapper&gt;&lt;div class=cms-video&gt;&lt;iframe allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\"allowfullscreen frameborder=0 scrolling=no src=https://www.youtube.com/embed/FHKrJRlGy1Q&gt;&lt;/iframe&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;p&gt; &lt;div class=cms-template_photo100&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat cyfrowy Ricoh GR IIIx\"src=//upload.cyfrowe.pl/cyfrowe/products/9521ed2c09.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;h3&gt;Obiektyw dający nową perspektywę&lt;/h3&gt;&lt;p&gt;W porównaniu do poprzednich modeli z serii GR III aparat x posiada&lt;strong&gt; nowoopracowny obiektyw, który zapewnia kąt widzenia odpowiadający ogniskowej 40 mm dla formatu 35 mm&lt;/strong&gt; (w innych modelach GR III jest to 28 mm dla formatu małoobrazkowego). Daje on perspektywę, która jest bardziej naturalna dla fotografii ulicznej. Jest to świetny kompromis pomiędzy szerszym obiektywem a uniknięciem przerysowań. Jednocześnie ten kąt widzenia zapewnia wrażenia współuczestniczenia w fotografowanych scenach. &lt;div class=cms-template_photo100&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat cyfrowy Ricoh GR IIIx\"src=//upload.cyfrowe.pl/cyfrowe/products/95203b4c81.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;p&gt;&lt;strong&gt;Zaawansowana, specjalnie opracowana konstrukcja optyczna &lt;/strong&gt;zapewnia obrazy wolne od zniekształceń czy aberracji chromatycznej. Obiektyw ten umożliwia także swobodne i wolne od flar i innych zakłóceń fotografowanie pod światło. Jest to w szczególności istotne w street photo, gdzie często trzeba pracować w nieprzewidywalnych warunkach oświetleniowych. &lt;h3&gt;Matryca CMOS APS-C o rozdzielczości 24,24 MP&lt;/h3&gt;&lt;p&gt;Ricoh GR IIIx to kompaktowy aparat, ale posiadający naprawdę dużą matrycę jak na ten segment sprzętu. Format &lt;strong&gt;APS-C &lt;/strong&gt;zapewnia niezwykle szczegółowe obrazy i niski poziom zaszumienia podczas korzystania z wysokich wartości czułości ISO.  Co więcej aparat ten wykorzystuje sensor o&lt;strong&gt; konstrukcji pozbawionej filtra natyaliasingowego &lt;/strong&gt;(AA). Matrycę wspiera opracowany podczas tworzenia tego modelu &lt;strong&gt;silnik obrazowania GR ENGINE 6.&lt;/strong&gt; Zapewnia on perfekcyjneprzetwarzanie obrazu.&lt;div class=cms-template_photo100&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat cyfrowy Ricoh GR IIIx\"src=//upload.cyfrowe.pl/cyfrowe/products/9523f83893.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;h3&gt;Hybrydowy system AF&lt;/h3&gt;&lt;p&gt;Aparat ten wykorzystuje system autofokusa, który&lt;strong&gt; łączy w sobie detekcję kontrastu i detekcję fazową. &lt;/strong&gt;Pozwala to na wykorzystanie zalet obydwu tych rozwiązań, a więc połączenie ogromnej precyzji z błyskawiczną pracą. Skorzystaj z trybów wykrywania twarzy lub oka. W przypadku fotografowania wielu osób możesz z łatwością wybrać, która konkretnie ma być centralnym punktem ostrości. &lt;div class=cms-template_photo100&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat cyfrowy Ricoh GR IIIx\"src=//upload.cyfrowe.pl/cyfrowe/products/95223bd372.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;h3&gt;Wydajny system redukcji drgań &lt;/h3&gt;&lt;p&gt;Pracuj swobodnie trzymając aparat w dłoni dzięki &lt;strong&gt;3-osiowej, 4-stopniowej redukcji wstrząsów&lt;/strong&gt;. Ricoh GR IIIx wykorzystuje oryginalny mechanizm SR (Shake Reduction) opracowany przez firmę Ricoh, skutecznie kompensując drgania powstałe w momencie wyzwalania migawki. Co więcej mechanizm oparty o 3 osie precyzyjnie ogranicza drgania wywołane przechylaniem i obracaniem aparatu ze &lt;strong&gt;skutecznością do 4 kroków ekspozycji.&lt;/strong&gt; Skorzystaj z opcji autokorekty horyzontu, aby uzyskiwać zawsze idealnie proste kadry. &lt;h3&gt;Kompaktowa i lekka konstrukcja &lt;/h3&gt;&lt;p&gt;Seria GR to &lt;strong&gt;lekkie, kompaktowe aparaty, &lt;/strong&gt;które mają być funkcjonalne w każdych warunkach. Dzięki temu możesz mieć je zawsze przy sobie i liczyć na ich&lt;strong&gt; ergonomiczne funkcje, takie jak np. krótki czas rozruchu &lt;/strong&gt;(tylko 0,8 s), &lt;strong&gt;wygodne pokrętła sterujące czy dotykowy ekran o przekątnej 3\'\' z możliwością zaawansowanego sterowania aparatem. &lt;/strong&gt;&lt;div class=cms-template_photo100&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat cyfrowy Ricoh GR IIIx\"src=//upload.cyfrowe.pl/cyfrowe/products/95248bb6de.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;h3&gt;Bezprzewodowa komunikacja&lt;/h3&gt;&lt;p&gt;Ricoh GR IIIx to wolność i podążanie za rytmem miasta. Dzięki temu możesz natychmiastowo przesyłać obrazy do urządzeń mobilnych poprzez &lt;strong&gt;Bluetooth&lt;/strong&gt;. Skorzystaj z &lt;strong&gt;aplikacji mobilnej Image Sync,&lt;/strong&gt; aby łatwo zapisywać obrazy na innych urządzeniach, wyświetlać podgląd Live View, zdalnie kontrolować aparat, sterować ekspozycją, a także bezproblemowo udostępniać zarejestrowane obrazy w mediach społecznościowych. &lt;div class=cms-template_photo100&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat cyfrowy Ricoh GR IIIx\"src=//upload.cyfrowe.pl/cyfrowe/products/951915a10f.png&gt;&lt;/div&gt;&lt;p&gt;System GR to nie tylko świetne aparaty, ale również szereg akcesoriów poszerzających ich możliwości.&lt;/div&gt;&lt;p class=short_description itemprop=description&gt;Model x z serii GR III posiada nowoopracowny obiektyw o kącie widzenia odpowiadającym ogniskowej 40 mm dla formatu małoobrazkowego. Dodatkowo oferuje matrycę APS-C z silnikiem przetwarzania obrazu GR ENGINE 6.', '', 'aparat-cyfrowy-ricoh-gr-iiix', '', '', '', 'Aparat cyfrowy Ricoh GR IIIx', '', '', '', ''),
(14, 1, 1, '&lt;div class=cms-template_title-subtitle&gt;&lt;h2&gt;fujifilm x100V&lt;/h2&gt;&lt;h3&gt;Stylowy i zaawansowany aparat kompaktowy z matrycą APS-C&lt;/h3&gt;&lt;p&gt;FujiFilm X100V to kompaktowy aparat klasy premium, który sprosta oczekiwaniom nawet bardziej wymagających użytkowników. Wykorzystuje zaawansowany, specjalnie opracowany obiektyw, doskonałe podzespoły i jednocześnie całość jest zamknięta w wyjątkowej, stylowej obudowie. Unikalny hybrydowy wizjer łączący w sobie zalety rozwiązania optycznego i elektronicznego pozwala na instynktowne łapanie każdej chwili.&lt;/div&gt;&lt;h2 style=\"text-align: center;\"class=background-block-gray&gt;Przeznaczenie&lt;/h2&gt;&lt;p&gt;Aparat FujiFilm X100V w perfekcyjny sposób łączy piękno z praktycznością. Ten zaprojektowany w stylu retro aparat jest już piatym modelem w swojej linii. Wyposażony w matrycę formatu APS-C oraz jasny obiektyw o ogniskowej 23 mm (equiv. 35 mm) &lt;strong&gt;idealnie sprawdzi się wszędzie tam, gdzie oczekujemy najwyższej jakości bez dużych gabarytów i bez zwracania na siebie uwagi. Jest więc idealnym rozwiązaniem w fotografii ulicznej, podróżniczej czy codziennym fotografowaniu. &lt;/strong&gt;&lt;h2 style=\"text-align: center;\"class=background-block-gray&gt;Cechy wyróżniające&lt;/h2&gt;&lt;h3&gt;Eleganckie wzornictwo&lt;/h3&gt;&lt;p&gt;FujiFilm X100V, podobnie jak poprzednie modele tej serii w niezwykły sposób łączą zaawansowane funkcje z piękną, klasyczną stylistyką. Zaprojektowany w oparciu o aparaty dalmierzowe model X100V wyglądem przypomina klasyczne aparaty analogowe. Również sterowanie aparatem odbywa się w sposób oparty na klasycznych pokrętłach i przyciskach - jak w dawnych konstrukcjach. Rozwiązanie takie sprawia, że możesz w pełni skupić się na fotografowanej scenie. Niewielkie, niemal kieszonkowe rozmiary sprawiają, że aparat możesz mieć przy sobie zawsze a fotografując \"życie ulicy\" nie będziesz zwracał na siebie uwagi. &lt;div class=cms-template_photo100&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/products/232999c216.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;h3&gt;Doświadczenie marki FujiFilm&lt;/h3&gt;&lt;p&gt;FujiFilm X100V to tylko jeden z wielu doskonałych aparatów marki FujiFilm. Aktualnie rozwijana seria aparatów cyfrowych FujiFilm X &lt;strong&gt;bazuje na podad 80-letnim doświadczeniu&lt;/strong&gt; firmy w produkcji zarówno aparatów jak i materiałów fotograficznych. Efektem tego doświadczenia jest nie tylko perfekcja wykonania ale też duża znajomość potrzeb rynku i &lt;strong&gt;dostosowywanie rozwiązań do oczekiwań klienta&lt;/strong&gt;. &lt;h3&gt;Aluminiowa obudowa&lt;/h3&gt;&lt;p&gt;Korpus FujiFilm X100V został &lt;strong&gt;wykonany z trwałego i jednocześnie lekkiego aluminium &lt;/strong&gt;a elementy sterujące wykończone z doskonałą precyzją.  Sprawia to, że &lt;strong&gt;obsługa aparatu jest czystą przyjemnością&lt;/strong&gt;. &lt;h3&gt;Duża matryca i szybki procesor&lt;/h3&gt;&lt;p&gt;Podobnie jak inne modele serii X, model ten został wyposażony w  czujnik X-Trans CMOS w rozmiarze APS-C co sprawia, że aparat &lt;strong&gt;pozwala na fotografowanie czy filmowanie  z zachowaniem najwyższej jakości obrazu nawet przy wysokich czułościach ISO. &lt;/strong&gt;&lt;p&gt;Rozdzielczość 26,1 MP sprawia, że &lt;strong&gt;każdy szczegół jest widoczny z niezwykłą dokładnością a gotowe obrazy mogą być bezstreso kadrowane nadal zachowując wysoką rozdzielczość.&lt;/strong&gt;  Duża matryca w połączeniu z obiektywem o jasności f/2.0 ułatwi też uzyskanie &lt;strong&gt;niewielkiej głębi ostrości.&lt;/strong&gt;  Matrycę i oprogramowanie aparatu wspiera niezwykle wydajny procesor obrazu X-Processor 4.  &lt;div class=cms-template_photo100&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/products/2567ba0a7b.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;h3&gt;Szybki, niezwykle czuły AF&lt;/h3&gt;&lt;p&gt;Zastosowany w aparacie X100V system AF bazuje na detekcji fazowej wykorzystując przy tym aż 425 punktów. Pokrywając niemal całe pole widzenia sprawia, że &lt;strong&gt;ustawianie ostrości, w tym śledzenie obiektu w trybie AP-C jest niezwykle skuteczne&lt;/strong&gt;. Na szczególną uwagę zasługuje też &lt;strong&gt;ogromna czułość czujnika sięgająca -5 EV, czyli niemal w całkowitych ciemnościach.&lt;/strong&gt; Aparat posiada ponadto funkcję wykrywania twarzy i oczu co jeszcze bardziej ułatwia poprawne i skuteczne ustawienie ostrości.&lt;div class=cms-template_photo100&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/products/25685ffb66.jpg&gt;&lt;/div&gt;&lt;p&gt;Czułość AF wynosi -5EV&lt;/div&gt;&lt;h3&gt;Niepowtarzalne tryby symulacji filmów&lt;/h3&gt;&lt;p&gt;Bazując na wieloletnim doświadczeniu w produkcji analogowych materiałów światłoczułych firma FujiFilm zastosowała w aparacie X100V &lt;strong&gt;aż 17 trybów symulacji filmów, wśród nich znajdują się takie materiały jak np.CLASSIC Neg czy ETERNA&lt;/strong&gt;. Symulacje filmów i doskonała jakość plików JPG są dla wielu użytkowników głównym elementem stanowiącym o wyborze aparatu marki FujiFilm.&lt;h3&gt;Filmowanie w jakości 4K&lt;/h3&gt;&lt;p&gt;Aparat X100V w porównaniu z poprzednimi modelami tej serii został zdecydowanie rozbudowany pod kątem filmowania. Umożliwia on nie tylko &lt;strong&gt;filmowanie w rozdzielczości 4K ale też z wykorzystaniem profili F-log.&lt;/strong&gt; Filmując aparatem można też korzystać z szerokiej palety symulacji filmów. &lt;h3&gt;Hybryfowy wizjer&lt;/h3&gt;&lt;p&gt;FujiFilm X100V wykorzystuje zaawansowany hybrydowy wizjer. Za pomocą jednego przełącznika umożliwia on przestawienie się z wizjera optycznego (dalmierzowego) na wizjer elektroniczny. Wysoka rozdzielczość wizjera elektronicznego pozwala na sprawne kadrowanie nawet w słabym oświetleniu. Podobnie jak w przypadku innych aparatów marki FujiFilm k&lt;strong&gt;orzystając z wizjera elektronicznego możemy wykorzystać funkcję symulacji ekspozycji widząc efekt końcowy (naświetlenie, balans bieli, itp) jeszcze przed wykonaniem zdjęcia. &lt;/strong&gt;&lt;h3&gt;Klasyczny sposób pracy z aparatem&lt;/h3&gt;&lt;p&gt;Konstrukcja aparatu i sposób jego obsługi nawiązują do klasycznych aparatów analogowych co sprawia niezwykłą satysfakcję z samej czynności fotografowania. Klasyczne pokrętła z czułością ISO czy czasem naświetlania pozwalają na podgląd wybranych parametrów nawet wtedy gdy aparat jest wyłączony. Rozwiązanie takie ułatwia też dyskretne fotografowanie, tak ważne w fotografii ulicznej czy reporterskiej.&lt;h3&gt;Udoskonalony obiektyw o tym samym kącie widzenia&lt;/h3&gt;&lt;p&gt;X100V został wyposażony w stałoogniskowy o&lt;strong&gt;biektyw o klasycznej ogniskowej 23 mm (odpowiednik 35 mm dla aparatów pełnoklatkowych) i dużej jasności f/2.0&lt;/strong&gt;. Ten rodzaj ogniskowej jest jednym z najczęściej wykorzystywanych przez reporterów. Duża jasność &lt;strong&gt;ułatwi fotografowanie z słabym oświetleniu.&lt;/strong&gt; Wspiera to również ogromna czułość matrycy sięgająca aż 12800 ISO. Konstrukcja obiektywu została udoskonalona względem poprzednich wersji &lt;strong&gt;poprawiając ostrość zarowno w środku jak i na brzegach kadru&lt;/strong&gt; dzięki czemu finalna jakość obrazu jest jeszcze lepsza i dostosowana do matrycy o wyższej rozdzielczości. &lt;h3&gt;Współpraca z akcesoriami dodatkowymi&lt;/h3&gt;&lt;p&gt;Aparat współpracuje z szeroką gamą akcesoriów dodatkowych, takimi jak lampy błyskowe, dedykowane pokrowce czy konwertery na obiektyw. Dla osób używających wcześniejszych wersji aparatu serii X100 dobrą wiadomością jest fakt, że &lt;strong&gt;konwertery zmieniające ogniskową są kompatybilne z poprzednimi wersjami aparatów X100.&lt;/strong&gt;&lt;h2 style=\"text-align: center;\"class=background-block-gray&gt;Materiały dodatkowe&lt;/h2&gt;&lt;ul&gt;&lt;li&gt;&lt;a href=https://fujifilm-x.com/pl-pl/products/cameras/x100v/ target=_blank&gt;Opis produktu na polskiej stronie producenta&lt;/a&gt;&lt;li&gt;&lt;a href=https://fujifilm-x.com/en-us/products/cameras/x100v/ target=_blank&gt;Opis produktu na zagranicznej stronie producenta&lt;/a&gt;&lt;li&gt;&lt;a href=https://fujifilm-x.com/global/products/cameras/x100v/gallery/&gt;Galeria zdjęć wykonanych aparatem FujiFilm X100V&lt;/a&gt;&lt;li&gt;&lt;a href=http://fujifilm-dsc.com/en-int/manual/x100v/?_ga=2.133068366.1778603309.1584356656-894579626.1584356656 target=_blank&gt;Instrukcja obsługi aparatu X100V&lt;/a&gt;&lt;/ul&gt;&lt;p&gt; &lt;p class=short_description itemprop=description&gt;FujiFilm X100V to piąta generacja kompaktowego aparat klasy premium. Wyposażony w stałoogniskowy obiektyw o dużej jasności perfekcyjnie łączy zaawansowane rozwiązania technologiczne z klasycznym wykonaniem. Metalowa, uszczelniana obudowa, matryca APS-C oraz szybki AF to tylko niektóre z funkcji sprawiające, że jest doskonałym rozwiązaniem zarówno do fotografii ulicznej, podróżniczej jak i codziennego fotografowania.', '', 'aparat-cyfrowy-fujifilm-x100v-srebrny', '', '', '', 'Aparat cyfrowy FujiFilm X100V srebrny', '', '', '', ''),
(15, 1, 1, '&lt;div class=cms-template_title-subtitle&gt;&lt;h2&gt;Canon powershot sx740 HS&lt;/h2&gt;&lt;h3&gt;Wszechstronny aparat z 40-krotnym zoomem optycznym&lt;/h3&gt;&lt;p&gt;&lt;strong&gt;Uchwyć niezapomniane chwile w domu lub w podróży dzięki uniwersalnemu aparatowi Canon PowerShot SX740 HS. &lt;/strong&gt;Doskonały &lt;strong&gt;40-krotny zoom optyczny&lt;/strong&gt; przybliży wszystkie odległe obiekty, a &lt;strong&gt;optyczna stabilizacja obrazu pomoże uzyskać ostre zdjęcia &lt;/strong&gt;podczas korzystania z teleobiektywu i przy małej ilości dostępnego światła. Uwolnij swoją kreatywność dzięki twórczym opcjom, takim jak np.&lt;strong&gt; filmy poklatkowe 4K, tryb fotografowania jedzenia&lt;/strong&gt; itp. Łącząc niesamowitą moc &lt;strong&gt;40-krotnego zoomu, filmów w jakości 4K i kompaktowych rozmiarów, &lt;/strong&gt;uzyskasz świetny aparat, który zapewni Ci zdumiewające rezultaty niezależnie gdzie przebywasz. &lt;/div&gt;&lt;div class=cms-template_text50-photo50&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/products/308e037da.jpg&gt;&lt;/div&gt;&lt;h3&gt;40-krotny zoom optyczny z optyczną stabilizacją obrazu&lt;/h3&gt;&lt;p&gt;Niezależnie od tego, czy akcje dzieje się bezpośrednio przed Tobą, czy gdzieś w oddali, &lt;strong&gt;40-krotny zoom optyczny&lt;/strong&gt; aparatu Canon PowerShot SX740 HS zapewni świetne kadry.&lt;strong&gt; Inteligentna technologia stabilizacji obrazu &lt;/strong&gt;gwarantuje wyraźne zdjęcia i filmy niezależnie od tego, jaką ogniskową używasz. Co więcej pomoże także wtedy, gdy światła jest nieco mniej, a nie chcesz lub nie możesz używać statywu. &lt;/div&gt;&lt;h3&gt;Nic Ci nie ucieknie z kadru&lt;/h3&gt;&lt;p&gt;Funkcja&lt;strong&gt; Zoom Framing Assistant &lt;/strong&gt;ułatwia śledzenie poruszających się obiektów, gdy używasz maksymalnego zbliżenia. Gdy dany obiekt ucieknie Ci z kadru, przytrzymaj przycisk Zoom Framing Assistang tak, aby automatycznie zwiększyć kąt widzenia. Gdy odnajdziesz swój motyw, zwolnij przycisk, dzięki czemu &lt;strong&gt;aparat znów skupi się tylko na nim. &lt;/strong&gt;Jednocześnie PowerShot SX740 HS będzie utrzymywał doskonałą ostrość.&lt;p&gt;W połączeniu z &lt;strong&gt;trybem zdjęć seryjnych z prędkością 7,4 kl./s&lt;/strong&gt; (do 10 kl./s z blokadą AF) uchwycisz każdy niuans dynamicznych scen. Aparat przyda się w trakcie wykonywania zdjęć podczas zawodów sportowych, podglądania przyrody czy zabaw dzieci. &lt;h3&gt;Podwójny system stabilizacji obrazu Dual Sensing IS&lt;/h3&gt;&lt;p&gt;Zaufaj &lt;strong&gt;zaawansowanej technologii stabilizacji obrazu Dual Sensing IS, &lt;/strong&gt;która zapewnia świetną redukcję drgań nawet podczas korzystania z najdłuższych ogniskowych. Przypadkowe i mimowolne ruchy dłoni nie będą już problemem. &lt;h3&gt;Bądź jeszcze bliżej z funkcją ZoomPlus&lt;/h3&gt;&lt;p&gt;Gdy zasięg 40-krotnego zoomu optycznego nie wystarczy, aparat Canon PowerShot SX740 HS umożliwia poszerzenie go o kolejne 40x aż do &lt;strong&gt;80-krotnego zoom cyfrowego.&lt;/strong&gt; Przybliżenie odbywa się bez utraty rozdzielczości. Uchwyć obiekty, które zawsze wydawały się zbyt daleko, aby sfotografować lub sfilmować je bez ruszania się z miejsca. Dzięki temu z łatwością uchwycisz wszystkie zdumiewające chwilę podczas koncertów, zawodów sportowych czy obserwowania dzikiej przyrody.&lt;h3&gt;Filmy w jakości 4K&lt;/h3&gt;&lt;p&gt;&lt;strong&gt;Nagrywaj filmy w jakości 4K z szybkością 30 kl./s, &lt;/strong&gt;uzyskując tym samym kinowe rezultaty. Nagrywanie z niemal &lt;strong&gt;4-krotnie wyższą rozdzielczością niż Full HD &lt;/strong&gt;pozwala zobaczyć każdy szczegół. Dodatkowo Canon PowerShot SX740 HS umożliwia tworzenie&lt;strong&gt; filmów poklatkowych w 4K&lt;/strong&gt; - posłuży do tego dedykowany tryb, który sprawia, że zabawa z tego typu filmami jest prosta i przyjemna. Co więcej korzystanie z 4K pozwala na uzyskiwanie wysokiej jakości fotografii z pojedynczych klatek filmu. Dzięki temu uchwycisz każdą niepowtarzalną chwilę.&lt;div class=cms-template_photo50-text50&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/products/30734f68d.jpg&gt;&lt;/div&gt;&lt;h3&gt;Bezprzewodowa łączność za pośrednictwem Bluetooth i Wi-Fi&lt;/h3&gt;&lt;p&gt;Canon PowerShot SX740 HS umożliwia &lt;strong&gt;łatwe i bezproblemowe łączenie się z urządzeniami mobilnymi czy komputerami za pośrednictwem technologii bezprzewodowych Bluetooth i Wi-Fi. &lt;/strong&gt;Pozwala to np. na &lt;strong&gt;przesyłanie z aparatu do smartfona lub tabletu multimediów, wykorzystując przy tym darmową aplikację Camera Connect. &lt;/strong&gt;Możesz także drukować bezpośrednio z aparatu za pomocą kompatybilnych drukarek Canon. &lt;p&gt; &lt;/div&gt;&lt;p&gt;&lt;strong&gt;Ergonomiczne połączenie Bluetooth ogranicza zużycie energii i pozwala na zdalne sterowanie aparatem.&lt;/strong&gt; Funkcja ta przydaje się np. podczas wykonywania zdjęć dzikiej przyrody czy robienia fotografii grupowych lub autoportretów. Łączność bezprzewodowa pozwala także na &lt;strong&gt;geotagowanie zdjęć za pośrednictwem GPS w smartfonie. &lt;/strong&gt;&lt;h3&gt;Procesor obrazu DIGIC 8&lt;/h3&gt;&lt;p&gt;Aparat Canon PowerShot SX740 HS został wyposażony w &lt;strong&gt;procesor obrazu DIGIC 8, &lt;/strong&gt;który pomaga &lt;strong&gt;poprawić wydajność systemu AF i umożliwia nagrywanie filmów w 4K UHD 30p&lt;/strong&gt;. Ponadto pozwala na wykorzystywanie wielu zaawansowanych funkcji aparatu bez żadnych opóźnień, gwarantując przy tym natychmiastowe reakcje. &lt;h3&gt;Miej kontrolę nad wszystkim&lt;/h3&gt;&lt;p&gt;Aparat został wyposażony w&lt;strong&gt; 3\'\' ekran LCD z funkcją odchylenia o 180 stopni.&lt;/strong&gt; Dzięki niemu uzyskasz dostęp do podglądu z nietypowej perspektywy. Co więcej możesz go ustawić tak, aby móc oglądać się podczas nagrywania odcinków vlogów czy realizowania autoportretów. &lt;ul&gt;&lt;li&gt;&lt;a href=https://www.usa.canon.com/internet/portal/us/home/products/details/cameras/point-and-shoot/long-zoom-cameras/powershot-sx740-hs target=_blank&gt;Opis produktu na zagranicznej stronie producenta&lt;/a&gt;&lt;li&gt;&lt;a href=https://www.canon.pl/cameras/powershot-sx740-hs/#reviews target=_blank&gt;Opis produktu na polskiej stronie producenta&lt;/a&gt;&lt;/ul&gt;&lt;p class=short_description itemprop=description&gt;Uchwyć niezapomniane chwile w domu lub w podróży dzięki uniwersalnemu aparatowi Canon PowerShot SX740 HS. Doskonały 40-krotny zoom optyczny przybliży wszystkie odległe obiekty, a optyczna stabilizacja obrazu pomoże uzyskać ostre zdjęcia podczas korzystania z teleobiektywu i przy małej ilości dostępnego światła. Uwolnij swoją kreatywność dzięki twórczym opcjom, takim jak np. filmy poklatkowe 4K, tryb fotografowania jedzenia itp. Łącząc niesamowitą moc 40-krotnego zoomu, filmów w jakości 4K i kompaktowych rozmiarów, uzyskasz świetny aparat, który zapewni Ci zdumiewające rezultaty niezależnie gdzie przebywasz. ', '', 'aparat-cyfrowy-canon-powershot-sx740-hs-srebrny', '', '', '', 'Aparat cyfrowy Canon PowerShot SX740 HS srebrny', '', '', '', '');
INSERT INTO `ps_product_lang` (`id_product`, `id_shop`, `id_lang`, `description`, `description_short`, `link_rewrite`, `meta_description`, `meta_keywords`, `meta_title`, `name`, `available_now`, `available_later`, `delivery_in_stock`, `delivery_out_stock`) VALUES
(16, 1, 1, '&lt;div class=cms-template_title-subtitle&gt;&lt;h2&gt;Canon powershot sx740 HS&lt;/h2&gt;&lt;h3&gt;Wszechstronny aparat z 40-krotnym zoomem optycznym&lt;/h3&gt;&lt;p&gt;&lt;strong&gt;Uchwyć niezapomniane chwile w domu lub w podróży dzięki uniwersalnemu aparatowi Canon PowerShot SX740 HS. &lt;/strong&gt;Doskonały &lt;strong&gt;40-krotny zoom optyczny&lt;/strong&gt; przybliży wszystkie odległe obiekty, a &lt;strong&gt;optyczna stabilizacja obrazu pomoże uzyskać ostre zdjęcia &lt;/strong&gt;podczas korzystania z teleobiektywu i przy małej ilości dostępnego światła. Uwolnij swoją kreatywność dzięki twórczym opcjom, takim jak np.&lt;strong&gt; filmy poklatkowe 4K, tryb fotografowania jedzenia&lt;/strong&gt; itp. Łącząc niesamowitą moc &lt;strong&gt;40-krotnego zoomu, filmów w jakości 4K i kompaktowych rozmiarów, &lt;/strong&gt;uzyskasz świetny aparat, który zapewni Ci zdumiewające rezultaty niezależnie gdzie przebywasz. &lt;/div&gt;&lt;div class=cms-template_text50-photo50&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/products/308e037da.jpg&gt;&lt;/div&gt;&lt;h3&gt;40-krotny zoom optyczny z optyczną stabilizacją obrazu&lt;/h3&gt;&lt;p&gt;Niezależnie od tego, czy akcje dzieje się bezpośrednio przed Tobą, czy gdzieś w oddali, &lt;strong&gt;40-krotny zoom optyczny&lt;/strong&gt; aparatu Canon PowerShot SX740 HS zapewni świetne kadry.&lt;strong&gt; Inteligentna technologia stabilizacji obrazu &lt;/strong&gt;gwarantuje wyraźne zdjęcia i filmy niezależnie od tego, jaką ogniskową używasz. Co więcej pomoże także wtedy, gdy światła jest nieco mniej, a nie chcesz lub nie możesz używać statywu. &lt;/div&gt;&lt;h3&gt;Nic Ci nie ucieknie z kadru&lt;/h3&gt;&lt;p&gt;Funkcja&lt;strong&gt; Zoom Framing Assistant &lt;/strong&gt;ułatwia śledzenie poruszających się obiektów, gdy używasz maksymalnego zbliżenia. Gdy dany obiekt ucieknie Ci z kadru, przytrzymaj przycisk Zoom Framing Assistang tak, aby automatycznie zwiększyć kąt widzenia. Gdy odnajdziesz swój motyw, zwolnij przycisk, dzięki czemu &lt;strong&gt;aparat znów skupi się tylko na nim. &lt;/strong&gt;Jednocześnie PowerShot SX740 HS będzie utrzymywał doskonałą ostrość.&lt;p&gt;W połączeniu z &lt;strong&gt;trybem zdjęć seryjnych z prędkością 7,4 kl./s&lt;/strong&gt; (do 10 kl./s z blokadą AF) uchwycisz każdy niuans dynamicznych scen. Aparat przyda się w trakcie wykonywania zdjęć podczas zawodów sportowych, podglądania przyrody czy zabaw dzieci. &lt;h3&gt;Podwójny system stabilizacji obrazu Dual Sensing IS&lt;/h3&gt;&lt;p&gt;Zaufaj &lt;strong&gt;zaawansowanej technologii stabilizacji obrazu Dual Sensing IS, &lt;/strong&gt;która zapewnia świetną redukcję drgań nawet podczas korzystania z najdłuższych ogniskowych. Przypadkowe i mimowolne ruchy dłoni nie będą już problemem. &lt;h3&gt;Bądź jeszcze bliżej z funkcją ZoomPlus&lt;/h3&gt;&lt;p&gt;Gdy zasięg 40-krotnego zoomu optycznego nie wystarczy, aparat Canon PowerShot SX740 HS umożliwia poszerzenie go o kolejne 40x aż do &lt;strong&gt;80-krotnego zoom cyfrowego.&lt;/strong&gt; Przybliżenie odbywa się bez utraty rozdzielczości. Uchwyć obiekty, które zawsze wydawały się zbyt daleko, aby sfotografować lub sfilmować je bez ruszania się z miejsca. Dzięki temu z łatwością uchwycisz wszystkie zdumiewające chwilę podczas koncertów, zawodów sportowych czy obserwowania dzikiej przyrody.&lt;h3&gt;Filmy w jakości 4K&lt;/h3&gt;&lt;p&gt;&lt;strong&gt;Nagrywaj filmy w jakości 4K z szybkością 30 kl./s, &lt;/strong&gt;uzyskując tym samym kinowe rezultaty. Nagrywanie z niemal &lt;strong&gt;4-krotnie wyższą rozdzielczością niż Full HD &lt;/strong&gt;pozwala zobaczyć każdy szczegół. Dodatkowo Canon PowerShot SX740 HS umożliwia tworzenie&lt;strong&gt; filmów poklatkowych w 4K&lt;/strong&gt; - posłuży do tego dedykowany tryb, który sprawia, że zabawa z tego typu filmami jest prosta i przyjemna. Co więcej korzystanie z 4K pozwala na uzyskiwanie wysokiej jakości fotografii z pojedynczych klatek filmu. Dzięki temu uchwycisz każdą niepowtarzalną chwilę.&lt;div class=cms-template_photo50-text50&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/products/30734f68d.jpg&gt;&lt;/div&gt;&lt;h3&gt;Bezprzewodowa łączność za pośrednictwem Bluetooth i Wi-Fi&lt;/h3&gt;&lt;p&gt;Canon PowerShot SX740 HS umożliwia &lt;strong&gt;łatwe i bezproblemowe łączenie się z urządzeniami mobilnymi czy komputerami za pośrednictwem technologii bezprzewodowych Bluetooth i Wi-Fi. &lt;/strong&gt;Pozwala to np. na &lt;strong&gt;przesyłanie z aparatu do smartfona lub tabletu multimediów, wykorzystując przy tym darmową aplikację Camera Connect. &lt;/strong&gt;Możesz także drukować bezpośrednio z aparatu za pomocą kompatybilnych drukarek Canon. &lt;p&gt; &lt;/div&gt;&lt;p&gt;&lt;strong&gt;Ergonomiczne połączenie Bluetooth ogranicza zużycie energii i pozwala na zdalne sterowanie aparatem.&lt;/strong&gt; Funkcja ta przydaje się np. podczas wykonywania zdjęć dzikiej przyrody czy robienia fotografii grupowych lub autoportretów. Łączność bezprzewodowa pozwala także na &lt;strong&gt;geotagowanie zdjęć za pośrednictwem GPS w smartfonie. &lt;/strong&gt;&lt;h3&gt;Procesor obrazu DIGIC 8&lt;/h3&gt;&lt;p&gt;Aparat Canon PowerShot SX740 HS został wyposażony w &lt;strong&gt;procesor obrazu DIGIC 8, &lt;/strong&gt;który pomaga &lt;strong&gt;poprawić wydajność systemu AF i umożliwia nagrywanie filmów w 4K UHD 30p&lt;/strong&gt;. Ponadto pozwala na wykorzystywanie wielu zaawansowanych funkcji aparatu bez żadnych opóźnień, gwarantując przy tym natychmiastowe reakcje. &lt;h3&gt;Miej kontrolę nad wszystkim&lt;/h3&gt;&lt;p&gt;Aparat został wyposażony w&lt;strong&gt; 3\'\' ekran LCD z funkcją odchylenia o 180 stopni.&lt;/strong&gt; Dzięki niemu uzyskasz dostęp do podglądu z nietypowej perspektywy. Co więcej możesz go ustawić tak, aby móc oglądać się podczas nagrywania odcinków vlogów czy realizowania autoportretów. &lt;ul&gt;&lt;li&gt;&lt;a href=https://www.usa.canon.com/internet/portal/us/home/products/details/cameras/point-and-shoot/long-zoom-cameras/powershot-sx740-hs target=_blank&gt;Opis produktu na zagranicznej stronie producenta&lt;/a&gt;&lt;li&gt;&lt;a href=https://www.canon.pl/cameras/powershot-sx740-hs/#reviews target=_blank&gt;Opis produktu na polskiej stronie producenta&lt;/a&gt;&lt;/ul&gt;&lt;p class=short_description itemprop=description&gt;Uchwyć niezapomniane chwile w domu lub w podróży dzięki uniwersalnemu aparatowi Canon PowerShot SX740 HS. Doskonały 40-krotny zoom optyczny przybliży wszystkie odległe obiekty, a optyczna stabilizacja obrazu pomoże uzyskać ostre zdjęcia podczas korzystania z teleobiektywu i przy małej ilości dostępnego światła. Uwolnij swoją kreatywność dzięki twórczym opcjom, takim jak np. filmy poklatkowe 4K, tryb fotografowania jedzenia itp. Łącząc niesamowitą moc 40-krotnego zoomu, filmów w jakości 4K i kompaktowych rozmiarów, uzyskasz świetny aparat, który zapewni Ci zdumiewające rezultaty niezależnie gdzie przebywasz. ', '', 'aparat-cyfrowy-canon-powershot-sx740-hs-czarny', '', '', '', 'Aparat cyfrowy Canon PowerShot SX740 HS czarny', '', '', '', ''),
(17, 1, 1, '&lt;div class=cms-template_title-subtitle&gt;&lt;h2&gt;fujifilm x100V&lt;/h2&gt;&lt;h3&gt;Stylowy i zaawansowany aparat kompaktowy z matrycą APS-C&lt;/h3&gt;&lt;p&gt;FujiFilm X100V to kompaktowy aparat klasy premium, który sprosta oczekiwaniom nawet bardziej wymagających użytkowników. Wykorzystuje zaawansowany, specjalnie opracowany obiektyw, doskonałe podzespoły i jednocześnie całość jest zamknięta w wyjątkowej, stylowej obudowie. Unikalny hybrydowy wizjer łączący w sobie zalety rozwiązania optycznego i elektronicznego pozwala na instynktowne łapanie każdej chwili.&lt;/div&gt;&lt;h2 style=\"text-align: center;\"class=background-block-gray&gt;Przeznaczenie&lt;/h2&gt;&lt;p&gt;Aparat FujiFilm X100V w perfekcyjny sposób łączy piękno z praktycznością. Ten zaprojektowany w stylu retro aparat jest już piatym modelem w swojej linii. Wyposażony w matrycę formatu APS-C oraz jasny obiektyw o ogniskowej 23 mm (equiv. 35 mm) &lt;strong&gt;idealnie sprawdzi się wszędzie tam, gdzie oczekujemy najwyższej jakości bez dużych gabarytów i bez zwracania na siebie uwagi. Jest więc idealnym rozwiązaniem w fotografii ulicznej, podróżniczej czy codziennym fotografowaniu. &lt;/strong&gt;&lt;h2 style=\"text-align: center;\"class=background-block-gray&gt;Cechy wyróżniające&lt;/h2&gt;&lt;h3&gt;Eleganckie wzornictwo&lt;/h3&gt;&lt;p&gt;FujiFilm X100V, podobnie jak poprzednie modele tej serii w niezwykły sposób łączą zaawansowane funkcje z piękną, klasyczną stylistyką. Zaprojektowany w oparciu o aparaty dalmierzowe model X100V wyglądem przypomina klasyczne aparaty analogowe. Również sterowanie aparatem odbywa się w sposób oparty na klasycznych pokrętłach i przyciskach - jak w dawnych konstrukcjach. Rozwiązanie takie sprawia, że możesz w pełni skupić się na fotografowanej scenie. Niewielkie, niemal kieszonkowe rozmiary sprawiają, że aparat możesz mieć przy sobie zawsze a fotografując \"życie ulicy\" nie będziesz zwracał na siebie uwagi. &lt;div class=cms-template_photo100&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/products/232999c216.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;h3&gt;Doświadczenie marki FujiFilm&lt;/h3&gt;&lt;p&gt;FujiFilm X100V to tylko jeden z wielu doskonałych aparatów marki FujiFilm. Aktualnie rozwijana seria aparatów cyfrowych FujiFilm X &lt;strong&gt;bazuje na podad 80-letnim doświadczeniu&lt;/strong&gt; firmy w produkcji zarówno aparatów jak i materiałów fotograficznych. Efektem tego doświadczenia jest nie tylko perfekcja wykonania ale też duża znajomość potrzeb rynku i &lt;strong&gt;dostosowywanie rozwiązań do oczekiwań klienta&lt;/strong&gt;. &lt;h3&gt;Aluminiowa obudowa&lt;/h3&gt;&lt;p&gt;Korpus FujiFilm X100V został &lt;strong&gt;wykonany z trwałego i jednocześnie lekkiego aluminium &lt;/strong&gt;a elementy sterujące wykończone z doskonałą precyzją.  Sprawia to, że &lt;strong&gt;obsługa aparatu jest czystą przyjemnością&lt;/strong&gt;. &lt;h3&gt;Duża matryca i szybki procesor&lt;/h3&gt;&lt;p&gt;Podobnie jak inne modele serii X, model ten został wyposażony w  czujnik X-Trans CMOS w rozmiarze APS-C co sprawia, że aparat &lt;strong&gt;pozwala na fotografowanie czy filmowanie  z zachowaniem najwyższej jakości obrazu nawet przy wysokich czułościach ISO. &lt;/strong&gt;&lt;p&gt;Rozdzielczość 26,1 MP sprawia, że &lt;strong&gt;każdy szczegół jest widoczny z niezwykłą dokładnością a gotowe obrazy mogą być bezstreso kadrowane nadal zachowując wysoką rozdzielczość.&lt;/strong&gt;  Duża matryca w połączeniu z obiektywem o jasności f/2.0 ułatwi też uzyskanie &lt;strong&gt;niewielkiej głębi ostrości.&lt;/strong&gt;  Matrycę i oprogramowanie aparatu wspiera niezwykle wydajny procesor obrazu X-Processor 4.  &lt;div class=cms-template_photo100&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/products/2567ba0a7b.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;h3&gt;Szybki, niezwykle czuły AF&lt;/h3&gt;&lt;p&gt;Zastosowany w aparacie X100V system AF bazuje na detekcji fazowej wykorzystując przy tym aż 425 punktów. Pokrywając niemal całe pole widzenia sprawia, że &lt;strong&gt;ustawianie ostrości, w tym śledzenie obiektu w trybie AP-C jest niezwykle skuteczne&lt;/strong&gt;. Na szczególną uwagę zasługuje też &lt;strong&gt;ogromna czułość czujnika sięgająca -5 EV, czyli niemal w całkowitych ciemnościach.&lt;/strong&gt; Aparat posiada ponadto funkcję wykrywania twarzy i oczu co jeszcze bardziej ułatwia poprawne i skuteczne ustawienie ostrości.&lt;div class=cms-template_photo100&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/products/25685ffb66.jpg&gt;&lt;/div&gt;&lt;p&gt;Czułość AF wynosi -5EV&lt;/div&gt;&lt;h3&gt;Niepowtarzalne tryby symulacji filmów&lt;/h3&gt;&lt;p&gt;Bazując na wieloletnim doświadczeniu w produkcji analogowych materiałów światłoczułych firma FujiFilm zastosowała w aparacie X100V &lt;strong&gt;aż 17 trybów symulacji filmów, wśród nich znajdują się takie materiały jak np.CLASSIC Neg czy ETERNA&lt;/strong&gt;. Symulacje filmów i doskonała jakość plików JPG są dla wielu użytkowników głównym elementem stanowiącym o wyborze aparatu marki FujiFilm.&lt;h3&gt;Filmowanie w jakości 4K&lt;/h3&gt;&lt;p&gt;Aparat X100V w porównaniu z poprzednimi modelami tej serii został zdecydowanie rozbudowany pod kątem filmowania. Umożliwia on nie tylko &lt;strong&gt;filmowanie w rozdzielczości 4K ale też z wykorzystaniem profili F-log.&lt;/strong&gt; Filmując aparatem można też korzystać z szerokiej palety symulacji filmów. &lt;h3&gt;Hybryfowy wizjer&lt;/h3&gt;&lt;p&gt;FujiFilm X100V wykorzystuje zaawansowany hybrydowy wizjer. Za pomocą jednego przełącznika umożliwia on przestawienie się z wizjera optycznego (dalmierzowego) na wizjer elektroniczny. Wysoka rozdzielczość wizjera elektronicznego pozwala na sprawne kadrowanie nawet w słabym oświetleniu. Podobnie jak w przypadku innych aparatów marki FujiFilm k&lt;strong&gt;orzystając z wizjera elektronicznego możemy wykorzystać funkcję symulacji ekspozycji widząc efekt końcowy (naświetlenie, balans bieli, itp) jeszcze przed wykonaniem zdjęcia. &lt;/strong&gt;&lt;h3&gt;Klasyczny sposób pracy z aparatem&lt;/h3&gt;&lt;p&gt;Konstrukcja aparatu i sposób jego obsługi nawiązują do klasycznych aparatów analogowych co sprawia niezwykłą satysfakcję z samej czynności fotografowania. Klasyczne pokrętła z czułością ISO czy czasem naświetlania pozwalają na podgląd wybranych parametrów nawet wtedy gdy aparat jest wyłączony. Rozwiązanie takie ułatwia też dyskretne fotografowanie, tak ważne w fotografii ulicznej czy reporterskiej.&lt;h3&gt;Udoskonalony obiektyw o tym samym kącie widzenia&lt;/h3&gt;&lt;p&gt;X100V został wyposażony w stałoogniskowy o&lt;strong&gt;biektyw o klasycznej ogniskowej 23 mm (odpowiednik 35 mm dla aparatów pełnoklatkowych) i dużej jasności f/2.0&lt;/strong&gt;. Ten rodzaj ogniskowej jest jednym z najczęściej wykorzystywanych przez reporterów. Duża jasność &lt;strong&gt;ułatwi fotografowanie z słabym oświetleniu.&lt;/strong&gt; Wspiera to również ogromna czułość matrycy sięgająca aż 12800 ISO. Konstrukcja obiektywu została udoskonalona względem poprzednich wersji &lt;strong&gt;poprawiając ostrość zarowno w środku jak i na brzegach kadru&lt;/strong&gt; dzięki czemu finalna jakość obrazu jest jeszcze lepsza i dostosowana do matrycy o wyższej rozdzielczości. &lt;h3&gt;Współpraca z akcesoriami dodatkowymi&lt;/h3&gt;&lt;p&gt;Aparat współpracuje z szeroką gamą akcesoriów dodatkowych, takimi jak lampy błyskowe, dedykowane pokrowce czy konwertery na obiektyw. Dla osób używających wcześniejszych wersji aparatu serii X100 dobrą wiadomością jest fakt, że &lt;strong&gt;konwertery zmieniające ogniskową są kompatybilne z poprzednimi wersjami aparatów X100.&lt;/strong&gt;&lt;h2 style=\"text-align: center;\"class=background-block-gray&gt;Materiały dodatkowe&lt;/h2&gt;&lt;ul&gt;&lt;li&gt;&lt;a href=https://fujifilm-x.com/pl-pl/products/cameras/x100v/ target=_blank&gt;Opis produktu na polskiej stronie producenta&lt;/a&gt;&lt;li&gt;&lt;a href=https://fujifilm-x.com/en-us/products/cameras/x100v/ target=_blank&gt;Opis produktu na zagranicznej stronie producenta&lt;/a&gt;&lt;li&gt;&lt;a href=https://fujifilm-x.com/global/products/cameras/x100v/gallery/&gt;Galeria zdjęć wykonanych aparatem FujiFilm X100V&lt;/a&gt;&lt;li&gt;&lt;a href=http://fujifilm-dsc.com/en-int/manual/x100v/?_ga=2.133068366.1778603309.1584356656-894579626.1584356656 target=_blank&gt;Instrukcja obsługi aparatu X100V&lt;/a&gt;&lt;/ul&gt;&lt;p&gt; &lt;p class=short_description itemprop=description&gt;FujiFilm X100V to piąta generacja kompaktowego aparat klasy premium. Wyposażony w stałoogniskowy obiektyw o dużej jasności perfekcyjnie łączy zaawansowane rozwiązania technologiczne z klasycznym wykonaniem. Metalowa, uszczelniana obudowa, matryca APS-C oraz szybki AF to tylko niektóre z funkcji sprawiające, że jest doskonałym rozwiązaniem zarówno do fotografii ulicznej, podróżniczej jak i codziennego fotografowania.', '', 'aparat-cyfrowy-fujifilm-x100v-czarny', '', '', '', 'Aparat cyfrowy FujiFilm X100V czarny', '', '', '', ''),
(18, 1, 1, '&lt;div class=cms-template_title-subtitle&gt;&lt;h2&gt;Sony DSC-RX100 III z akcesoriami&lt;/h2&gt;&lt;h3&gt;Doskonałość w kieszeni&lt;/h3&gt;&lt;p&gt;Aparaty &lt;strong&gt;Sony RX&lt;/strong&gt; to seria zaawansowanych kompaktów klasy premium, które&lt;strong&gt; oferują profesjonalną jakość zdjęć i funkcje godne zawodowców&lt;/strong&gt;, gwarantując jednocześnie &lt;strong&gt;prostotę obsługi odpowiednią dla początkujących&lt;/strong&gt;. Wyposażone w najnowsze technologie Sony oraz optykę spod znaku Zeiss &lt;strong&gt;tworzą nową definicję aparatu kompaktowego.&lt;/strong&gt; Wyróźnić można wśród nich aparaty typu zoom o możliwosciach lustrzanek (linia RX10), konstrukcje kieszonkowe z rozbudowanymi opcjami filmowymi (linia RX100) oraz inspirowane klasyką XX w. kompakty z pełnoklatkową matrycą 35 mm (linia RX1). &lt;/div&gt;&lt;h2 style=\"text-align: justify;\"&gt;Przeznaczenie&lt;/h2&gt;&lt;p&gt;Sony DSC-RX100 III to zaawansowany aparat kompaktowy dla ambitnych fotoamatorów i filmowców, którzy oczekują możliwie jak najlepszej jakości obrazu połączonej z prostą obsługą. Zaspokoi również potrzeby profesjonalistów, którzy szukają dyskretnego sprzętu do fotografowania w szczególnych sytuacjach i do dokumentowania czasu wolnego i rodzinnego. Eleganckie i gustowne akcesoria podkreślają wyjątkowość jego zawartości.&lt;h2 style=\"text-align: justify;\"&gt;Cechy i korzyści&lt;/h2&gt;&lt;div class=cms-template_photo50-text50&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/descFiles/sony-cyber-shot-rx100-iii-drop-shadow-outlineai1569938379.jpg&gt;&lt;/div&gt;&lt;h3&gt;Najlepszy aparat kompaktowy&lt;/h3&gt;&lt;p&gt;EISA (Europejskie Stowarzyszenie Obrazu i Dźwięku) to działająca od 1982r. organizacja zrzeszająca czasopisma poświęcone tamtyce multimediów, publikujące m.in. testy sprzętu foto, wideo, RTV itp. &lt;strong&gt;Coroczne nagrody przyznawane przez EISA uznawane są za najbardziej prestiżowe wyróżnienia w dziedzinie sprzętu adiowizualnego. &lt;/strong&gt;&lt;/div&gt;&lt;h3&gt;Doskonała jakość zdjęć&lt;/h3&gt;&lt;div class=cms-template_text33x3&gt;&lt;div class=cms-text-column&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/descFiles/3d90706c30ce4a0fa7078a5f4f939f3d234440712.png&gt;&lt;/div&gt;&lt;h3&gt;Matryca CMOS Exmor R 20,1 MP&lt;/h3&gt;&lt;p&gt;Wykonana w technologii BSI wychwytuje 4x więcej światła niż inne matryce, dzięki czemu rejestruje bogactwo detali i nastrój każdej sceny.&lt;/div&gt;&lt;div class=cms-text-column&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/descFiles/5229c413803c43169d54dba055deff47777637209.png&gt;&lt;/div&gt;&lt;h3&gt;Procesor Bionz X&lt;/h3&gt;&lt;p&gt;Wiernie i naturalnie odwzorowuje szczegóły i faktury, czym osiąga wiekszy realizm zdjęć i filmów, gładsze przejścia tonalne i mniejszy poziom szumu.&lt;/div&gt;&lt;div class=cms-text-column&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/descFiles/6c575bf87e7b442aa493c9d62dee9525887341408.png&gt;&lt;/div&gt;&lt;h3&gt;Obiektyw Zeiss Vario-Sonnar T&lt;/h3&gt;&lt;p&gt;O wszechstronnej ogniskowej 24-70mm i jasnym szkle F/1.8-2.8. Posiada powłokę redukującą odblaski, żeby zdjęcia były bardziej kolorowe i kontrastowe.&lt;/div&gt;&lt;/div&gt;&lt;h3&gt;Szersze ujęcia, lepsze zbliżenia&lt;/h3&gt;&lt;p&gt;Optyka spod logo Zeiss to gwarancja najlepszej jakości zdjęć. Obiektyw Zeiss Vario-Sonnar T o ogniskowej 24-70 mm pozwoli Ci fotografować zarówno szerokie scenerie jak i małe przedmioty w zbliżeniu. Jasna przysłona F/1.8-2.8 umożliwi robienie zdjęć w kiepskich warunkach oświetleniowych oraz pięknie rozmyje tło za fotografowanym obiektem (bokeh).&lt;div class=cms-template_text50-text50&gt;&lt;div class=cms-text-column&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/descFiles/7580ac085aa32865fd448c481af888ec1582773574.jpg&gt;&lt;/div&gt;&lt;h3&gt;Zalety obiektywu szerokokątnego&lt;/h3&gt;&lt;p&gt;Obiektyw pokazuje całą scenerię na jednym ujęciu. Może służyć do robienia panoram, zdjęć wysokich budynków i ciasnych ulic, w których nie można się oddalić.&lt;/div&gt;&lt;div class=cms-text-column&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/descFiles/c06a7e7b6ca7568dc645c44239708eb51145592815.jpg&gt;&lt;/div&gt;&lt;h3&gt;Zdjęcia z bliska&lt;/h3&gt;&lt;p&gt;Największe zbliżenia z ogniskową 70mm uzyskasz z odległości 30 cm. Maksymalna przysłona dla tej ogniskowej wynosi F/2.8&lt;/div&gt;&lt;/div&gt;&lt;h3&gt; Tryby AF dostosowane do sytuacji&lt;/h3&gt;&lt;p&gt;Mając aparat Sony RX 100 III nie musisz skupiać się na sprzęcie i masz więcej uwagi dla robienia zdjęć. Jest to możliwe dzięki dopasowanym do każdej sytuacji trybom autofokusu.&lt;div class=cms-template_text50-text50&gt;&lt;div class=cms-text-column&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/descFiles/fbd2f6e3442aa7723d2a37b00c1b1d12582884536.jpg&gt;&lt;/div&gt;&lt;h3&gt;Tryb śledzenia ostrości&lt;/h3&gt;&lt;p&gt;Autofokus dopasowuje wielkość ramki do rozmiarów obiektu, na którym ustawiasz ostrość.&lt;/div&gt;&lt;div class=cms-text-column&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/descFiles/e0b61741c7c0d4b5c0dff43cb4cef766982780315.jpg&gt;&lt;/div&gt;&lt;h3&gt;Łapanie ostrości na źrenicę oka&lt;/h3&gt;&lt;p&gt;Oczy to najważniejszy punkt w każdym portrecie. Aparat śledzi źrenicę i ustawia na nia ostrośćnawet, gdy model jest lekko odwrócony od aparatu.&lt;/div&gt;&lt;/div&gt;&lt;h3&gt;Personalizowane ustawienia&lt;/h3&gt;&lt;div class=cms-template_text33x3&gt;&lt;div class=cms-text-column&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/descFiles/58cd3c03475ff80e57c5aed1e8ceb077477256818.jpg&gt;&lt;/div&gt;&lt;h3&gt;Odchylany o 180&lt;span class=_Tgc&gt;°&lt;/span&gt; ekran LCD&lt;/h3&gt;&lt;p&gt;3-calowy ekran o wysokiej rozdzielczości jest idealny do robienia autoportretów oraz zdjęć z niecodziennej perspektywy, np. nad głowami ludzi lub blisko ziemi.&lt;/div&gt;&lt;div class=cms-text-column&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/descFiles/9a0d42a35b09fcf9b98ebaf34899dbf0624967536.jpg&gt;&lt;/div&gt;&lt;h3&gt;Programowalne przyciski&lt;/h3&gt;&lt;p&gt;Do pierścienia na obiektywie i przycisku na obudowie możesz przypisać swoją ulubioną funkcję i zaoszczędzić czas spędzany na przeszukiwaniu menu.&lt;/div&gt;&lt;div class=cms-text-column&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/descFiles/ed1c9dbfc43f0cb12cf2b18e2e5aa917862485787.jpg&gt;&lt;/div&gt;&lt;h3&gt;Wizjer elektroniczny&lt;/h3&gt;&lt;p&gt;Pomaga komponować obraz w ostrym słońcu, gdy zawodzi ekran LCD. Czujnik wykrywania oka automatycznie przełączy wyświetlanie między jednym a drugim.&lt;/div&gt;&lt;/div&gt;&lt;h3&gt;Zaawansowany tryb filmowy&lt;/h3&gt;&lt;p&gt;Dzięki różnym formatom zapisu i intelgentnej stabilizacji możesz nagrywać profesjonalnie wyglądające filmy pełnometrażowe albo krótkie ujęcia gotowe do publikacji w internecie.&lt;div class=cms-template_text33x3&gt;&lt;div class=cms-text-column&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/descFiles/55caa7bcfebcbd04f20d41d16b2c5d41789098388.png&gt;&lt;/div&gt;&lt;h3&gt;Odczytywanie wszystkich pikseli&lt;/h3&gt;&lt;p&gt;Niełączenie pikseli w grupy gromadzi więcej informacji niż jest to wymagane&lt;strong&gt;. Nadpróbkowanie generuje obrazy o znakomitej rozdzielczości z ograniczonym efektem mory i bez postrzępionych krawędzi. &lt;/strong&gt;&lt;/div&gt;&lt;div class=cms-text-column&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/descFiles/7bb369a4efef7d97022ac6fddf3564931947605997.png&gt;&lt;/div&gt;&lt;h3&gt;Najwyższej jakosci nagrania&lt;/h3&gt;&lt;p&gt;XAVC S to format filmowy nagrywający przy bardzo dużej przepływności 50 MB/s. Umożliwia późniejszą zaawansowaną obróbkę video.&lt;/div&gt;&lt;div class=cms-text-column&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/descFiles/2b84b3435cf30ef70866d86d4e85241e1352852183.png&gt;&lt;/div&gt;&lt;h3&gt;Nagrywanie w dwóch formatach&lt;/h3&gt;&lt;p&gt;Każdy film możesz nagrac jednocześnie w profesjonalnym formacie AVCHD lub XAVC S oraz MP4, który jest popularny w internecie.&lt;/div&gt;&lt;/div&gt;&lt;div class=cms-template_text50-photo50&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/descFiles/6afdf99d02d1c5ced0815f5171bed9f42058017368.jpg&gt;&lt;/div&gt;&lt;h3&gt;Pobieranie nowych funkcji z internetu&lt;/h3&gt;&lt;p&gt;Wchodząc na &lt;a href=https://www.playmemoriescameraapps.com/portal/ target=_blank&gt;Play Memories Camera Apps&lt;/a&gt; możesz zainstalować na swoim smartfonie i tablecie kilka aplikacji, które współpracują z aparatem za pomocą Wi-Fi. Rozszerzą jego możliwości lub pozwolą Ci pobawić się ciekawymi efektami. Dostępne są&lt;ul&gt;&lt;li&gt;\"Pilot\" do zdalnego wyzwalania migawki i zmieniania ustawień na odległość, np. zoomowania&lt;li&gt;Udostępnianie zdjęć w internecie, np. w mediach społecznościowych&lt;li&gt;Edytowanie zdjęć i filmów poprzez nakładanie filtrów i efektów&lt;/ul&gt;&lt;/div&gt;&lt;div class=cms-template_photo50-text50&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/descFiles/4595072abc5eac41033dbf758df02a60417595515.jpg&gt;&lt;/div&gt;&lt;h3&gt;Darmowy program do obróbki zdjęć&lt;/h3&gt;&lt;p&gt;Capture One Express od Phase One to &lt;strong&gt;jeden z najlepszych programów do obróbki zdjęć w formacie RAW&lt;/strong&gt;. Znajdziesz w nim profile przeznaczone do szeregu aparatów Sony, dokładny edytor kolorów, który ułatwia subtelne korekty kolorystyki obrazu, a także proste narzędzia do tworzenia zdjęć czarno-białych i HDR. &lt;strong&gt;Użytkownicy produktów Sony mogą pobrać program i używać go całkowicie bezpłatnie&lt;/strong&gt;.&lt;p&gt; &lt;/div&gt;&lt;div class=cms-template_text50-photo50&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/descFiles/8cd2a02577de18b9c0d07ce537222f291073623780.png&gt;&lt;/div&gt;&lt;h3&gt;Przechowywanie zdjęć w chmurze&lt;/h3&gt;&lt;p&gt;Żeby chronić pliki przed utratą, warto mieć ich przynajmniej jedną kopię poza swoim komputerem, np. &lt;a href=https://playmemoriesonline.com/?lang=pl-pl&amp;mf=diwebpmotop target=_blank&gt;w chmurze udostępnionej przez Sony&lt;/a&gt;. Oprócz tworzenia kopii zapasowej serwis oferuje dostęp do zdjęć przez internet za pomocą smartfona i innych urządzeń. Dzięki temu możesz je oglądać i pokazywać znajomym gdziekolwiek jesteś, bez noszenia ich przy sobie i przenoszenia na dyski i pendrive. Wszystkie Twoje wspomnienia znajdują się w jednym miejscu.&lt;/div&gt;&lt;p style=\"text-align: justify;\"class=background-block-yellow&gt;W prezentowanym zestawie znajduje się grip AG-R2, zapewniający wygodę i stabilność podczas fotografowania oraz wysokiej jakości torba LCS-RXG, wykonana z naturalnej skóry.&lt;ul&gt;&lt;li style=\"text-align: justify;\"&gt;&lt;a href=https://www.sony.pl/electronics/cyber-shot-aparaty-kompaktowe/dsc-rx100m3&gt;Opis produktu na polskiej stronie producenta&lt;/a&gt;&lt;li style=\"text-align: justify;\"&gt;&lt;a href=https://www.sony.com/electronics/cyber-shot-compact-cameras/dsc-rx100m3&gt;Opis produktu na zagranicznej stronie producenta&lt;/a&gt;&lt;li style=\"text-align: justify;\"&gt;&lt;a href=https://helpguide.sony.net/dsc/1410/v1/pl/index.html target=_blank&gt;Przewodnik obsługi aparatu on-line&lt;/a&gt;&lt;li style=\"text-align: justify;\"&gt;&lt;a href=//upload.cyfrowe.pl/cyfrowe/uploader_plikow/rx100_3.pdf target=_blank&gt;Instrukcja pdf&lt;/a&gt;&lt;/ul&gt;&lt;ul class=optional-links&gt;&lt;li&gt;&lt;a title=\"Strefa filmowa Sony \"href=https://www.cyfrowe.pl/lp/strefa-filmowa-sony.html rel=nofollow target=_blank&gt;Strefa filmowa Sony &lt;/a&gt;&lt;/ul&gt;&lt;p class=short_description itemprop=description&gt;Wyposażony w matrycę o przekątnej jednego cala model RX100 III pozwala na uzyskanie niesłychanie wysokiej jakości zdjęć. Dodatkowo obiektyw Carl Zeiss o ogniskowyej 24-70 (ekwiwalent 35mm) i jasności f/1.8-2.8 uchwyci każdą scenę niezależnie od oświetlenia. Zestaw z poręcznym gripem AG-R2 i wysokiej skórzaną torbą LCS-RXG.', '', 'aparat-cyfrowy-sony-dsc-rx100-iii-gratis-grip-ag-r2-i-torba-lcs-rxg', '', '', '', 'Aparat cyfrowy Sony DSC-RX100 III -GRATIS grip AG-R2 i torba LCS-RXG', '', '', '', ''),
(19, 1, 1, '&lt;div class=cms-template_title-subtitle&gt;&lt;h2&gt;Panasonic Lumix DMC-FZ1000 M2 &lt;/h2&gt;&lt;h3&gt;16x zoom z jasnym obiektywem&lt;/h3&gt;&lt;p&gt;Panasonic Lumix DMC-FZ1000 M2 to aparat hybrydowy, który jest świetną alternatywą dla lustrzanek. Wyposażony został w czułą, 1-calową matrycę posiadającą 20,1 megapikseli. Jasny obiektyw o zakresie przysłony F2.8-4.0 gwarantuje wysoką jakość zdjęć nawet w trudnych warunkach oświetleniowych. Z kolei 16-krotny zoom optyczny umożliwi Ci uzyskanie dużego przybliżenia przy jednoczesnym zachowaniu jakości obrazu. Wiele różnych funkcji sprawi, że w sposób komfortowy uzyskasz niesamowite zdjęcia w każdych warunkach oświetleniowych i sytuacyjnych. &lt;/div&gt;&lt;div class=cms-template_video100&gt;&lt;div class=cms-video-wrapper&gt;&lt;div class=cms-video&gt;&lt;iframe allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\"allowfullscreen frameborder=0 scrolling=no src=https://www.youtube.com/embed/Ck4NgXcL_2E&gt;&lt;/iframe&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;div class=cms-template_text50-photo50&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat cyfrowy Panasonic Lumix DMC-FZ1000 M2\"src=//upload.cyfrowe.pl/cyfrowe/products/11209753b43.jpg&gt;&lt;/div&gt;&lt;h3&gt;1-calowa matryca MOS z 20,1 megapikselami&lt;/h3&gt;&lt;p&gt;Dzięki 1-calowej matrycy MOS, którą wyróżnia wysoka czułoś,  aparat FZ1000 gwarantuje rejestrację ostrych zdjęć przy jednoczesnym minimalnym poziomie szumów nawet przy ustawieniach ISO12800. Ponadto matryca przetwarza dużą ilość światła zapewniając fantstyczny efekt nieostrości. &lt;/div&gt;&lt;div class=cms-template_text50-text50&gt;&lt;div class=cms-text-column&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat cyfrowy Panasonic Lumix DMC-FZ1000 M2\"src=//upload.cyfrowe.pl/cyfrowe/products/112240329e4.jpg&gt;&lt;/div&gt;&lt;h3&gt;Focus Peaking &lt;/h3&gt;&lt;p&gt;Focus Peaking to funkcja wizualnie uwydatniająca obszary, które w danym momencie są ostre na zdjęciu. Funkcja ta dostępna jest także podczas zdalnego fotografowania sterując, np. smartfonem za pomocą Wi-Fi. Zapomnij o martwieniu się ostrością - z Focus Peaking Twoje zdjęcia zawsze będą perfekcyjnie ostre.&lt;/div&gt;&lt;div class=cms-text-column&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat cyfrowy Panasonic Lumix DMC-FZ1000 M2\"src=//upload.cyfrowe.pl/cyfrowe/products/1122339666f.jpg&gt;&lt;/div&gt;&lt;h3&gt;Komfortowy ręczny pierścień &lt;/h3&gt;&lt;p&gt;Obiektyw FZ1000 wyposażony został w ręczny pierścień regulujący powiększenie oraz ostrość. Zaprojektowany został z myślą o użytkowniku oraz jego komforcie i wygodzie pracy. Przekonaj się sam, jakie to szybkie i proste!&lt;/div&gt;&lt;/div&gt;&lt;div class=cms-template_photo33-text67&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat cyfrowy Panasonic Lumix DMC-FZ1000 M2\"src=//upload.cyfrowe.pl/cyfrowe/products/112085cb180.jpg&gt;&lt;/div&gt;&lt;h3&gt;Obiektyw Leica DC F2.8-4.0 25-400 mm&lt;/h3&gt;&lt;p&gt;Obiektyw LEICA DC VARIO-ELMARIT wyposażony został w 5 asferycznych soczewek szklanych, które stworzone zostały dzięki wyjątkowej technologii modelowania soczewek. &lt;p&gt;LEICA DC F2.8-4.0 25-400 mm współpracując z aparatem FZ1000, który posiada 1-calową matrycę MOS gwarantują Ci zdjęcia wysokiej jakości o płytkiej głębi ostrości oraz fantastycznym efektem bokeh. &lt;/div&gt;&lt;div class=cms-template_text50-text50&gt;&lt;div class=cms-text-column&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat cyfrowy Panasonic Lumix DMC-FZ1000 M2\"src=//upload.cyfrowe.pl/cyfrowe/products/11220d74ee3.jpg&gt;&lt;/div&gt;&lt;h3&gt;Ostre zdjęcia nawet w ciemnościach!&lt;/h3&gt;&lt;p&gt;&lt;strong&gt;Lumix DMC-FZ1000 M2 &lt;/strong&gt;posiada tzw. Low Light AF, który umożliwi Ci uzyskanie doskonałej ostrości na obiekcie podczas trudnych warunków oświetleniowych.&lt;/div&gt;&lt;div class=cms-text-column&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat cyfrowy Panasonic Lumix DMC-FZ1000 M2\"src=//upload.cyfrowe.pl/cyfrowe/products/112214bedf9.jpg&gt;&lt;/div&gt;&lt;h3&gt;Pinpoint AF&lt;/h3&gt;&lt;p&gt;Funkcja Pinpoint AF umożliwia uzyskanie powiększeenia od 3x do 10x w stopniach 0,1x. Docenisz to szczególnie podczas fotorafii portretowej chcąc wyostrzyć źrenicę fotografowanej osoby. &lt;/div&gt;&lt;/div&gt;&lt;div class=cms-template_text75-photo25&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat cyfrowy Panasonic Lumix DMC-FZ1000 M2\"src=//upload.cyfrowe.pl/cyfrowe/products/11211e7e49d.jpg&gt;&lt;/div&gt;&lt;h3&gt;Podejdź bliżej&lt;/h3&gt;&lt;p&gt;Twórz przepiękne fotografie makro wykorzystując FZ1000, który pozwala rejestrować zdjęcia makro przy minimalnej odległości ogniskowania wynoszącej 3 cm. Możesz więc podejść blisko fotografowanego obiektu bez obaw o jakość i ostrość zdjęcia. &lt;/div&gt;&lt;div class=cms-template_text50-text50&gt;&lt;div class=cms-text-column&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat cyfrowy Panasonic Lumix DMC-FZ1000 M2\"src=//upload.cyfrowe.pl/cyfrowe/products/11218272b41.jpg&gt;&lt;/div&gt;&lt;h3&gt;Idealny podczas dynamicznych scen&lt;/h3&gt;&lt;p&gt;&lt;strong&gt;Lumix DMC-FZ1000 M2:&lt;/strong&gt;&lt;ul&gt;&lt;li&gt;oferuje bardzo krótki czas otwarcia migawki,&lt;li&gt;zapewnia szybkie uchwycenie dynamicznie poruszającego się obiektu,&lt;li&gt;1/4000 sekundy przy najkrótszej ogniskowej,&lt;li&gt;1/3000 sekundy przy najdłuższej ogniskowej,&lt;li&gt;umożliwia otwarcie przysłony fotografując na zewnątrz,&lt;li&gt;ponadto czas otwarcia elektronicznej migawki wynosi maks. 1/16000 sekundy i jednocześnie zmniejsza blaknięcie zdjęć przy ostrym świetle słonecznym.&lt;/ul&gt;&lt;/div&gt;&lt;div class=cms-text-column&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat cyfrowy Panasonic Lumix DMC-FZ1000 M2\"src=//upload.cyfrowe.pl/cyfrowe/products/112195f60bf.jpg&gt;&lt;/div&gt;&lt;h3&gt;Szybkie zdjęcia seryjne &lt;/h3&gt;&lt;p&gt;Twórz zdjęcia seryjne:&lt;ul&gt;&lt;li&gt;z prędkością 12 kl./s,&lt;li&gt;wykorzystując pełną rozdzielczość 20,1 megapikseli,&lt;li&gt;z szybkim uruchomieniem - około 0,7 sekundy,&lt;li&gt;oraz krótkim opóźnieniem,&lt;li&gt;z &lt;strong&gt;FZ1000 &lt;/strong&gt;nie przegapisz żadnego istotnego kadru.&lt;/ul&gt;&lt;/div&gt;&lt;/div&gt;&lt;div class=cms-template_photo50-text50&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat cyfrowy Panasonic Lumix DMC-FZ1000 M2\"src=//upload.cyfrowe.pl/cyfrowe/products/11212a5dcda.jpg&gt;&lt;/div&gt;&lt;h3&gt;Twórz materiały wysokiej jakości&lt;/h3&gt;&lt;p&gt;&lt;strong&gt;Panasonic Lumix DMC-FZ1000 M2 &lt;/strong&gt;oferuje:&lt;ul&gt;&lt;li&gt;nagrywanie szczegółowego obrazu wideo w formacie 4K (QFHD 4K: 3840x2160, 25kl./s w MP4),&lt;li&gt;nagrywanie wideo 4K przez około 30 minut,&lt;li&gt;nowy sposób tworzenia zdjęć poprzez wycinanie z materiału filmowego 4K nieruchomego obrazu o rozdzielczości 3840x2160. &lt;/ul&gt;&lt;/div&gt;&lt;div class=cms-template_text50-photo50&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat cyfrowy Panasonic Lumix DMC-FZ1000 M2\"src=//upload.cyfrowe.pl/cyfrowe/products/11213ca4552.jpg&gt;&lt;/div&gt;&lt;h3&gt;Nie tylko obraz&lt;/h3&gt;&lt;p&gt;Lumix FZ1000 nie tylko nagrywa wideo w wysokiej jakości 4K, ale także gwarantuje realistyczny dźwięk stereo. &lt;p&gt;Mikrofon stereo:&lt;ul&gt;&lt;li&gt;wyposażony został w system redukcji szumów typu zoom,&lt;li&gt;posiada funkcję Auto Wind Cut tłumiącą szumy, które tworzy wiatr,&lt;li&gt;sterefoniczność/kierunkowość mikrofonu pozwala dostosować charkterystykę rejestracji dźwięku do aktualnej sytuacji.&lt;/ul&gt;&lt;/div&gt;&lt;div class=cms-template_photo33-text67&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat cyfrowy Panasonic Lumix DMC-FZ1000 M2\"src=//upload.cyfrowe.pl/cyfrowe/products/11214b29e3b.jpg&gt;&lt;/div&gt;&lt;h3&gt;5 stopni prędkości&lt;/h3&gt;&lt;ul&gt;&lt;li&gt;Nagrywając wideo możesz skorzystać z funkcji 16-krotnego powiększenia optycznego.&lt;li&gt;FZ1000 zapewnia kontrolę nad funkcjonowaniem zoomu korzystając z pięciu prędkości powiększenia cyfrowego (od niskiej do wysokiej).&lt;li&gt;Dzięki temu będziesz mógł cieszyć się płynnym powiększaniem zachowując wysoką jakość. &lt;/ul&gt;&lt;/div&gt;&lt;div class=cms-template_text67-photo33&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat cyfrowy Panasonic Lumix DMC-FZ1000 M2\"src=//upload.cyfrowe.pl/cyfrowe/products/11215b440f6.jpg&gt;&lt;/div&gt;&lt;h3&gt;Optyczna stabilizacja obrazu &lt;/h3&gt;&lt;p&gt;Lumix FZ1000:&lt;ul&gt;&lt;li&gt;posiada wbudowany stabilizator HYBRID O.I.S. z 5-osiową korekcją,&lt;li&gt;umożliwia nagrywanie nieporuszonego wideo przy użyciu jednej ręki,&lt;li&gt;wykrywa oraz niweluje 5 typów poruszenia aparatu: w poziomie, w pionie, oś obrotu, obrót w pionie oraz obrót w poziomie,&lt;li&gt;funkcja stabilizacji obrazu wykryje poziomą płaszczyznę obrazu i utrzyma ją nawet jeśli przechylisz aparat podczas robienia zdjęcia.&lt;/ul&gt;&lt;/div&gt;&lt;div class=cms-template_text50-text50&gt;&lt;div class=cms-text-column&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat cyfrowy Panasonic Lumix DMC-FZ1000 M2\"src=//upload.cyfrowe.pl/cyfrowe/products/112165d4b0b.jpg&gt;&lt;/div&gt;&lt;h3&gt;Wideo Full HD &lt;/h3&gt;&lt;p&gt;Nagrywaj wideo z FZ1000:&lt;ul&gt;&lt;li&gt;z prędkością 100 kl./s,&lt;li&gt;w jakości Full HD,&lt;li&gt;odtwarzaj wideo w zwolnionym tempie - nawet 5 razy wolniej! &lt;/ul&gt;&lt;/div&gt;&lt;div class=cms-text-column&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat cyfrowy Panasonic Lumix DMC-FZ1000 M2\"src=//upload.cyfrowe.pl/cyfrowe/products/11217710463.jpg&gt;&lt;/div&gt;&lt;h3&gt;Stwórz poklatkowany film&lt;/h3&gt;&lt;ul&gt;&lt;li&gt;Umieść aparat w nieruchomym miejscu.&lt;li&gt;Uchwyć, np. płynące po niebie chmury.&lt;li&gt;Otrzymasz serię następujących po sobie zdjęć.&lt;li&gt;Połącz je w aparcie i stwórz swój własny poklatkowany film.&lt;/ul&gt;&lt;/div&gt;&lt;/div&gt;&lt;div class=cms-template_photo33-text67&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat cyfrowy Panasonic Lumix DMC-FZ1000 M2\"src=//upload.cyfrowe.pl/cyfrowe/products/1122294abd8.jpg&gt;&lt;/div&gt;&lt;h3&gt;System ostrości z silnikiem liniowym i technologia DFD&lt;/h3&gt;&lt;ul&gt;&lt;li&gt;Silnik liniowy FZ1000 umożliwia ustawienie ostrości aż o 300% szybciej niż w jego poprzedniku (FZ200).&lt;li&gt;Technologia DFD (Depth From Defocus) skraca czas ustawienia ostrości oraz oblicza odległość do obiektu analizując 2 zdjecia o różnych poziomach ostrości w sposób natychmiastowy - około 0,08 sekundy.&lt;/ul&gt;&lt;/div&gt;&lt;div class=cms-template_text50-text50&gt;&lt;div class=cms-text-column&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat cyfrowy Panasonic Lumix DMC-FZ1000 M2\"src=//upload.cyfrowe.pl/cyfrowe/products/11225503751.jpg&gt;&lt;/div&gt;&lt;h3&gt;Przejmij kontrolę nad światłem i cieniem &lt;/h3&gt;&lt;p&gt;Stwórz doskonałe zdjęcie już na etapie tworzenia, a poświęcisz mniej czasu podczas postprodukcji. Dostouj kontrast do swoich potrzeb korzystając z trzech zaprogramowanych wzorów lub wzorów ustawień, którymi możesz manipulować: wyższy kontrast, niższy kontrast, rozjaśnienie cienia)&lt;/div&gt;&lt;div class=cms-text-column&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat cyfrowy Panasonic Lumix DMC-FZ1000 M2\"src=//upload.cyfrowe.pl/cyfrowe/products/1122693c238.jpg&gt;&lt;/div&gt;&lt;h3&gt;Edycja zdjęć z poziomu aparatu&lt;/h3&gt;&lt;p&gt;Zapisanie zdjęcia w formacie RAW to nie wszystko! Możesz także dokonać obróbki w aparacie FZ1000 zmieniając takie ustawienia jak: Ustawienie przestrzeni kolorów (sRGB/AdobeRGB), Balans bieli, Ekspozycja, Styl zdjęcia, Inteligentna dynamiczna kontrola zakresu, Kontrast, Światło/Cień, Nasycenie, Redukcja szumów, Inteligentna rozdzielczość, Ostrość. Zmieniaj ustawienia i nadaj zdjęciu Twojego niepowtarzalnego stylu.&lt;/div&gt;&lt;/div&gt;&lt;p class=short_description itemprop=description&gt;Panasonic Lumix DMC-FZ1000 M2 to kompaktowy aparat cyfrowy. Wyposażony został w czułą, 1-calową matrycę posiadającą 20,1 megapikseli. Ponadto aparat umożliwia nagrywanie materiałów wideo w jakości 4K. Jasny obiektyw o zakresie przysłony F2.8-4.0 gwarantuje wysoką jakość zdjęć nawet w ciemnej scenerii. Z kolei 16-krotny zoom optyczny umożliwi Ci uzyskanie dużego przybliżenia przy jednoczesnym zachowaniu jakości obrazu. Obiektyw posiada ręczny pierścień regulujący zbliżenie i ostrość, co zapewnia wygodne użytkowanie.', '', 'aparat-cyfrowy-panasonic-lumix-dmc-fz1000-m2', '', '', '', 'Aparat cyfrowy Panasonic Lumix DMC-FZ1000 M2', '', '', '', '');
INSERT INTO `ps_product_lang` (`id_product`, `id_shop`, `id_lang`, `description`, `description_short`, `link_rewrite`, `meta_description`, `meta_keywords`, `meta_title`, `name`, `available_now`, `available_later`, `delivery_in_stock`, `delivery_out_stock`) VALUES
(20, 1, 1, '&lt;div class=cms-template_title-subtitle&gt;&lt;h2&gt;Panasonic Lumix FZ2000&lt;/h2&gt;&lt;h3&gt;Uniwersalny aparat kompaktowy z zoomem optycznym x20, video 4K i obracanym ekranem&lt;/h3&gt;&lt;/div&gt;&lt;div class=cms-template_photo100&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/descFiles/DMC-FZ2000EP-Product_Main_PictureGlobal-1_pl_pl1854936454.jpg&gt;&lt;/div&gt;&lt;p&gt;LUMIX FZ2000&lt;/div&gt;&lt;h3 style=\"text-align: center;\"class=background-block-gray&gt;Przeznaczenie&lt;/h3&gt;&lt;p&gt;&lt;strong&gt;Aparat kompaktowy Panasonic Lumix FZ2000 stworzono z myślą o twórczych osobach, które lubią realizować swoje pomysły za pomocą zdjęć i filmów.&lt;/strong&gt; Duża &lt;strong&gt;1-calowa matryca&lt;/strong&gt; w połączeniu z obiektywem legendarnej marki &lt;strong&gt;Leica&lt;/strong&gt; spełni wymagania średniozaawansowanych użytkowników i amatorów fotografii. &lt;strong&gt;20-krotny zoom optyczny&lt;/strong&gt; umożliwi fotografowanie odległych krajobrazów na wakacjach, dzikich zwierząt, samolotów czy imprez sportowych. Dzięki wydajnej, 5-osiowej stabilizacji możesz fotografować i filmować także w nocy. Funkcja ostrzenia z odległości 3 cm pozytywnie zaskoczy fanów &lt;strong&gt;makrofotografii i fotografii kulinarnej. &lt;/strong&gt;W porównaniu do swojego poprzednika FZ1000 jest jeszcze bardziej wydajny i zapewnia płynniejsze i szybsze działanie zoomu oraz autofokusa.&lt;div class=cms-template_photo100&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/descFiles/lumixfz20001028428350.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;h3 style=\"text-align: center;\"class=background-block-gray&gt;Jakość obrazu&lt;/h3&gt;&lt;div class=cms-template_text50-photo50&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/descFiles/FZ2000_feature_global_2-3-1_01691153763.jpg&gt;&lt;/div&gt;&lt;h3&gt;Duża, 1-calowa matryca&lt;/h3&gt;&lt;p&gt;&lt;strong&gt;Matryca MOS o rozdzielczości 20.1 megapikseli&lt;/strong&gt; wyróżnia się wysoką czułością z maksymalnym &lt;strong&gt;ISO 12800 / ISO25600. &lt;/strong&gt;Umożliwia rejestrowanie wyraźnego obrazu o &lt;strong&gt;minimalnym poziomie szumów&lt;/strong&gt; nawet w przypadku fotografowania na najwyższych czułościach.  Duża matryca to duża ilość światła do wykorzystania przez procesor, które pomaga stworzyć imponujący efekt rozmycia o małej głębi ostrości (bokeh).&lt;h3&gt;Wydajny procesor&lt;/h3&gt;&lt;p&gt;Wykorzystany silnik &lt;strong&gt;Venus Engine&lt;/strong&gt; jest wyposażony w wiele układów redukcji szumów, takich jak Multi Process NR, Random Filter i Aperture Filter, co pozwala osiągnąć &lt;strong&gt;wierną reprodukcję kolorów i naturalnie wyglądający obraz.&lt;/strong&gt;&lt;/div&gt;&lt;h3 style=\"text-align: center;\"class=background-block-gray&gt;Obiektyw i optyka&lt;/h3&gt;&lt;div class=cms-template_photo50-text50&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/descFiles/FZ2000_feature_global_2-1-1_011507857782.jpg&gt;&lt;/div&gt;&lt;h3&gt;Obiektyw foto-video z mega zoomem&lt;/h3&gt;&lt;p&gt;&lt;span style=\"color: rgb(44, 44, 44); font-family: Montserrat,\"helvetica neue&gt;Aparat wyposażono we wszechstronny obiektyw &lt;strong&gt;LEICA DC VARIO-ELMARIT z 20-krotnym zoomem optycznym&lt;/strong&gt; (odpowiednik ogniskowej 24-480 mm). Umożliwi skuteczne fotografowanie większości codziennych sytuacji. &lt;/span&gt;&lt;h3&gt;Optyka spod znaku LEICA&lt;/h3&gt;&lt;p&gt;&lt;span style=\"color: rgb(44, 44, 44); font-family: Montserrat,\"helvetica neue&gt;W konstrukcji obiektywu zastosowano 16 elementów optycznych ułożonych w 11 grupach, w tym 4 soczewki ED, 5 soczewek asferycznych i osczewki UHR. Gwarantuje to szczegółowy obraz z ostrymi krawędziami bez zniekształceń geometrycznych. Obiektyw spełnia rygorystyczne standardy firmy Leica w zakresie wartości MTF i eliminacji flar i odblasków.&lt;/span&gt;&lt;h3&gt;&lt;span style=\"color: rgb(44, 44, 44); font-family: Montserrat,\"helvetica neue&gt;Precyzyjne i płynne mechanizmy&lt;/span&gt;&lt;/h3&gt;&lt;p&gt;&lt;span style=\"color: rgb(44, 44, 44); font-family: Montserrat,\"helvetica neue&gt;Wewnętrzny system zoomu z mechanizmem prowadnicy zapewnia płynną i stabilną pracę i radykalnie ogranicza przesunięcie obrazu (o 80% w porównaniu z poprzednim modelem. FZ1000). Bezrdzeniowy silnik na prąd stały umożliwia także powolną ciągłą zmianę powiększenia od szerokiego kąta po 20x zoom. Galwanometryczna przysłona używana w profesjonalnych kamerach wideo płynnie reaguje na nagłe zmiany jasności. Zapewnia to płynną pracę przysłony nawet podczas zoomowania.&lt;/span&gt;&lt;/div&gt;&lt;h3 style=\"text-align: center;\"class=background-block-gray&gt;Stabilizacja i autofocus&lt;/h3&gt;&lt;div class=cms-template_text50-photo50&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/fck_files/stabilizacja.jpg&gt;&lt;/div&gt;&lt;h3&gt;&lt;strong&gt;Optyczna stabilizacja obrazu &lt;/strong&gt;&lt;/h3&gt;&lt;div style=line-height:115%&gt;Wbudowany stabilizator HYBRID O.I.S.+ z 5-osiową korekcją umożliwia nagrywanie wideo bez drgań przy użyciu jednej ręki. Wykrywa i skuteczne niweluje 5 typów poruszenia aparatu - w poziomie, w pionie, oś obrotu, obrót w pionie i obrót w poziomie. Funkcja stabilizacji obrazu aparatu FZ2000 wykrywa poziomą płaszczyznę obrazu i zachowuje ją, nawet w przypadku przechylenia aparatu.&lt;/div&gt;&lt;/div&gt;&lt;div class=cms-template_photo50-text50&gt;&lt;div class=cms-photo&gt;&lt;img src=\"//upload.cyfrowe.pl/cyfrowe/fck_files/stand CIPA.jpg\"&gt;&lt;/div&gt;&lt;h3&gt;Szybkość działania&lt;/h3&gt;&lt;p&gt;Dodanie nowej technologii DFD (depth from defocus) do standardowego systemu autofokusa sprawiło, że ustawianie ostrości działa jeszcze precyzyjniej i szybciej - wymaga zaledwie 0.09s! Ponadto szybki czas uruchomienia aparatu wynoszący poniżej sekundy i tryb zdjęć seryjnych 12 kl./s w pełnej rozdzielczości daje Ci możliwość złapania każdej okazji do zrobienia zdjęcia!&lt;/div&gt;&lt;h3 style=\"text-align: center;\"class=background-block-gray&gt;&lt;strong&gt;Zaawansowany tryb video&lt;/strong&gt;&lt;/h3&gt;&lt;div class=cms-template_text50-photo50&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/descFiles/FZ2000_feature_global_2-2-1_01710643046.jpg&gt;&lt;/div&gt;&lt;h3&gt;Filmowanie 4K&lt;/h3&gt;&lt;p&gt;Filmowanie to mocna strona aparatów Panasonic. FZ2000 oferuje nagrywanie niesamowicie szczegółowego obrazu wideo w kinowym formacie 4K (4096 x 2160 / 24 kl./s), QFHD 4K (3840 x 2160 / do 30 kl./s) oraz MOV/MP4. Umożliwia również nagrywanie wideo w rozdzielczości Full HD przy bardzo wysokiej przepływności 200 Mb/s (ALL-Intra) / 100 Mb/s (IPB) bez limitu długości nagrania. By wykorzystać potencjał aparatu konieczne jest posiadanie karty pamięci oznaczonej klasą szybkości UHS Speed Class 3 (U3).&lt;/div&gt;&lt;div class=cms-template_photo50-text50&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/descFiles/FZ2000_feature_global_2-5-1_012134111870.jpg&gt;&lt;/div&gt;&lt;h3&gt;Ustrzel decydujący moment&lt;/h3&gt;&lt;p&gt;Aparat FZ2000 oferuje również nowy sposób tworzenia zdjęć. Wycinając nieruchomy obraz odpowiadający rozdzielczości 8 megapikseli z materiału filmowego 4K, możesz uchwycić spontaniczne chwile, co było często niemożliwe w przypadku zwykłego wykonywania zdjęć.&lt;h3&gt;&lt;strong&gt;Slow motion 60 kl/s&lt;/strong&gt;&lt;/h3&gt;&lt;div style=line-height:115%&gt;Panasonic Lumix FZ2000 pozwoli Ci pokazać akcję w zwolnionym tempie. Możesz nagrywać filmy z prędkością aż 60 klatek na sekundę w jakości Full HD, co pozwoli ponad dwukrotnie spowolnić materiał.&lt;/div&gt;&lt;/div&gt;&lt;h3 style=\"text-align: center;\"class=background-block-gray&gt;&lt;strong&gt;Ergonomiczna konstrukcja&lt;/strong&gt;&lt;/h3&gt;&lt;div class=cms-template_text50-photo50&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/descFiles/FZ2000_feature_global_2-4-3_01669421132.jpg&gt;&lt;/div&gt;&lt;h3&gt;Obracany ekran LCD&lt;/h3&gt;&lt;p&gt;Wyświetlacz LCD posiada &lt;strong&gt;rozdzielczość 921 tys. punktów&lt;/strong&gt;, czego efektem jest bogaty w detale obraz. Umieszczony na przegubie ekran ułatwia robienie &lt;strong&gt;selfie&lt;/strong&gt; &lt;strong&gt;oraz kadrowanie z nietypowej perspektywy, &lt;/strong&gt;np. nisko nad ziemią, gdy korzystanie z wizjera byłoby niewygodne lub niemożliwe. Świetny wybór do vlogowania.&lt;h3&gt;Duży korpus - wygodny chwyt&lt;/h3&gt;&lt;p&gt;Aparat jest stosunkowo duży, swoim wyglądem przypomina lustrzankę. Wyposażony w optymalnie rozlokowane koła nastaw daje szybki dostęp do wielu potrzebnych funkcji bez szperania w menu. Posiada głęboki grip umożliwiający wygodny uchwyt nawet podczas wielogodzinnych wędrówek. Pewnie leży w dłoni, co zapewnia mu dodatkową dozę bezpieczeństwa.&lt;/div&gt;&lt;div class=cms-template_photo50-text50&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/descFiles/FZ2000_feature_global_2-4-1_011473657233.jpg&gt;&lt;/div&gt;&lt;h3&gt;Duży i czytelny wizjer&lt;/h3&gt;&lt;p&gt;Aparat FZ2000 wyposazono w wizjer OLED LVF (Live View Finder) o rozdzielczości 2360 tys. punktów, który zapewnia stabilne kadrowanie i znakomitą widoczność nawet  w silnym świetle słonecznym. Wyświetlacz OLED charakteryzuje się szybką reakcją dzięki minimalnemu opóźnieniu. Cechuje się wysokim kontrastem 10 000:1 zapewniającym ponadprzeciętne odwzorowanie kolorów. Duże powiększenie 0,74x (odpowiednik dla aparatu 35 mm) i szeroki kąt widzenia ułatwiają dostrzeżenie szczegółów obrazu nawet po odsunięciu oka od centrum wizjera.&lt;/div&gt;&lt;h2&gt;Materiały dodatkowe&lt;/h2&gt;&lt;div class=\"cms-template_grid5 cms-grid cms-grid-5 js-flexbox\"&gt;&lt;div class=cms-box&gt;&lt;div class=box-inner&gt;&lt;div class=cms-photo&gt;&lt;a href=https://upload.cyfrowe.pl/cyfrowe/instrukcje/aparaty/panasonic/kompakty/DMC_FZ2000_instrukcja.pdf target=_blank&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/descFiles/fz200052630536.jpg&gt;&lt;/a&gt;&lt;/div&gt;&lt;div class=cms-description&gt;&lt;h3&gt;&lt;a href=https://upload.cyfrowe.pl/cyfrowe/instrukcje/aparaty/panasonic/kompakty/DMC_FZ2000_instrukcja.pdf target=_blank&gt;Instrukcja PDF&lt;/a&gt;&lt;/h3&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;div class=cms-box&gt;&lt;div class=box-inner&gt;&lt;div class=cms-photo&gt;&lt;a href=https://upload.cyfrowe.pl/cyfrowe/instrukcje/aparaty/panasonic/Tabela_kompatybilnosci.pdf target=_blank&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/descFiles/tabelka2064150669.jpg&gt;&lt;/a&gt;&lt;/div&gt;&lt;div class=cms-description&gt;&lt;h3&gt;&lt;a href=https://upload.cyfrowe.pl/cyfrowe/instrukcje/aparaty/panasonic/Tabela_kompatybilnosci.pdf target=_blank&gt;Tabela kompatybilności &lt;/a&gt;&lt;/h3&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;ul&gt;&lt;li&gt;&lt;a href=https://www.panasonic.com/pl/consumer/kamery-i-aparaty/aparaty-kompaktowe/dmc-fz2000.html target=_blank&gt;Opis produktu na polskiej stronie producenta&lt;/a&gt;&lt;/ul&gt;&lt;p class=short_description itemprop=description&gt;Aparat kompaktowy Panasonic Lumix FZ2000 z wbudowanym obiektywem Leica. Wyposażony w 1-calową matrycę o rozdzielczości 20,1 MP, 20-krotny zoom optyczny, wizjer OLED i obracany ekran LCD. Spełni wymagania początkujących i średniozaawansowanych użytkowników, w tym fotografów i filmowców. Uniwersalny zoom 24-480 mm sprawdzi się w większości codziennych sytuacji, np. na wakacjach, w fotografii kulinarnej i makro (ostrzenie od 3 cm). Umożliwia nagrywanie filmów 4K, slow motion 60 kl/s w full HD, których jakość poprawia wydajna optyczna stabilizacja. Wysokiej jakości konstrukcja zapewnia pewny i bezpieczny chwyt.', '', 'aparat-cyfrowy-panasonic-lumix-fz2000', '', '', '', 'Aparat cyfrowy Panasonic LUMIX FZ2000', '', '', '', ''),
(21, 1, 1, '&lt;div class=cms-img-template_photo-small-text&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/fck_files_n/4449784615.jpg&gt;&lt;/div&gt;&lt;p&gt;&lt;strong&gt;Wyjątkowo kompaktowy aparat wyposażony w aż 12-krotny zoom optyczny, matrycę o rozdzielczości 20 mln pikseli i filmowanie w rozdzielczości Full HD. Dzięki komunikacji Wi-Fi oraz NFC w prosty sposób prześlesz swoje zdjęcia i filmy do innych urządzeń. &lt;/strong&gt;&lt;/div&gt;&lt;h2&gt;Funkcje aparatu Canon IXUS 285 HS&lt;/h2&gt;&lt;h3&gt;&lt;strong&gt;Rozdzielczość 20 mln pikseli&lt;/strong&gt;&lt;/h3&gt;&lt;p&gt;Wysoka rozdzielczość matrycy pozwala na rejestrację obrazu z wyjatkową szczegółowością obrazu. Dzięki temu każdy szczegół na zdjęciu będzie wyraźny, nawet po powiększeniu zdjęcia do badzo dużego formatu.&lt;h3&gt;Aż 12-krotny zoom optyczny&lt;/h3&gt;&lt;p&gt;Wydawać by się mogło, że to niemożliwe. Choć IXUS 285 HS jest tak płaski to mieści w sobie obiektyw z 12-krotnym zoomem o ogniskowych 25-300 (odpowiednik dla aparatów 35 mm). Dodatkowo funkcja ZoomPlus pozwoli na uzyskanie aż 24-krotnego przybliżenia. Tak rozległy zakres ogniskowych sprawia, że choć aparat jest wyjątkowo mały możesz nim zrobić zdjęcie w każdej sytuacji.&lt;h3&gt;Szerokokątny obiektyw 24 mm&lt;/h3&gt;&lt;p&gt;Zastosowanie obiektywu, którego minimalna ogniskowa wynosi 25 mm (odpowiednik dla aparatów 35 mm) to doskonałe rozwiązanie do fotografowania w niewielkich pomieszczeniach. Nawet jeśli miejsca nie ma zbyt dużo wszytsko zmieści się w polu widzenia. To również doskonałe rozwiązanie do fotografowania szerokich pejzaży.&lt;h3&gt;Komunikacja Wi-Fi i NFC&lt;/h3&gt;&lt;p&gt;Dzięki komunikacji Wi-Fi i NFC możesz łatwo wysyłać zdjęcia do innych urządzeń a także sterować aparatem na odległość.&lt;h3&gt;Funkcja wykrywania twarzy&lt;/h3&gt;&lt;p&gt;Aby wykonanie portretu było jeszcze łatwiejsze aparat wyposażono w funkcję wykrywania twarzy. Tak, by wszystkie ustawienia aparatu były optymalne dla zrobienia najwyższej jakości portretu.&lt;h3&gt;Filmowanie w rozdzielczości FullHD&lt;/h3&gt;&lt;p&gt;Ten kompaktowy model pozwala nie tylko na wykonanie wysokiej jakości zjęć w każdej sytuacji. Funkcja filmowania w rozdzielczości Full HD czyni z niego wyjątkowo kompaktową kamerę.&lt;h3&gt;Procesor Digic 4+&lt;/h3&gt;&lt;p&gt;Zastosowany w aparacie procesor Digic 4+ odpowiada za szybkie przetwarzanie danych i idealne odwzorowanie koloru. Aparat jest więc gotowy do zrobienia zdjęć zaraz po włączeniu.&lt;p class=short_description itemprop=description&gt;Wyjątkowo kompaktowy aparat wyposażony w aż 12-krotny zoom optyczny, matrycę o rozdzielczości 20 mln pikseli i filmowanie w rozdzielczości Full HD. Dzięki komunikacji Wi-Fi oraz NFC w prosty sposób prześlesz swoje zdjęcia i filmy do innych urządzeń.', '', 'aparat-cyfrowy-canon-ixus-285-hs-srebrny', '', '', '', 'Aparat cyfrowy Canon IXUS 285 HS srebrny', '', '', '', ''),
