ia najwyższej jakości portretu.&lt;h3&gt;Filmowanie w rozdzielczości FullHD&lt;/h3&gt;&lt;p&gt;Ten kompaktowy model pozwala nie tylko na wykonanie wysokiej jakości zjęć w każdej sytuacji. Funkcja filmowania w rozdzielczości Full HD czyni z niego wyjątkowo kompaktową kamerę.&lt;h3&gt;Procesor Digic 4+&lt;/h3&gt;&lt;p&gt;Zastosowany w aparacie procesor Digic 4+ odpowiada za szybkie przetwarzanie danych i idealne odwzorowanie koloru. Aparat jest więc gotowy do zrobienia zdjęć zaraz po włączeniu.&lt;p class=short_description itemprop=description&gt;Wyjątkowo kompaktowy aparat wyposażony w aż 12-krotny zoom optyczny, matrycę o rozdzielczości 20 mln pikseli i filmowanie w rozdzielczości Full HD. Dzięki komunikacji Wi-Fi oraz NFC w prosty sposób prześlesz swoje zdjęcia i filmy do innych urządzeń.', '', 'aparat-cyfrowy-canon-ixus-285-hs-czarny', '', '', '', 'Aparat cyfrowy Canon IXUS 285 HS czarny', '', '', '', ''),
(23, 1, 1, '&lt;div class=cms-img-template_photo-small-text&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/fck_files_n/4449784615.jpg&gt;&lt;/div&gt;&lt;p&gt;&lt;strong&gt;Wyjątkowo kompaktowy aparat wyposażony w aż 12-krotny zoom optyczny, matrycę o rozdzielczości 20 mln pikseli i filmowanie w rozdzielczości Full HD. Dzięki komunikacji Wi-Fi oraz NFC w prosty sposób prześlesz swoje zdjęcia i filmy do innych urządzeń. &lt;/strong&gt;&lt;/div&gt;&lt;h2&gt;Funkcje aparatu Canon IXUS 285 HS&lt;/h2&gt;&lt;h3&gt;&lt;strong&gt;Rozdzielczość 20 mln pikseli&lt;/strong&gt;&lt;/h3&gt;&lt;p&gt;Wysoka rozdzielczość matrycy pozwala na rejestrację obrazu z wyjatkową szczegółowością obrazu. Dzięki temu każdy szczegół na zdjęciu będzie wyraźny, nawet po powiększeniu zdjęcia do badzo dużego formatu.&lt;h3&gt;Aż 12-krotny zoom optyczny&lt;/h3&gt;&lt;p&gt;Wydawać by się mogło, że to niemożliwe. Choć IXUS 285 HS jest tak płaski to mieści w sobie obiektyw z 12-krotnym zoomem o ogniskowych 25-300 (odpowiednik dla aparatów 35 mm). Dodatkowo funkcja ZoomPlus pozwoli na uzyskanie aż 24-krotnego przybliżenia. Tak rozległy zakres ogniskowych sprawia, że choć aparat jest wyjątkowo mały możesz nim zrobić zdjęcie w każdej sytuacji.&lt;h3&gt;Szerokokątny obiektyw 24 mm&lt;/h3&gt;&lt;p&gt;Zastosowanie obiektywu, którego minimalna ogniskowa wynosi 25 mm (odpowiednik dla aparatów 35 mm) to doskonałe rozwiązanie do fotografowania w niewielkich pomieszczeniach. Nawet jeśli miejsca nie ma zbyt dużo wszytsko zmieści się w polu widzenia. To również doskonałe rozwiązanie do fotografowania szerokich pejzaży.&lt;h3&gt;Komunikacja Wi-Fi i NFC&lt;/h3&gt;&lt;p&gt;Dzięki komunikacji Wi-Fi i NFC możesz łatwo wysyłać zdjęcia do innych urządzeń a także sterować aparatem na odległość.&lt;h3&gt;Funkcja wykrywania twarzy&lt;/h3&gt;&lt;p&gt;Aby wykonanie portretu było jeszcze łatwiejsze aparat wyposażono w funkcję wykrywania twarzy. Tak, by wszystkie ustawienia aparatu były optymalne dla zrobienia najwyższej jakości portretu.&lt;h3&gt;Filmowanie w rozdzielczości FullHD&lt;/h3&gt;&lt;p&gt;Ten kompaktowy model pozwala nie tylko na wykonanie wysokiej jakości zjęć w każdej sytuacji. Funkcja filmowania w rozdzielczości Full HD czyni z niego wyjątkowo kompaktową kamerę.&lt;h3&gt;Procesor Digic 4+&lt;/h3&gt;&lt;p&gt;Zastosowany w aparacie procesor Digic 4+ odpowiada za szybkie przetwarzanie danych i idealne odwzorowanie koloru. Aparat jest więc gotowy do zrobienia zdjęć zaraz po włączeniu.&lt;p class=short_description itemprop=description&gt;Wyjątkowo kompaktowy aparat wyposażony w aż 12-krotny zoom optyczny, matrycę o rozdzielczości 20 mln pikseli i filmowanie w rozdzielczości Full HD. Dzięki komunikacji Wi-Fi oraz NFC w prosty sposób prześlesz swoje zdjęcia i filmy do innych urządzeń.', '', 'aparat-cyfrowy-canon-ixus-285-hs-purpurowy', '', '', '', 'Aparat cyfrowy Canon IXUS 285 HS purpurowy', '', '', '', ''),
(24, 1, 1, '&lt;div class=cms-template_title-subtitle&gt;&lt;h2&gt;nikon coolpix p950&lt;/h2&gt;&lt;h3&gt;Spójrz na wszystko z bliska&lt;/h3&gt;&lt;p&gt;Nikon Coolpix P950 oferuje zdumiewający superzoom, który pozwala zbliżyć się nawet do najbardziej odległych obiektów. Dzięki niemu możesz spojrzeć prosto w oczy latającym ptakom czy przyjrzeć się powierzchni Księżyca. To aparat o zdumiewających możliwościach, który został wyposażony w 83-krotny zoom optyczny. &lt;/div&gt;&lt;h3&gt;Zachwycające możliwości&lt;/h3&gt;&lt;p&gt;Nikon P950 posiada 83-krotny zoom optyczny, który udostępnia ogniskowe 24-2000 mm. Dzięki temu możesz zarejestrować zarówno rozległe krajobrazy, jak i odległe obiekty. Dodatkowo optykę wspiera 166-krotny zoom cyfrowy. To pozwala na zwiększenie maksymalnej ogniskowej do niebotycznych parametrów 4000 mm. &lt;h3&gt;Znakomita jakość obrazu&lt;/h3&gt;&lt;p&gt;Nikon P950 posiada matrycę CMOS w technologii BSI, procesor obrazu EXPEED i obiektyw wyposażony w szkło Super ED i oferujący światłosiłę f/2.8. Dzięki temu możesz uzyskać doskonałe efekty, niezależnie od tego jaki wybierzesz temat swoich zdjęć. Aparat daje ogromne możliwości nie tylko podczas fotografowania, ale również w trakcie filmowania. Zdumiewające filmy w jakości 4K pozwolą Ci na pokazanie niezwykłych tajemnic świata przyrody, dynamiki zmagań sportowych czy niuansów wszystkich pozostałych tematów. Wyjście HDMI umożliwi Ci wyświetlenie podglądu wideo na zewnętrznym monitorze. Wbudowane złącze mikrofonowe pozwala na zastosowanie zewnętrznych akcesoriów i uzyskanie perfekcyjnego dźwięku. Możesz z łatwością dostosować parametry nagrywania w trybie manualnym, tak aby przejąć pełną kontrole nad finalnym efektem. &lt;h3&gt;Niezwykła funkcjonalność&lt;/h3&gt;&lt;p&gt; Duży wizjer elektroniczny OLED o przekątnej 0,39\'\' i rozdzielczości 2 359 000 punktów pozwala na intuicyjne kadrowanie i daje wyraźny podgląd kadru. Zastosowano w nim czujnik zbliżenia, który wykrywa przybliżenie twarzy i automatycznie przełącza pomiędzy wyświetlaniem obrazu na ekranie a w wizjerze. Pozwala to nie tylko na sprawniejszą i bardziej intuicyjną pracę, ale także oszczędza energię i zwiększa wydajność akumulatorów. Obracany i uchylany ekran LCD pozwala na wygodne kadrowanie nawet przy bardzo nietypowych kątach widzenia. Funkcja zapisu zdjęć do RAW pozwala uwolnić cały potencjał aparatu w programach graficznych. Dzięki RAW zyskasz pełną kontrolę nad finalnym efektem pracy i z łatwością dopracujesz wszystkie elementy obrazu. &lt;p&gt;Boczna dźwignia zoomu umożliwia natychmiastową zmianę ogniskowej, tak aby płynnie i szybko przejść od pełnego zoomu do szerokiego kąta. Dzięki temu możliwe jest łatwe śledzenie dynamicznie poruszających się obiektów i ponowne ich odszukiwanie, gdy uciekną z kadru. Nikon P950 oferuje standardowe mocowanie gorącej stopki, które umożliwia korzystanie z wielu różnych akcesoriów. Dzięki niemu możliwe jest np. podłączenie zewnętrznej, reporterskiej lampy błyskowej. &lt;p&gt;Aparat oferuje bardzo ciekawe tryby fotograficzne umożliwiające uwolnienie pełni potencjału jego potężnego obiektywu. Tryb obserwowania ptaków czy fotografowania Księżyca automatycznie dopasowuje optymalne ustawienia, tak aby pokazać piękno pierzastych zwierząt czy Srebrnego Globu. Funkcja SnapBridge pozwala na wydajną komunikację pomiędzy aparatem a smartfonem i łatwe przesyłanie danych oraz udostępnianie filmów czy zdjęć. &lt;h3&gt;Wydajna stabilizacja nawet podczas korzystania z ekstremalnych ogniskowych &lt;/h3&gt;&lt;p&gt;Nikon P950 wykorzystuje doskonałą optyczną redukcję drgań, która nie tylko zapewnia doskonałe efekty  zdjęciowe, ale również ułatwia korzystania z teleobiektywu. Stabilizacja działa z wydajnością nawet 5 EV. &lt;p class=short_description itemprop=description&gt;Nikon Coolpix P950 oferuje zdumiewający superzoom, który pozwala zbliżyć się nawet do najbardziej odległych obiektów. Dzięki niemu możesz spojrzeć prosto w oczy latającym ptakom czy przyjrzeć się powierzchni Księżyca. To aparat o zdumiewających możliwościach, który został wyposażony w 83-krotny zoom optyczny. Dodatkowo umożliwia rejestrowanie filmów w jakości 4K, wykorzystuje wydajną stabilizację obrazu, oferuje wizjer elektorniczny OLED i posiada szereg przydatnych funkcji, takich jak np. pliki RAW, technologia SnapBridge czy złącze gorącej stopki.', '', 'aparat-cyfrowy-nikon-coolpix-p950', '', '', '', 'Aparat cyfrowy Nikon Coolpix P950', '', '', '', ''),
(25, 1, 1, '&lt;div class=cms-template_title-subtitle&gt;&lt;h2&gt;aparat fujifilm Instax Pal Powder Pink&lt;/h2&gt;&lt;h3&gt;To chyba najmniejszy aparat świata!?&lt;/h3&gt;&lt;p&gt;Ten aparat jest po prostu niesamowity. Spójrz tylko na niego! A w zasadzie, lepiej po prostu spójrz w jego obiektyw i zrób sobie wyjątkowe foty z przyjaciółmi. &lt;strong&gt;Niebywały design i zabawne gabaryty &lt;/strong&gt;kryją w sobie zdumiewający potencjał. &lt;strong&gt;Połącz go z drukarką natychmiastową Instax Link&lt;/strong&gt; (sprzedawane oddzielnie), aby móc bawić się na całego z fotografią natychmiastową. Będziesz mieć w garści nie tylko aparat - ale również całą moc niepowtarzalnych wspomnień.&lt;/div&gt;&lt;div class=\"cms-template_2photos-grid cms-grid cms-grid-2 js-flexbox\"&gt;&lt;div class=cms-box&gt;&lt;div class=box-inner&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat FujiFilm Instax Pal Milky White\"src=//upload.cyfrowe.pl/cyfrowe/products/18231902bd0.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;div class=cms-box&gt;&lt;div class=box-inner&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat FujiFilm Instax Pal Milky White\"src=//upload.cyfrowe.pl/cyfrowe/products/182305e3316.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;h3&gt;Aparat do drukarek natychmiastowych&lt;/h3&gt;&lt;p&gt;Trudno wyobrazić sobie mniejszy aparat. Ale w zasadzie nie ma potrzeby! FujiFilm Instax Pal to unikatowy&lt;strong&gt; sprzęt, który mieści się w dłoni, &lt;/strong&gt;ale pozwala na robienie pełnoprawnych zdjęć natychmiastowych. Wystarczy &lt;strong&gt;sparować go poprzez smartfon z drukarką z serii Instax Link,&lt;/strong&gt; aby drukować zdjęcia w formacie Mini, Square lub Wide. Aparat wykorzystuje bezprzewodową łączność Bluetooth.&lt;p&gt;&lt;strong&gt;Uwaga! Drukarki sprzedawane są oddzielnie. Format drukowanych zdjęć natychmiastowych zależy od modelu drukarki z serii Instax Link.&lt;/strong&gt;&lt;div class=cms-template_video100&gt;&lt;div class=cms-video-wrapper&gt;&lt;div class=cms-video&gt;&lt;iframe allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\"allowfullscreen frameborder=0 scrolling=no src=https://www.youtube.com/embed/wG-QLZYFVXw?si=aOPL4YnK8hqqcjTo&gt;&lt;/iframe&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;h3&gt;Zmieść go w dłoni lub w kieszeni&lt;/h3&gt;&lt;p&gt;Instax Pal to unikatowy projekt. &lt;strong&gt;Zmieści się w kieszeni, &lt;/strong&gt;dzięki czemu możesz go mieć zawsze przy sobie. Sięgaj po niego, gdy tylko najdzie Cię ochota na fotografię natychmiastową. Zapisuj niepowtarzalne chwile i ciesz się z bliskimi niebywałymi pamiątkami. Ten aparat jest jak as w rękawie na każdej dobre imprezie. Do tego występuje w kilku szalonych kolorach, wśród których każdy znajdzie coś dla siebie.&lt;div class=\"cms-template_2photos-grid cms-grid cms-grid-2 js-flexbox\"&gt;&lt;div class=cms-box&gt;&lt;div class=box-inner&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat FujiFilm Instax Pal Milky White\"src=//upload.cyfrowe.pl/cyfrowe/products/1822983fe01.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;div class=cms-box&gt;&lt;div class=box-inner&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat FujiFilm Instax Pal Milky White\"src=//upload.cyfrowe.pl/cyfrowe/products/1822893848d.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;h3&gt;Wielofunkcyjny pierścień&lt;/h3&gt;&lt;p&gt;Instax Pal uzupełnia &lt;strong&gt;wielofunkcyjny pierścień, który nakłada się na palec, &lt;/strong&gt;tak aby aparat pozostawał cały czas pod ręką. Już nigdzie Ci nie ucieknie! A co więcej ten uchwyt może pełnić także funkcję podstawki do robienia zdjęć z samowyzwalaczem. Wielofunkcyjny pierścień to także wizjer. Wystarczy zamocować go w górnej części aparatu natychmiastowego FujiFilm Instax Pal. &lt;div class=cms-template_photo100&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat FujiFilm Instax Pal Milky White\"src=//upload.cyfrowe.pl/cyfrowe/products/18225cbbadf.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;h3&gt;Obiektyw szerokokątny&lt;/h3&gt;&lt;p&gt;Instax Pal wykorzystuje &lt;strong&gt;wbudowany, szerokokątny obiektyw&lt;/strong&gt;, który pozwala Ci na robienie świetnych zdjęć grupowych wraz z przyjaciółmi. Wygłupiajcie się przed obiektywem, a najśmieszniejsze ujęcia wydrukujcie w formie zdjęć natychmiastowych. Obiektyw szerokokątny zapewni Ci także wiele kreatywnych możliwości nie tylko podczas fotografowania ludzi - rób świetne ujęcia krajobrazowe czy uwiecznij widoki miejskie. &lt;h3&gt;Nagrywanie dźwięków&lt;/h3&gt;&lt;p&gt;Miniaturowe rozmiary, świetny obiektyw szerokokątny, wielofunkcyjny uchwyt - chcesz czegoś więcej? Proszę bardzo! Instax Pal to sprzęt, który pozwoli Ci kreatywnie się wyszaleć. Zapewnia&lt;strong&gt; funkcję rejestrowania dźwięków, które będą słyszane przed migawką&lt;/strong&gt;. Będą zapisywane w grupach po pięć za pośrednictwem kompatybilnej aplikacji. Będą potem losowo odtwarzane podczas każdorazowego naciskania spustu migawki. To świetna zabawa, która sprawia, że przed zrobieniem zdjęcia możesz usłyszeć np. \"Zatańcz!\", \"Uśmiechnij się!\" lub \"Zrób zwariowaną minę!\". Wyjątkowa zabawa z wyjątkowym aparatem i równie niesamowitymi zdjęciami natychmiastowymi.&lt;h3&gt;Drukuj zdjęcia, które chcesz i jak chcesz&lt;/h3&gt;&lt;p&gt;Aparat jest w stanie&lt;strong&gt; zapisać jednorazowo do 50 zdjęć&lt;/strong&gt;. Następnie możesz je przenieść do smartfona, aby w aplikacji bawić się nimi i zdecydować, które zostaną wydrukowane w formie zdjęć natychmiastowych. &lt;strong&gt;Dodawaj filtry, teksty i naklejki,&lt;/strong&gt; a także wybieraj rozmiar, w jakim zostaną wydrukowane - mini, Square czy Wide (rozmiar wydruków uzależniony jest od modelu drukarki i zastosowanego materiału natychmiastowego). &lt;div class=cms-template_photo100&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat FujiFilm Instax Pal Milky White\"src=//upload.cyfrowe.pl/cyfrowe/products/18232b0dd38.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;h3&gt;18 filtrów&lt;/h3&gt;&lt;p&gt;Niech Twoje zdjęcia wyglądają naprawdę świetnie, dzięki zastosowaniu jednego z&lt;strong&gt; 18 filtrów.&lt;/strong&gt; Nadaj im niepowtarzalny charakter! Filtry możesz wybierać w trybach Fotografowania zdalnego, Fotografii poklatkowej lub po prostu podczas edycji gotowych ekspozycji. Jeśli filtr zostanie ustawiony w trybie zdalnego fotografowania, to aparat będzie go używał także podczas standardowego robienia zdjęć. &lt;div class=cms-template_text50-photo50&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat FujiFilm Instax Pal Milky White\"src=//upload.cyfrowe.pl/cyfrowe/products/182260aba0c.jpg&gt;&lt;/div&gt;&lt;h3&gt;Zdalne sterowanie przez smartfon&lt;/h3&gt;&lt;p&gt;Dzięki aplikacji mobilnej Instax Pal Twój &lt;strong&gt;smartfon może stać się pilotem do aparatu natychmiastowego&lt;/strong&gt;. Możesz podglądać kadr na żywo, dostosowywać obraz za pomocą filtrów, ustawiać samowyzwalacz, a także wyłączać i włączać lampę błyskową. Masz pełną kontrolę podczas pozowania z przyjaciółmi lub robienia sobie autoportretów. Pokaż się światu, dokładnie tak, jak chcesz. &lt;h3&gt;Fotografia poklatkowa&lt;/h3&gt;&lt;p&gt;Instax Pal jest mały, ale może wiele. Przykładowo może &lt;strong&gt;zrobić wiele zdjęć z interwałometrem.&lt;/strong&gt; Zrobi Ci szybkie &lt;strong&gt;fotki w sekwencjach po 3, 6, 11 lub 21 obrazów &lt;/strong&gt;(wystarczy ustawić tryb w aplikacji). Zarejestruj niebywałe chwile pokazując nie tylko ich kluczowe momenty, ale także to, co działo się przed lub po. A zresztą, często nie wiadomo, co było najważniejszym momentem. Często też zdarzy się je przegapić. Z Instax Pal nie masz tego problemu. Możesz wybrać ulubioną klatkę po zrobieniu zdjęć lub mieć pewność, że zapisało się wszystko to, co najważniejsze. &lt;/div&gt;&lt;h3&gt;Animacje&lt;/h3&gt;&lt;p&gt;Idźmy o krok dalej! Instax Pal to także &lt;strong&gt;wyjątkowe animacje&lt;/strong&gt;. Aplikacja łączy zrobione zdjęcia w niesamowite se&lt;strong&gt;kwencje, które potem możesz wykorzysatć - przykładowo drukując na materiałach natychmiastowych z kodem QR&lt;/strong&gt;, tak aby każdy mógł je obejrzeć. Możesz także dzielić się swoimi animacjami online. A teraz do dzieła! &lt;p class=short_description itemprop=description&gt;Wyjątkowy, kieszonkowy aparat o nieprawdopodobnie małych gabarytach, który drukuje zdjęcia natychmiastowe za pomocą drukarki z serii Link (sprzedawane oddzielnie). Posiada w zestawie pierścień wielofunkcyjny, który umożliwia pewne trzymanie go w dłoni lub stworzenie podstawy pod aparat czy wizjer. Instax Pal oferuje wbudowany, obiektyw szerokokątny, doskonale sprawdzający się podczas robienia zdjęć grupowych.', '', 'aparat-fujifilm-instax-pal-powder-pink', '', '', '', 'Aparat FujiFilm Instax Pal Powder Pink', '', '', '', ''),
(26, 1, 1, '&lt;div class=cms-template_title-subtitle&gt;&lt;h2&gt;aparat fujifilm Instax Pal Milky White&lt;/h2&gt;&lt;h3&gt;To chyba najmniejszy aparat świata!?&lt;/h3&gt;&lt;p&gt;Ten aparat jest po prostu niesamowity. Spójrz tylko na niego! A w zasadzie, lepiej po prostu spójrz w jego obiektyw i zrób sobie wyjątkowe foty z przyjaciółmi. &lt;strong&gt;Niebywały design i zabawne gabaryty &lt;/strong&gt;kryją w sobie zdumiewający potencjał. &lt;strong&gt;Połącz go z drukarką natychmiastową Instax Link&lt;/strong&gt; (sprzedawane oddzielnie), aby móc bawić się na całego z fotografią natychmiastową. Będziesz mieć w garści nie tylko aparat - ale również całą moc niepowtarzalnych wspomnień.&lt;/div&gt;&lt;div class=\"cms-template_2photos-grid cms-grid cms-grid-2 js-flexbox\"&gt;&lt;div class=cms-box&gt;&lt;div class=box-inner&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat FujiFilm Instax Pal Milky White\"src=//upload.cyfrowe.pl/cyfrowe/products/18231902bd0.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;div class=cms-box&gt;&lt;div class=box-inner&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat FujiFilm Instax Pal Milky White\"src=//upload.cyfrowe.pl/cyfrowe/products/182305e3316.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;h3&gt;Aparat do drukarek natychmiastowych&lt;/h3&gt;&lt;p&gt;Trudno wyobrazić sobie mniejszy aparat. Ale w zasadzie nie ma potrzeby! FujiFilm Instax Pal to unikatowy&lt;strong&gt; sprzęt, który mieści się w dłoni, &lt;/strong&gt;ale pozwala na robienie pełnoprawnych zdjęć natychmiastowych. Wystarczy &lt;strong&gt;sparować go poprzez smartfon z drukarką z serii Instax Link,&lt;/strong&gt; aby drukować zdjęcia w formacie Mini, Square lub Wide. Aparat wykorzystuje bezprzewodową łączność Bluetooth.&lt;p&gt;&lt;strong&gt;Uwaga! Drukarki sprzedawane są oddzielnie. Format drukowanych zdjęć natychmiastowych zależy od modelu drukarki z serii Instax Link.&lt;/strong&gt;&lt;div class=cms-template_video100&gt;&lt;div class=cms-video-wrapper&gt;&lt;div class=cms-video&gt;&lt;iframe allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\"allowfullscreen frameborder=0 scrolling=no src=https://www.youtube.com/embed/wG-QLZYFVXw?si=aOPL4YnK8hqqcjTo&gt;&lt;/iframe&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;h3&gt;Zmieść go w dłoni lub w kieszeni&lt;/h3&gt;&lt;p&gt;Instax Pal to unikatowy projekt. &lt;strong&gt;Zmieści się w kieszeni, &lt;/strong&gt;dzięki czemu możesz go mieć zawsze przy sobie. Sięgaj po niego, gdy tylko najdzie Cię ochota na fotografię natychmiastową. Zapisuj niepowtarzalne chwile i ciesz się z bliskimi niebywałymi pamiątkami. Ten aparat jest jak as w rękawie na każdej dobre imprezie. Do tego występuje w kilku szalonych kolorach, wśród których każdy znajdzie coś dla siebie.&lt;div class=\"cms-template_2photos-grid cms-grid cms-grid-2 js-flexbox\"&gt;&lt;div class=cms-box&gt;&lt;div class=box-inner&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat FujiFilm Instax Pal Milky White\"src=//upload.cyfrowe.pl/cyfrowe/products/1822983fe01.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;div class=cms-box&gt;&lt;div class=box-inner&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat FujiFilm Instax Pal Milky White\"src=//upload.cyfrowe.pl/cyfrowe/products/1822893848d.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;h3&gt;Wielofunkcyjny pierścień&lt;/h3&gt;&lt;p&gt;Instax Pal uzupełnia &lt;strong&gt;wielofunkcyjny pierścień, który nakłada się na palec, &lt;/strong&gt;tak aby aparat pozostawał cały czas pod ręką. Już nigdzie Ci nie ucieknie! A co więcej ten uchwyt może pełnić także funkcję podstawki do robienia zdjęć z samowyzwalaczem. Wielofunkcyjny pierścień to także wizjer. Wystarczy zamocować go w górnej części aparatu natychmiastowego FujiFilm Instax Pal. &lt;div class=cms-template_photo100&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat FujiFilm Instax Pal Milky White\"src=//upload.cyfrowe.pl/cyfrowe/products/18225cbbadf.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;h3&gt;Obiektyw szerokokątny&lt;/h3&gt;&lt;p&gt;Instax Pal wykorzystuje &lt;strong&gt;wbudowany, szerokokątny obiektyw&lt;/strong&gt;, który pozwala Ci na robienie świetnych zdjęć grupowych wraz z przyjaciółmi. Wygłupiajcie się przed obiektywem, a najśmieszniejsze ujęcia wydrukujcie w formie zdjęć natychmiastowych. Obiektyw szerokokątny zapewni Ci także wiele kreatywnych możliwości nie tylko podczas fotografowania ludzi - rób świetne ujęcia krajobrazowe czy uwiecznij widoki miejskie. &lt;h3&gt;Nagrywanie dźwięków&lt;/h3&gt;&lt;p&gt;Miniaturowe rozmiary, świetny obiektyw szerokokątny, wielofunkcyjny uchwyt - chcesz czegoś więcej? Proszę bardzo! Instax Pal to sprzęt, który pozwoli Ci kreatywnie się wyszaleć. Zapewnia&lt;strong&gt; funkcję rejestrowania dźwięków, które będą słyszane przed migawką&lt;/strong&gt;. Będą zapisywane w grupach po pięć za pośrednictwem kompatybilnej aplikacji. Będą potem losowo odtwarzane podczas każdorazowego naciskania spustu migawki. To świetna zabawa, która sprawia, że przed zrobieniem zdjęcia możesz usłyszeć np. \"Zatańcz!\", \"Uśmiechnij się!\" lub \"Zrób zwariowaną minę!\". Wyjątkowa zabawa z wyjątkowym aparatem i równie niesamowitymi zdjęciami natychmiastowymi.&lt;h3&gt;Drukuj zdjęcia, które chcesz i jak chcesz&lt;/h3&gt;&lt;p&gt;Aparat jest w stanie&lt;strong&gt; zapisać jednorazowo do 50 zdjęć&lt;/strong&gt;. Następnie możesz je przenieść do smartfona, aby w aplikacji bawić się nimi i zdecydować, które zostaną wydrukowane w formie zdjęć natychmiastowych. &lt;strong&gt;Dodawaj filtry, teksty i naklejki,&lt;/strong&gt; a także wybieraj rozmiar, w jakim zostaną wydrukowane - mini, Square czy Wide (rozmiar wydruków uzależniony jest od modelu drukarki i zastosowanego materiału natychmiastowego). &lt;div class=cms-template_photo100&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat FujiFilm Instax Pal Milky White\"src=//upload.cyfrowe.pl/cyfrowe/products/18232b0dd38.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;h3&gt;18 filtrów&lt;/h3&gt;&lt;p&gt;Niech Twoje zdjęcia wyglądają naprawdę świetnie, dzięki zastosowaniu jednego z&lt;strong&gt; 18 filtrów.&lt;/strong&gt; Nadaj im niepowtarzalny charakter! Filtry możesz wybierać w trybach Fotografowania zdalnego, Fotografii poklatkowej lub po prostu podczas edycji gotowych ekspozycji. Jeśli filtr zostanie ustawiony w trybie zdalnego fotografowania, to aparat będzie go używał także podczas standardowego robienia zdjęć. &lt;div class=cms-template_text50-photo50&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat FujiFilm Instax Pal Milky White\"src=//upload.cyfrowe.pl/cyfrowe/products/182260aba0c.jpg&gt;&lt;/div&gt;&lt;h3&gt;Zdalne sterowanie przez smartfon&lt;/h3&gt;&lt;p&gt;Dzięki aplikacji mobilnej Instax Pal Twój &lt;strong&gt;smartfon może stać się pilotem do aparatu natychmiastowego&lt;/strong&gt;. Możesz podglądać kadr na żywo, dostosowywać obraz za pomocą filtrów, ustawiać samowyzwalacz, a także wyłączać i włączać lampę błyskową. Masz pełną kontrolę podczas pozowania z przyjaciółmi lub robienia sobie autoportretów. Pokaż się światu, dokładnie tak, jak chcesz. &lt;h3&gt;Fotografia poklatkowa&lt;/h3&gt;&lt;p&gt;Instax Pal jest mały, ale może wiele. Przykładowo może &lt;strong&gt;zrobić wiele zdjęć z interwałometrem.&lt;/strong&gt; Zrobi Ci szybkie &lt;strong&gt;fotki w sekwencjach po 3, 6, 11 lub 21 obrazów &lt;/strong&gt;(wystarczy ustawić tryb w aplikacji). Zarejestruj niebywałe chwile pokazując nie tylko ich kluczowe momenty, ale także to, co działo się przed lub po. A zresztą, często nie wiadomo, co było najważniejszym momentem. Często też zdarzy się je przegapić. Z Instax Pal nie masz tego problemu. Możesz wybrać ulubioną klatkę po zrobieniu zdjęć lub mieć pewność, że zapisało się wszystko to, co najważniejsze. &lt;/div&gt;&lt;h3&gt;Animacje&lt;/h3&gt;&lt;p&gt;Idźmy o krok dalej! Instax Pal to także &lt;strong&gt;wyjątkowe animacje&lt;/strong&gt;. Aplikacja łączy zrobione zdjęcia w niesamowite se&lt;strong&gt;kwencje, które potem możesz wykorzysatć - przykładowo drukując na materiałach natychmiastowych z kodem QR&lt;/strong&gt;, tak aby każdy mógł je obejrzeć. Możesz także dzielić się swoimi animacjami online. A teraz do dzieła! &lt;p class=short_description itemprop=description&gt;Wyjątkowy, kieszonkowy aparat o nieprawdopodobnie małych gabarytach, który drukuje zdjęcia natychmiastowe za pomocą drukarki z serii Link (sprzedawane oddzielnie). Posiada w zestawie pierścień wielofunkcyjny, który umożliwia pewne trzymanie go w dłoni lub stworzenie podstawy pod aparat czy wizjer. Instax Pal oferuje wbudowany, obiektyw szerokokątny, doskonale sprawdzający się podczas robienia zdjęć grupowych.', '', 'aparat-fujifilm-instax-pal-milky-white', '', '', '', 'Aparat FujiFilm Instax Pal Milky White', '', '', '', '');
