woje zdjęcia wyglądają naprawdę świetnie, dzięki zastosowaniu jednego z&lt;strong&gt; 18 filtrów.&lt;/strong&gt; Nadaj im niepowtarzalny charakter! Filtry możesz wybierać w trybach Fotografowania zdalnego, Fotografii poklatkowej lub po prostu podczas edycji gotowych ekspozycji. Jeśli filtr zostanie ustawiony w trybie zdalnego fotografowania, to aparat będzie go używał także podczas standardowego robienia zdjęć. &lt;div class=cms-template_text50-photo50&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat FujiFilm Instax Pal Milky White\"src=//upload.cyfrowe.pl/cyfrowe/products/182260aba0c.jpg&gt;&lt;/div&gt;&lt;h3&gt;Zdalne sterowanie przez smartfon&lt;/h3&gt;&lt;p&gt;Dzięki aplikacji mobilnej Instax Pal Twój &lt;strong&gt;smartfon może stać się pilotem do aparatu natychmiastowego&lt;/strong&gt;. Możesz podglądać kadr na żywo, dostosowywać obraz za pomocą filtrów, ustawiać samowyzwalacz, a także wyłączać i włączać lampę błyskową. Masz pełną kontrolę podczas pozowania z przyjaciółmi lub robienia sobie autoportretów. Pokaż się światu, dokładnie tak, jak chcesz. &lt;h3&gt;Fotografia poklatkowa&lt;/h3&gt;&lt;p&gt;Instax Pal jest mały, ale może wiele. Przykładowo może &lt;strong&gt;zrobić wiele zdjęć z interwałometrem.&lt;/strong&gt; Zrobi Ci szybkie &lt;strong&gt;fotki w sekwencjach po 3, 6, 11 lub 21 obrazów &lt;/strong&gt;(wystarczy ustawić tryb w aplikacji). Zarejestruj niebywałe chwile pokazując nie tylko ich kluczowe momenty, ale także to, co działo się przed lub po. A zresztą, często nie wiadomo, co było najważniejszym momentem. Często też zdarzy się je przegapić. Z Instax Pal nie masz tego problemu. Możesz wybrać ulubioną klatkę po zrobieniu zdjęć lub mieć pewność, że zapisało się wszystko to, co najważniejsze. &lt;/div&gt;&lt;h3&gt;Animacje&lt;/h3&gt;&lt;p&gt;Idźmy o krok dalej! Instax Pal to także &lt;strong&gt;wyjątkowe animacje&lt;/strong&gt;. Aplikacja łączy zrobione zdjęcia w niesamowite se&lt;strong&gt;kwencje, które potem możesz wykorzysatć - przykładowo drukując na materiałach natychmiastowych z kodem QR&lt;/strong&gt;, tak aby każdy mógł je obejrzeć. Możesz także dzielić się swoimi animacjami online. A teraz do dzieła! &lt;p class=short_description itemprop=description&gt;Wyjątkowy, kieszonkowy aparat o nieprawdopodobnie małych gabarytach, który drukuje zdjęcia natychmiastowe za pomocą drukarki z serii Link (sprzedawane oddzielnie). Posiada w zestawie pierścień wielofunkcyjny, który umożliwia pewne trzymanie go w dłoni lub stworzenie podstawy pod aparat czy wizjer. Instax Pal oferuje wbudowany, obiektyw szerokokątny, doskonale sprawdzający się podczas robienia zdjęć grupowych.', '', 'aparat-fujifilm-instax-pal-pistachio-green', '', '', '', 'Aparat FujiFilm Instax Pal Pistachio Green', '', '', '', ''),
(28, 1, 1, '&lt;div class=cms-template_title-subtitle&gt;&lt;h2&gt;aparat fujifilm Instax Pal Lavender Blue&lt;/h2&gt;&lt;h3&gt;To chyba najmniejszy aparat świata!?&lt;/h3&gt;&lt;p&gt;Ten aparat jest po prostu niesamowity. Spójrz tylko na niego! A w zasadzie, lepiej po prostu spójrz w jego obiektyw i zrób sobie wyjątkowe foty z przyjaciółmi. &lt;strong&gt;Niebywały design i zabawne gabaryty &lt;/strong&gt;kryją w sobie zdumiewający potencjał. &lt;strong&gt;Połącz go z drukarką natychmiastową Instax Link&lt;/strong&gt; (sprzedawane oddzielnie), aby móc bawić się na całego z fotografią natychmiastową. Będziesz mieć w garści nie tylko aparat - ale również całą moc niepowtarzalnych wspomnień.&lt;/div&gt;&lt;div class=\"cms-template_2photos-grid cms-grid cms-grid-2 js-flexbox\"&gt;&lt;div class=cms-box&gt;&lt;div class=box-inner&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat FujiFilm Instax Pal Milky White\"src=//upload.cyfrowe.pl/cyfrowe/products/18231902bd0.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;div class=cms-box&gt;&lt;div class=box-inner&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat FujiFilm Instax Pal Milky White\"src=//upload.cyfrowe.pl/cyfrowe/products/182305e3316.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;h3&gt;Aparat do drukarek natychmiastowych&lt;/h3&gt;&lt;p&gt;Trudno wyobrazić sobie mniejszy aparat. Ale w zasadzie nie ma potrzeby! FujiFilm Instax Pal to unikatowy&lt;strong&gt; sprzęt, który mieści się w dłoni, &lt;/strong&gt;ale pozwala na robienie pełnoprawnych zdjęć natychmiastowych. Wystarczy &lt;strong&gt;sparować go poprzez smartfon z drukarką z serii Instax Link,&lt;/strong&gt; aby drukować zdjęcia w formacie Mini, Square lub Wide. Aparat wykorzystuje bezprzewodową łączność Bluetooth.&lt;p&gt;&lt;strong&gt;Uwaga! Drukarki sprzedawane są oddzielnie. Format drukowanych zdjęć natychmiastowych zależy od modelu drukarki z serii Instax Link.&lt;/strong&gt;&lt;div class=cms-template_video100&gt;&lt;div class=cms-video-wrapper&gt;&lt;div class=cms-video&gt;&lt;iframe allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\"allowfullscreen frameborder=0 scrolling=no src=https://www.youtube.com/embed/wG-QLZYFVXw?si=aOPL4YnK8hqqcjTo&gt;&lt;/iframe&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;h3&gt;Zmieść go w dłoni lub w kieszeni&lt;/h3&gt;&lt;p&gt;Instax Pal to unikatowy projekt. &lt;strong&gt;Zmieści się w kieszeni, &lt;/strong&gt;dzięki czemu możesz go mieć zawsze przy sobie. Sięgaj po niego, gdy tylko najdzie Cię ochota na fotografię natychmiastową. Zapisuj niepowtarzalne chwile i ciesz się z bliskimi niebywałymi pamiątkami. Ten aparat jest jak as w rękawie na każdej dobre imprezie. Do tego występuje w kilku szalonych kolorach, wśród których każdy znajdzie coś dla siebie.&lt;div class=\"cms-template_2photos-grid cms-grid cms-grid-2 js-flexbox\"&gt;&lt;div class=cms-box&gt;&lt;div class=box-inner&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat FujiFilm Instax Pal Milky White\"src=//upload.cyfrowe.pl/cyfrowe/products/1822983fe01.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;div class=cms-box&gt;&lt;div class=box-inner&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat FujiFilm Instax Pal Milky White\"src=//upload.cyfrowe.pl/cyfrowe/products/1822893848d.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;h3&gt;Wielofunkcyjny pierścień&lt;/h3&gt;&lt;p&gt;Instax Pal uzupełnia &lt;strong&gt;wielofunkcyjny pierścień, który nakłada się na palec, &lt;/strong&gt;tak aby aparat pozostawał cały czas pod ręką. Już nigdzie Ci nie ucieknie! A co więcej ten uchwyt może pełnić także funkcję podstawki do robienia zdjęć z samowyzwalaczem. Wielofunkcyjny pierścień to także wizjer. Wystarczy zamocować go w górnej części aparatu natychmiastowego FujiFilm Instax Pal. &lt;div class=cms-template_photo100&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat FujiFilm Instax Pal Milky White\"src=//upload.cyfrowe.pl/cyfrowe/products/18225cbbadf.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;h3&gt;Obiektyw szerokokątny&lt;/h3&gt;&lt;p&gt;Instax Pal wykorzystuje &lt;strong&gt;wbudowany, szerokokątny obiektyw&lt;/strong&gt;, który pozwala Ci na robienie świetnych zdjęć grupowych wraz z przyjaciółmi. Wygłupiajcie się przed obiektywem, a najśmieszniejsze ujęcia wydrukujcie w formie zdjęć natychmiastowych. Obiektyw szerokokątny zapewni Ci także wiele kreatywnych możliwości nie tylko podczas fotografowania ludzi - rób świetne ujęcia krajobrazowe czy uwiecznij widoki miejskie. &lt;h3&gt;Nagrywanie dźwięków&lt;/h3&gt;&lt;p&gt;Miniaturowe rozmiary, świetny obiektyw szerokokątny, wielofunkcyjny uchwyt - chcesz czegoś więcej? Proszę bardzo! Instax Pal to sprzęt, który pozwoli Ci kreatywnie się wyszaleć. Zapewnia&lt;strong&gt; funkcję rejestrowania dźwięków, które będą słyszane przed migawką&lt;/strong&gt;. Będą zapisywane w grupach po pięć za pośrednictwem kompatybilnej aplikacji. Będą potem losowo odtwarzane podczas każdorazowego naciskania spustu migawki. To świetna zabawa, która sprawia, że przed zrobieniem zdjęcia możesz usłyszeć np. \"Zatańcz!\", \"Uśmiechnij się!\" lub \"Zrób zwariowaną minę!\". Wyjątkowa zabawa z wyjątkowym aparatem i równie niesamowitymi zdjęciami natychmiastowymi.&lt;h3&gt;Drukuj zdjęcia, które chcesz i jak chcesz&lt;/h3&gt;&lt;p&gt;Aparat jest w stanie&lt;strong&gt; zapisać jednorazowo do 50 zdjęć&lt;/strong&gt;. Następnie możesz je przenieść do smartfona, aby w aplikacji bawić się nimi i zdecydować, które zostaną wydrukowane w formie zdjęć natychmiastowych. &lt;strong&gt;Dodawaj filtry, teksty i naklejki,&lt;/strong&gt; a także wybieraj rozmiar, w jakim zostaną wydrukowane - mini, Square czy Wide (rozmiar wydruków uzależniony jest od modelu drukarki i zastosowanego materiału natychmiastowego). &lt;div class=cms-template_photo100&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat FujiFilm Instax Pal Milky White\"src=//upload.cyfrowe.pl/cyfrowe/products/18232b0dd38.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;h3&gt;18 filtrów&lt;/h3&gt;&lt;p&gt;Niech Twoje zdjęcia wyglądają naprawdę świetnie, dzięki zastosowaniu jednego z&lt;strong&gt; 18 filtrów.&lt;/strong&gt; Nadaj im niepowtarzalny charakter! Filtry możesz wybierać w trybach Fotografowania zdalnego, Fotografii poklatkowej lub po prostu podczas edycji gotowych ekspozycji. Jeśli filtr zostanie ustawiony w trybie zdalnego fotografowania, to aparat będzie go używał także podczas standardowego robienia zdjęć. &lt;div class=cms-template_text50-photo50&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat FujiFilm Instax Pal Milky White\"src=//upload.cyfrowe.pl/cyfrowe/products/182260aba0c.jpg&gt;&lt;/div&gt;&lt;h3&gt;Zdalne sterowanie przez smartfon&lt;/h3&gt;&lt;p&gt;Dzięki aplikacji mobilnej Instax Pal Twój &lt;strong&gt;smartfon może stać się pilotem do aparatu natychmiastowego&lt;/strong&gt;. Możesz podglądać kadr na żywo, dostosowywać obraz za pomocą filtrów, ustawiać samowyzwalacz, a także wyłączać i włączać lampę błyskową. Masz pełną kontrolę podczas pozowania z przyjaciółmi lub robienia sobie autoportretów. Pokaż się światu, dokładnie tak, jak chcesz. &lt;h3&gt;Fotografia poklatkowa&lt;/h3&gt;&lt;p&gt;Instax Pal jest mały, ale może wiele. Przykładowo może &lt;strong&gt;zrobić wiele zdjęć z interwałometrem.&lt;/strong&gt; Zrobi Ci szybkie &lt;strong&gt;fotki w sekwencjach po 3, 6, 11 lub 21 obrazów &lt;/strong&gt;(wystarczy ustawić tryb w aplikacji). Zarejestruj niebywałe chwile pokazując nie tylko ich kluczowe momenty, ale także to, co działo się przed lub po. A zresztą, często nie wiadomo, co było najważniejszym momentem. Często też zdarzy się je przegapić. Z Instax Pal nie masz tego problemu. Możesz wybrać ulubioną klatkę po zrobieniu zdjęć lub mieć pewność, że zapisało się wszystko to, co najważniejsze. &lt;/div&gt;&lt;h3&gt;Animacje&lt;/h3&gt;&lt;p&gt;Idźmy o krok dalej! Instax Pal to także &lt;strong&gt;wyjątkowe animacje&lt;/strong&gt;. Aplikacja łączy zrobione zdjęcia w niesamowite se&lt;strong&gt;kwencje, które potem możesz wykorzysatć - przykładowo druk