t pozwala na drukowanie wybranych zdjęć. &lt;/strong&gt;Możesz więc wybrać najlepszy kadr i uzyskać z niego niepowtarzalną odbitkę. &lt;h3&gt;Wyjątkowy design&lt;/h3&gt;&lt;p&gt;Jak każdy produkt Leica, Sofort 2 wyróżnia się &lt;strong&gt;niepowtarzalną stylistyką, dopracowaną w najmniejszym szczególe&lt;/strong&gt;. Dostępny jest w różnych wersjach kolorystycznych, tak aby móc dopasować go do swojego stylu. &lt;div class=cms-template_photo100&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat Leica SOFORT 2 czerwony\"src=//upload.cyfrowe.pl/cyfrowe/products/182486ab2f2.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;p class=short_description itemprop=description&gt;Stylowy aparat natychmiastowy Leica, który umożliwia drukowanie wybranych zdjęć. Dzięki łączności bezprzewodowej i aplikacji Leica Fotos możliwe jest wykonywanie odbitek z fotografii wykonanych także innymi aparatami Leica. Zdjęcia wyświetlane są na 3-calowym wyświetlaczu.', '', 'aparat-leica-sofort-2-czerwony', '', '', '', 'Aparat Leica SOFORT 2 czerwony', '', '', '', ''),
