pozwala na drukowanie wybranych zdjęć. &lt;/strong&gt;Możesz więc wybrać najlepszy kadr i uzyskać z niego niepowtarzalną odbitkę. &lt;h3&gt;Wyjątkowy design&lt;/h3&gt;&lt;p&gt;Jak każdy produkt Leica, Sofort 2 wyróżnia się &lt;strong&gt;niepowtarzalną stylistyką, dopracowaną w najmniejszym szczególe&lt;/strong&gt;. Dostępny jest w różnych wersjach kolorystycznych, tak aby móc dopasować go do swojego stylu. &lt;div class=cms-template_photo100&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat Leica SOFORT 2 czerwony\"src=//upload.cyfrowe.pl/cyfrowe/products/182486ab2f2.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;p class=short_description itemprop=description&gt;Stylowy aparat natychmiastowy Leica, który umożliwia drukowanie wybranych zdjęć. Dzięki łączności bezprzewodowej i aplikacji Leica Fotos możliwe jest wykonywanie odbitek z fotografii wykonanych także innymi aparatami Leica. Zdjęcia wyświetlane są na 3-calowym wyświetlaczu.', '', 'aparat-leica-sofort-2-czarny', '', '', '', 'Aparat Leica SOFORT 2 czarny', '', '', '', ''),
(33, 1, 1, '&lt;div class=cms-template_title-subtitle&gt;&lt;h2&gt;aparat fujifilm instax mini evo (TYPE C)&lt;/h2&gt;&lt;h3&gt;Kompaktowy aparat cyfrowy z natychmiastowym wydrukiem&lt;/h3&gt;&lt;p&gt;&lt;strong&gt;FujiFilm Instax Mini Evo&lt;/strong&gt; to aparat natychmiastowy gwarantujący niesamowitą kreatywność. W tej wersji został udoskonalony o złącze USB-C. To niezwykle &lt;strong&gt;kompaktowy model, &lt;/strong&gt;dzięki któremu&lt;strong&gt; w kilka sekund otrzymasz odbitkę natychmiastową oraz podzielisz się najlepszymi momentami w mediach społecznościowych. Posiada 10 efektów obiektywu i 10 efektów filmu fotograficznego, &lt;/strong&gt;pozwalające na zabawę z wyglądem zdjęć. Połącz aparat ze swoim smartfonem - miej ustawienia pod kontrolą oraz steruj nimi zdalnie. Świetny design i &lt;strong&gt;kompaktowa konstrukcja &lt;/strong&gt;sprawiają, że z łatwością zabierzesz go w każde miejsce. &lt;/div&gt;&lt;div class=cms-template_photo33-text67&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat FujiFilm Instax Mini Evo\"src=//upload.cyfrowe.pl/cyfrowe/products/11552e5572c.jpg&gt;&lt;/div&gt;&lt;h3&gt;Dostosuj ustawienia obrazów &lt;/h3&gt;&lt;p&gt;&lt;strong&gt;Ustaw ekspozycję, balans bieli, skorzystaj z lampy błyskowej w razie konieczności lub baw się trybem makro,&lt;/strong&gt; aby Twoje zdjęcia były możliwie najbardziej Twoje. Możesz także z łatwością samemu stać się bohaterem własnych zdjęć. Skorzystaj po prostu z&lt;strong&gt; trybu samowyzwalacza. &lt;/strong&gt;&lt;/div&gt;&lt;div class=cms-template_text67-photo33&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat FujiFilm Instax Mini Evo\"src=//upload.cyfrowe.pl/cyfrowe/products/1155935e79e.jpg&gt;&lt;/div&gt;&lt;h3&gt;Połączenie technologii cyfrowej i tradycyjnej&lt;/h3&gt;&lt;p&gt;Hybrydowe aparaty natychmiastowe to doskonałe rozwiązanie dla tych, którzy czują &lt;strong&gt;radość korzystania zarówno z technologii cyfrowej, jak i tradycyjnej&lt;/strong&gt;. Ten model posiada &lt;strong&gt;2-krotnie wyższą rozdzielczość&lt;/strong&gt; w porównaniu z poprzednimi tego typu aparatami natychmiastowymi. Daje Ci dostęp do różnych ciekawych trybów, które nadadzą wyjątkowy charakter Twoich kadrów.&lt;h3&gt;100 sposobów, aby opowiedzieć swoją historię &lt;/h3&gt;&lt;p&gt;Mini Evo da Ci &lt;strong&gt;10 efektów obiektywu i 10 efektów filmu fotograficznego.&lt;/strong&gt; To razem daje &lt;strong&gt;100 kombinacji różnych styli fotografowania, zapewniając ogromne możliwości ekspresji&lt;/strong&gt;. Do tego dochodzi możliwość korzystania z niezwykłych materiałów natychmiastowych Fuji, które zapewniają odbitki o znakomitych barwach i o unikatowej charakterystyce. &lt;/div&gt;&lt;div class=cms-template_text50-text50&gt;&lt;div class=cms-text-column&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat FujiFilm Instax Mini Evo\"src=//upload.cyfrowe.pl/cyfrowe/products/11556d2d07b.jpg&gt;&lt;/div&gt;&lt;h3&gt;10 efektów obiektywu&lt;/h3&gt;&lt;/div&gt;&lt;div class=cms-text-column&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat FujiFilm Instax Mini Evo\"src=//upload.cyfrowe.pl/cyfrowe/products/11557bd3bba.jpg&gt;&lt;/div&gt;&lt;h3&gt;10 efektów filmu fotograficznego&lt;/h3&gt;&lt;/div&gt;&lt;/div&gt;&lt;div class=cms-template_photo33-text67&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat FujiFilm Instax Mini Evo\"src=//upload.cyfrowe.pl/cyfrowe/products/1155184a5dd.jpg&gt;&lt;/div&gt;&lt;h3&gt;Doskonałe wzornictwo&lt;/h3&gt;&lt;p&gt;&lt;strong&gt;FujiFilm Instax Mini Evo&lt;/strong&gt; nie tylko da Ci świetnie wyglądające odbitki, ale również sam doskonale się prezentuje. Jego&lt;strong&gt; design to inspiracje retro i precyzyjne wykończenie.&lt;/strong&gt; Jego wygląd nawiązuje do segmentu premium, dając Ci zawsze radość obcowania z fotografią natychmiastową. &lt;/div&gt;&lt;div class=cms-template_text50-photo50&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat FujiFilm Instax Mini Evo\"src=//upload.cyfrowe.pl/cyfrowe/products/1156161bb77.jpg&gt;&lt;/div&gt;&lt;h3&gt;Drukuj zdjęcia kiedy chcesz&lt;/h3&gt;&lt;p&gt;&lt;strong&gt;Możesz wybrać swoje ulubione kadry i zamienić je w odbitki natychmiastowe. &lt;/strong&gt;Z Mini Evo zrobisz to bardzo stylowo - za pomocą świetnie wyglądającej i bardzo wygodnej dźwigni wydruku. Daje to bardziej świadome doświadczenie fotografii tradycyjnej.&lt;/div&gt;&lt;div class=cms-template_photo50-text50&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat FujiFilm Instax Mini Evo\"src=//upload.cyfrowe.pl/cyfrowe/products/11560b9a84e.jpg&gt;&lt;/div&gt;&lt;h3&gt;Aparat i drukarka do smartfona w 1 urządzeniu&lt;/h3&gt;&lt;p&gt;Hybrydowe aparaty natychmiastowe mają tę ogromną zaletę, że tak naprawdę stanowią&lt;strong&gt; 2 urządzenia w 1&lt;/strong&gt;. &lt;strong&gt;Fotografuj lub po prostu użyj go jako drukarki do fotografii natychmiastowych.&lt;/strong&gt; Wybierz ulubione kadry ze smartfona i zamień je w niepowtarzalne odbitki natychmiastowe. W aplikacji możesz dostosować parametry fotografii, tak aby Twoja kreatywność mogła działać także po naciśnięciu spustu migawki. &lt;/div&gt;&lt;div class=cms-template_text50-text50&gt;&lt;div class=cms-text-column&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat FujiFilm Instax Mini Evo\"src=//upload.cyfrowe.pl/cyfrowe/products/11554236966.jpg&gt;&lt;/div&gt;&lt;h3&gt;Fotografuj zdalnie &lt;/h3&gt;&lt;p&gt;&lt;strong&gt;Aplikacja mobilna i sparowanie aparatu ze smartfonem umożliwia zdalne wyzwalanie migawki. &lt;/strong&gt;Dzięki temu możesz z łatwością robić zdjęcia grupowe czy selfie. Wszędzie tam, gdzie konieczne lub wygodne jest oddalenie się od aparatu, przy jednoczesnym zachowaniu pełnej kontroli. &lt;/div&gt;&lt;div class=cms-text-column&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat FujiFilm Instax Mini Evo\"src=//upload.cyfrowe.pl/cyfrowe/products/11555f24852.jpg&gt;&lt;/div&gt;&lt;h3&gt;Zapis w aplikacji&lt;/h3&gt;&lt;p&gt;Parowanie ze smartfonem pozwala także na&lt;strong&gt; zapisanie każdej wydrukowanej odbitki w formie elektronicznej w pamięci urządzenia mobilnego.&lt;/strong&gt; Teraz możesz natychmiastowo podzielić się nimi w mediach społecznościowych lub wysłać znajomym. &lt;/div&gt;&lt;/div&gt;&lt;p class=short_description itemprop=description&gt;FujiFilm Instax Mini Evo ze złączem USB-C to hybrydowy aparat natychmiastowy, który pozwala na drukowanie zdjęć natychmiastowych lub udostępnianie ich w sieci. Posiada 10 efektów obiektywu i 10 efektów filmu fotograficznego, pozwalające na zabawę z wyglądem zdjęć. Świetny design i kompaktowa konstrukcja sprawiają, że z łatwością zabierzesz go w każde miejsce.', '', 'aparat-fujifilm-instax-mini-evo-type-c', '', '', '', 'Aparat FujiFilm Instax Mini Evo (TYPE C)', '', '', '', ''),
