h społecznościowych lub wysłać znajomym. &lt;/div&gt;&lt;/div&gt;&lt;p class=short_description itemprop=description&gt;FujiFilm Instax Mini Evo to hybrydowy aparat natychmiastowy, który pozwala na drukowanie zdjęć natychmiastowych lub udostępnianie ich w sieci. Posiada 10 efektów obiektywu i 10 efektów filmu fotograficznego, pozwalające na zabawę z wyglądem zdjęć. Świetny design i kompaktowa konstrukcja sprawiają, że z łatwością zabierzesz go w każde miejsce.', '', 'aparat-fujifilm-instax-mini-evo', '', '', '', 'Aparat FujiFilm Instax Mini Evo', '', '', '', '');
INSERT INTO `ps_product_lang` (`id_product`, `id_shop`, `id_lang`, `description`, `description_short`, `link_rewrite`, `meta_description`, `meta_keywords`, `meta_title`, `name`, `available_now`, `available_later`, `delivery_in_stock`, `delivery_out_stock`) VALUES
(35, 1, 1, '&lt;div class=cms-template_title-subtitle&gt;&lt;h2&gt;&lt;strong&gt;Fuji Instax Mini 90 Neo Classic&lt;/strong&gt;&lt;/h2&gt;&lt;h3&gt;&lt;strong&gt;Specjalista od fotografii natychmiastowej&lt;/strong&gt;&lt;/h3&gt;&lt;p&gt;&lt;strong&gt;Seria Instax Mini to proste w obsłudze aparaty&lt;/strong&gt;, których głównym zadaniem jest&lt;strong&gt; sprawianie radości&lt;/strong&gt;, jaka towarzyszy drukowaniu zdjęć od razu po ich naświetleniu. Natchmiastowo wywołane, niepowtarzalne odbitki wielkości karty kredytowej w łatwy i przyjemny sposób umożliwiają dzielenie się ważnymi chwilami z bliskimi . &lt;strong&gt;Daj się wciągnąć w świat analogowej fotografii! &lt;/strong&gt;&lt;/div&gt;&lt;h2&gt;Przeznaczenie&lt;/h2&gt;&lt;p&gt;Instax Mini 90 to &lt;strong&gt;zaawansowany aparat natychmiastowy&lt;/strong&gt;, który oprócz stylowej obudowy oferuje szereg funkcji znanych z tradycyjnych aparatów analogowych. Tryb BULB oraz podwójna ekspozycja umożliwią bardziej &lt;strong&gt;kreatywne wykorzystanie światła&lt;/strong&gt;, co na pewno docenią ambitni fotografowie. Instax Mini 90 to również &lt;strong&gt;świetna zabawa na spotkaniach ze znajomymi i wakacjach&lt;/strong&gt;. Zabierz zapas wkładów światłoczułych na &lt;strong&gt;letni festiwal&lt;/strong&gt;, stwórz &lt;strong&gt;fotobudkę&lt;/strong&gt; na weselu albo wymyśl &lt;strong&gt;własny projekt&lt;/strong&gt; &lt;strong&gt;DIY&lt;/strong&gt;. Uwaga, to wciąga!&lt;div class=\"cms-template_3photos-grid cms-grid cms-grid-3 js-flexbox\"&gt;&lt;div class=cms-box&gt;&lt;div class=box-inner&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/descFiles/feature_img_04288608562.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;div class=cms-box&gt;&lt;div class=box-inner&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/descFiles/feature_img_03812435142.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;div class=cms-box&gt;&lt;div class=box-inner&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/descFiles/IMG_0001a1448917250.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;h2&gt;Cechy i korzyści&lt;/h2&gt;&lt;div class=cms-template_photo33-text67&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/fck_files_n/585239f00b.jpg&gt;&lt;/div&gt;&lt;h3&gt;Wysokiej jakości lampa błyskowa&lt;/h3&gt;&lt;p&gt;Lampa błyskowa automatycznie emituje tyle światła, ile potrzebujesz do uzyskania &lt;strong&gt;idealnej ekspozycji.&lt;/strong&gt; Dostosowuje swoją moc do odległości od obiektu oraz ogólnej jasności otoczenia.&lt;/div&gt;&lt;div class=cms-template_text67-photo33&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/fck_files_n/5851480d1f.jpg&gt;&lt;/div&gt;&lt;h3&gt;Tryb \"impreza\"&lt;/h3&gt;&lt;p&gt;Konwencjonalne aparaty mają tendencję do uzyskiwania ciemnego tła, podczas gdy obiekt na pierwszym planie jest zbyt jasny. Instax mini 90 dostosuje czas otwarcia migawki oraz natężenie błysku lampy do sytuacji. Dzięki temu całe &lt;strong&gt;zdjęcie wygląda naturalnie, nawet wykonywane wieczorem lub w pomieszczeniach.&lt;/strong&gt;&lt;/div&gt;&lt;div class=cms-template_photo33-text67&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/fck_files_n/5850c389a1.jpg&gt;&lt;/div&gt;&lt;h3&gt;Tryb \"dziecko\"&lt;/h3&gt;&lt;p&gt;Korzystaj z tego trybu podczas fotografowania &lt;strong&gt;dynamicznych scen&lt;/strong&gt;, biegających dzieci, ruchliwych zwierząt i innych zmieniających się szybko warunków. Skuteczny również w &lt;strong&gt;słabym oświetleniu&lt;/strong&gt;, we wnętrzach i przy pochmurnej pogodzie.&lt;/div&gt;&lt;div class=cms-template_text67-photo33&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/fck_files_n/5849c5790b.jpg&gt;&lt;/div&gt;&lt;h3&gt;Tryb \"krajobraz\"&lt;/h3&gt;&lt;p&gt;Najlepszy wybór w przypadku zdjęć odległych obiektów. Jeśli temat Twojego zdjęcia znajduje się ponad &lt;strong&gt;3 metry&lt;/strong&gt; od Ciebie, opcja ta zagwarantuje, że &lt;strong&gt;obiekt znajdzie się zakresie głębi ostrości.&lt;/strong&gt;&lt;/div&gt;&lt;div class=cms-template_photo33-text67&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/descFiles/feature002_img_09aa-horz660460801.jpg&gt;&lt;/div&gt;&lt;h3&gt;Tryb \"makro\"&lt;/h3&gt;&lt;p&gt;Tryb makro pozwoli Ci na wykonanie ostrych zdjęć z odległości zaledwie &lt;strong&gt;30 cm&lt;/strong&gt;. Sprawdzi się przy fotografowaniu &lt;strong&gt;kwiatów, jedzenia&lt;/strong&gt; &lt;strong&gt;i innych modnych tematów&lt;/strong&gt;. Pokaż na zdjęciach świat detali, obok których inni przechodzą obojętnie.&lt;/div&gt;&lt;h3&gt;Kontrola jasności&lt;/h3&gt;&lt;p&gt;Aż 4 stopnie regulacji jasności ułatwią Ci wykreowanie własnej wizji i stylu fotografii. Możesz wykonać świetliste zdjęcia &lt;strong&gt;high-key&lt;/strong&gt; tak modne ostatnio w mediach społecznościowych albo &lt;strong&gt;low-key&lt;/strong&gt;, gdy fotografujesz ciemne przedmioty na ciemnym tle.&lt;div class=\"cms-template_4photos-grid cms-grid cms-grid-4 js-flexbox\"&gt;&lt;div class=cms-box&gt;&lt;div class=box-inner&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/fck_files_n/58473f88af.jpg&gt;&lt;/div&gt;&lt;p&gt;Tryb: normalny&lt;/div&gt;&lt;/div&gt;&lt;div class=cms-box&gt;&lt;div class=box-inner&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/fck_files_n/58460c67c5.jpg&gt;&lt;/div&gt;&lt;p&gt;Tryb: jasny&lt;/div&gt;&lt;/div&gt;&lt;div class=cms-box&gt;&lt;div class=box-inner&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/fck_files_n/5844706472.jpg&gt;&lt;/div&gt;&lt;p&gt;Tryb: jasny +&lt;/div&gt;&lt;/div&gt;&lt;div class=cms-box&gt;&lt;div class=box-inner&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/fck_files_n/58485c389c.jpg&gt;&lt;/div&gt;&lt;p&gt;Tryb: ciemny&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;div class=cms-template_text67-photo33&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/fck_files_n/5842619733.jpg&gt;&lt;/div&gt;&lt;h3&gt;&lt;strong&gt;Malowanie światłem - tryb BULB&lt;/strong&gt;&lt;/h3&gt;&lt;p&gt;Zdjęcie powstaje przez cały czas wciskania spustu migawki. Umożliwia to tzw. malowanie światłem  oraz wykonywanie ciekawych zdjęć nocnych. Aby móc wykorzystać pełnię możliwości tego trybu, &lt;strong&gt;aparat wyposażono w gniazdo do montażu na statywie&lt;/strong&gt;.&lt;/div&gt;&lt;div class=cms-template_photo33-text67&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/fck_files_n/5841ad1353.jpg&gt;&lt;/div&gt;&lt;h3&gt;Podwójna ekspozycja&lt;/h3&gt;&lt;p&gt;Naciśnij przycisk wyzwalania migawki dwa razy i zobacz, co stanie się dalej! &lt;strong&gt;Połączenie dwóch zdjęć w jedno pozwoli Ci uzyskać artystyczny efekt&lt;/strong&gt;, niemożliwy do stworzenia w tradycyjny sposób.&lt;/div&gt;&lt;h3&gt;Prosta obsługa&lt;/h3&gt;&lt;div class=\"cms-template_3photos-grid cms-grid cms-grid-3 js-flexbox\"&gt;&lt;div class=cms-box&gt;&lt;div class=box-inner&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/descFiles/feature004_img_011198636084.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;div class=cms-box&gt;&lt;div class=box-inner&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/descFiles/feature004_img_02464133168.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;div class=cms-box&gt;&lt;div class=box-inner&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/descFiles/feature004_img_04-horz1973870878.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;p&gt;Aparat wyposażono w niewielki &lt;strong&gt;ekran LCD&lt;/strong&gt;, ułatwiajacy zmianę trybów kreatywnych. Rozmieszczenie przycisków pozwala na zmianę funkcji bez odrywania aparatu od oka. W przeciwieństwie do pozostałych aparatów Instax Mini zasilany jest przez wymienny akumulator (ładowarka w zestawie), który pozwala na wykonanie około 100 zdjęć na jednym ładowaniu. Wyposażono go również w &lt;strong&gt;gwint statywowy&lt;/strong&gt;, przydatny do korzystania z trybów bulb i podwójnej ekspozycji.&lt;h2&gt;Materiały dodatkowe&lt;/h2&gt;&lt;div class=\"cms-template_grid5 cms-grid cms-grid-5 js-flexbox\"&gt;&lt;div class=cms-box&gt;&lt;div class=box-inner&gt;&lt;div class=cms-photo&gt;&lt;a href=https://upload.cyfrowe.pl/cyfrowe/pdf/Porownianie_aparatow_Fujifilm_Instax.pdf target=_blank&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/descFiles/IMG_00011210383084.jpg&gt;&lt;/a&gt;&lt;/div&gt;&lt;div class=cms-description&gt;&lt;h3&gt;Porównanie serii aparatów Instax&lt;/h3&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;div class=cms-box&gt;&lt;div class=box-inner&gt;&lt;div class=cms-photo&gt;&lt;a href=https://upload.cyfrowe.pl/cyfrowe/pdf/Instax_katalog_A5_2016-09_397078668.pdf target=_blank&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/descFiles/katalogproduktow1312000613.jpg&gt;&lt;/a&gt;&lt;/div&gt;&lt;div class=cms-description&gt;&lt;h3&gt;Katalog produktów Instax Mini, Wide, Square&lt;/h3&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;div class=cms-box&gt;&lt;div class=box-inner&gt;&lt;div class=cms-photo&gt;&lt;a href=https://www.fujifilm.eu/fileadmin/content/instax/download/instaxmini90_manual_01.pdf target=_blank&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/descFiles/instrukcjamini90956981386.jpg&gt;&lt;/a&gt;&lt;/div&gt;&lt;div class=cms-description&gt;&lt;h3&gt;Instrukcja obsługi Instax Mini 90 neo classic&lt;/h3&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;ul&gt;&lt;li&gt;&lt;a href=https://instax.pl/Instax-mini-90.html target=_blank&gt;Opis produktu na polskiej stronie producenta&lt;/a&gt;&lt;li&gt;&lt;a href=http://instax.com/mini90/en/ target=_blank&gt;Opis produktu na zagranicznej stronie producenta&lt;/a&gt;&lt;li&gt;&lt;a href=http://instax.com/mini90/en/guide/double_exposure_mode/ target=_blank&gt;Szczegółowy poradnik fotografowania Instaxem Mini 90 &lt;/a&gt;&lt;li&gt;&lt;a href=http://blog.cyfrowe.pl/2017/12/16/5-pomyslow-na-kreatywne-wykorzystanie-fujifilm-instax/ target=_blank&gt;Kreatywne pomysły na wykorzystanie aparatów FujiFilm Instax - artykuł na blog.cyfrowe.pl&lt;/a&gt;&lt;li&gt;&lt;a href=https://blog.cyfrowe.pl/jakiego-instaxa-kupic/ target=_blank&gt;Jakiego Instaxa kupić? Porównanie wszystkich modeli na blog.cyfrowe.pl &lt;/a&gt;&lt;/ul&gt;&lt;p class=short_description itemprop=description&gt;Instax Mini 90 Neo jest stylowym i niewielkim aparatem natychmiastowym z rodziny Fuji Instax, którego design nawiązuje do klasycznych aparatów analogowych. Korzysta z tych samych wkładów co inne aparaty Instax Mini. Aparat wyposażono w optyczny wizjer oraz wiele trybów ułatwiających fotografowanie w wielu sytuacjach. Zdjęcia z tego modelu mają rozmiar 86 x 54 mm.', '', 'aparat-fujifilm-instax-mini-90-neo-classic-brazowy', '', '', '', 'Aparat FujiFilm Instax Mini 90 Neo Classic brązowy', '', '', '', ''),
