src=//upload.cyfrowe.pl/cyfrowe/descFiles/IMG_0001a1448917250.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;h2&gt;Cechy i korzyści&lt;/h2&gt;&lt;div class=cms-template_photo33-text67&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/fck_files_n/585239f00b.jpg&gt;&lt;/div&gt;&lt;h3&gt;Wysokiej jakości lampa błyskowa&lt;/h3&gt;&lt;p&gt;Lampa błyskowa automatycznie emituje tyle światła, ile potrzebujesz do uzyskania &lt;strong&gt;idealnej ekspozycji.&lt;/strong&gt; Dostosowuje swoją moc do odległości od obiektu oraz ogólnej jasności otoczenia.&lt;/div&gt;&lt;div class=cms-template_text67-photo33&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/fck_files_n/5851480d1f.jpg&gt;&lt;/div&gt;&lt;h3&gt;Tryb \"impreza\"&lt;/h3&gt;&lt;p&gt;Konwencjonalne aparaty mają tendencję do uzyskiwania ciemnego tła, podczas gdy obiekt na pierwszym planie jest zbyt jasny. Instax mini 90 dostosuje czas otwarcia migawki oraz natężenie błysku lampy do sytuacji. Dzięki temu całe &lt;strong&gt;zdjęcie wygląda naturalnie, nawet wykonywane wieczorem lub w pomieszczeniach.&lt;/strong&gt;&lt;/div&gt;&lt;div class=cms-template_photo33-text67&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/fck_files_n/5850c389a1.jpg&gt;&lt;/div&gt;&lt;h3&gt;Tryb \"dziecko\"&lt;/h3&gt;&lt;p&gt;Korzystaj z tego trybu podczas fotografowania &lt;strong&gt;dynamicznych scen&lt;/strong&gt;, biegających dzieci, ruchliwych zwierząt i innych zmieniających się szybko warunków. Skuteczny również w &lt;strong&gt;słabym oświetleniu&lt;/strong&gt;, we wnętrzach i przy pochmurnej pogodzie.&lt;/div&gt;&lt;div class=cms-template_text67-photo33&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/fck_files_n/5849c5790b.jpg&gt;&lt;/div&gt;&lt;h3&gt;Tryb \"krajobraz\"&lt;/h3&gt;&lt;p&gt;Najlepszy wybór w przypadku zdjęć odległych obiektów. Jeśli temat Twojego zdjęcia znajduje się ponad &lt;strong&gt;3 metry&lt;/strong&gt; od Ciebie, opcja ta zagwarantuje, że &lt;strong&gt;obiekt znajdzie się zakresie głębi ostrości.&lt;/strong&gt;&lt;/div&gt;&lt;div class=cms-template_photo33-text67&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/descFiles/feature002_img_09aa-horz660460801.jpg&gt;&lt;/div&gt;&lt;h3&gt;Tryb \"makro\"&lt;/h3&gt;&lt;p&gt;Tryb makro pozwoli Ci na wykonanie ostrych zdjęć z odległości zaledwie &lt;strong&gt;30 cm&lt;/strong&gt;. Sprawdzi się przy fotografowaniu &lt;strong&gt;kwiatów, jedzenia&lt;/strong&gt; &lt;strong&gt;i innych modnych tematów&lt;/strong&gt;. Pokaż na zdjęciach świat detali, obok których inni przechodzą obojętnie.&lt;/div&gt;&lt;h3&gt;Kontrola jasności&lt;/h3&gt;&lt;p&gt;Aż 4 stopnie regulacji jasności ułatwią Ci wykreowanie własnej wizji i stylu fotografii. Możesz wykonać świetliste zdjęcia &lt;strong&gt;high-key&lt;/strong&gt; tak modne ostatnio w mediach społecznościowych albo &lt;strong&gt;low-key&lt;/strong&gt;, gdy fotografujesz ciemne przedmioty na ciemnym tle.&lt;div class=\"cms-template_4photos-grid cms-grid cms-grid-4 js-flexbox\"&gt;&lt;div class=cms-box&gt;&lt;div class=box-inner&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/fck_files_n/58473f88af.jpg&gt;&lt;/div&gt;&lt;p&gt;Tryb: normalny&lt;/div&gt;&lt;/div&gt;&lt;div class=cms-box&gt;&lt;div class=box-inner&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/fck_files_n/58460c67c5.jpg&gt;&lt;/div&gt;&lt;p&gt;Tryb: jasny&lt;/div&gt;&lt;/div&gt;&lt;div class=cms-box&gt;&lt;div class=box-inner&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/fck_files_n/5844706472.jpg&gt;&lt;/div&gt;&lt;p&gt;Tryb: jasny +&lt;/div&gt;&lt;/div&gt;&lt;div class=cms-box&gt;&lt;div class=box-inner&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/fck_files_n/58485c389c.jpg&gt;&lt;/div&gt;&lt;p&gt;Tryb: ciemny&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;div class=cms-template_text67-photo33&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/fck_files_n/5842619733.jpg&gt;&lt;/div&gt;&lt;h3&gt;&lt;strong&gt;Malowanie światłem - tryb BULB&lt;/strong&gt;&lt;/h3&gt;&lt;p&gt;Zdjęcie powstaje przez cały czas wciskania spustu migawki. Umożliwia to tzw. malowanie światłem  oraz wykonywanie ciekawych zdjęć nocnych. Aby móc wykorzystać pełnię możliwości tego trybu, &lt;strong&gt;aparat wyposażono w gniazdo do montażu na statywie&lt;/strong&gt;.&lt;/div&gt;&lt;div class=cms-template_photo33-text67&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/fck_files_n/5841ad1353.jpg&gt;&lt;/div&gt;&lt;h3&gt;Podwójna ekspozycja&lt;/h3&gt;&lt;p&gt;Naciśnij przycisk wyzwalania migawki dwa razy i zobacz, co stanie się dalej! &lt;strong&gt;Połączenie dwóch zdjęć w jedno pozwoli Ci uzyskać artystyczny efekt&lt;/strong&gt;, niemożliwy do stworzenia w tradycyjny sposób.&lt;/div&gt;&lt;h3&gt;Prosta obsługa&lt;/h3&gt;&lt;div class=\"cms-template_3photos-grid cms-grid cms-grid-3 js-flexbox\"&gt;&lt;div class=cms-box&gt;&lt;div class=box-inner&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/descFiles/feature004_img_011198636084.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;div class=cms-box&gt;&lt;div class=box-inner&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/descFiles/feature004_img_02464133168.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;div class=cms-box&gt;&lt;div class=box-inner&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/descFiles/feature004_img_04-horz1973870878.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;p&gt;Aparat wyposażono w niewielki &lt;strong&gt;ekran LCD&lt;/strong&gt;, ułatwiajacy zmianę trybów kreatywnych. Rozmieszczenie przycisków pozwala na zmianę funkcji bez odrywania aparatu od oka. W przeciwieństwie do pozostałych aparatów Instax Mini zasilany jest przez wymienny akumulator (ładowarka w zestawie), który pozwala na wykonanie około 100 zdjęć na jednym ładowaniu. Wyposażono go również w &lt;strong&gt;gwint statywowy&lt;/strong&gt;, przydatny do korzystania z trybów bulb i podwójnej ekspozycji.&lt;h2&gt;Materiały dodatkowe&lt;/h2&gt;&lt;div class=\"cms-template_grid5 cms-grid cms-grid-5 js-flexbox\"&gt;&lt;div class=cms-box&gt;&lt;div class=box-inner&gt;&lt;div class=cms-photo&gt;&lt;a href=https://upload.cyfrowe.pl/cyfrowe/pdf/Porownianie_aparatow_Fujifilm_Instax.pdf target=_blank&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/descFiles/IMG_00011210383084.jpg&gt;&lt;/a&gt;&lt;/div&gt;&lt;div class=cms-description&gt;&lt;h3&gt;Porównanie serii aparatów Instax&lt;/h3&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;div class=cms-box&gt;&lt;div class=box-inner&gt;&lt;div class=cms-photo&gt;&lt;a href=https://upload.cyfrowe.pl/cyfrowe/pdf/Instax_katalog_A5_2016-09_397078668.pdf target=_blank&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/descFiles/katalogproduktow1312000613.jpg&gt;&lt;/a&gt;&lt;/div&gt;&lt;div class=cms-description&gt;&lt;h3&gt;Katalog produktów Instax Mini, Wide, Square&lt;/h3&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;div class=cms-box&gt;&lt;div class=box-inner&gt;&lt;div class=cms-photo&gt;&lt;a href=https://www.fujifilm.eu/fileadmin/content/instax/download/instaxmini90_manual_01.pdf target=_blank&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/descFiles/instrukcjamini90956981386.jpg&gt;&lt;/a&gt;&lt;/div&gt;&lt;div class=cms-description&gt;&lt;h3&gt;Instrukcja obsługi Instax Mini 90 neo classic&lt;/h3&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;ul&gt;&lt;li&gt;&lt;a href=https://instax.pl/Instax-mini-90.html target=_blank&gt;Opis produktu na polskiej stronie producenta&lt;/a&gt;&lt;li&gt;&lt;a href=http://instax.com/mini90/en/ target=_blank&gt;Opis produktu na zagranicznej stronie producenta&lt;/a&gt;&lt;li&gt;&lt;a href=http://instax.com/mini90/en/guide/double_exposure_mode/ target=_blank&gt;Szczegółowy poradnik fotografowania Instaxem Mini 90 &lt;/a&gt;&lt;li&gt;&lt;a href=http://blog.cyfrowe.pl/2017/12/16/5-pomyslow-na-kreatywne-wykorzystanie-fujifilm-instax/ target=_blank&gt;Kreatywne pomysły na wykorzystanie aparatów FujiFilm Instax - artykuł na blog.cyfrowe.pl&lt;/a&gt;&lt;li&gt;&lt;a href=https://blog.cyfrowe.pl/jakiego-instaxa-kupic/ target=_blank&gt;Jakiego Instaxa kupić? Porównanie wszystkich modeli na blog.cyfrowe.pl &lt;/a&gt;&lt;/ul&gt;&lt;p class=short_description itemprop=description&gt;Model Mini 90 Neo Classic to kolejny aparat z funkcją natychmiastowego wydruku z serii Instax. Swoim stylowym wyglądem odnosi się do tradycyjnych aparatów analogowych, co dodatkowo podnosi jego atrakcyjność.', '', 'aparat-fujifilm-instax-mini-90-neo-classic-czarny', '', '', '', 'Aparat FujiFilm Instax Mini 90 Neo Classic czarny', '', '', '', ''),
(37, 1, 1, '&lt;div class=cms-template_title-subtitle&gt;&lt;h2&gt;aparat natychmiastowy polaroid now+&lt;/h2&gt;&lt;h3&gt;Udoskonalona wersja kultowego aparatu natychmiastowego &lt;/h3&gt;&lt;p&gt;&lt;strong&gt;Nowa, ulepszona konstrukcja Polaroid Now+ &lt;/strong&gt;oferuje wszystkie ulubione funkcje, takie jak np. &lt;strong&gt;autofokus, dynamiczna lampa błyskowa czy samowyzwalacz&lt;/strong&gt;. Teraz jednak została uzupełniona o&lt;strong&gt; mocowanie statywowe&lt;/strong&gt;, aby było Ci jeszcze łatwiej utrwalać Twoje wszystkie pomysły. Polaroid Now+ to sprzymierzeniec Twojej kreatywności. &lt;/div&gt;&lt;div class=cms-template_text50-photo50&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat Polaroid Now+ czarny\"src=//upload.cyfrowe.pl/cyfrowe/products/9528b67be3.jpg&gt;&lt;/div&gt;&lt;h3&gt;Udoskonalona wersja, kultowe rozwiązania&lt;/h3&gt;&lt;p&gt;Polaroid Now+ posiada kilka naprawdę ekscytujących funkcji. Jedną z nich jest&lt;strong&gt; możliwość podłączenia go do smartfona i zaktualizowana aplikacja Polaroid.&lt;/strong&gt;Wystarczy otworzyć apkę i wybierać spośród wielu różnych kreatywnych funkcji - malowanie światłem, podwójna ekspozycja, tryb ręczny itp. Udoskonalona aplikacja posiada 2 nowe funkcje - &lt;strong&gt;fotografowanie z priorytetem przysłony i tryb fotografowania ze statywem. &lt;/strong&gt;&lt;h3&gt;Zestaw filtrów do obiektywu &lt;/h3&gt;&lt;p&gt;Aparat jest dostarczany z zestawem filtrów do obiektywu. &lt;strong&gt;5 filtrów optycznych,&lt;/strong&gt; które można z łatwością zamocować na obiektywie. &lt;strong&gt;Nasycaj swoje zdjęcia kolorami, pogłębiaj kontrast lub dodawaj nowe efekty wizualne dzięki filtrom eksperymentalnym, takim jak rozbłysk gwiazdy, czerwona winieta czy filtry kolorowe&lt;/strong&gt; (pomarańczowy, niebieski i żółty). Zestaw filtrów jest w dodatku dostarczany z futerałem ułatwiającym przenoszenie. &lt;/div&gt;&lt;h3&gt;Świetna lampa błyskowa&lt;/h3&gt;&lt;p&gt;Wyróżnikiem Polaroid Now+ jest &lt;strong&gt;precyzyjna lampa błyskowa&lt;/strong&gt;, która pracuje z uwzględnieniem warunków oświetleniowych. Pozwala więc na uzyskanie doskonałych rezultatów nawet w słabszych warunkach oświetleniowych. Polaroid Now+ &lt;strong&gt;może się również pochwalić długą żywotnością akumulatora&lt;/strong&gt;. Bateria pozwala na zarejestrowanie aż 15 paczek z materiałem światłoczułym, co sprawia, że Polaroid Now+ to doskonały towarzysz podróży. &lt;p class=short_description itemprop=description&gt;Udoskonalona wersja słynnego aparatu natychmiastowego. Posiada system AF, precyzyjną lampę błyskową, tryb podwójnej ekspozycji czy mocowanie statywowe. Istnieje możliwość połączenia go ze smartfonem.', '', 'aparat-polaroid-now-czarny', '', '', '', 'Aparat Polaroid Now+ czarny', '', '', '', ''),
(38, 1, 1, '&lt;div class=cms-template_title-subtitle&gt;&lt;h2&gt;aparat natychmiastowy polaroid now+&lt;/h2&gt;&lt;h3&gt;Udoskonalona wersja kultowego aparatu natychmiastowego &lt;/h3&gt;&lt;p&gt;&lt;strong&gt;Nowa, ulepszona konstrukcja Polaroid Now+ &lt;/strong&gt;oferuje wszystkie ulubione funkcje, takie jak np. &lt;strong&gt;autofokus, dynamiczna lampa błyskowa czy samowyzwalac&lt;/strong&gt;z. Teraz jednak została uzupełniona o&lt;strong&gt; mocowanie statywowe&lt;/strong&gt;, aby było Ci jeszcze łatwiej utrwalać Twoje wszystkie pomysły. Polaroid Now+ to sprzymierzeniec Twojej kreatywności. &lt;/div&gt;&lt;div class=cms-template_text50-photo50&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat Polaroid Now+ czarny\"src=//upload.cyfrowe.pl/cyfrowe/products/9528b67be3.jpg&gt;&lt;/div&gt;&lt;h3&gt;Udoskonalona wersja, kultowe rozwiązania&lt;/h3&gt;&lt;p&gt;Polaroid Now+ posiada kilka naprawdę ekscytujących funkcji. Jedną z nich jest&lt;strong&gt; możliwość podłączenia go do smartfona i zaktualizowana aplikacja Polaroid.&lt;/strong&gt;Wystarczy otworzyć apkę i wybierać spośród wielu różnych kreatywnych funkcji - malowanie światłem, podwójna ekspozycja, tryb ręczny itp. Udoskonalona aplikacja posiada 2 nowe funkcje - &lt;strong&gt;fotografowanie z priorytetem przysłony i tryb fotografowania ze statywem. &lt;/strong&gt;&lt;h3&gt;Zestaw filtrów do obiektywu &lt;/h3&gt;&lt;p&gt;Aparat jest dostarczany z zestawem filtrów do obiektywu. &lt;strong&gt;5 filtrów optycznych,&lt;/strong&gt; które można z łatwością zamocować na obiektywie. &lt;strong&gt;Nasycaj swoje zdjęcia kolorami, pogłębiaj kontrast lub dodawaj nowe efekty wizualne dzięki filtrom eksperymentalnym, takim jak rozbłysk gwiazdy, czerwona winieta czy filtry kolorowe&lt;/strong&gt; (pomarańczowy, niebieski i żółty). Zestaw filtrów jest w dodatku dostarczany z futerałem ułatwiającym przenoszenie. &lt;/div&gt;&lt;h3&gt;Świetna lampa błyskowa&lt;/h3&gt;&lt;p&gt;Wyróżnikiem Polaroid Now+ jest &lt;strong&gt;precyzyjna lampa błyskowa&lt;/strong&gt;, która pracuje z uwzględnieniem warunków oświetleniowych. Pozwala więc na uzyskanie doskonałych rezultatów nawet w słabszych warunkach oświetleniowych. Polaroid Now+ &lt;strong&gt;może się również pochwalić długą żywotnością akumulatora&lt;/strong&gt;. Bateria pozwala na zarejestrowanie aż 15 paczek z materiałem światłoczułym, co sprawia, że Polaroid Now+ to doskonały towarzysz podróży. &lt;p class=short_description itemprop=description&gt;Udoskonalona wersja słynnego aparatu natychmiastowego. Posiada system AF, precyzyjną lampę błyskową, tryb podwójnej ekspozycji czy mocowanie statywowe. Istnieje możliwość połączenia go ze smartfonem.', '', 'aparat-polaroid-now-niebieski', '', '', '', 'Aparat Polaroid Now+ niebieski', '', '', '', ''),
(39, 1, 1, '&lt;div class=cms-template_title-subtitle&gt;&lt;h2&gt;aparat natychmiastowy polaroid now+&lt;/h2&gt;&lt;h3&gt;Udoskonalona wersja kultowego aparatu natychmiastowego &lt;/h3&gt;&lt;p&gt;&lt;strong&gt;Nowa, ulepszona konstrukcja Polaroid Now+ &lt;/strong&gt;oferuje wszystkie ulubione funkcje, takie jak np. &lt;strong&gt;autofokus, dynamiczna lampa błyskowa czy samowyzwalac&lt;/strong&gt;z. Teraz jednak została uzupełniona o&lt;strong&gt; mocowanie statywowe&lt;/strong&gt;, aby było Ci jeszcze łatwiej utrwalać Twoje wszystkie pomysły. Polaroid Now+ to sprzymierzeniec Twojej kreatywności. &lt;/div&gt;&lt;div class=cms-template_text50-photo50&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat Polaroid Now+ czarny\"src=//upload.cyfrowe.pl/cyfrowe/products/9528b67be3.jpg&gt;&lt;/div&gt;&lt;h3&gt;Udoskonalona wersja, kultowe rozwiązania&lt;/h3&gt;&lt;p&gt;Polaroid Now+ posiada kilka naprawdę ekscytujących funkcji. Jedną z nich jest&lt;strong&gt; możliwość podłączenia go do smartfona i zaktualizowana aplikacja Polaroid.&lt;/strong&gt;Wystarczy otworzyć apkę i wybierać spośród wielu różnych kreatywnych funkcji - malowanie światłem, podwójna ekspozycja, tryb ręczny itp. Udoskonalona aplikacja posiada 2 nowe funkcje - &lt;strong&gt;fotografowanie z priorytetem przysłony i tryb fotografowania ze statywem. &lt;/strong&gt;&lt;h3&gt;Zestaw filtrów do obiektywu &lt;/h3&gt;&lt;p&gt;Aparat jest dostarczany z zestawem filtrów do obiektywu. &lt;strong&gt;5 filtrów optycznych,&lt;/strong&gt; które można z łatwością zamocować na obiektywie. &lt;strong&gt;Nasycaj swoje zdjęcia kolorami, pogłębiaj kontrast lub dodawaj nowe efekty wizualne dzięki filtrom eksperymentalnym, takim jak rozbłysk gwiazdy, czerwona winieta czy filtry kolorowe&lt;/strong&gt; (pomarańczowy, niebieski i żółty). Zestaw filtrów jest w dodatku dostarczany z futerałem ułatwiającym przenoszenie. &lt;/div&gt;&lt;h3&gt;Świetna lampa błyskowa&lt;/h3&gt;&lt;p&gt;Wyróżnikiem Polaroid Now+ jest &lt;strong&gt;precyzyjna lampa błyskowa&lt;/strong&gt;, która pracuje z uwzględnieniem warunków oświetleniowych. Pozwala więc na uzyskanie doskonałych rezultatów nawet w słabszych warunkach oświetleniowych. Polaroid Now+ &lt;strong&gt;może się również pochwalić długą żywotnością akumulatora&lt;/strong&gt;. Bateria pozwala na zarejestrowanie aż 15 paczek z materiałem światłoczułym, co sprawia, że Polaroid Now+ to doskonały towarzysz podróży. &lt;p class=short_description itemprop=description&gt;Udoskonalona wersja słynnego aparatu natychmiastowego. Posiada system AF, precyzyjną lampę błyskową, tryb podwójnej ekspozycji czy mocowanie statywowe. Istnieje możliwość połączenia go ze smartfonem.', '', 'aparat-polaroid-now-bialy', '', '', '', 'Aparat Polaroid Now+ biały', '', '', '', ''),
(40, 1, 1, '&lt;div class=cms-template_title-subtitle&gt;&lt;h2&gt;Fujifilm instax mini 11 box&lt;/h2&gt;&lt;h3&gt;Idealny zestaw dla każdego kto chce rozpocząć przygodę z fotografią natychmiastową &lt;/h3&gt;&lt;p&gt;Zestaw Instax zawierający aparat FujiFilm Instax Mini 11 i wkład pozwalający na wykonanie 10 zdjęć. Dzięki temu możesz natychmiast rozpocząć przygodę z fotografią natychmiastową. Dodatkowe funkcje takie jak lusterko do selfie czy nakładka makro sprawiają, że możesz cieszyć się aparatem od razu po wyjęciu z pudełka.&lt;/div&gt;&lt;h3&gt;Skład zestawu:&lt;/h3&gt;&lt;ul&gt;&lt;li&gt;aparat do fotografii natychmiastowej FujiFilm Instax11 Mini&lt;li&gt;materiał światłoczuły Instax Mini (10 sztuk)&lt;/ul&gt;&lt;h3&gt;FujiFilm Instax Mini 11 &lt;/h3&gt;&lt;h3&gt;Następca kultowego aparatu natychmiastowego&lt;/h3&gt;&lt;p&gt;Aparaty FujiFilm Instax to już kultowe urządzenia! W szczególności ikoną stał się model Mini - aparat natychmiastowy, który zyskał uznanie entuzjastów fotografii na całym świecie! Teraz dostępny jest w nowej odsłonie, która pozwala na jeszcze łatwiejsze wykonywanie świetnych zdjęć natychmiastowych.   &lt;div class=cms-template_photo100&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/products/248295a18c.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;div class=cms-template_photo50-text50&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/products/2484553560.jpg&gt;&lt;/div&gt;&lt;h3&gt;Zdjęcia natychmiastowe jeszcze nigdy nie były tak proste&lt;/h3&gt;&lt;p&gt;Fujifilm Instax Mini 11 posiada wbudowaną lampę błyskową i automatycznie analizuje jasność otoczenia, dopasowując parametry ekspozycji tak, aby zapewnić odpowiedni balans pomiędzy jasnością pierszego planu i tła. Dzięki temu Twoje zdjęcia będą zawsze świetnie wyglądać, nawet jeśli będziesz robić zdjęcia na imprezie. &lt;/div&gt;&lt;div class=cms-template_photo100&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/products/2483967398.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;div class=cms-template_text50-photo50&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/products/24851e99e9.jpg&gt;&lt;/div&gt;&lt;h3&gt;Udoskonalony tryb selfie&lt;/h3&gt;&lt;p&gt;Przełącz pierścień na obiektywie, aby aktywować tryb selfie. Wykorzystaj lusterko, aby uzyskać doskonałe autoportrety lub zdjęcia z przyjaciółmi. Tryb selfie pozwala także na wykonywanie doskonałych zdjęć zbliżeniowych. Skorzystaj z niego podczas rejestrowania obiektów znajdujących się w odległości 30-50 cm od aparatu. &lt;/div&gt;&lt;h3&gt;Wyraź siebie&lt;/h3&gt;&lt;p&gt;Aparat Fujifilm Instax Mini 11 możesz dopasować do swojego stylu. Wybierz swoją ulubioną wersję kolorystyczną i dobierz wyjątkowe, oryginalne dodatki.Możesz dobrać idealnie pasujący pasek lub zamontować stylową nakładkę na spust migawki. Dodatkowo do dyspozycji masz pokrowce utrzymane w kolorystyce aparatu czy albumy, umożliwiające Ci zgromadzenie Twoich najlepszych wspomnień.&lt;h3 style=\"text-align: center;\"class=background-block-gray&gt;Wkład na 10 zdjęć - na dobry początek!&lt;/h3&gt;&lt;div class=cms-template_photo50-text50&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/descFiles/opeopepepepepepe1273109190.jpg&gt;&lt;/div&gt;&lt;h3&gt;Prosty w użyciu&lt;/h3&gt;&lt;p&gt;Światłoszczelna &lt;strong&gt;kasetka chroni papier przed szkodliwym działaniem czynników zewnętrznych&lt;/strong&gt;. Wystarczy włożyć ją do komory aparatu, zatrzasnąć klapkę i nacisnąć spust migawki. &lt;strong&gt;Po wykonaniu 10 zdjęć należy wymienić kasetkę na nową. &lt;/strong&gt;&lt;h3&gt;Natychmiastowa odbitka&lt;/h3&gt;&lt;p&gt;W dobie fotografii cyfrowej &lt;strong&gt;możliwość obejrzenia prawdziwej odbitki zaraz po wykonaniu zdjęcia jest czymś naprawdę wyjątkowym.&lt;/strong&gt; Doskonałej jakości odbitka będzie gotowa po około 90 sekundach. Im wyższa temperatura otoczenia, tym obraz powstanie szybciej.&lt;/div&gt;&lt;div class=cms-template_text50-photo50&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/descFiles/09093a4626f1c8d3a469060a509bdf6d530565404.jpg&gt;&lt;/div&gt;&lt;h3 class=western&gt;Zdjęcie z dedykacją&lt;/h3&gt;&lt;p&gt;Zanotuj na białej ramce, kiedy powstało zdjęcie albo napisz na niej dedykację dla przyjaciół.&lt;h3&gt;Kieszonkowy format&lt;/h3&gt;&lt;p&gt;Odbitka wielkości karty kredytowej to świetny sposób na to, by najpiękniejsze wspomnienia i najbliższe osoby mieć zawsze przy sobie, np. w portfelu.&lt;/div&gt;&lt;ul&gt;&lt;li&gt;&lt;a href=https://instax.pl/ target=_blank&gt;Polska strona producenta &lt;/a&gt;&lt;li&gt;&lt;a href=http://instax.com/ target=_blank&gt;Zagraniczna strona producenta&lt;/a&gt;&lt;li&gt;&lt;a href=http://blog.cyfrowe.pl/2017/12/16/5-pomyslow-na-kreatywne-wykorzystanie-fujifilm-instax/ target=_blank&gt;5 pomysłów na kreatywne wykorzystanie FujiFilm Instax - artykuł na Bog.cyfrowe.pl&lt;/a&gt;&lt;li&gt;&lt;a href=https://blog.cyfrowe.pl/jakiego-instaxa-kupic/ target=_blank&gt;Jakiego Instaxa kupić? Porównanie wszystkich modeli na blog.cyfrowe.pl &lt;/a&gt;&lt;/ul&gt;&lt;p class=short_description itemprop=description&gt;Zestaw Instax zawierający aparat FujiFilm Instax Mini 11 i wkład pozwalający na wykonanie 10 zdjęć. Dzięki temu możesz natychmiast rozpocząć przygodę z fotografią natychmiastową. Dodatkowe funkcje takie jak lusterko do selfie czy nakładka makro sprawiają, że możesz cieszyć się aparatem od razu po wyjęciu z pudełka.', '', 'aparat-fujifilm-instax-box-mini-11-fioletowy-wklad-10szt', '', '', '', 'Aparat FujiFilm Instax BOX Mini 11 fioletowy + wkład 10szt', '', '', '', ''),
