(42, 1, 1, '&lt;div class=cms-template_title-subtitle&gt;&lt;h2&gt;FujiFIlm Instax mini 11&lt;/h2&gt;&lt;h3&gt;Następca kultowego aparatu natychmiastowego&lt;/h3&gt;&lt;p&gt;Aparaty FujiFilm Instax to już kultowe urządzenia! W szczególności ikoną stał się model Mini - aparat natychmiastowy, który zyskał uznanie entuzjastów fotografii na całym świecie! Teraz dostępny jest w nowej odsłonie, która pozwala na jeszcze łatwiejsze wykonywanie świetnych zdjęć natychmiastowych. &lt;/div&gt;&lt;div class=cms-template_photo100&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/products/248295a18c.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;div class=cms-template_photo50-text50&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/products/2484553560.jpg&gt;&lt;/div&gt;&lt;h3&gt;Zdjęcia natychmiastowe jeszcze nigdy nie były tak proste&lt;/h3&gt;&lt;p&gt;Fujifilm Instax Mini 11 posiada wbudowaną lampę błyskową i automatycznie analizuje jasność otoczenia, dopasowując parametry ekspozycji tak, aby zapewnić odpowiedni balans pomiędzy jasnością pierszego planu i tła. Dzięki temu Twoje zdjęcia będą zawsze świetnie wyglądać, nawet jeśli będziesz robić zdjęcia na imprezie. &lt;/div&gt;&lt;div class=cms-template_photo100&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/products/2483967398.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;div class=cms-template_text50-photo50&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/products/24851e99e9.jpg&gt;&lt;/div&gt;&lt;h3&gt;Udoskonalony tryb selfie&lt;/h3&gt;&lt;p&gt;Przełącz pierścień na obiektywie, aby aktywować tryb selfie. Wykorzystaj lusterko, aby uzyskać doskonałe autoportrety lub zdjęcia z przyjaciółmi. Tryb selfie pozwala także na wykonywanie doskonałych zdjęć zbliżeniowych. Skorzystaj z niego podczas rejestrowania obiektów znajdujących się w odległości 30-50 cm od aparatu. &lt;/div&gt;&lt;h3&gt;Wyraź siebie&lt;/h3&gt;&lt;p&gt;Aparat Fujifilm Instax Mini 11 możesz dopasować do swojego stylu. Wybierz swoją ulubioną wersję kolorystyczną i dobierz wyjątkowe, oryginalne dodatki.Możesz dobrać idealnie pasujący pasek lub zamontować stylową nakładkę na spust migawki. Dodatkowo do dyspozycji masz pokrowce utrzymane w kolorystyce aparatu czy albumy, umożliwiające Ci zgromadzenie Twoich najlepszych wspomnień.&lt;ul&gt;&lt;li&gt;&lt;a href=https://blog.cyfrowe.pl/jakiego-instaxa-kupic/ target=_blank&gt;Jakiego Instaxa kupić? Porównanie wszystkich modeli na blog.cyfrowe.pl &lt;/a&gt;&lt;/ul&gt;&lt;p class=short_description itemprop=description&gt;Fujifilm Instax Mini 11 to następca kultowego aparatu. Posiada udoskonalony tryb automatyczny i selfie. W trybie selfie możesz także wykonywać świetne zdjęcia zbliżeniowe (obiektów znajdujących się od obiektywu w odległości 30-50 cm). Fujifilm Instax Mini 11 jest dostępny w kilku wersjach kolorystycznych, dzięki czemu z łatwością dopasujesz go do swojego stylu.', '', 'aparat-fujifilm-instax-mini-11-niebieski', '', '', '', 'Aparat FujiFilm Instax Mini 11 niebieski', '', '', '', ''),
(43, 1, 1, '&lt;div class=cms-template_title-subtitle&gt;&lt;h2&gt;FujiFIlm Instax mini 11&lt;/h2&gt;&lt;h3&gt;Następca kultowego aparatu natychmiastowego&lt;/h3&gt;&lt;p&gt;Aparaty FujiFilm Instax to już kultowe urządzenia! W szczególności ikoną stał się model Mini - aparat natychmiastowy, który zyskał uznanie entuzjastów fotografii na całym świecie! Teraz dostępny jest w nowej odsłonie, która pozwala na jeszcze łatwiejsze wykonywanie świetnych zdjęć natychmiastowych. &lt;/div&gt;&lt;div class=cms-template_photo100&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/products/248295a18c.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;div class=cms-template_photo50-text50&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/products/2484553560.jpg&gt;&lt;/div&gt;&lt;h3&gt;Zdjęcia natychmiastowe jeszcze nigdy nie były tak proste&lt;/h3&gt;&lt;p&gt;Fujifilm Instax Mini 11 posiada wbudowaną lampę błyskową i automatycznie analizuje jasność otoczenia, dopasowując parametry ekspozycji tak, aby zapewnić odpowiedni balans pomiędzy jasnością pierszego planu i tła. Dzięki temu Twoje zdjęcia będą zawsze świetnie wyglądać, nawet jeśli będziesz robić zdjęcia na imprezie. &lt;/div&gt;&lt;div class=cms-template_photo100&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/products/2483967398.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;div class=cms-template_text50-photo50&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/products/24851e99e9.jpg&gt;&lt;/div&gt;&lt;h3&gt;Udoskonalony tryb selfie&lt;/h3&gt;&lt;p&gt;Przełącz pierścień na obiektywie, aby aktywować tryb selfie. Wykorzystaj lusterko, aby uzyskać doskonałe autoportrety lub zdjęcia z przyjaciółmi. Tryb selfie pozwala także na wykonywanie doskonałych zdjęć zbliżeniowych. Skorzystaj z niego podczas rejestrowania obiektów znajdujących się w odległości 30-50 cm od aparatu. &lt;/div&gt;&lt;h3&gt;Wyraź siebie&lt;/h3&gt;&lt;p&gt;Aparat Fujifilm Instax Mini 11 możesz dopasować do swojego stylu. Wybierz swoją ulubioną wersję kolorystyczną i dobierz wyjątkowe, oryginalne dodatki.Możesz dobrać idealnie pasujący pasek lub zamontować stylową nakładkę na spust migawki. Dodatkowo do dyspozycji masz pokrowce utrzymane w kolorystyce aparatu czy albumy, umożliwiające Ci zgromadzenie Twoich najlepszych wspomnień.&lt;ul&gt;&lt;li&gt;&lt;a href=https://blog.cyfrowe.pl/jakiego-instaxa-kupic/ target=_blank&gt;Jakiego Instaxa kupić? Porównanie wszystkich modeli na blog.cyfrowe.pl &lt;/a&gt;&lt;/ul&gt;&lt;p class=short_description itemprop=description&gt;Fujifilm Instax Mini 11 to następca kultowego aparatu. Posiada udoskonalony tryb automatyczny i selfie. W trybie selfie możesz także wykonywać świetne zdjęcia zbliżeniowe (obiektów znajdujących się od obiektywu w odległości 30-50 cm). Fujifilm Instax Mini 11 jest dostępny w kilku wersjach kolorystycznych, dzięki czemu z łatwością dopasujesz go do swojego stylu.', '', 'aparat-fujifilm-instax-mini-11-szary', '', '', '', 'Aparat FujiFilm Instax Mini 11 szary', '', '', '', '');
INSERT INTO `ps_product_lang` (`id_product`, `id_shop`, `id_lang`, `description`, `description_short`, `link_rewrite`, `meta_description`, `meta_keywords`, `meta_title`, `name`, `available_now`, `available_later`, `delivery_in_stock`, `delivery_out_stock`) VALUES
(44, 1, 1, '&lt;div class=cms-template_title-subtitle&gt;&lt;h2&gt;&lt;strong&gt;Fuji Instax Wide 300&lt;/strong&gt;&lt;/h2&gt;&lt;h3&gt;Chwytaj cenne momenty w szerszym spojrzeniu&lt;/h3&gt;&lt;p&gt;&lt;strong&gt; Instax Wide to proste w obsłudze aparaty&lt;/strong&gt;, które są doskonałym towarzyszem wszelkich spotkań i imprez. W dobie fotografii cyfrowej, możliwość obejrzenia prawdziwej odbitki od razu po naciśnięciu spustu migawki sprawia wszystkim dużo radości. Większy niż w serii Mini rozmiar papieru światłoczułego pozwala na rejestrowanie cennych chwil w lepszej jakości i ułatwia dzielenie się nimi z przyjaciółmi. &lt;strong&gt;Przyjmij zaproszenie do świata analogowej fotografii!&lt;/strong&gt;&lt;/div&gt;&lt;div class=cms-template_photo80&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/fck_files/pic_01.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;h2 style=\"text-align: justify;\"&gt;Przeznaczenie&lt;/h2&gt;&lt;p&gt;Instax Wide 300 robi zdjęcia dwukrotnie większe niż aparaty z serii Instax Mini, co sprawia, że &lt;strong&gt;w kadrze zmieści się więcej osób a emocje i uśmiechy na ich twarzach będą lepiej widoczne&lt;/strong&gt;. Wykonane odbitki możesz od razu włożyć do albumu, udekorować nimi dom lub podpisać i podarować znajomym. Połączenie zaawansowanych funkcji z prostotą obsługi zadowoli nawet ambitnych fotografów ani nie sprawi trudności dzieciom. Zabierz zapas odbitek na&lt;strong&gt; wakacje&lt;/strong&gt;, stwórz &lt;strong&gt;fotobudkę&lt;/strong&gt; na urodzinowym przyjęciu albo wymyśl &lt;strong&gt;własny projekt&lt;/strong&gt; &lt;strong&gt;DIY&lt;/strong&gt;. Frajda gwarantowana!&lt;div class=\"cms-template_3photos-grid cms-grid cms-grid-3 js-flexbox\"&gt;&lt;div class=cms-box&gt;&lt;div class=box-inner&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/descFiles/feature_img_081869585461.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;div class=cms-box&gt;&lt;div class=box-inner&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/descFiles/feature_img_09611747560.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;div class=cms-box&gt;&lt;div class=box-inner&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/descFiles/feature_img_102116103424.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;h2&gt;Cechy i korzyści&lt;/h2&gt;&lt;div class=cms-template_photo50-text50&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/descFiles/instaxwide259584157.jpg&gt;&lt;/div&gt;&lt;h3&gt;Banalnie prosta obsługa&lt;/h3&gt;&lt;p&gt;Fotografowanie aparetm Instax Wide 300 jest bardzo proste i przyjemne. &lt;strong&gt;Jego obsługę opanują nawet kilkuletnie dzieci. Nie sprawi też trudności osobom starszym. &lt;/strong&gt;Wystarczy włączyć zasilanie i nacisnąć spust migawki, a zdjęcie automatycznie wysunie się z górnej części korpusu.&lt;h3&gt;Ergonomia&lt;/h3&gt;&lt;p&gt;Aparat wyposażono w specjalny uchwyt, aby lepiej leżał w dłoni. Przycisk wyzwalania migawki znajdujący się na gripie, sprawia, że korzystanie z niego jest bardzo wygodne.&lt;h3&gt;Natychmiastowa odbitka&lt;/h3&gt;&lt;p&gt;Na początkowo białej karcie, po kilku sekundach zacznie pojawiać się obraz. Doskonałej jakości odbitka będzie gotowa po około 90 sekundach (zależnie od temperatury otoczenia). W świecie, w którym powstają gigabajty cyfrowych, nudnych zdjęć, możliwość obejrzenia prawdziwej odbitki zaraz po naciśnięciu spustu migawki robi na wszystkich ogromne wrażenie.&lt;/div&gt;&lt;div class=cms-template_text67-photo33&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/descFiles/feature_img_02388249436.jpg&gt;&lt;/div&gt;&lt;h3&gt;Zdjęcie z dedykacją&lt;/h3&gt;&lt;p&gt;Biała ramka otaczająca obraz jest podatna na atrament, dzięki czemu możesz zanotować na niej, kiedy powstało zdjęcie albo zostawić dedykację dla przyjaciół.&lt;h3&gt;Regulacja strefy ostrości&lt;/h3&gt;&lt;p&gt;&lt;strong&gt;Żeby wykonywać wyraziste i ostre zdjęcia tematyczne, skorzystaj z różnych ustawień autofokusa. &lt;/strong&gt;Standardowe ustawienia pozwalają na wykonywanie zdjęć od 90 cm do 3 m od obiektu, co jest doskonałe w przypadku &lt;strong&gt;portretów&lt;/strong&gt;. Żeby uwiecznić &lt;strong&gt;scenę krajobrazową&lt;/strong&gt; lub rzeczy, które znajdują się dalej niż 3 metry od aparatu, przekręć pierścień obiektywu na daną funkcję.&lt;h3&gt;Nakładka makro&lt;/h3&gt;&lt;p&gt;Do fotografowania &lt;strong&gt;zbliżeń i robienia selfie&lt;/strong&gt; służy natomiast specjalna &lt;strong&gt;nakładka makro&lt;/strong&gt;, którą znajdziesz w zestawie. Łapie ostrość już od 40 cm.&lt;/div&gt;&lt;div class=cms-template_photo33-text67&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/descFiles/feature_img_031008485791.jpg&gt;&lt;/div&gt;&lt;h3&gt;Idealne selfie&lt;/h3&gt;&lt;p&gt;Zamontuj nakładkę do zbliżeń na obiektywie aparatu zanim zaczniesz robić selfie. Znajdujące się na niej mini lusterko pozwoli Ci ustawić najatrakcyjniejszy kąt widzenia.&lt;/div&gt;&lt;div class=cms-template_text67-photo33&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/descFiles/feature_img_041837131383.jpg&gt;&lt;/div&gt;&lt;h3&gt;Zaawansowana kontrola ekspozycji&lt;/h3&gt;&lt;p&gt;Lampa błyskowa wyzwalana jest automatycznie, gdy aparat wykryje, że ilość światła jest niewystarczająca i dobiera jej siłę błysku do warunków. Dla uzyskania innego efektu możesz ją całkowicie wyłączyć lub wykorzystać błysk dopełniający, który lekko muśnie pierwszy plan, tło rejestrująć w naturalnych kolorach. Do Twojej dyspozycji są też tryby high i low key.&lt;/div&gt;&lt;h3 style=\"text-align: justify;\"&gt;Zrób zapas wkładów - to wciąga!&lt;/h3&gt;&lt;p style=text-align:justify&gt;Aby móc fotografować aparatem Instax Wide 300, należy wyposażyć się we wkład z papierem &lt;strong&gt;Fujifilm Instax Wide&lt;/strong&gt; (rozmiar papieru: 108 x 86mm, obszar obrazu:62 x 99mm). Aparat zasilany jest &lt;strong&gt;czterema bateriami AA&lt;/strong&gt;, co daje możliwość wykonania około &lt;strong&gt;100 zdjęć&lt;/strong&gt;.&lt;h2&gt;Materiały dodatkowe&lt;/h2&gt;&lt;div class=\"cms-template_grid5 cms-grid cms-grid-5 js-flexbox\"&gt;&lt;div class=cms-box&gt;&lt;div class=box-inner&gt;&lt;div class=cms-photo&gt;&lt;a href=https://upload.cyfrowe.pl/cyfrowe/pdf/Porownianie_aparatow_Fujifilm_Instax.pdf target=_blank&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/descFiles/IMG_00011210383084.jpg&gt;&lt;/a&gt;&lt;/div&gt;&lt;div class=cms-description&gt;&lt;h3&gt;Porównanie aparatów z serii Instax Mini&lt;/h3&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;div class=cms-box&gt;&lt;div class=box-inner&gt;&lt;div class=cms-photo&gt;&lt;a href=https://upload.cyfrowe.pl/cyfrowe/pdf/Instax_katalog_A5_2016-09_397078668.pdf target=_blank&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/descFiles/katalogproduktow1312000613.jpg&gt;&lt;/a&gt;&lt;/div&gt;&lt;div class=cms-description&gt;&lt;h3&gt;Katalog produktów Instax Mini, Wide, Square&lt;/h3&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;div class=cms-box&gt;&lt;div class=box-inner&gt;&lt;div class=cms-photo&gt;&lt;a href=https://www.fujifilm.eu/fileadmin/content/instax/download/instaxwide300_manual_01.pdf target=_blank&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/descFiles/instrukcjamini90956981386.jpg&gt;&lt;/a&gt;&lt;/div&gt;&lt;div class=cms-description&gt;&lt;h3&gt;Instrukcja obsługi Instax Wide 300&lt;/h3&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;ul&gt;&lt;li&gt;&lt;a href=https://instax.pl/Instax-Wide-300.html target=_blank&gt;Opis produktu na polskiej stronie producenta&lt;/a&gt;&lt;li&gt;&lt;a href=http://instax.com/wide/en/ target=_blank&gt;Opis produktu na zagranicznej stronie producenta&lt;/a&gt;&lt;li&gt;&lt;a href=http://blog.cyfrowe.pl/2017/12/16/5-pomyslow-na-kreatywne-wykorzystanie-fujifilm-instax/ target=_blank&gt;5 pomysłów na kreatywne wykorzystanie FujiFilm Instax - artykuł na blog.cyfrowe.pl&lt;/a&gt;&lt;li&gt;&lt;a href=https://blog.cyfrowe.pl/jakiego-instaxa-kupic/ target=_blank&gt;Jakiego Instaxa kupić? Porównanie wszystkich modeli na blog.cyfrowe.pl &lt;/a&gt;&lt;/ul&gt;&lt;p class=short_description itemprop=description&gt;Wide 300 jest przedstawicielem najbardziej zaawansowanej rodziny aparatów Instax. Korzysta z większych wkładów o nazwie Instax Wide Film. Fujifilm Instax Wide 300 posiada m.in. optyczny wizjer, dwuzakresowy pierścień ustawiania ostrości oraz złącze statywowe. Fotografowanie aparatami natychmiastowymi Instax to niesamowita frajda! Zdjęcia z tego modelu mają rozmiar 108 x 86 mm.', '', 'aparat-fujifilm-instax-wide-300', '', '', '', 'Aparat FujiFilm Instax Wide 300', '', '', '', ''),
(45, 1, 1, '&lt;div class=cms-template_title-subtitle&gt;&lt;h2&gt;&lt;strong&gt;Fuji Instax Wide 300 toffee&lt;/strong&gt;&lt;/h2&gt;&lt;h3&gt;Chwytaj cenne momenty w szerszym spojrzeniu&lt;/h3&gt;&lt;p&gt;&lt;strong&gt; Instax Wide to proste w obsłudze aparaty&lt;/strong&gt;, które są doskonałym towarzyszem wszelkich spotkań i imprez. W dobie fotografii cyfrowej, możliwość obejrzenia prawdziwej odbitki od razu po naciśnięciu spustu migawki sprawia wszystkim dużo radości. Większy niż w serii Mini rozmiar papieru światłoczułego pozwala na rejestrowanie cennych chwil w lepszej jakości i ułatwia dzielenie się nimi z przyjaciółmi. &lt;strong&gt;Przyjmij zaproszenie do świata analogowej fotografii!&lt;/strong&gt;&lt;/div&gt;&lt;div class=cms-template_photo80&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/fck_files/pic_01.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;h2 style=\"text-align: justify;\"&gt;Słodka wersja kolorystyczna&lt;/h2&gt;&lt;p&gt;Aparat natychmiastowy FujiFilm Instax Wide 300 Toffee ma kolorystykę, która przywodzi na myśl słodki deser! Ten wyjątkowy design z pewnością umili fotografowanie. Posiada stylowe akcenty kolorystyczne, a cały jest utrzymany w kolorze bieli. &lt;h2 style=\"text-align: justify;\"&gt;Przeznaczenie&lt;/h2&gt;&lt;p&gt;Instax Wide 300 robi zdjęcia dwukrotnie większe niż aparaty z serii Instax Mini, co sprawia, że &lt;strong&gt;w kadrze zmieści się więcej osób a emocje i uśmiechy na ich twarzach będą lepiej widoczne&lt;/strong&gt;. Wykonane odbitki możesz od razu włożyć do albumu, udekorować nimi dom lub podpisać i podarować znajomym. Połączenie zaawansowanych funkcji z prostotą obsługi zadowoli nawet ambitnych fotografów ani nie sprawi trudności dzieciom. Zabierz zapas odbitek na&lt;strong&gt; wakacje&lt;/strong&gt;, stwórz &lt;strong&gt;fotobudkę&lt;/strong&gt; na urodzinowym przyjęciu albo wymyśl &lt;strong&gt;własny projekt&lt;/strong&gt; &lt;strong&gt;DIY&lt;/strong&gt;. Frajda gwarantowana!&lt;div class=\"cms-template_3photos-grid cms-grid cms-grid-3 js-flexbox\"&gt;&lt;div class=cms-box&gt;&lt;div class=box-inner&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/descFiles/feature_img_081869585461.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;div class=cms-box&gt;&lt;div class=box-inner&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/descFiles/feature_img_09611747560.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;div class=cms-box&gt;&lt;div class=box-inner&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/descFiles/feature_img_102116103424.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;h2&gt;Cechy i korzyści&lt;/h2&gt;&lt;div class=cms-template_photo50-text50&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/descFiles/instaxwide259584157.jpg&gt;&lt;/div&gt;&lt;h3&gt;Banalnie prosta obsługa&lt;/h3&gt;&lt;p&gt;Fotografowanie aparetm Instax Wide 300 jest bardzo proste i przyjemne. &lt;strong&gt;Jego obsługę opanują nawet kilkuletnie dzieci. Nie sprawi też trudności osobom starszym. &lt;/strong&gt;Wystarczy włączyć zasilanie i nacisnąć spust migawki, a zdjęcie automatycznie wysunie się z górnej części korpusu.&lt;h3&gt;Ergonomia&lt;/h3&gt;&lt;p&gt;Aparat wyposażono w specjalny uchwyt, aby lepiej leżał w dłoni. Przycisk wyzwalania migawki znajdujący się na gripie, sprawia, że korzystanie z niego jest bardzo wygodne.&lt;h3&gt;Natychmiastowa odbitka&lt;/h3&gt;&lt;p&gt;Na początkowo białej karcie, po kilku sekundach zacznie pojawiać się obraz. Doskonałej jakości odbitka będzie gotowa po około 90 sekundach (zależnie od temperatury otoczenia). W świecie, w którym powstają gigabajty cyfrowych, nudnych zdjęć, możliwość obejrzenia prawdziwej odbitki zaraz po naciśnięciu spustu migawki robi na wszystkich ogromne wrażenie.&lt;/div&gt;&lt;div class=cms-template_text67-photo33&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/descFiles/feature_img_02388249436.jpg&gt;&lt;/div&gt;&lt;h3&gt;Zdjęcie z dedykacją&lt;/h3&gt;&lt;p&gt;Biała ramka otaczająca obraz jest podatna na atrament, dzięki czemu możesz zanotować na niej, kiedy powstało zdjęcie albo zostawić dedykację dla przyjaciół.&lt;h3&gt;Regulacja strefy ostrości&lt;/h3&gt;&lt;p&gt;&lt;strong&gt;Żeby wykonywać wyraziste i ostre zdjęcia tematyczne, skorzystaj z różnych ustawień autofokusa. &lt;/strong&gt;Standardowe ustawienia pozwalają na wykonywanie zdjęć od 90 cm do 3 m od obiektu, co jest doskonałe w przypadku &lt;strong&gt;portretów&lt;/strong&gt;. Żeby uwiecznić &lt;strong&gt;scenę krajobrazową&lt;/strong&gt; lub rzeczy, które znajdują się dalej niż 3 metry od aparatu, przekręć pierścień obiektywu na daną funkcję.&lt;h3&gt;Nakładka makro&lt;/h3&gt;&lt;p&gt;Do fotografowania &lt;strong&gt;zbliżeń i robienia selfie&lt;/strong&gt; służy natomiast specjalna &lt;strong&gt;nakładka makro&lt;/strong&gt;, którą znajdziesz w zestawie. Łapie ostrość już od 40 cm.&lt;/div&gt;&lt;div class=cms-template_photo33-text67&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/descFiles/feature_img_031008485791.jpg&gt;&lt;/div&gt;&lt;h3&gt;Idealne selfie&lt;/h3&gt;&lt;p&gt;Zamontuj nakładkę do zbliżeń na obiektywie aparatu zanim zaczniesz robić selfie. Znajdujące się na niej mini lusterko pozwoli Ci ustawić najatrakcyjniejszy kąt widzenia.&lt;/div&gt;&lt;div class=cms-template_text67-photo33&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/descFiles/feature_img_041837131383.jpg&gt;&lt;/div&gt;&lt;h3&gt;Zaawansowana kontrola ekspozycji&lt;/h3&gt;&lt;p&gt;Lampa błyskowa wyzwalana jest automatycznie, gdy aparat wykryje, że ilość światła jest niewystarczająca i dobiera jej siłę błysku do warunków. Dla uzyskania innego efektu możesz ją całkowicie wyłączyć lub wykorzystać błysk dopełniający, który lekko muśnie pierwszy plan, tło rejestrująć w naturalnych kolorach. Do Twojej dyspozycji są też tryby high i low key.&lt;/div&gt;&lt;h3 style=\"text-align: justify;\"&gt;Zrób zapas wkładów - to wciąga!&lt;/h3&gt;&lt;p style=text-align:justify&gt;Aby móc fotografować aparatem Instax Wide 300, należy wyposażyć się we wkład z papierem &lt;strong&gt;Fujifilm Instax Wide&lt;/strong&gt; (rozmiar papieru: 108 x 86mm, obszar obrazu:62 x 99mm). Aparat zasilany jest &lt;strong&gt;czterema bateriami AA&lt;/strong&gt;, co daje możliwość wykonania około &lt;strong&gt;100 zdjęć&lt;/strong&gt;.&lt;h2&gt;Materiały dodatkowe&lt;/h2&gt;&lt;div class=\"cms-template_grid5 cms-grid cms-grid-5 js-flexbox\"&gt;&lt;div class=cms-box&gt;&lt;div class=box-inner&gt;&lt;div class=cms-photo&gt;&lt;a href=https://upload.cyfrowe.pl/cyfrowe/pdf/Porownianie_aparatow_Fujifilm_Instax.pdf target=_blank&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/descFiles/IMG_00011210383084.jpg&gt;&lt;/a&gt;&lt;/div&gt;&lt;div class=cms-description&gt;&lt;h3&gt;Porównanie aparatów z serii Instax Mini&lt;/h3&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;div class=cms-box&gt;&lt;div class=box-inner&gt;&lt;div class=cms-photo&gt;&lt;a href=https://upload.cyfrowe.pl/cyfrowe/pdf/Instax_katalog_A5_2016-09_397078668.pdf target=_blank&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/descFiles/katalogproduktow1312000613.jpg&gt;&lt;/a&gt;&lt;/div&gt;&lt;div class=cms-description&gt;&lt;h3&gt;Katalog produktów Instax Mini, Wide, Square&lt;/h3&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;div class=cms-box&gt;&lt;div class=box-inner&gt;&lt;div class=cms-photo&gt;&lt;a href=https://www.fujifilm.eu/fileadmin/content/instax/download/instaxwide300_manual_01.pdf target=_blank&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/descFiles/instrukcjamini90956981386.jpg&gt;&lt;/a&gt;&lt;/div&gt;&lt;div class=cms-description&gt;&lt;h3&gt;Instrukcja obsługi Instax Wide 300&lt;/h3&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;ul&gt;&lt;li&gt;&lt;a href=https://instax.pl/Instax-Wide-300.html target=_blank&gt;Opis produktu na polskiej stronie producenta&lt;/a&gt;&lt;li&gt;&lt;a href=http://instax.com/wide/en/ target=_blank&gt;Opis produktu na zagranicznej stronie producenta&lt;/a&gt;&lt;li&gt;&lt;a href=http://blog.cyfrowe.pl/2017/12/16/5-pomyslow-na-kreatywne-wykorzystanie-fujifilm-instax/ target=_blank&gt;5 pomysłów na kreatywne wykorzystanie FujiFilm Instax - artykuł na blog.cyfrowe.pl&lt;/a&gt;&lt;li&gt;&lt;a href=https://blog.cyfrowe.pl/jakiego-instaxa-kupic/ target=_blank&gt;Jakiego Instaxa kupić? Porównanie wszystkich modeli na blog.cyfrowe.pl &lt;/a&gt;&lt;/ul&gt;&lt;p class=short_description itemprop=description&gt;Aparat natychmiastowy FujiFilm Instax Wide 300 Toffee ma kolorystykę, która przywodzi na myśl słodki deser! Ten wyjątkowy design z pewnością umili fotografowanie. Wide 300 jest przedstawicielem najbardziej zaawansowanej rodziny aparatów Instax. Instax Wide 300 posiada m.in. optyczny wizjer, dwuzakresowy pierścień ustawiania ostrości oraz złącze statywowe.', '', 'aparat-fujifilm-instax-wide-300-toffe', '', '', '', 'Aparat FujiFilm Instax Wide 300 Toffe', '', '', '', ''),
(46, 1, 1, '&lt;div class=cms-template_title-subtitle&gt;&lt;h2&gt;Canon zoemini s2 &lt;/h2&gt;&lt;h3&gt;Aparat z drukarką&lt;/h3&gt;&lt;p&gt;&lt;strong&gt;Zoemini S2&lt;/strong&gt; to najnowsza propozycja z serii aparatów natychmiastowych od &lt;strong&gt;Canon&lt;/strong&gt;. Model ten umożliwia nie tylko fotografowanie, ale także natychmiastowe &lt;strong&gt;drukowanie&lt;/strong&gt; zrobionych zdjęć. Aparat o rozdzielczości 8 megapikseli zapewni świetną jakość Twoich kadrów. Ponadto wyposażony jest w Bluetooth oraz wygodne lusterko i lampę pierścieniową, które są przydatne podczas robienia selfie. Z Zoemini S2 będziesz tworzył wspomnienia, jeszcze w trakcie ich trwania. &lt;/div&gt;&lt;div class=cms-template_video100&gt;&lt;div class=cms-video-wrapper&gt;&lt;div class=cms-video&gt;&lt;iframe allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\"allowfullscreen frameborder=0 scrolling=no src=https://www.youtube.com/embed/uqjb2RGbbYo&gt;&lt;/iframe&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;div class=cms-template_photo50-text50&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Canon Zoemini S2 matowa różowe złoto\"src=//upload.cyfrowe.pl/cyfrowe/products/9815d5b955.jpg&gt;&lt;/div&gt;&lt;h3&gt;Niewielki rozmiar, wiele możliwości &lt;/h3&gt;&lt;p&gt;Niesamowicie lekki i poręczny aparat natychmiastowy z możliwością drukowania zdjęć zaraz po ich wykonaniu to idealna propozycja dla osób ceniących sobie komfort i wygodę.&lt;p&gt; &lt;strong&gt;Zoemini S2 &lt;/strong&gt;zapewnia:&lt;ul&gt;&lt;li&gt;rozdzielczość &lt;strong&gt;8 megapikseli&lt;/strong&gt;,&lt;li&gt;technologię Zink,&lt;li&gt;ładunek akumulatora wystrarczający na zrobienie 250 zdjęć,&lt;li&gt;zapisywanie zdjęć na karcie &lt;strong&gt;Micro SD&lt;/strong&gt;.&lt;/ul&gt;&lt;/div&gt;&lt;div class=cms-template_text50-photo50&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat Canon Zoemini S2 matowa różowe złoto\"src=//upload.cyfrowe.pl/cyfrowe/products/9823ae2801.jpg&gt;&lt;/div&gt;&lt;h3&gt;Jedno ładowanie = aż 250 zdjęć &lt;/h3&gt;&lt;p&gt;&lt;strong&gt;Canon Zoemini S2 &lt;/strong&gt;posiada wbudowany akumulator litowo-polimerowy.&lt;p&gt;Czas jaki potrzebny jest do jego pełnego naładowania to 120 minut. Dzięki temu spokojnie możesz cieszyć się łapaniem chwil w różnych sytuacjach. &lt;/div&gt;&lt;div class=cms-template_text50-text50&gt;&lt;div class=cms-text-column&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Canon Zoemini S2 matowa różowe złoto\"src=//upload.cyfrowe.pl/cyfrowe/products/98169d3ed6.jpg&gt;&lt;/div&gt;&lt;h3&gt;Wyjątkowe efekty na zdjęciach &lt;/h3&gt;&lt;p&gt;&lt;strong&gt;Zoemini S2 &lt;/strong&gt;umożliwia dodanie różnych efektów, które sprawią, że Twoje zdjęcia nabiorą niepowtarzalnego klimatu wybranego przez Ciebie. &lt;p&gt;&lt;strong&gt;Ramki do zdjęć&lt;/strong&gt; dodasz dzięki specjalnym przyciskom na obudowie. &lt;p&gt;Efekt ramki można uzyskać za pomocą aplikacji &lt;strong&gt;Canon Mini Print.&lt;/strong&gt;&lt;/div&gt;&lt;div class=cms-text-column&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Canon Zoemini S2 matowa różowe złoto\"src=//upload.cyfrowe.pl/cyfrowe/products/98184686d2.jpg&gt;&lt;/div&gt;&lt;h3&gt;Pełna kontrola nad selfie &lt;/h3&gt;&lt;p&gt;&lt;strong&gt;Canon&lt;/strong&gt; &lt;strong&gt;Zoemini S2 &lt;/strong&gt;wyposażony został w: &lt;ul&gt;&lt;li&gt;lusterko,&lt;li&gt;lampę pierścieniową.&lt;/ul&gt;&lt;p&gt;&lt;strong&gt;Lusterko&lt;/strong&gt; sprawi, że zdjęcia nie będą powstawać przypadkowo, a &lt;strong&gt;lampa pierścieniowa&lt;/strong&gt; gwarantuje robienie zdjęć nawet w ciemnych pomieszczeniach. Dzięki temu Twoje selfie będą najwyższej jakości.&lt;p&gt;Dodatkowo &lt;strong&gt;Zoemini S2 &lt;/strong&gt;posiada samowyzwalacz (3s, 5s, 10s), który będzie idealny do uchwycenia ulotnych kadrów.  &lt;/div&gt;&lt;/div&gt;&lt;div class=\"cms-template_2photos-grid cms-grid cms-grid-2 js-flexbox\"&gt;&lt;div class=cms-box&gt;&lt;div class=box-inner&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat Canon Zoemini S2 matowa różowe złoto\"src=//upload.cyfrowe.pl/cyfrowe/products/98210ef6df.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;div class=cms-box&gt;&lt;div class=box-inner&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat Canon Zoemini S2 matowa różowe złoto\"src=//upload.cyfrowe.pl/cyfrowe/products/9822f6c008.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;div class=cms-template_text50-photo50&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Canon Zoemini S2 matowa różowe złoto\"src=//upload.cyfrowe.pl/cyfrowe/products/9819179a7f.jpg&gt;&lt;/div&gt;&lt;h3&gt;Wygodna i szybka personalizacja zdjęć&lt;/h3&gt;&lt;p&gt;Dzięki temu, że &lt;strong&gt;Canon Zoemini S2 &lt;/strong&gt;wyposażony jest w &lt;strong&gt;Bluetooth&lt;/strong&gt; umożliwia przesyłanie i drukowanie zdjęć prosto ze smarftona.&lt;p&gt;Dodatkowo, korzystanie z aplikacji &lt;strong&gt;Canon Mini Print&lt;/strong&gt; umożliwia:&lt;ul&gt;&lt;li&gt;dodawanie różnych, wybranych przez Ciebie elementów,&lt;li&gt;tworzenie profesjonalnych kolaży,&lt;li&gt;zdalne wyzwalanie migawki,&lt;li&gt;sprawdzanie podglądu na żywo. &lt;/ul&gt;&lt;/div&gt;&lt;div class=cms-template_photo50-text50&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Canon Zoemini S2 matowa różowe złoto\"style=\"margin-top: 50px; margin-bottom: 50px;\"src=//upload.cyfrowe.pl/cyfrowe/products/982035d5c6.jpg&gt;&lt;/div&gt;&lt;h3&gt;Nie tylko zdjęcia, ale też naklejki!&lt;/h3&gt;&lt;p&gt;&lt;strong&gt;Canonem Zoemini S2 &lt;/strong&gt;tworzysz nie tylko zdjęcia, ale także naklejki.&lt;p&gt;Korzystając z tego aparatu natychmiastowego wkładasz maksymalnie &lt;strong&gt;10 arkuszy papieru fotograficznego Zink&lt;/strong&gt;, które posiadają samoprzylepną warstwę.&lt;p&gt;Po wydrukowaniu zdjęcia możesz odkleić warstwę ochronną znajdującą się z tyłu i przykleić zdjęcie gdzie tylko zechcesz (na np. na telefonie) i sprawić, że wspomnienia będą z Tobą w każdym miejscu. &lt;/div&gt;&lt;ul class=optional-links&gt;&lt;li&gt;&lt;a title=\"Opis produktu na polskiej stronie producenta  \"href=https://www.canon.pl/cameras/zoemini-s2/ rel=nofollow target=_blank&gt;Opis produktu na polskiej stronie producenta &lt;/a&gt;&lt;li&gt;&lt;a title=\"Opis produktu na zagranicznej stronie producenta \"href=https://www.canon.co.uk/get-inspired/stories/express-yourself-canon-zoemini-s2/ rel=nofollow target=_blank&gt;Opis produktu na zagranicznej stronie producenta &lt;/a&gt;&lt;li&gt;&lt;a title=\"Zobacz nasze porównanie\"href=https://blog.cyfrowe.pl/canon-zoemini-i-selphy/ rel=nofollow target=_blank&gt;Zobacz nasze porównanie&lt;/a&gt;&lt;/ul&gt;&lt;p class=short_description itemprop=description&gt;Bardzo lekki, natychmiastowy aparat Zoemini S2 marki Canon. Aparat wyposażony w matryce o rozdzielczości 8 megapikseli, łączność Bluetooth umożliwiające drukowanie zdjęć ze smartfona. Zoemini S2 posiada lusterko i lampę pierścieniową, które ułatwiają robienie selfie.', '', 'aparat-canon-zoemini-s2-matowa-perlowa-biel', '', '', '', 'Aparat Canon Zoemini S2 matowa perłowa biel', '', '', '', ''),
(47, 1, 1, '&lt;div class=cms-template_title-subtitle&gt;&lt;h2&gt;Canon zoemini s2 &lt;/h2&gt;&lt;h3&gt;Aparat z drukarką&lt;/h3&gt;&lt;p&gt;&lt;strong&gt;Zoemini S2&lt;/strong&gt; to najnowsza propozycja z serii aparatów natychmiastowych od &lt;strong&gt;Canon&lt;/strong&gt;. Model ten umożliwia nie tylko fotografowanie, ale także natychmiastowe &lt;strong&gt;drukowanie&lt;/strong&gt; zrobionych zdjęć. Aparat o rozdzielczości 8 megapikseli zapewni świetną jakość Twoich kadrów. Ponadto wyposażony jest w Bluetooth oraz wygodne lusterko i lampę pierścieniową, które są przydatne podczas robienia selfie. Z Zoemini S2 będziesz tworzył wspomnienia, jeszcze w trakcie ich trwania. &lt;/div&gt;&lt;div class=cms-template_video100&gt;&lt;div class=cms-video-wrapper&gt;&lt;div class=cms-video&gt;&lt;iframe allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\"allowfullscreen frameborder=0 scrolling=no src=https://www.youtube.com/embed/uqjb2RGbbYo&gt;&lt;/iframe&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;div class=cms-template_photo50-text50&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Canon Zoemini S2 matowa różowe złoto\"src=//upload.cyfrowe.pl/cyfrowe/products/9815d5b955.jpg&gt;&lt;/div&gt;&lt;h3&gt;Niewielki rozmiar, wiele możliwości &lt;/h3&gt;&lt;p&gt;Niesamowicie lekki i poręczny aparat natychmiastowy z możliwością drukowania zdjęć zaraz po ich wykonaniu to idealna propozycja dla osób ceniących sobie komfort i wygodę.&lt;p&gt; &lt;strong&gt;Zoemini S2 &lt;/strong&gt;zapewnia:&lt;ul&gt;&lt;li&gt;rozdzielczość &lt;strong&gt;8 megapikseli&lt;/strong&gt;,&lt;li&gt;technologię Zink,&lt;li&gt;ładunek akumulatora wystrarczający na zrobienie 250 zdjęć,&lt;li&gt;zapisywanie zdjęć na karcie &lt;strong&gt;Micro SD&lt;/strong&gt;.&lt;/ul&gt;&lt;/div&gt;&lt;div class=cms-template_text50-photo50&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat Canon Zoemini S2 matowa różowe złoto\"src=//upload.cyfrowe.pl/cyfrowe/products/9823ae2801.jpg&gt;&lt;/div&gt;&lt;h3&gt;Jedno ładowanie = aż 250 zdjęć &lt;/h3&gt;&lt;p&gt;&lt;strong&gt;Canon Zoemini S2 &lt;/strong&gt;posiada wbudowany akumulator litowo-polimerowy.&lt;p&gt;Czas jaki potrzebny jest do jego pełnego naładowania to 120 minut. Dzięki temu spokojnie możesz cieszyć się łapaniem chwil w różnych sytuacjach. &lt;/div&gt;&lt;div class=cms-template_text50-text50&gt;&lt;div class=cms-text-column&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Canon Zoemini S2 matowa różowe złoto\"src=//upload.cyfrowe.pl/cyfrowe/products/98169d3ed6.jpg&gt;&lt;/div&gt;&lt;h3&gt;Wyjątkowe efekty na zdjęciach &lt;/h3&gt;&lt;p&gt;&lt;strong&gt;Zoemini S2 &lt;/strong&gt;umożliwia dodanie różnych efektów, które sprawią, że Twoje zdjęcia nabiorą niepowtarzalnego klimatu wybranego przez Ciebie. &lt;p&gt;&lt;strong&gt;Ramki do zdjęć&lt;/strong&gt; dodasz dzięki specjalnym przyciskom na obudowie. &lt;p&gt;Efekt ramki można uzyskać za pomocą aplikacji &lt;strong&gt;Canon Mini Print.&lt;/strong&gt;&lt;/div&gt;&lt;div class=cms-text-column&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Canon Zoemini S2 matowa różowe złoto\"src=//upload.cyfrowe.pl/cyfrowe/products/98184686d2.jpg&gt;&lt;/div&gt;&lt;h3&gt;Pełna kontrola nad selfie &lt;/h3&gt;&lt;p&gt;&lt;strong&gt;Canon&lt;/strong&gt; &lt;strong&gt;Zoemini S2 &lt;/strong&gt;wyposażony został w: &lt;ul&gt;&lt;li&gt;lusterko,&lt;li&gt;lampę pierścieniową.&lt;/ul&gt;&lt;p&gt;&lt;strong&gt;Lusterko&lt;/strong&gt; sprawi, że zdjęcia nie będą powstawać przypadkowo, a &lt;strong&gt;lampa pierścieniowa&lt;/strong&gt; gwarantuje robienie zdjęć nawet w ciemnych pomieszczeniach. Dzięki temu Twoje selfie będą najwyższej jakości.&lt;p&gt;Dodatkowo &lt;strong&gt;Zoemini S2 &lt;/strong&gt;posiada samowyzwalacz (3s, 5s, 10s), który będzie idealny do uchwycenia ulotnych kadrów.  &lt;/div&gt;&lt;/div&gt;&lt;div class=\"cms-template_2photos-grid cms-grid cms-grid-2 js-flexbox\"&gt;&lt;div class=cms-box&gt;&lt;div class=box-inner&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat Canon 