tu na polskiej stronie producenta  \"href=https://www.canon.pl/cameras/zoemini-s2/ rel=nofollow target=_blank&gt;Opis produktu na polskiej stronie producenta &lt;/a&gt;&lt;li&gt;&lt;a title=\"Opis produktu na zagranicznej stronie producenta \"href=https://www.canon.co.uk/get-inspired/stories/express-yourself-canon-zoemini-s2/ rel=nofollow target=_blank&gt;Opis produktu na zagranicznej stronie producenta &lt;/a&gt;&lt;li&gt;&lt;a title=\"Zobacz nasze porównanie\"href=https://blog.cyfrowe.pl/canon-zoemini-i-selphy/ rel=nofollow target=_blank&gt;Zobacz nasze porównanie&lt;/a&gt;&lt;/ul&gt;&lt;p class=short_description itemprop=description&gt;Bardzo lekki, natychmiastowy aparat Zoemini S2 marki Canon. Aparat wyposażony w matryce o rozdzielczości 8 megapikseli, łączność Bluetooth umożliwiające drukowanie zdjęć ze smartfona. Zoemini S2 posiada lusterko i lampę pierścieniową, które ułatwiają robienie selfie.', '', 'aparat-canon-zoemini-s2-ciemny-turkus', '', '', '', 'Aparat Canon Zoemini S2 ciemny turkus', '', '', '', ''),
