Zoemini S2 matowa różowe złoto\"src=//upload.cyfrowe.pl/cyfrowe/products/98210ef6df.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;div class=cms-box&gt;&lt;div class=box-inner&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat Canon Zoemini S2 matowa różowe złoto\"src=//upload.cyfrowe.pl/cyfrowe/products/9822f6c008.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;div class=cms-template_text50-photo50&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Canon Zoemini S2 matowa różowe złoto\"src=//upload.cyfrowe.pl/cyfrowe/products/9819179a7f.jpg&gt;&lt;/div&gt;&lt;h3&gt;Wygodna i szybka personalizacja zdjęć&lt;/h3&gt;&lt;p&gt;Dzięki temu, że &lt;strong&gt;Canon Zoemini S2 &lt;/strong&gt;wyposażony jest w &lt;strong&gt;Bluetooth&lt;/strong&gt; umożliwia przesyłanie i drukowanie zdjęć prosto ze smarftona.&lt;p&gt;Dodatkowo, korzystanie z aplikacji &lt;strong&gt;Canon Mini Print&lt;/strong&gt; umożliwia:&lt;ul&gt;&lt;li&gt;dodawanie różnych, wybranych przez Ciebie elementów,&lt;li&gt;tworzenie profesjonalnych kolaży,&lt;li&gt;zdalne wyzwalanie migawki,&lt;li&gt;sprawdzanie podglądu na żywo. &lt;/ul&gt;&lt;/div&gt;&lt;div class=cms-template_photo50-text50&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Canon Zoemini S2 matowa różowe złoto\"style=\"margin-top: 50px; margin-bottom: 50px;\"src=//upload.cyfrowe.pl/cyfrowe/products/982035d5c6.jpg&gt;&lt;/div&gt;&lt;h3&gt;Nie tylko zdjęcia, ale też naklejki!&lt;/h3&gt;&lt;p&gt;&lt;strong&gt;Canonem Zoemini S2 &lt;/strong&gt;tworzysz nie tylko zdjęcia, ale także naklejki.&lt;p&gt;Korzystając z tego aparatu natychmiastowego wkładasz maksymalnie &lt;strong&gt;10 arkuszy papieru fotograficznego Zink&lt;/strong&gt;, które posiadają samoprzylepną warstwę.&lt;p&gt;Po wydrukowaniu zdjęcia możesz odkleić warstwę ochronną znajdującą się z tyłu i przykleić zdjęcie gdzie tylko zechcesz (na np. na telefonie) i sprawić, że wspomnienia będą z Tobą w każdym miejscu. &lt;/div&gt;&lt;ul class=optional-links&gt;&lt;li&gt;&lt;a title=\"Opis produktu na polskiej stronie producenta  \"href=https://www.canon.pl/cameras/zoemini-s2/ rel=nofollow target=_blank&gt;Opis produktu na polskiej stronie producenta &lt;/a&gt;&lt;li&gt;&lt;a title=\"Opis produktu na zagranicznej stronie producenta \"href=https://www.canon.co.uk/get-inspired/stories/express-yourself-canon-zoemini-s2/ rel=nofollow target=_blank&gt;Opis produktu na zagranicznej stronie producenta &lt;/a&gt;&lt;li&gt;&lt;a title=\"Zobacz nasze porównanie\"href=https://blog.cyfrowe.pl/canon-zoemini-i-selphy/ rel=nofollow target=_blank&gt;Zobacz nasze porównanie&lt;/a&gt;&lt;/ul&gt;&lt;p class=short_description itemprop=description&gt;Bardzo lekki, natychmiastowy aparat Zoemini S2 marki Canon. Aparat wyposażony w matryce o rozdzielczości 8 megapikseli, łączność Bluetooth umożliwiające drukowanie zdjęć ze smartfona. Zoemini S2 posiada lusterko i lampę pierścieniową, które ułatwiają robienie selfie.', '', 'aparat-canon-zoemini-s2-matowa-rozowe-zloto', '', '', '', 'Aparat Canon Zoemini S2 matowa różowe złoto', '', '', '', ''),
(49, 1, 1, '&lt;h2&gt;Canon Zoemini S2 matowa perłowa biel + papier ZP-2030 zestaw&lt;/h2&gt;&lt;p&gt;Niezwykle lekki, natychmiastowy &lt;strong&gt;aparat Zoemini S2 marki Canon&lt;/strong&gt; wyposażony został w matryce o rozdzielczości 8 megapikseli, łączność Bluetooth umożliwiające drukowanie zdjęć ze smartfona. Zoemini S2 posiada lusterko i lampę pierścieniową, które ułatwiają robienie selfie. Model ten, umożliwia nie tylko fotografowanie, ale także natychmiastowe &lt;strong&gt;drukowanie&lt;/strong&gt; zrobionych zdjęć.&lt;strong&gt; Papier ZP-2030&lt;/strong&gt; kompatybilny jest z drukarkami Zoemini i aparatami Zoemini S. Papier ten można &lt;strong&gt;wykorzystać w postaci spersonalizowanej naklejki.&lt;/strong&gt; Aparat z drukarką w połączeniu z dedykowanym papierem zapewnia&lt;strong&gt; wysoką jakość odbitek, żywą kolorystykę i wysoką wytrzymałość na rozdarcia.&lt;/strong&gt;&lt;h3&gt;Zestaw zawiera:&lt;/h3&gt;&lt;ul&gt;&lt;li&gt; aparat z drukarką Canon Zoemini S2 &lt;li&gt;papier Canon ZP-2030&lt;/ul&gt;&lt;div class=cms-template_title-subtitle&gt;&lt;h2&gt;Canon zoemini s2 &lt;/h2&gt;&lt;h3&gt;Aparat z drukarką&lt;/h3&gt;&lt;p&gt;&lt;strong&gt;Zoemini S2&lt;/strong&gt; to najnowsza propozycja z serii aparatów natychmiastowych od &lt;strong&gt;Canon&lt;/strong&gt;. Model ten umożliwia nie tylko fotografowanie, ale także natychmiastowe &lt;strong&gt;drukowanie&lt;/strong&gt; zrobionych zdjęć. Aparat o rozdzielczości 8 megapikseli zapewni świetną jakość Twoich kadrów. Ponadto wyposażony jest w Bluetooth oraz wygodne lusterko i lampę pierścieniową, które są przydatne podczas robienia selfie. Z Zoemini S2 będziesz tworzył wspomnienia, jeszcze w trakcie ich trwania. &lt;/div&gt;&lt;div class=cms-template_video100&gt;&lt;div class=cms-video-wrapper&gt;&lt;div class=cms-video&gt;&lt;iframe allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\"allowfullscreen frameborder=0 scrolling=no src=https://www.youtube.com/embed/uqjb2RGbbYo&gt;&lt;/iframe&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;div class=cms-template_photo50-text50&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Canon Zoemini S2 matowa różowe złoto\"src=//upload.cyfrowe.pl/cyfrowe/products/9815d5b955.jpg&gt;&lt;/div&gt;&lt;h3&gt;Niewielki rozmiar, wiele możliwości &lt;/h3&gt;&lt;p&gt;Niesamowicie lekki i poręczny aparat natychmiastowy z możliwością drukowania zdjęć zaraz po ich wykonaniu to idealna propozycja dla osób ceniących sobie komfort i wygodę.&lt;p&gt; &lt;strong&gt;Zoemini S2 &lt;/strong&gt;zapewnia:&lt;ul&gt;&lt;li&gt;rozdzielczość &lt;strong&gt;8 megapikseli&lt;/strong&gt;,&lt;li&gt;technologię Zink,&lt;li&gt;ładunek akumulatora wystrarczający na zrobienie 250 zdjęć,&lt;li&gt;zapisywanie zdjęć na karcie &lt;strong&gt;Micro SD&lt;/strong&gt;.&lt;/ul&gt;&lt;/div&gt;&lt;div class=cms-template_text50-photo50&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat Canon Zoemini S2 matowa różowe złoto\"src=//upload.cyfrowe.pl/cyfrowe/products/9823ae2801.jpg&gt;&lt;/div&gt;&lt;h3&gt;Jedno ładowanie = aż 250 zdjęć &lt;/h3&gt;&lt;p&gt;&lt;strong&gt;Canon Zoemini S2 &lt;/strong&gt;posiada wbudowany akumulator litowo-polimerowy.&lt;p&gt;Czas jaki potrzebny jest do jego pełnego naładowania to 120 minut. Dzięki temu spokojnie możesz cieszyć się łapaniem chwil w różnych sytuacjach. &lt;/div&gt;&lt;div class=cms-template_text50-text50&gt;&lt;div class=cms-text-column&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Canon Zoemini S2 matowa różowe złoto\"src=//upload.cyfrowe.pl/cyfrowe/products/98169d3ed6.jpg&gt;&lt;/div&gt;&lt;h3&gt;Wyjątkowe efekty na zdjęciach &lt;/h3&gt;&lt;p&gt;&lt;strong&gt;Zoemini S2 &lt;/strong&gt;umożliwia dodanie różnych efektów, które sprawią, że Twoje zdjęcia nabiorą niepowtarzalnego klimatu wybranego przez Ciebie. &lt;p&gt;&lt;strong&gt;Ramki do zdjęć&lt;/strong&gt; dodasz dzięki specjalnym przyciskom na obudowie. &lt;p&gt;Efekt ramki można uzyskać za pomocą aplikacji &lt;strong&gt;Canon Mini Print.&lt;/strong&gt;&lt;/div&gt;&lt;div class=cms-text-column&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Canon Zoemini S2 matowa różowe złoto\"src=//upload.cyfrowe.pl/cyfrowe/products/98184686d2.jpg&gt;&lt;/div&gt;&lt;h3&gt;Pełna kontrola nad selfie &lt;/h3&gt;&lt;p&gt;&lt;strong&gt;Canon&lt;/strong&gt; &lt;strong&gt;Zoemini S2 &lt;/strong&gt;wyposażony został w: &lt;ul&gt;&lt;li&gt;lusterko,&lt;li&gt;lampę pierścieniową.&lt;/ul&gt;&lt;p&gt;&lt;strong&gt;Lusterko&lt;/strong&gt; sprawi, że zdjęcia nie będą powstawać przypadkowo, a &lt;strong&gt;lampa pierścieniowa&lt;/strong&gt; gwarantuje robienie zdjęć nawet w ciemnych pomieszczeniach. Dzięki temu Twoje selfie będą najwyższej jakości.&lt;p&gt;Dodatkowo &lt;strong&gt;Zoemini S2 &lt;/strong&gt;posiada samowyzwalacz (3s, 5s, 10s), który będzie idealny do uchwycenia ulotnych kadrów.  &lt;/div&gt;&lt;/div&gt;&lt;div class=\"cms-template_2photos-grid cms-grid cms-grid-2 js-flexbox\"&gt;&lt;div class=cms-box&gt;&lt;div class=box-inner&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat Canon Zoemini S2 matowa różowe złoto\"src=//upload.cyfrowe.pl/cyfrowe/products/98210ef6df.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;div class=cms-box&gt;&lt;div class=box-inner&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat Canon Zoemini S2 matowa różowe złoto\"src=//upload.cyfrowe.pl/cyfrowe/products/9822f6c008.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;div class=cms-template_text50-photo50&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Canon Zoemini S2 matowa różowe złoto\"src=//upload.cyfrowe.pl/cyfrowe/products/9819179a7f.jpg&gt;&lt;/div&gt;&lt;h3&gt;Wygodna i szybka personalizacja zdjęć&lt;/h3&gt;&lt;p&gt;Dzięki temu, że &lt;strong&gt;Canon Zoemini S2 &lt;/strong&gt;wyposażony jest w &lt;strong&gt;Bluetooth&lt;/strong&gt; umożliwia przesyłanie i drukowanie zdjęć prosto ze smarftona.&lt;p&gt;Dodatkowo, korzystanie z aplikacji &lt;strong&gt;Canon Mini Print&lt;/strong&gt; umożliwia:&lt;ul&gt;&lt;li&gt;dodawanie różnych, wybranych przez Ciebie elementów,&lt;li&gt;tworzenie profesjonalnych kolaży,&lt;li&gt;zdalne wyzwalanie migawki,&lt;li&gt;sprawdzanie podglądu na żywo. &lt;/ul&gt;&lt;/div&gt;&lt;div class=cms-template_photo50-text50&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Canon Zoemini S2 matowa różowe złoto\"style=\"margin-top: 50px; margin-bottom: 50px;\"src=//upload.cyfrowe.pl/cyfrowe/products/982035d5c6.jpg&gt;&lt;/div&gt;&lt;h3&gt;Nie tylko zdjęcia, ale też naklejki!&lt;/h3&gt;&lt;p&gt;&lt;strong&gt;Canonem Zoemini S2 &lt;/strong&gt;tworzysz nie tylko zdjęcia, ale także naklejki.&lt;p&gt;Korzystając z tego aparatu natychmiastowego wkładasz maksymalnie &lt;strong&gt;10 arkuszy papieru fotograficznego Zink&lt;/strong&gt;, które posiadają samoprzylepną warstwę.&lt;p&gt;Po wydrukowaniu zdjęcia możesz odkleić warstwę ochronną znajdującą się z tyłu i przykleić zdjęcie gdzie tylko zechcesz (na np. na telefonie) i sprawić, że wspomnienia będą z Tobą w każdym miejscu. &lt;/div&gt;&lt;div class=cms-template_title-subtitle&gt;&lt;h2&gt;Papier do aparatów zoemini&lt;/h2&gt;&lt;h3&gt;Poczuj radość fotografii natychmiastowej&lt;/h3&gt;&lt;p&gt;Papier do fotografii natychmiastowej kompatybilny z drukarkami Zoemini i aparatami Zoemini S oraz C&lt;/div&gt;&lt;h3&gt;Wysoka jakość zdjęć&lt;/h3&gt;&lt;p&gt;Papier Zink zapewnia &lt;strong&gt;wysoką jakość odbitek,&lt;/strong&gt; &lt;strong&gt;żywą kolorystykę i wysoką wytrzymałość na rozdarcia&lt;/strong&gt;. Jego dodatkową zaletą jest &lt;strong&gt;możliwość wykorzystania go jako spersonalizowane naklejki.  &lt;/strong&gt;Wymiary papieru wynoszą 5,8x7,62 cm (2x3\'\'). Papier Zink pozwala uruchomić wyobraźnię i stworzyć kreatywne gadżety. Możesz np. ozdobić swój notatnik, laptopa czy tablet za pomocą wydruków ulubionych fotografii. Co więcej papier Zink i fotografia natychmiastowa stanowi świetny sposób na zachowanie wspomnień. &lt;strong&gt;Możesz drukować zdjęcia z dowolnego źródła &lt;/strong&gt;- portali społecznościowych, pamięci urządzeń mobilnych czy komputera, a także tuż po wykonaniu ekspozycji w przypadku wykorzystania go z aparatami Zoemini S i C. &lt;h3&gt;Odporny materiał&lt;/h3&gt;&lt;p&gt;Papier Zink działa w oparciu o &lt;strong&gt;technologię termosublimacyjną&lt;/strong&gt;, w związku z czym nie potrzebuje do działania atramentu. Wystarczy więc umieścić go w kasecie drukarki Zoemini lub aparatów Zoemini C i S, aby móc z niego korzystać. Nie potrzeba stosować żadnych dodatkowych akcesoriów. Dodatkową zaletą tej technologii jest &lt;strong&gt;zwiększona odporność materiałów na rozdarcia i działanie wody, a także brak rozmazań. &lt;/strong&gt;&lt;p&gt;&lt;strong&gt;Poczuj niepowtarzalny klimat fotografii natychmiastowej i baw się odbitkami swoich ulubionych fotografii!&lt;/strong&gt;&lt;ul class=optional-links&gt;&lt;li&gt;&lt;a title=\"Opis produktu na polskiej stronie producenta  \"href=https://www.canon.pl/cameras/zoemini-s2/ rel=nofollow target=_blank&gt;Opis produktu na polskiej stronie producenta &lt;/a&gt;&lt;li&gt;&lt;a title=\"Opis produktu na zagranicznej stronie producenta \"href=https://www.canon.co.uk/get-inspired/stories/express-yourself-canon-zoemini-s2/ rel=nofollow target=_blank&gt;Opis produktu na zagranicznej stronie producenta &lt;/a&gt;&lt;li&gt;&lt;a title=\"Zobacz nasze porównanie\"href=https://blog.cyfrowe.pl/canon-zoemini-i-selphy/ rel=nofollow target=_blank&gt;Zobacz nasze porównanie&lt;/a&gt;&lt;/ul&gt;&lt;p class=short_description itemprop=description&gt;Niezwykle lekki, natychmiastowy aparat Zoemini S2 marki Canon wyposażony został w matryce o rozdzielczości 8 megapikseli, łączność Bluetooth umożliwiające drukowanie zdjęć ze smartfona. Zoemini S2 posiada lusterko i lampę pierścieniową, które ułatwiają robienie selfie. Model ten, umożliwia nie tylko fotografowanie, ale także natychmiastowe drukowanie zrobionych zdjęć. Papier ZP-2030 kompatybilny jest z drukarkami Zoemini i aparatami Zoemini S. Papier ten można wykorzystać w postaci spersonalizowanej naklejki. Aparat z drukarką w połączeniu z dedykowanym papierem zapewnia wysoką jakość odbitek, żywą kolorystykę i wysoką wytrzymałość na rozdarcia.', '', 'aparat-canon-zoemini-s2-matowa-perlowa-biel-papier-zp-2030', '', '', '', 'Aparat Canon Zoemini S2 matowa perłowa biel + papier ZP-2030', '', '', '', '');
INSERT INTO `ps_product_lang` (`id_product`, `id_shop`, `id_lang`, `description`, `description_short`, `link_rewrite`, `meta_description`, `meta_keywords`, `meta_title`, `name`, `available_now`, `available_later`, `delivery_in_stock`, `delivery_out_stock`) VALUES
(50, 1, 1, '&lt;div class=cms-template_title-subtitle&gt;&lt;h2&gt;Fujifilm Instax Mini 12 kwiatowy róż&lt;/h2&gt;&lt;h3&gt;Aparat z natychmiastowym wydrukiem&lt;/h3&gt;&lt;p&gt;&lt;strong&gt;Instax Mini 12&lt;/strong&gt; doda uroku każdej imprezie, zachowa na długo Twoje wspomnienia, ożywi przestrzeń i zagwarantuje świetną zabawę! &lt;strong&gt;Precyzyjnie umieszczone lusterko, tryb zbliżenia oraz automatyczna kontrola błysku&lt;/strong&gt; sprawią, że bez większego wysiłku&lt;strong&gt; zrobisz doskonałe selfie!&lt;/strong&gt; Nie musisz martwić się skomplikowanymi ustawieniami! &lt;strong&gt;Aparat zrobi to za Ciebie&lt;/strong&gt; - wystarczy, że &lt;strong&gt;obrócisz obiektyw,&lt;/strong&gt; by go&lt;strong&gt; włączyć i wyłączyć oraz przejść do trybu zbliżenia.&lt;/strong&gt; &lt;strong&gt;Wydruk odbitek zajmuje&lt;/strong&gt; zaledwie&lt;strong&gt; 5 sekund!&lt;/strong&gt;&lt;/div&gt;&lt;div class=cms-template_video100&gt;&lt;div class=cms-video-wrapper&gt;&lt;div class=cms-video&gt;&lt;iframe allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\"allowfullscreen frameborder=0 scrolling=no src=https://www.youtube.com/embed/QLou0ZPc6AU&gt;&lt;/iframe&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;h3&gt;Wbudowane lusterko do selfie i tryb zbliżenia&lt;/h3&gt;&lt;p&gt;&lt;strong&gt;Fujifilm Instax mini 12&lt;/strong&gt; powstał szczególnie z myślą o &lt;strong&gt;selfie&lt;/strong&gt;. Aparat posiada wiele &lt;strong&gt;przydatnych funkcji,&lt;/strong&gt; które ułatwią Ci tworzenie selfie:&lt;ul&gt;&lt;li&gt;&lt;strong&gt;doskonale umieszczone lusterko,&lt;/strong&gt;&lt;li&gt;&lt;strong&gt;tryb zbliżenia&lt;/strong&gt;,&lt;li&gt;&lt;strong&gt;automatyczna kontrola błysku.&lt;/strong&gt;&lt;/ul&gt;&lt;p&gt;Ciesz się wspaniałymi momentami i zachowuj je na &lt;strong&gt;wyjątkowych mini odbitkach&lt;/strong&gt;. Twórz kreatywne zdjęcia, uwieczniaj radosne imprezy z przyjaciółmi i szalone selfie!&lt;div class=\"cms-template_2photos-grid cms-grid cms-grid-2 js-flexbox\"&gt;&lt;div class=cms-box&gt;&lt;div class=box-inner&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat FujiFilm Instax Mini 12 kwiatowy róż\"src=//upload.cyfrowe.pl/cyfrowe/products/16278f60674.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;div class=cms-box&gt;&lt;div class=box-inner&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat FujiFilm Instax Mini 12 kwiatowy róż\"src=//upload.cyfrowe.pl/cyfrowe/products/16279364aac.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;h3&gt;Przekonaj się, jakie to proste!&lt;/h3&gt;&lt;p&gt;Nie musisz się śpieszyć! &lt;strong&gt;Instax mini 12 automatycznie ustawi za Ciebie ekspozycję &lt;/strong&gt;oraz będzie &lt;strong&gt;sterował błyskiem&lt;/strong&gt;. Jedyne co musisz zrobić to &lt;strong&gt;wycelować w swój fotografowany obiekt i wcisnąć migawkę.&lt;/strong&gt; Nie myśl o ustawieniach i odpowiednich parametrach! &lt;strong&gt;Aparat Fujifilm z natychmiastowym wydrukiem &lt;/strong&gt;zrobi to za Ciebie i co więcej, zrobi to dobrze! &lt;div class=\"cms-template_3photos-grid cms-grid cms-grid-3 js-flexbox\"&gt;&lt;div class=cms-box&gt;&lt;div class=box-inner&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat FujiFilm Instax Mini 12 kwiatowy róż\"src=//upload.cyfrowe.pl/cyfrowe/products/16285f9c189.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;div class=cms-box&gt;&lt;div class=box-inner&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat FujiFilm Instax Mini 12 kwiatowy róż\"src=//upload.cyfrowe.pl/cyfrowe/products/1628662df4e.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;div class=cms-box&gt;&lt;div class=box-inner&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat FujiFilm Instax Mini 12 kwiatowy róż\"src=//upload.cyfrowe.pl/cyfrowe/products/16287672c73.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;h3&gt;Obrót i gotowe &lt;/h3&gt;&lt;p&gt;&lt;strong&gt;Fujifilm Instax mini 12&lt;/strong&gt; wyposażony został w łatwe w obsłudze&lt;strong&gt; elementy sterujące, &lt;/strong&gt;które zagwarantują Tobie oraz Twoim bliskim przyjemne użytkowanie. Obsługa aparatu poleca na &lt;strong&gt;obracaniu obiektywu&lt;/strong&gt;. Dzięki temu &lt;strong&gt;włączysz i wyłączysz aparat &lt;/strong&gt;oraz wejdziesz w &lt;strong&gt;tryb zbliżenia&lt;/strong&gt;. Żadnych skomplikowanych ustawień w menu, przycisków, które nie wiadomo do czego służą - wystarczą obroty! To takie proste, prawda? &lt;div class=\"cms-template_2photos-grid cms-grid cms-grid-2 js-flexbox\"&gt;&lt;div class=cms-box&gt;&lt;div class=box-inner&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat FujiFilm Instax Mini 12 kwiatowy róż\"src=//upload.cyfrowe.pl/cyfrowe/products/162807c9a37.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;div class=cms-box&gt;&lt;div class=box-inner&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat FujiFilm Instax Mini 12 kwiatowy róż\"src=//upload.cyfrowe.pl/cyfrowe/products/16281da1730.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;h3&gt;Wycentruj widok&lt;/h3&gt;&lt;p&gt;&lt;strong&gt;Efekt paralaksy&lt;/strong&gt;, krzywe i przesunięte zdjęcie oraz frustracja, bo kolega na zdjęciu został ucięty? A co jeśli powiem Ci, że koniec z tym? Super, prawda?&lt;strong&gt; Instax mini 12 &lt;/strong&gt;wychodzi naprzeciw Twoim potrzebom.&lt;strong&gt; Po przełączeniu w tryb zbliżenia regulowany wizjer zgrabnie dopasowuje się do obiektywu,&lt;/strong&gt; dlatego &lt;strong&gt;na wydrukowanej odbitce otrzymasz dokładnie to, co widziałeś w wizjerze. &lt;/strong&gt;&lt;p&gt;Co prawda w tym przypadku efekt paralaksy to kwestia kilku milimetrów, ale doskonale wiemy, że z perfekcyjnie zaaranżowanym kadrem nie ma dyskusji - po prostu musi być idealnie. &lt;div class=\"cms-template_2photos-grid cms-grid cms-grid-2 js-flexbox\"&gt;&lt;div class=cms-box&gt;&lt;div class=box-inner&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat FujiFilm Instax Mini 12 kwiatowy róż\"src=//upload.cyfrowe.pl/cyfrowe/products/16282bfa5fe.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;div class=cms-box&gt;&lt;div class=box-inner&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat FujiFilm Instax Mini 12 kwiatowy róż\"src=//upload.cyfrowe.pl/cyfrowe/products/16284557872.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;h3&gt;Wydruk w 5 sekund! &lt;/h3&gt;&lt;p&gt;Co jesteś w stanie zrobić w 5 sekund? Pewnie niewiele, ale na pewno bez problemu wytrzymasz tyle, czekając na wydruk Twojej wspaniałej odbitki. Tylko tyle potrzebuje &lt;strong&gt;Instax mini 12&lt;/strong&gt;, by zapisać Twoje wspomnienie, które zostanie z Tobą na pewno na dłużej niż &lt;strong&gt;5 sekund!&lt;/strong&gt;&lt;p class=short_description itemprop=description&gt;Instax Mini 12 doda uroku każdej imprezie, zachowa na długo Twoje wspomnienia, ożywi przestrzeń i zagwarantuje świetną zabawę! Precyzyjnie umieszczone lusterko, tryb zbliżenia oraz automatyczna kontrola błysku sprawią, że bez większego wysiłku zrobisz doskonałe selfie! Nie musisz martwić się skomplikowanymi ustawieniami! Aparat zrobi to za Ciebie - wystarczy, że obrócisz obiektyw, by go włączyć i wyłączyć oraz przejść do trybu zbliżenia. Wydruk odbitek zajmuje zaledwie 5 sekund!', '', 'aparat-fujifilm-instax-mini-12-kwiatowy-roz', '', '', '', 'Aparat FujiFilm Instax Mini 12 kwiatowy róż', '', '', '', ''),
