t;/div&gt;&lt;div class=cms-box&gt;&lt;div class=box-inner&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat FujiFilm Instax Mini 12 kwiatowy róż\"src=//upload.cyfrowe.pl/cyfrowe/products/16284557872.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;h3&gt;Wydruk w 5 sekund! &lt;/h3&gt;&lt;p&gt;Co jesteś w stanie zrobić w 5 sekund? Pewnie niewiele, ale na pewno bez problemu wytrzymasz tyle, czekając na wydruk Twojej wspaniałej odbitki. Tylko tyle potrzebuje &lt;strong&gt;Instax mini 12&lt;/strong&gt;, by zapisać Twoje wspomnienie, które zostanie z Tobą na pewno na dłużej niż &lt;strong&gt;5 sekund!&lt;/strong&gt;&lt;p class=short_description itemprop=description&gt;Instax Mini 12 doda uroku każdej imprezie, zachowa na długo Twoje wspomnienia, ożywi przestrzeń i zagwarantuje świetną zabawę! Precyzyjnie umieszczone lusterko, tryb zbliżenia oraz automatyczna kontrola błysku sprawią, że bez większego wysiłku zrobisz doskonałe selfie! Nie musisz martwić się skomplikowanymi ustawieniami! Aparat zrobi to za Ciebie - wystarczy, że obrócisz obiektyw, by go włączyć i wyłączyć oraz przejść do trybu zbliżenia. Wydruk odbitek zajmuje zaledwie 5 sekund!', '', 'aparat-fujifilm-instax-mini-12-pastelowy-niebieski', '', '', '', 'Aparat FujiFilm Instax Mini 12 pastelowy niebieski', '', '', '', ''),
(52, 1, 1, '&lt;div class=cms-template_title-subtitle&gt;&lt;h2&gt;Fujifilm Instax Mini 12 liliowy fiolet&lt;/h2&gt;&lt;h3&gt;Aparat z natychmiastowym wydrukiem&lt;/h3&gt;&lt;p&gt;&lt;strong&gt;Instax Mini 12&lt;/strong&gt; doda uroku każdej imprezie, zachowa na długo Twoje wspomnienia, ożywi przestrzeń i zagwarantuje świetną zabawę! &lt;strong&gt;Precyzyjnie umieszczone lusterko, tryb zbliżenia oraz automatyczna kontrola błysku&lt;/strong&gt; sprawią, że bez większego wysiłku&lt;strong&gt; zrobisz doskonałe selfie!&lt;/strong&gt; Nie musisz martwić się skomplikowanymi ustawieniami! &lt;strong&gt;Aparat zrobi to za Ciebie&lt;/strong&gt; - wystarczy, że &lt;strong&gt;obrócisz obiektyw,&lt;/strong&gt; by go&lt;strong&gt; włączyć i wyłączyć oraz przejść do trybu zbliżenia.&lt;/strong&gt; &lt;strong&gt;Wydruk odbitek zajmuje&lt;/strong&gt; zaledwie&lt;strong&gt; 5 sekund!&lt;/strong&gt;&lt;/div&gt;&lt;div class=cms-template_video100&gt;&lt;div class=cms-video-wrapper&gt;&lt;div class=cms-video&gt;&lt;iframe allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\"allowfullscreen frameborder=0 scrolling=no src=https://www.youtube.com/embed/QLou0ZPc6AU&gt;&lt;/iframe&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;h3&gt;Wbudowane lusterko do selfie i tryb zbliżenia&lt;/h3&gt;&lt;p&gt;&lt;strong&gt;Fujifilm Instax mini 12&lt;/strong&gt; powstał szczególnie z myślą o &lt;strong&gt;selfie&lt;/strong&gt;. Aparat posiada wiele &lt;strong&gt;przydatnych funkcji,&lt;/strong&gt; które ułatwią Ci tworzenie selfie:&lt;ul&gt;&lt;li&gt;&lt;strong&gt;doskonale umieszczone lusterko,&lt;/strong&gt;&lt;li&gt;&lt;strong&gt;tryb zbliżenia&lt;/strong&gt;,&lt;li&gt;&lt;strong&gt;automatyczna kontrola błysku.&lt;/strong&gt;&lt;/ul&gt;&lt;p&gt;Ciesz się wspaniałymi momentami i zachowuj je na &lt;strong&gt;wyjątkowych mini odbitkach&lt;/strong&gt;. Twórz kreatywne zdjęcia, uwieczniaj radosne imprezy z przyjaciółmi i szalone selfie!&lt;div class=\"cms-template_2photos-grid cms-grid cms-grid-2 js-flexbox\"&gt;&lt;div class=cms-box&gt;&lt;div class=box-inner&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat FujiFilm Instax Mini 12 kwiatowy róż\"src=//upload.cyfrowe.pl/cyfrowe/products/16278f60674.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;div class=cms-box&gt;&lt;div class=box-inner&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat FujiFilm Instax Mini 12 kwiatowy róż\"src=//upload.cyfrowe.pl/cyfrowe/products/16279364aac.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;h3&gt;Przekonaj się, jakie to proste!&lt;/h3&gt;&lt;p&gt;Nie musisz się śpieszyć! &lt;strong&gt;Instax mini 12 automatycznie ustawi za Ciebie ekspozycję &lt;/strong&gt;oraz będzie &lt;strong&gt;sterował błyskiem&lt;/strong&gt;. Jedyne co musisz zrobić to &lt;strong&gt;wycelować w swój fotografowany obiekt i wcisnąć migawkę.&lt;/strong&gt; Nie myśl o ustawieniach i odpowiednich parametrach! &lt;strong&gt;Aparat Fujifilm z natychmiastowym wydrukiem &lt;/strong&gt;zrobi to za Ciebie i co więcej, zrobi to dobrze! &lt;div class=\"cms-template_3photos-grid cms-grid cms-grid-3 js-flexbox\"&gt;&lt;div class=cms-box&gt;&lt;div class=box-inner&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat FujiFilm Instax Mini 12 kwiatowy róż\"src=//upload.cyfrowe.pl/cyfrowe/products/16285f9c189.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;div class=cms-box&gt;&lt;div class=box-inner&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat FujiFilm Instax Mini 12 kwiatowy róż\"src=//upload.cyfrowe.pl/cyfrowe/products/1628662df4e.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;div class=cms-box&gt;&lt;div class=box-inner&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat FujiFilm Instax Mini 12 kwiatowy róż\"src=//upload.cyfrowe.pl/cyfrowe/products/16287672c73.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;h3&gt;Obrót i gotowe &lt;/h3&gt;&lt;p&gt;&lt;strong&gt;Fujifilm Instax mini 12&lt;/strong&gt; wyposażony został w łatwe w obsłudze&lt;strong&gt; elementy sterujące, &lt;/strong&gt;które zagwarantują Tobie oraz Twoim bliskim przyjemne użytkowanie. Obsługa aparatu poleca na &lt;strong&gt;obracaniu obiektywu&lt;/strong&gt;. Dzięki temu &lt;strong&gt;włączysz i wyłączysz aparat &lt;/strong&gt;oraz wejdziesz w &lt;strong&gt;tryb zbliżenia&lt;/strong&gt;. Żadnych skomplikowanych ustawień w menu, przycisków, które nie wiadomo do czego służą - wystarczą obroty! To takie proste, prawda? &lt;div class=\"cms-template_2photos-grid cms-grid cms-grid-2 js-flexbox\"&gt;&lt;div class=cms-box&gt;&lt;div class=box-inner&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat FujiFilm Instax Mini 12 kwiatowy róż\"src=//upload.cyfrowe.pl/cyfrowe/products/162807c9a37.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;div class=cms-box&gt;&lt;div class=box-inner&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat FujiFilm Instax Mini 12 kwiatowy róż\"src=//upload.cyfrowe.pl/cyfrowe/products/16281da1730.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;h3&gt;Wycentruj widok&lt;/h3&gt;&lt;p&gt;&lt;strong&gt;Efekt paralaksy&lt;/strong&gt;, krzywe i przesunięte zdjęcie oraz frustracja, bo kolega na zdjęciu został ucięty? A co jeśli powiem Ci, że koniec z tym? Super, prawda?&lt;strong&gt; Instax mini 12 &lt;/strong&gt;wychodzi naprzeciw Twoim potrzebom.&lt;strong&gt; Po przełączeniu w tryb zbliżenia regulowany wizjer zgrabnie dopasowuje się do obiektywu,&lt;/strong&gt; dlatego &lt;strong&gt;na wydrukowanej odbitce otrzymasz dokładnie to, co widziałeś w wizjerze. &lt;/strong&gt;&lt;p&gt;Co prawda w tym przypadku efekt paralaksy to kwestia kilku milimetrów, ale doskonale wiemy, że z perfekcyjnie zaaranżowanym kadrem nie ma dyskusji - po prostu musi być idealnie. &lt;div class=\"cms-template_2photos-grid cms-grid cms-grid-2 js-flexbox\"&gt;&lt;div class=cms-box&gt;&lt;div class=box-inner&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat FujiFilm Instax Mini 12 kwiatowy róż\"src=//upload.cyfrowe.pl/cyfrowe/products/16282bfa5fe.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;div class=cms-box&gt;&lt;div class=box-inner&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat FujiFilm Instax Mini 12 kwiatowy róż\"src=//upload.cyfrowe.pl/cyfrowe/products/16284557872.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;h3&gt;Wydruk w 5 sekund! &lt;/h3&gt;&lt;p&gt;Co jesteś w stanie zrobić w 5 sekund? Pewnie niewiele, ale na pewno bez problemu wytrzymasz tyle, czekając na wydruk Twojej wspaniałej odbitki. Tylko tyle potrzebuje &lt;strong&gt;Instax mini 12&lt;/strong&gt;, by zapisać Twoje wspomnienie, które zostanie z Tobą na pewno na dłużej niż &lt;strong&gt;5 sekund!&lt;/strong&gt;&lt;p class=short_description itemprop=description&gt;Instax Mini 12 doda uroku każdej imprezie, zachowa na długo Twoje wspomnienia, ożywi przestrzeń i zagwarantuje świetną zabawę! Precyzyjnie umieszczone lusterko, tryb zbliżenia oraz automatyczna kontrola błysku sprawią, że bez większego wysiłku zrobisz doskonałe selfie! Nie musisz martwić się skomplikowanymi ustawieniami! Aparat zrobi to za Ciebie - wystarczy, że obrócisz obiektyw, by go włączyć i wyłączyć oraz przejść do trybu zbliżenia. Wydruk odbitek zajmuje zaledwie 5 sekund!', '', 'aparat-fujifilm-instax-mini-12-liliowy-fiolet', '', '', '', 'Aparat FujiFilm Instax Mini 12 liliowy fiolet', '', '', '', ''),
