iv class=cms-box&gt;&lt;div class=box-inner&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat FujiFilm Instax Mini 12 kwiatowy róż\"src=//upload.cyfrowe.pl/cyfrowe/products/16284557872.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;h3&gt;Wydruk w 5 sekund! &lt;/h3&gt;&lt;p&gt;Co jesteś w stanie zrobić w 5 sekund? Pewnie niewiele, ale na pewno bez problemu wytrzymasz tyle, czekając na wydruk Twojej wspaniałej odbitki. Tylko tyle potrzebuje &lt;strong&gt;Instax mini 12&lt;/strong&gt;, by zapisać Twoje wspomnienie, które zostanie z Tobą na pewno na dłużej niż &lt;strong&gt;5 sekund!&lt;/strong&gt;&lt;p class=short_description itemprop=description&gt;Instax Mini 12 doda uroku każdej imprezie, zachowa na długo Twoje wspomnienia, ożywi przestrzeń i zagwarantuje świetną zabawę! Precyzyjnie umieszczone lusterko, tryb zbliżenia oraz automatyczna kontrola błysku sprawią, że bez większego wysiłku zrobisz doskonałe selfie! Nie musisz martwić się skomplikowanymi ustawieniami! Aparat zrobi to za Ciebie - wystarczy, że obrócisz obiektyw, by go włączyć i wyłączyć oraz przejść do trybu zbliżenia. Wydruk odbitek zajmuje zaledwie 5 sekund!', '', 'aparat-fujifilm-instax-mini-12-biel', '', '', '', 'Aparat FujiFilm Instax Mini 12 biel', '', '', '', ''),
(54, 1, 1, '&lt;div class=cms-template_title-subtitle&gt;&lt;h2&gt;Fujifilm Instax Mini 12 miętowa zieleń&lt;/h2&gt;&lt;h3&gt;Aparat z natychmiastowym wydrukiem&lt;/h3&gt;&lt;p&gt;&lt;strong&gt;Instax Mini 12&lt;/strong&gt; doda uroku każdej imprezie, zachowa na długo Twoje wspomnienia, ożywi przestrzeń i zagwarantuje świetną zabawę! &lt;strong&gt;Precyzyjnie umieszczone lusterko, tryb zbliżenia oraz automatyczna kontrola błysku&lt;/strong&gt; sprawią, że bez większego wysiłku&lt;strong&gt; zrobisz doskonałe selfie!&lt;/strong&gt; Nie musisz martwić się skomplikowanymi ustawieniami! &lt;strong&gt;Aparat zrobi to za Ciebie&lt;/strong&gt; - wystarczy, że &lt;strong&gt;obrócisz obiektyw,&lt;/strong&gt; by go&lt;strong&gt; włączyć i wyłączyć oraz przejść do trybu zbliżenia.&lt;/strong&gt; &lt;strong&gt;Wydruk odbitek zajmuje&lt;/strong&gt; zaledwie&lt;strong&gt; 5 sekund!&lt;/strong&gt;&lt;/div&gt;&lt;div class=cms-template_video100&gt;&lt;div class=cms-video-wrapper&gt;&lt;div class=cms-video&gt;&lt;iframe allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\"allowfullscreen frameborder=0 scrolling=no src=https://www.youtube.com/embed/QLou0ZPc6AU&gt;&lt;/iframe&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;h3&gt;Wbudowane lusterko do selfie i tryb zbliżenia&lt;/h3&gt;&lt;p&gt;&lt;strong&gt;Fujifilm Instax mini 12&lt;/strong&gt; powstał szczególnie z myślą o &lt;strong&gt;selfie&lt;/strong&gt;. Aparat posiada wiele &lt;strong&gt;przydatnych funkcji,&lt;/strong&gt; które ułatwią Ci tworzenie selfie:&lt;ul&gt;&lt;li&gt;&lt;strong&gt;doskonale umieszczone lusterko,&lt;/strong&gt;&lt;li&gt;&lt;strong&gt;tryb zbliżenia&lt;/strong&gt;,&lt;li&gt;&lt;strong&gt;automatyczna kontrola błysku.&lt;/strong&gt;&lt;/ul&gt;&lt;p&gt;Ciesz się wspaniałymi momentami i zachowuj je na &lt;strong&gt;wyjątkowych mini odbitkach&lt;/strong&gt;. Twórz kreatywne zdjęcia, uwieczniaj radosne imprezy z przyjaciółmi i szalone selfie!&lt;div class=\"cms-template_2photos-grid cms-grid cms-grid-2 js-flexbox\"&gt;&lt;div class=cms-box&gt;&lt;div class=box-inner&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat FujiFilm Instax Mini 12 kwiatowy róż\"src=//upload.cyfrowe.pl/cyfrowe/products/16278f60674.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;div class=cms-box&gt;&lt;div class=box-inner&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat FujiFilm Instax Mini 12 kwiatowy róż\"src=//upload.cyfrowe.pl/cyfrowe/products/16279364aac.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;h3&gt;Przekonaj się, jakie to proste!&lt;/h3&gt;&lt;p&gt;Nie musisz się śpieszyć! &lt;strong&gt;Instax mini 12 automatycznie ustawi za Ciebie ekspozycję &lt;/strong&gt;oraz będzie &lt;strong&gt;sterował błyskiem&lt;/strong&gt;. Jedyne co musisz zrobić to &lt;strong&gt;wycelować w swój fotografowany obiekt i wcisnąć migawkę.&lt;/strong&gt; Nie myśl o ustawieniach i odpowiednich parametrach! &lt;strong&gt;Aparat Fujifilm z natychmiastowym wydrukiem &lt;/strong&gt;zrobi to za Ciebie i co więcej, zrobi to dobrze! &lt;div class=\"cms-template_3photos-grid cms-grid cms-grid-3 js-flexbox\"&gt;&lt;div class=cms-box&gt;&lt;div class=box-inner&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat FujiFilm Instax Mini 12 kwiatowy róż\"src=//upload.cyfrowe.pl/cyfrowe/products/16285f9c189.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;div class=cms-box&gt;&lt;div class=box-inner&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat FujiFilm Instax Mini 12 kwiatowy róż\"src=//upload.cyfrowe.pl/cyfrowe/products/1628662df4e.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;div class=cms-box&gt;&lt;div class=box-inner&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat FujiFilm Instax Mini 12 kwiatowy róż\"src=//upload.cyfrowe.pl/cyfrowe/products/16287672c73.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;h3&gt;Obrót i gotowe &lt;/h3&gt;&lt;p&gt;&lt;strong&gt;Fujifilm Instax mini 12&lt;/strong&gt; wyposażony został w łatwe w obsłudze&lt;strong&gt; elementy sterujące, &lt;/strong&gt;które zagwarantują Tobie oraz Twoim bliskim przyjemne użytkowanie. Obsługa aparatu poleca na &lt;strong&gt;obracaniu obiektywu&lt;/strong&gt;. Dzięki temu &lt;strong&gt;włączysz i wyłączysz aparat &lt;/strong&gt;oraz wejdziesz w &lt;strong&gt;tryb zbliżenia&lt;/strong&gt;. Żadnych skomplikowanych ustawień w menu, przycisków, które nie wiadomo do czego służą - wystarczą obroty! To takie proste, prawda? &lt;div class=\"cms-template_2photos-grid cms-grid cms-grid-2 js-flexbox\"&gt;&lt;div class=cms-box&gt;&lt;div class=box-inner&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat FujiFilm Instax Mini 12 kwiatowy róż\"src=//upload.cyfrowe.pl/cyfrowe/products/162807c9a37.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;div class=cms-box&gt;&lt;div class=box-inner&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat FujiFilm Instax Mini 12 kwiatowy róż\"src=//upload.cyfrowe.pl/cyfrowe/products/16281da1730.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;h3&gt;Wycentruj widok&lt;/h3&gt;&lt;p&gt;&lt;strong&gt;Efekt paralaksy&lt;/strong&gt;, krzywe i przesunięte zdjęcie oraz frustracja, bo kolega na zdjęciu został ucięty? A co jeśli powiem Ci, że koniec z tym? Super, prawda?&lt;strong&gt; Instax mini 12 &lt;/strong&gt;wychodzi naprzeciw Twoim potrzebom.&lt;strong&gt; Po przełączeniu w tryb zbliżenia regulowany wizjer zgrabnie dopasowuje się do obiektywu,&lt;/strong&gt; dlatego &lt;strong&gt;na wydrukowanej odbitce otrzymasz dokładnie to, co widziałeś w wizjerze. &lt;/strong&gt;&lt;p&gt;Co prawda w tym przypadku efekt paralaksy to kwestia kilku milimetrów, ale doskonale wiemy, że z perfekcyjnie zaaranżowanym kadrem nie ma dyskusji - po prostu musi być idealnie. &lt;div class=\"cms-template_2photos-grid cms-grid cms-grid-2 js-flexbox\"&gt;&lt;div class=cms-box&gt;&lt;div class=box-inner&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat FujiFilm Instax Mini 12 kwiatowy róż\"src=//upload.cyfrowe.pl/cyfrowe/products/16282bfa5fe.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;div class=cms-box&gt;&lt;div class=box-inner&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat FujiFilm Instax Mini 12 kwiatowy róż\"src=//upload.cyfrowe.pl/cyfrowe/products/16284557872.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;h3&gt;Wydruk w 5 sekund! &lt;/h3&gt;&lt;p&gt;Co jesteś w stanie zrobić w 5 sekund? Pewnie niewiele, ale na pewno bez problemu wytrzymasz tyle, czekając na wydruk Twojej wspaniałej odbitki. Tylko tyle potrzebuje &lt;strong&gt;Instax mini 12&lt;/strong&gt;, by zapisać Twoje wspomnienie, które zostanie z Tobą na pewno na dłużej niż &lt;strong&gt;5 sekund!&lt;/strong&gt;&lt;p class=short_description itemprop=description&gt;Instax Mini 12 doda uroku każdej imprezie, zachowa na długo Twoje wspomnienia, ożywi przestrzeń i zagwarantuje świetną zabawę! Precyzyjnie umieszczone lusterko, tryb zbliżenia oraz automatyczna kontrola błysku sprawią, że bez większego wysiłku zrobisz doskonałe selfie! Nie musisz martwić się skomplikowanymi ustawieniami! Aparat zrobi to za Ciebie - wystarczy, że obrócisz obiektyw, by go włączyć i wyłączyć oraz przejść do trybu zbliżenia. Wydruk odbitek zajmuje zaledwie 5 sekund!', '', 'aparat-fujifilm-instax-mini-12-mietowa-zielen', '', '', '', 'Aparat FujiFilm Instax Mini 12 miętowa zieleń', '', '', '', ''),
(55, 1, 1, '&lt;div class=cms-template_title-subtitle&gt;&lt;h2&gt;Fujifilm Instax Mini 40&lt;/h2&gt;&lt;h3&gt;&lt;strong&gt;Specjalista od fotografii natychmiastowej &lt;/strong&gt;&lt;/h3&gt;&lt;p&gt;&lt;strong&gt;Seria Instax Mini to proste w obsłudze aparaty&lt;/strong&gt;, których głównym zadaniem jest&lt;strong&gt; sprawianie radości&lt;/strong&gt;, jaka towarzyszy drukowaniu zdjęć od razu po ich naświetleniu. Natchmiastowo wywołane, niepowtarzalne odbitki wielkości karty kredytowej w łatwy i przyjemny sposób umożliwiają dzielenie się ważnymi chwilami z bliskimi. &lt;strong&gt;Daj się wciągnąć w świat tradycyjnej fotografii!&lt;/strong&gt;&lt;/div&gt;&lt;h3&gt;Styl przede wszystkim&lt;/h3&gt;&lt;p&gt;Aparat natychmiastowy FujiFilm Instax Mini 40 to przede wszystkim&lt;strong&gt; świetna stylistyka.&lt;/strong&gt; Model ten&lt;strong&gt; wyróżnia się wyjątkowym wzornictwem opartym o czarną fakturę i srebrne wykończenia, która przywodzi na myśl tradycyjne aparaty&lt;/strong&gt;. Co więcej wykorzystane materiały są niezwykle przyjemne w dotyku, tak iż zabawa z tym aparatem staje się czystą radością. &lt;div class=\"cms-template_2photos-grid cms-grid cms-grid-2 js-flexbox\"&gt;&lt;div class=cms-box&gt;&lt;div class=box-inner&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat FujiFilm Instax Mini 40 czarny\"src=//upload.cyfrowe.pl/cyfrowe/products/10769d2f7f0.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;div class=cms-box&gt;&lt;div class=box-inner&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat FujiFilm Instax Mini 40 czarny\"src=//upload.cyfrowe.pl/cyfrowe/products/10770f89347.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;div class=cms-template_text50-photo50&gt;&lt;div class=cms-photo&gt;&lt;img alt=\"Aparat FujiFilm Instax Mini 40 czarny\"src=//upload.cyfrowe.pl/cyfrowe/products/10771888713.jpeg&gt;&lt;/div&gt;&lt;h3&gt;Zaawansowane funkcje &lt;/h3&gt;&lt;p&gt;Aparat oferuje &lt;strong&gt;automatyczną ekspozycję, &lt;/strong&gt;dzięki czemu wystarczy, że skomponujesz idealny kadr i naciśniesz spust migawki, a FujiFilm Instax Mini 40 poradzi sobie z całą resztą. W każdej sytuacji zdjęciowe zapewni Ci zrównoważoną ekspozycję.&lt;h3&gt;Aparat dopasowany do Ciebie&lt;/h3&gt;&lt;p&gt;Model ten oferuje &lt;strong&gt;jednodotykowy tryb selfie,&lt;/strong&gt; który pozowli Ci na łatwe robienie sobie autoportretów. Rób sobie także niezapomniane wspólne fotki z przyjaciółmi i bliskimi.&lt;p&gt;Aparat jest natychmiast gotowy do działania, co gwarantuje Ci możliwość błyskawiczne sięgania po aparat i uzyskiwania idealnych kadrów w każdych okolicznościach.&lt;/div&gt;&lt;div class=cms-template_photo33-text67&gt;&lt;div class=cms-photo&gt;&lt;img src=https://upload.cyfrowe.pl/cyfrowe/fck_files_n/585239f00b.jpg&gt;&lt;/div&gt;&lt;h3&gt;Wysokiej jakości lampa błyskowa&lt;/h3&gt;&lt;p&gt;Lampa błyskowa automatycznie emituje tyle światła, ile potrzebujesz do uzyskania &lt;strong&gt;idealnej ekspozycji.&lt;/strong&gt; Dostosowuje swoją moc do odległości od obiektu oraz ogólnej jasności otoczenia.&lt;/div&gt;&lt;ul&gt;&lt;li&gt;&lt;a href=http://blog.cyfrowe.pl/2017/12/16/5-pomyslow-na-kreatywne-wykorzystanie-fujifilm-instax/ target=_blank&gt;Kreatywne pomysły na wykorzystanie aparatów FujiFilm Instax - artykuł na Blog.cyfrowe.pl&lt;/a&gt;&lt;/ul&gt;&lt;ul class=optional-links&gt;&lt;li&gt;&lt;a title=\"Przeczytaj test na naszym blogu\"href= https://blog.cyfrowe.pl/nowosci-instax-od-fujifilm/ rel=nofollow target=_blank&gt;Przeczytaj test na naszym blogu&lt;/a&gt;&lt;/ul&gt;&lt;p class=short_description itemprop=description&gt;Stylowy aparat natychmiastowy, który łączy w sobie czarną fakturę i srebrne wykończenia. Dzięki temu przywodzi na myśl klimat aparatów retro. Model ten zapewnia automatyczną ekspozycję, jednodotykowy tryb selfie czy wbudowaną lampę błyskową.', '', 'aparat-fujifilm-instax-mini-40-czarny', '', '', '', 'Aparat FujiFilm Instax Mini 40 czarny', '', '', '', ''),
(56, 1, 1, '&lt;div class=cms-template_title-subtitle&gt;&lt;h2&gt;Fujifilm Instax Square sq1&lt;/h2&gt;&lt;h3&gt;Zatrzymaj chwilę w kwadratowym kadrze&lt;/h3&gt;&lt;p&gt;Wraz z automatyczną ekspozycją i łatwym w użyciu trybem Selfie stylowy aparat Instax SQ1 otwiera przed Tobą całkiem nowe możliwości. Przecież najlepsze rzeczy w życiu są proste!  Więcej zabawy. Więcej przyjaciół. Więcej możliwości. A do tego kultowy kwadratowy format zdjęć!&lt;/div&gt;&lt;div class=cms-template_video100&gt;&lt;div class=cms-video-wrapper&gt;&lt;div class=cms-video&gt;&lt;iframe allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\"allowfullscreen frameborder=0 scrolling=no src=https://www.youtube.com/embed/phidB0pwyXM&gt;&lt;/iframe&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;div class=cms-template_text33x3&gt;&lt;div class=cms-text-column&gt;&lt;p style=\"text-align: center;\"class=border-blue&gt;Piękny design&lt;p&gt;SQ1 jest idealnym towarzyszem, z jakim chętnie wszędzie się pokażesz. 3 wersje kolorystyczne pasują do każdego stylu. Obłe linie korpusu i faktura powierzchni uchwytu, będzie wyróżniać się wszędzie, gdzie zabierzesz go ze sobą.&lt;/div&gt;&lt;div class=cms-text-column&gt;&lt;p style=\"text-align: center;\"class=border-red&gt;Automatyczna ekspozycja&lt;p&gt;Nie przegap żadnego cennego momentu. Nie trać też na jakości. Wbudowane czujniki aparatu SQ1 automatycznie określają jasność otoczenia i dostosowują czas otwarcia migawki.&lt;/div&gt;&lt;div class=cms-text-column&gt;&lt;p style=\"text-align: center;\"class=border-green&gt;Kwadratowy format&lt;p&gt;Pokaż świat w proporcjach 1:1 otoczony gustowną białą ramką na wysokiej jakości filmie. Najbardziej kultowy, oldschoolowy format zdjęć SQUARE.&lt;/div&gt;&lt;/div&gt;&lt;div class=cms-template_photo100&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/products/5610843feb.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;div class=cms-template_text67-photo33&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/products/56080bb3ca.jpg&gt;&lt;/div&gt;&lt;h3&gt;Tryb selfie&lt;/h3&gt;&lt;p&gt;Spraw, by Twoja osobowość lśniła na doskonale ostrych zdjęciach. Wykorzystaj cały potencjał trybu Selfie (uaktywnianego poprzez przekręcenie obiektywu) oraz dogodnie umieszczone w aparacie lusterko. Wstawione obok wysuwanego obiektywu lusterko niesłychanie ułatwia kadrowanie i niejednokrotnie sprawi, że zmieścisz jeszcze więcej twarzy w kadrze.&lt;/div&gt;&lt;div class=cms-template_photo33-text67&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/products/56099ace91.jpg&gt;&lt;/div&gt;&lt;h3&gt;Większe, kwadratowe wydruki&lt;/h3&gt;&lt;p&gt;Dla pełnych dramaturgii, wyrazistych wizualizacji, nie ma nic lepszego niż film SQUARE. Idealny, by zmieścić więcej swojego świata w kwadratowym kadrze o proporcjach 1:1 i symetrycznie uchwycić cenne chwile. A wszystko drukowane z gustowną biała ramką na wysokiej jakości filmie. Nie dziwi więc, że film SQUARE pokochało wielu, gdyż uchwyci on wszystko.&lt;/div&gt;&lt;ul&gt;&lt;li&gt;&lt;a href=https://instax.pl/gwarancja/#formularz_zgloszeniowy target=_blank&gt;Dodatkowe 6 miesięcy gwarancji na Twojego Instaxa&lt;/a&gt;&lt;li&gt;&lt;a href=https://instax.pl/produkt/square-sq1/ target=_blank&gt;Opis produktu na stronie producenta&lt;/a&gt;&lt;li&gt;&lt;a href=https://blog.cyfrowe.pl/jakiego-instaxa-kupic/ target=_blank&gt;Jakiego Instaxa kupić? Porównanie wszystkich modeli na blog.cyfrowe.pl &lt;/a&gt;&lt;/ul&gt;&lt;p class=short_description itemprop=description&gt;Aparat natychmiastowy FujiFilm Instax Square SQ1 dostępny jest w 3 wariantach kolorystycznych. Drukuje kwadratowe zdjęcia o rozmiarze 86mm x 72mm (format filmu), 62mm x 62mm (format zdjęcia), które otrzymujemy w zaledwie 90 sekund. Zaprogramowana elektroniczna migawka umożliwia automatyczną ekspozycję, bez konieczności wprowadzania żadnych ustawień. Specjalny tryb selfie i wbudowane lusterko zapewni udane autoportrety. Zasilany na baterie CR2.', '', 'aparat-fujifilm-instax-square-sq1-lodowy-blekit', '', '', '', 'Aparat FujiFilm Instax Square SQ1 lodowy błękit', '', '', '', ''),
(57, 1, 1, '&lt;div class=cms-template_title-subtitle&gt;&lt;h2&gt;Fujifilm Instax Square sq1&lt;/h2&gt;&lt;h3&gt;Zatrzymaj chwilę w kwadratowym kadrze&lt;/h3&gt;&lt;p&gt;Wraz z automatyczną ekspozycją i łatwym w użyciu trybem Selfie stylowy aparat Instax SQ1 otwiera przed Tobą całkiem nowe możliwości. Przecież najlepsze rzeczy w życiu są proste!  Więcej zabawy. Więcej przyjaciół. Więcej możliwości. A do tego kultowy kwadratowy format zdjęć!&lt;/div&gt;&lt;div class=cms-template_video100&gt;&lt;div class=cms-video-wrapper&gt;&lt;div class=cms-video&gt;&lt;iframe allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\"allowfullscreen frameborder=0 scrolling=no src=https://www.youtube.com/embed/phidB0pwyXM&gt;&lt;/iframe&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;div class=cms-template_text33x3&gt;&lt;div class=cms-text-column&gt;&lt;p style=\"text-align: center;\"class=border-blue&gt;Piękny design&lt;p&gt;SQ1 jest idealnym towarzyszem, z jakim chętnie wszędzie się pokażesz. 3 wersje kolorystyczne pasują do każdego stylu. Obłe linie korpusu i faktura powierzchni uchwytu, będzie wyróżniać się wszędzie, gdzie zabierzesz go ze sobą.&lt;/div&gt;&lt;div class=cms-text-column&gt;&lt;p style=\"text-align: center;\"class=border-red&gt;Automatyczna ekspozycja&lt;p&gt;Nie przegap żadnego cennego momentu. Nie trać też na jakości. Wbudowane czujniki aparatu SQ1 automatycznie określają jasność otoczenia i dostosowują czas otwarcia migawki.&lt;/div&gt;&lt;div class=cms-text-column&gt;&lt;p style=\"text-align: center;\"class=border-green&gt;Kwadratowy format&lt;p&gt;Pokaż świat w proporcjach 1:1 otoczony gustowną białą ramką na wysokiej jakości filmie. Najbardziej kultowy, oldschoolowy format zdjęć SQUARE.&lt;/div&gt;&lt;/div&gt;&lt;div class=cms-template_photo100&gt;&lt;div class=cms-photo&gt;&lt;img src=//upload.cyfrowe.pl/cyfrowe/products/5610843feb.jpg&gt;&lt;/div&gt;&lt;/div&gt;&lt;div class=cms-template_text67-photo33&gt;&lt;div class=cms-photo&gt;&lt;